public class CF1665C extends PrintWriter {
	CF1665C() { super(System.out); }
	Scanner sc = new Scanner(System.in);
	public static void main(String[] $) {
		CF1665C o = new CF1665C(); o.main(); o.flush();
	}

	boolean check(int[] dd, int n, int m) {
		int k1 = 0, k2 = 0;
		for (int i = n; i >= 0; i--) {
			int d = dd[i];
			if (d == 0)
				break;
			k1++;
			d--;
			if (k1 + d > m)
				k2 += k1 + d - m;
		}
		return k1 + k2 <= m;
	}
	void main() {
		int t = sc.nextInt();
		while (t-- > 0) {
			int n = sc.nextInt();
			int[] dd = new int[n + 1];
			dd[0]++;
			for (int h = 0; h < n - 1; h++) {
				int p = sc.nextInt();
				dd[p]++;
			}
			Arrays.sort(dd);
			int lower = 0, upper = n;
			while (upper - lower > 1) {
				int m = (lower + upper) / 2;
				if (check(dd, n, m))
					upper = m;
				else
					lower = m;
			}
			println(upper);
		}
	}
}
