import java.util.*;

public class Main {

    public static boolean check(int x,ArrayList<Integer> l){
      int size=l.size();
      int b[]=new int[size];
      int count=0;
      for(int i=0;i<size;i++){
        if(l.get(i)>0){
          b[i]=Math.max(l.get(i)-x+i,0);
        }
        count+=b[i];
      }
      if(x-count>=size){
        return true;
      }
      return false;
    }

    public static void main(String[] args) {
        Scanner s=new Scanner(System.in);
        int t=s.nextInt();
        while(t-->0){
          int n=s.nextInt();
          int a[]=new int[n];
          for(int i=0;i<n-1;i++){
            int x=s.nextInt();
            a[x-1]++;
          }
          ArrayList<Integer> l=new ArrayList<>();
          for(int i=0;i<n;i++){
            if(a[i]!=0){
              l.add(a[i]);
            }
          }
          l.add(1);
          Collections.sort(l,Collections.reverseOrder());
          int lo=0;
          int hi=n;
          int ans=n;
          while(lo<=hi){
            int mid=(lo+hi)/2;
            if(check(mid,l)){
              ans=mid;
              hi=mid-1;
            }
            else{
              lo=mid+1;
            }
          }
          System.out.println(ans);
        }
    }
},"binary search,greedy,sortings,trees"

