public class Round_780_Div_3 {
    static Scanner str = new Scanner(System.in);
    static ArrayList<Integer> list;

    public static void main(String[] args) throws IOException {
        int t = str.nextInt();
        while (t-- > 0) {
            solve();
        }
    }

    public static void solve() {
        int n = str.nextInt();
        Map<Integer, Integer> map = new HashMap<>();
        map.put(0, 1);
        for (int i = 0; i < n - 1; i++) {
            int a = str.nextInt();
            map.put(a, map.getOrDefault(a, 0) + 1);
        }
        Integer num[] = new Integer[map.size()];
        int idx = 0;
        for (Integer x : map.values()) {
            num[idx++] = x;
        }
        Arrays.sort(num, Collections.reverseOrder());
        int l = num.length;
        int r = n;
        while (l < r) {
            int mid = l + r >> 1;
            int cnt = 0;
            for (int i = 0; i < num.length; i++) {
                cnt += Math.max(0, num[i] - mid + i);
            }
            if (cnt + num.length <= mid) {
                r = mid;
            } else {
                l = mid + 1;
            }
        }
        out.println(l);
    }
},"binary search,greedy,sortings,trees"

import java.io.*;
import java.util.*;

public class Solution {
    public static void main(String[] args) throws IOException {
        BufferedReader in = new BufferedReader(new InputStreamReader(System.in));
        int tt = Integer.parseInt(in.readLine());
        for (int t = 1; t <= tt; t++) {
            int n = Integer.parseInt(in.readLine());
            int[] nums = Arrays.stream(in.readLine().split("\s+")).mapToInt(Integer::parseInt).toArray();
            Map<Integer, Integer> map = new HashMap();
            for (int num : nums) {
                map.put(num, map.getOrDefault(num, 0) + 1);
            }
            List<Integer> groups = new ArrayList<>();
            groups.add(1);
            groups.addAll(map.values());
            Collections.sort(groups, (a,b) -> b - a);
            PriorityQueue<Integer> maxQueue = new PriorityQueue<>((a, b) -> b - a);
            int size = groups.size();
            for (int i = 0; i < size; i++) {
                maxQueue.add(groups.get(i) - size + i);
            }
            int time;
            for (time = size; true; time++) {
                int maxGroup = maxQueue.remove();
                if (time - size >= maxGroup) {
                    break;
                }
                maxQueue.add(maxGroup - 1);
            }
            System.out.println(time);
        }
    }
}
