			m1[i]=sc.nextInt();
			if(m1[i]==1)++num1;
		}
		if(num1!=1) {
			System.out.println("NO");
			continue;
		}
		int p=0;
		while(m1[p]!=1)++p;
		int m2[]=new int[n];
		for(int i=0;i<n;++i) {
			m2[i]=m1[p++];
			if(p==n)p=0;
		}
		int fl=1;
		for(int i=1;i<n;++i) {
			if(m2[i]-m2[i-1]>1) {
				fl=0;
				break;
			}
		}
		if(fl==0)System.out.println("NO");
		else System.out.println("YES");
	}
}
