public class E {
    public static void main(String[] args) {
        Scanner s = new Scanner(System.in);
        int lines = s.nextInt();

        s.nextLine();

        for (int i = 0; i < lines; i += 1) {
            solve(s.nextInt(), s);
        }
    }


    public static void solve(int n, Scanner s) {
        int[][] grid = new int[n][n];
        for (int i = 0; i < n; i++) {
            for (int j = 0; j < n; j++) {
                grid[i][j] = s.nextInt();
            }
        }

        int xor = 0;

        int startX = 0;
        int startY = 0;

        for (int i = 0; i < n / 2; i++) {
            for (int j = 0; j <= Math.abs(startX - startY) / 2; j++) {
                xor ^= grid[startX + j * 2][startY - j * 2];
                xor ^= grid[n - 1 - (startX + j * 2)][startY - j * 2];
            }

            for (int j = 0; j < 4; j++) {
                if (startY < n - 1) startY++; else startX++;
            }
        }

        System.out.println(xor);
    }
}
