import java.io.BufferedReader;
import java.io.IOException;
import java.io.InputStreamReader;
import java.io.PrintWriter;
import java.util.StringTokenizer;

public class C1628 {

    private static int find(int[][] x, int[][] a, int r, int c) {
        int n = x.length;
        if (r == 1) {
            if (c == 0) {
                return a[0][1] ^ x[0][0];
            }
            if (c == n - 1) {
                return a[0][n - 2] ^ x[0][n - 1];
            }
            return a[0][c - 1] ^ a[0][c + 1] ^ x[0][c];
        }
        if (c == 0) {
            return a[r - 1][1] ^ a[r - 2][0] ^ x[r - 1][0];
        }
        if (c == n - 1) {
            return a[r - 1][n - 2] ^ a[r - 2][n - 1] ^ x[r - 1][n - 1];
        }
        return a[r - 1][c - 1] ^ a[r - 1][c + 1] ^ a[r - 2][c] ^ x[r - 1][c];
    }

    private static int findAllXor(int[][] x) {
        int n = x.length;
        int[][] a = new int[n][n];
        for (int i = 0; i < n; i++) {
            a[0][i] = 0;
        }
        int res = 0;
        for (int i = 1; i < n; i++) {
            for (int j = 0; j < n; j++) {
                a[i][j] = find(x, a, i, j);
                res ^= a[i][j];
            }
        }
        return res;
    }

    public static void main(String[] args) throws IOException {
        BufferedReader rd = new BufferedReader(new InputStreamReader(System.in));
        PrintWriter pw = new PrintWriter(System.out);
        int numTests = Integer.parseInt(rd.readLine());
        for (int t = 0; t < numTests; t++) {
            int n = Integer.parseInt(rd.readLine());
            int[][] x = new int[n][n];
            for (int i = 0; i < n; i++) {
                StringTokenizer st = new StringTokenizer(rd.readLine());
                for (int j = 0; j < n; j++) {
                    x[i][j] = Integer.parseInt(st.nextToken());
                }
            }
            pw.println(findAllXor(x));
        }
        pw.flush();
        pw.close();
        rd.close();
    }
}
