import java.util.*;
import java.io.*;

public class F {

    static FastScanner fs = new FastScanner();
    static PrintWriter pw = new PrintWriter(System.out);
    static StringBuilder sb = new StringBuilder("");

    public static void main(String[] args) {
        int t = fs.nextInt();
        for (int tt = 0; tt < t; tt++) {
            int n = fs.nextInt(), a = fs.nextInt();
            int b = fs.nextInt(), c = fs.nextInt();
            String s = fs.next();
            ArrayList<Integer> p = new ArrayList<>();
            for (int i = 0; i < n; i++) if (s.charAt(i) == '1') p.add(i);
            int cnt = p.size();
            if (cnt == 0) {
                if (n == 1) sb.append("0
");
                else sb.append(a + "
");
            } else {
                int A = 0, C = 0;
                for (int i = 0; i < n; i++) {
                    if (s.charAt(i) == '0') {
                        if (i == 0) C++;
                        else if (s.charAt(i-1) == '1') C++;
                        else A++;
                    }
                }
                int[] d = new int[cnt-1];
                for (int i = 0; i < cnt-1; i++) d[i] = p.get(i+1) - p.get(i) - 1;
                sort(d);
                int sum = 0;
                int nonzero = 0;
                long ans = 0;
                for (int i = 0; i < cnt; i++) {
                    if (sum >= i+1) break;
                    if (A+C < i-1) break;
                    long res = (long) b * i;
                    res-= (long) c * nonzero;
                    res += (long) a * (sum - nonzero);
                    int A2 = A - (sum - nonzero);
                    int rem = i+1 - sum;
                    int x = Math.min(rem, A2);
                    res += (long) a * x;
                    rem -= x;
                    int R;
                    if (i == 0) R = Math.max(rem-1, 0);
                    else R = Math.max(rem-2, 0);
                    res -= (long) c * R;
                    ans = Math.max(ans, res);
                    if (i < cnt - 1) {
                        sum += d[i];
                        if (d[i] > 0) nonzero++;
                    }
                }
                sb.append(ans + "
");
            }
        }
        pw.print(sb.toString());
        pw.close();
    }

    static void sort(int[] a) {
        ArrayList<Integer> al = new ArrayList<>();
        for (int i : a)
            al.add(i);
        Collections.sort(al);
        for (int i = 0; i < a.length; i++)
            a[i] = al.get(i);
    }

    static class FastScanner {
