		int[] major_imp = new int[3];
		int[] major_crew = new int[3];
		int[] res = new int[N/3];
		int fixed_imp = -1;
		int fixed_crew = -1;
		LinkedList<Integer> queue = new LinkedList<>();
		for( int i = 0; i < N; i+=3 ) {
			res[i/3] = query(i,i+1,i+2);
			if( res[i/3] == 0 ) {
				major_imp[0] = i;
				major_imp[1] = i+1;
				major_imp[2] = i+2;
			}else {
				major_crew[0] = i;
				major_crew[1] = i+1;
				major_crew[2] = i+2;
			}
		}

		for( int i = 0; i < 2; i++ ) {
			if( query(major_crew[0],major_crew[1],major_imp[i]) == 0 ) {
				fixed_imp = major_imp[i];
				fixed_crew = major_crew[2];
			}
		}

		if( fixed_imp == -1 ) {
			for( int i = 0; i < 2; i++ ) {
				if( query(major_crew[0],major_crew[2],major_imp[i]) == 0 ) {
					fixed_imp = major_imp[i];
					fixed_crew = major_crew[1];
				}
			}
			if( fixed_crew == -1 ) {
				fixed_crew = major_crew[0];
				if( query(major_imp[0],major_imp[1],fixed_crew) == 1 ) fixed_imp = major_imp[2];
				else if( query(major_imp[0],major_imp[2],fixed_crew) == 1 ) fixed_imp = major_imp[1];
				else fixed_imp = major_imp[0];
			}
		}

		for( int i = 0; i < N; i+=3 ) {
			if( res[i/3] == 0 ) {
				if( query(fixed_crew,i+1,i+2) == 1 ) {
					queue.offer(i);
					if( query(fixed_crew,i,i+2) == 1 ) queue.offer(i+1);
					else queue.offer(i+2);
				}else if( query(fixed_crew,i,i+2) == 1 ) {
					queue.offer(i+1);
					queue.offer(i+2);
				}else {
					queue.offer(i);
					queue.offer(i+1);
					queue.offer(i+2);
				}
			}else {
				if( query(fixed_imp,i+1,i+2) == 0 ) {
					if( query(fixed_imp,i,i+2) == 0 ) queue.offer(i+2);
					else queue.offer(i+1);
				}else if( query(fixed_imp,i,i+2) == 0 ) {
					queue.offer(i);
				}
			}
		}

		answer_query(queue);

	}

static void answer_query(LinkedList<Integer> queue) {

