						for (int j = l; j <= r; j++) {
							int cnt = dyncnt[j], ans = dynans[j];
							if (j < mb + i) {
								cnt = add(cnt, dyncnt[j + 1]);
								ans = add(ans, dynans[j + 1]);
							}
							ndyncnt[j] = cnt;
							ndynans[j] = add(ans, mul(abs(j - mb), cnt));
						}
					} else {
						for (int j = l; j <= r; j++) {
							int cnt = dyncnt[j], ans = dynans[j];
							if (j > mb - i) {
								cnt = add(cnt, dyncnt[j - 1]);
								ans = add(ans, dynans[j - 1]);
							}
							ndyncnt[j] = cnt;
							ndynans[j] = add(ans, mul(abs(j - mb), cnt));
						}
					}
					int t[] = dyncnt;
					dyncnt = ndyncnt;
					ndyncnt = t;
					t = dynans;
					dynans = ndynans;
					ndynans = t;
				} else if (ca != cb) {
					if ((ca == '0') ^ ((i & 1) != 0)) {
						for (int j = l; j <= r; j++) {
							int cnt = 0, ans = 0;
							if (j < mb + i) {
								cnt = dyncnt[j + 1];
								ans = dynans[j + 1];
							}
							ndyncnt[j] = cnt;
							ndynans[j] = add(ans, mul(abs(j - mb), cnt));
						}
					} else {
						for (int j = l; j <= r; j++) {
							int cnt = 0, ans = 0;
							if (j > mb - i) {
								cnt = dyncnt[j - 1];
								ans = dynans[j - 1];
							}
							ndyncnt[j] = cnt;
							ndynans[j] = add(ans, mul(abs(j - mb), cnt));
						}
					}
					int t[] = dyncnt;
					dyncnt = ndyncnt;
					ndyncnt = t;
					t = dynans;
					dynans = ndynans;
					ndynans = t;
				} else {
					for (int j = l; j < n; j++) {
						dynans[j] = add(dynans[j], mul(abs(j - mb), dyncnt[j]));
					}
				}
			}
			out.println(dynans[mb]);
		}
