	int[] ds;
	int find(int i) {
		return ds[i] < 0 ? i : (ds[i] = find(ds[i]));
	}
	boolean join(int i, int j) {
		i = find(i);
		j = find(j);
		if (i == j)
			return false;
		if (ds[i] > ds[j]) {
			int tmp = i; i = j; j = tmp;
		}
		ds[i] += ds[j];
		ds[j] = i;
		return true;
	}
	void main() {
		int n = sc.nextInt();
		int d = sc.nextInt();
		int[] xx = new int[d];
