		for (int d_ = 1; d_ <= d; d_++) {
			int k = 0;
			Arrays.fill(ds, -1);
			for (int h = 0; h < d_; h++)
				if (!join(xx[h], yy[h]))
					k++;
			int[] qu = new int[n]; int cnt = 0;
			for (int i = 0; i < n; i++)
				if (ds[i] < 0)
					qu[cnt++] = -ds[i];
			Arrays.sort(qu, 0, cnt);
			int s = 0;
