        for(int i=1;i<=n;i++)
            sum += deg[i];
        if(sum>0)
        {
            System.out.println("NO");
            System.out.println(sum/2);
        }
        else
        {
            System.out.println("YES");
            dfstree(1);
            for(int i=1;i<=q;i++)
            {
                Arrays.fill(vis,false);
                ArrayList<Integer>path=new ArrayList<>();
                dfspath(query[i][0],query[i][1],path);
                System.out.println(path.size());
                for(int it:path)
                    System.out.print(it+" ");
                System.out.println("");
            }
        }
    }
    public static void dfstree(int node)
    {
        vis[node]=true;
        for(int it:g[node])
        {
            if(!vis[it])
            {
                tree[node].add(it);
                tree[it].add(node);
                dfstree(it);
            }
        }
    }
    public static boolean dfspath(int node,int target,ArrayList<Integer>path)
    {
        path.add(node);
        vis[node]=true;
        if(node==target)
        {
            return true;
        }
        for(int it:tree[node])
        {
            if(!vis[it] && dfspath(it,target,path))
            {
                return true;
            }
        }
        path.remove(path.size()-1);
        return false;
    }
