            int arr[] = new int[n];
            for (int i = 0; i < n; i++) {
                int x = in.nextInt();
                arr[i] = x;
                set.add(x);
            }
            HashMap<Integer,Integer> rank = new HashMap<>();
            int k = 1;
            for (Integer x: set){
                rank.put(x,k++);
            }
            int c[] = new int[n+1];
            long ans = 0;
            for (int i = 0; i < n; i++) {
                int val = rank.get(arr[i]);
                long xiaoyu = query(val-1,c);
                long dengyu = query(val,c) - xiaoyu;
                long dayu = i - xiaoyu - dengyu;
                ans += Math.min(xiaoyu,dayu);
                update(val,1,c);
            }
            System.out.println(ans);
        }
    }
    public static int lowbit(int x){
        return x & -x;
    }
    public static void update(int x,int k,int c[]){
        for (;x<=c.length-1;x+=lowbit(x)){
            c[x] += k;
        }
    }
    public static long query(int x,int c[]){
        long ans = 0;
        for (;x>=1;x-=lowbit(x)){
            ans += c[x];
        }
        return ans;
    }
}

