        while(t-->0)
        {
            int n=Integer.parseInt(bu.readLine());
            int a[]=new int[n],i;
            Set<Integer> set=new TreeSet<>();
            HashMap<Integer,Integer> hm=new HashMap<>();
            String s[]=bu.readLine().split(" ");
            for(i=0;i<n;i++)
            {
                a[i]=Integer.parseInt(s[i]);
                set.add(a[i]);
            }

            i=0;
            for(int x:set) hm.put(x,i++);
            int sz=i; bit=new int[sz+1];
            update(hm.get(a[0]),sz);

            long ans=0;
            for(i=1;i<n;i++)
            {
                int m1=query(hm.get(a[i])-1),m2=i-query(hm.get(a[i]));
                ans+=Math.min(m1,m2);
                update(hm.get(a[i]),sz);
            }
            sb.append(ans+"
");
        }
        System.out.print(sb);
    }

    static int bit[];
    static void update(int i,int n)
    {
        i++;
        while(i<=n)
        {
            bit[i]++;
            i+=i&-i;
        }
    }

    static int query(int i)
    {
        i++;
        int s=0;
        while(i>0)
        {
            s+=bit[i];
            i-=i&-i;
        }
        return s;
    }
