			int n = Integer.parseInt(br.readLine());
			StringTokenizer st = new StringTokenizer(br.readLine());

			it = 1;
			int[] ar = new int[n];
			FenwickTree ft = new FenwickTree(n+2);
			TreeMap<Integer, Integer> comp = new TreeMap<Integer, Integer>();	

			for(int i = 0; i < n; i++) {

				ar[i] = Integer.parseInt(st.nextToken());
				comp.put(ar[i], 0);

			}

			comp.forEach((val, ind) -> {

				comp.replace(val, it);
				it++;

			});

			long inversions = 0;

			for(int i = 0; i < n; i++) {

				long frontCost = ft.sum(comp.get(ar[i])-1);
				long backCost = ft.sum(comp.get(ar[i])+1, n+1);

				inversions += Math.min(frontCost, backCost);

				ft.add(comp.get(ar[i]), 1);

			}

			System.out.println(inversions);

		}

	}

	static class FenwickTree{

		long[] bit;
		int n;

		public FenwickTree(int n) {

			this.n = n;
			bit = new long[n];

		}

		public long sum(int r) {

			long ret = 0;
	        for (; r >= 0; r = (r & (r + 1)) - 1)
	            ret += bit[r];
	        return ret;

		}

	    public long sum(int l, int r) {

	        return sum(r) - sum(l - 1);

	    }

	    public void add(int idx, long delta) {

	        for (; idx < n; idx = idx | (idx + 1))
	            bit[idx] += delta;

	    }

	}

