        String str = sc.nextLine().trim();
        assert str.length() >= 1 && str.length() <= 8 : "Length of S not in range";
        if (str.charAt(0) == '0') {
            System.out.println(str.length() > 1 ? "0" : "1");
            return;
        }
        int fromVal = Integer.parseInt("1" + "0".repeat(str.length() - 1));
        if (fromVal == 1) {
            fromVal = 0;
        } else if (fromVal == 10) {
            fromVal = 25;
        }
        int toVal = Integer.parseInt("9".repeat(str.length()));
        int count = 0;
        for (int val = fromVal; val <= toVal; val += 25) {
            if (canFormInteger(val, str)) {
                count++;
            }
        }
        System.out.println(count);
    }

    private static boolean canFormInteger(int num, String str) {
        String strNum = String.valueOf(num);
        char xVal = '*';
        for (int index = 0; index < str.length(); index++) {
            if (str.charAt(index) == '_') {
                continue;
            } else if (str.charAt(index) == 'X') {
                if (xVal != '*' && xVal != strNum.charAt(index)) {
                    return false;
                }
                xVal = strNum.charAt(index);
            } else if (str.charAt(index) != strNum.charAt(index)) {
                return false;
            }
        }
        return true;
    }
}
