                if (us[i] < k && vs[i] >= k) {
                    type[i] = us[i];
                } else if (vs[i] < k && us[i] >= k) {
                    type[i] = vs[i];
                } else {
                    type[i] = k;
                }
            }
            debug.debug("size", us.length);
            long best = inf;
            for (int i = 0; i < 1 << m; i++) {
                boolean ok = true;
                dsu.init();
