                MatroidIndependentSet tree = MatroidIndependentSet.ofSpanningTree(n, new int[][]{us, vs});
                MaximumWeightMatroidIntersect mi = new MaximumWeightMatroidIntersect(us.length, ws);
                boolean[] sol = mi.intersect(container, tree);
