import java.util.*;

public class Main {
  public static void main(String[] args) {
    Scanner in = new Scanner(System.in);
    int t = in.nextInt();

    while (t-- > 0) {
      int n = in.nextInt(), ones = 0, x = 1, a = 0, b = 0;

      // 0 0 0 1 1 1
      //
      for (int i = 1; i <= n; i++) {
        int mod = in.nextInt() % 2;

        ones += mod;

        if (mod == 1) {
          a += Math.abs(i - 1 - x);
          b += Math.abs(i - x);
          x += 2;
        }
      }

      if (Math.abs(n - 2 * ones) > 1)
        System.out.println(-1);
      else if (n % 2 == 0)
        System.out.println(Math.min(a, b));
      else if (n - ones > ones)
        System.out.println(a);
      else
        System.out.println(b);
    }
  }
}
