                evenFirstRes += Math.abs(evens[i] - i*2);
                oddFirstRes += Math.abs(evens[i] - (i*2 + 1));
            }
            int res = Math.abs(noe - (n-noe)) > 1 ? -1 : (n/2)*2 == n ? Math.min(evenFirstRes, oddFirstRes) : n-noe < noe ? evenFirstRes : oddFirstRes;

            out.append(res + "
");
        }
        System.out.print(out);
