    public static void main(String[] args) throws Exception {
        Scanner sc = new Scanner(new BufferedInputStream(System.in));
        int n = sc.nextInt();
        int k = sc.nextInt();
        String s = sc.next();
        int left = 0;
        int right = n;
        int ans = 0;
        char[] cs = s.toCharArray();
        while (left<=right){
            int mid = (left+right)/2;
            if(check(k,cs,n,mid)){
                ans = mid;
                left = mid + 1;
            }else {
                right = mid - 1;
            }
        }
        System.out.println(ans);
    }
    static int INF = 0x3f3f3f3f;
    public static boolean check(int k,char[] s,int n,int limit){
        int[][] f = new int[k][n+3];
        for (int i = 0; i < k; i++) {
            f[i][n+1] = f[i][n+2] = n + 2;
            int now = 0;
            for(int j = n; j >= 1; j--) {
                if(s[j-1]=='?'||s[j-1]=='a'+i)now++;
                else now = 0;
                f[i][j] = (now>=limit?j+limit:f[i][j+1]);
            }
        }
        //System.out.println(Arrays.toString(f[1]));
        int[] dp = new int[(1<<k)];
        Arrays.fill(dp,n+2);
        dp[0] = 1;
        for (int i = 0; i < (1 << k); i++) {
            for (int j = 0; j < k; j++) {
                if((i>>j&1)==1)continue;
                int state = (i|(1<<j));
                dp[state] = Math.min(dp[state],f[j][dp[i]]);
            }
        }
        return dp[(1<<k)-1]<=n+1;
    }
