public class _111 {
    static int MAX = (int) 1e7;
    public static void main(String[] args) {
        MyScanner sc = new MyScanner();
        PrintWriter out = new PrintWriter(new BufferedOutputStream(System.out));
        int t = 1;
        while (t-- > 0) {
            int n = sc.nextInt();
            int k = sc.nextInt();
            String s = sc.next();
            int l = 0; int r = n / k + 2;
            while (l < r) {
                int len = (l + r) / 2;
                // starting from the suffix at i, how far do I have to go to create a run of length len
                int [][] end = new int[k][n + 1];
                for (int [] arr: end) Arrays.fill(arr, MAX);
                for (int c = 0; c < k; c++) {
                    int run = 0;
                    for (int i = n - 1; i >= 0; i--) {
                        if (s.charAt(i) == 'a' + c || s.charAt(i) == '?') ++run; else run = 0;
                        end[c][i] = end[c][i + 1];
                        if (run >= len) end[c][i] = i + len - 1;
                    }
                }
                // length of the minimum prefix such that we can fit runs of all the bits set in mask
                int [] dp = new int[1 << k];
                Arrays.fill(dp, MAX);
                dp[0] = -1;
                for (int i = 1; i < (1 << k); i++) {
                    for (int j = 0; j < k; j++) {
                        if (((i >> j) & 1) == 1 && dp[i ^ (1 << j)] < MAX) {
                            int previous = dp[i ^ (1 << j)];
                            dp[i] = Math.min(dp[i], end[j][previous + 1]);
                        }
