import java.io.BufferedOutputStream;
import java.io.BufferedReader;
import java.io.FileInputStream;
import java.io.FileOutputStream;
import java.io.IOException;
import java.io.InputStreamReader;
import java.io.PrintStream;
import java.util.Locale;
import java.util.StringTokenizer;

public class Solution implements Runnable {

	public static final int MOD = 998244353;

	private PrintStream out;
	private BufferedReader in;
	private StringTokenizer st;

	public void solve() throws IOException {
		long time0 = System.currentTimeMillis();

		int t = nextInt();
		for (int test = 1; test <= t; test++) {
			int n = nextInt();
			int[][] a = new int[2 * n][n];
			for (int i = 0; i < 2 * n; i++) {
				for (int j = 0; j < n; j++) {
					a[i][j] = nextInt() - 1;
				}
			}
			String answer = solve(n, a);
			out.println(answer);
		}

		System.err.println("time: " + (System.currentTimeMillis() - time0));
	}

	private String solve(int n, int[][] a) {
		int[][] posnumcount = new int[n][n];
		int[] posonescount = new int[n];
		for (int i = 0; i < a.length; i++) {
			add(a[i], 1, posnumcount, posonescount);
		}
		boolean[] killed = new boolean[2 * n];
		int answer = 1;
		int[] ansarr = new int[n];
		for (int i = 0; i < n; i++) {
			int onepos = -1;
			for (int j = 0; j < n; j++) {
				if (posonescount[j] > 0) {
					onepos = j;
					break;
				}
			}
			int tokill = -1;
			if (onepos == -1) {
				answer = (answer * 2) % MOD;
				for (int j = 0; j < 2 * n; j++) {
					if (!killed[j]) {
						tokill = j;
						break;
					}
				}
			} else {
				for (int j = 0; j < 2 * n; j++) {
					if (!killed[j] && posnumcount[onepos][a[j][onepos]] == 1) {
						tokill = j;
						break;
					}
				}
			}
			ansarr[i] = tokill;
			for (int j = 0; j < 2 * n; j++) {
				if (!killed[j]) {
					for (int k = 0; k < n; k++) {
						if (a[j][k] == a[tokill][k]) {
							killed[j] = true;
							add(a[j], -1, posnumcount, posonescount);
							break;
						}
					}
				}
			}
		}
		StringBuilder buf = new StringBuilder();
		buf.append(answer).append("
");
		for (int i = 0; i < n; i++) {
			buf.append(ansarr[i] + 1).append(" ");
		}
		return buf.toString();
	}

	private void add(int[] ai, int add, int[][] posnumcount, int[] posonescount) {
		for (int j = 0; j < ai.length; j++) {
			if (posnumcount[j][ai[j]] == 1) {
				posonescount[j]--;
			}
			posnumcount[j][ai[j]] += add;
			if (posnumcount[j][ai[j]] == 1) {
				posonescount[j]++;
			}
		}
	}

	public double nextDouble() throws IOException {
		return Double.parseDouble(next());
	}

	public long nextLong() throws IOException {
		return Long.parseLong(next());
	}

	public int nextInt() throws IOException {
		return Integer.parseInt(next());
	}

	public String next() throws IOException {
		while (!st.hasMoreTokens()) {
			String line = in.readLine();
			if (line == null) {
				return null;
			}
			st = new StringTokenizer(line);
		}
		return st.nextToken();
	}

	@Override
	public void run() {
		try {
			solve();
			out.close();
		} catch (Throwable e) {
			throw new RuntimeException(e);
		}
	}

	public Solution(String name) throws IOException {
		Locale.setDefault(Locale.US);
		if (name == null) {
			in = new BufferedReader(new InputStreamReader(System.in));
			out = new PrintStream(new BufferedOutputStream(System.out));
		} else {
			in = new BufferedReader(new InputStreamReader(new FileInputStream(name + ".in")));
			out = new PrintStream(new BufferedOutputStream(new FileOutputStream(name + ".out")));
		}
		st = new StringTokenizer("");
	}

	public static void main(String[] args) throws IOException {
		new Thread(new Solution(null)).start();
	}
}
