			for (int i = 0; i < sz; ++i) {
				for (int j = i + 1; j < sz; ++j) {
					flag = false;
					for (int k = 0; k < n; ++k) {
						if (a[i][k] == a[j][k]) {
							flag = true;
							break;
						}
					}
					g[i][j] = flag;
					g[j][i] = flag;
				}
			}
			for (int col = 0; col < n; ++col) {
				for (int v = 0; v < n; ++v) {
					value[col][v] = 0;
				}
				for (int i = 0; i < sz; ++i) {
					value[col][a[i][col]]++;
