									used[r] = true;
									for (int x = 0; x < n; ++x) {
										value[x][a[r][x]]--;
									}
									ans.add(r);
									for (int i = 0; i < sz; ++i) {
										if (!used[i] && g[r][i]) {
											used[i] = true;
											for (int x = 0; x < n; ++x) {
