		for(int i=0; i<n; i++) {
			a[i][0] = in.nextInt();
			a[i][1] = i;
		}
		Arrays.sort(a, new Comparator<int[]>() {
			public int compare(int[] o1, int[] o2) {
				return o1[0]-o2[0];
			}
		});

		for(int i=0;i<n;i++)
		{
			int oo=0,oe=0,no=0,ne=0;
			int temp = a[i][0];
			while(i<n && a[i][0]==temp) {
				if(i%2==0)	oe++;
				else	oo++;
				if(a[i][1]%2==0) ne++;
				else	no++;
				i++;
			}
			i--;
			if(oo!=no || oe!=ne) {
				System.out.println("NO");
				return;
			}
		}
		System.out.println("YES");
