// https://codeforces.com/problemset/problem/1534/A
	static Scanner scn = new Scanner(System.in);
	public static void solve() {
		int h = scn.nextInt() , w = scn.nextInt();
		boolean f1 = false , f2 = false;
		char[][] board = new char[h][];
		for(int i=0 ; i<h ; i++) {
			board[i] = scn.next().toCharArray();
		}
		for(int x = 0 ; x<w ; x++) {
			for(int y = 0 ; y<h ; y++) {
				if(board[y][x] != '.') {
					if(board[y][x]=='W' == ((x+y)%2==0))
						f1 = true;
					else
						f2 = true;
				}
			}

		}
		if(f1&&f2)
			System.out.println("No");
		else {
			System.out.println("Yes");
			if(f1) {
				for(int y=0 ; y<h ; y++) {
					for(int x = 0 ; x<w ; x++) {
						System.out.print((x+y)%2==0?"W":"R");
					}
					System.out.println();
				}
			}
			else {
				for (int y=0; y<h; y++) {
					for (int x=0; x<w; x++) {
						System.out.print((x+y)%2!=0?"W":"R");
					}
					System.out.println();
				}
			}
		}
	}

	public static void main(String[] args) {


		int t = scn.nextInt();
		while(t-->0) {
			solve();
		}
	}
}
