        dp[0][0]=true;
        for(i=1;i<=n;i++)
        for(j=0;j<=sum;j++)
        if(j<a[i-1]) dp[i][j]=dp[i-1][j];
        else dp[i][j]=dp[i-1][j] | dp[i-1][j-a[i-1]];

        if(!dp[n][sum/2]) {System.out.println(0); return;}

