		for(int i=0;i<n;i++) {
			pref[sc.nextInt()-1]^=1;
		}
		for(int i=1;i<m;i++)pref[i]^=pref[i-1];
		int[][]xor=new int[m][20];
		for(int i=1,len=2;len<=m;i++,len<<=1) {
			for(int j=0;j<m;j++) {
				int left=xor[j][i-1],right=j+(len>>1)>=m?0:xor[j+(len>>1)][i-1];
				xor[j][i]=left^right;
				int odd=j+(len>>1)<m && (pref[Math.min(m-1, j+len-1)]^pref[j+(len>>1)-1])==1?1:0;
				xor[j][i]^=(odd)*(len>>1);
			}
		}
		char[]ans= {'B','A'};
		int q=sc.nextInt();
		while(q-->0) {
			int l=sc.nextInt()-1,r=sc.nextInt()-1;
			int curxor=0;
			for(int i=19,len=1<<i;i>0;i--,len>>=1) {
				if(l+len-1>r)continue;
				curxor^=xor[l][i];
				int odd=(pref[r]^pref[l+(len)-1]);
				curxor^=(odd)*(len);
				l+=len;
			}
			pw.print(ans[Math.min(curxor, 1)]);
		}
		pw.println();
    }
