		for (int i = 0; i < n - 1; i++) {
			from[i] = ni() - 1;
			to[i] = ni() - 1;
		}
		int[][] g = packU(n, from, to);
		int[][] pars = parents(g, 0);
		int[] par = pars[0], ord = pars[1], dep = pars[2];

		HeavyLightDecomposition hld = new HeavyLightDecomposition(g, par, ord, dep);
		Node[] nodes = new Node[n];
		Node[] roots = new Node[hld.m];
		int[][] fts = new int[hld.m][];
		int[] lclus = new int[n];
		for(int i = 0;i < hld.m;i++){
			fts[i] = new int[hld.cluspath[i].length + 3];
			Node root = null;
			for(int j = 0;j < hld.cluspath[i].length;j++){
				nodes[a[hld.cluspath[i][j]]-1] = new Node(a[hld.cluspath[i][j]]-1);
				lclus[a[hld.cluspath[i][j]]-1] = i;
				root = merge(root, nodes[a[hld.cluspath[i][j]]-1]);
			}
			roots[i] = root;
		}

		long age = 0;
		boolean first = true;
		for(int i = n-1;i >= 0;i--){
			Node tar = nodes[i];
//			tr(tar);

			addFenwick(fts[lclus[i]], index(tar), 1);
			long nm = 0;
			boolean allmore = true;
			int vtar = hld.cluspath[lclus[i]][index(tar)];
//			tr(vtar);
			Deque<int[]> dq = new ArrayDeque<>();
			for(int x = vtar;;){
				int cx = hld.clus[x];
				int l = 0;
				int r = hld.clusiind[x];
				dq.add(new int[]{cx, r});

				int more = sumFenwick(fts[cx], r);
				if(more != r+1) {
					allmore = false;
				}
				nm += more;

				if(cx == 0)break;
				x = par[hld.cluspath[cx][0]];
			}
//			tr(i, nm, allmore, lclus[i]);
			if(nm != 1 && !allmore){
				out.println("NO");
				return;
			}
			if(nm == 1)continue;
			assert allmore;

			if(!first){
				if(next(tar) != null){
					out.println("NO");
					return;
				}
				if(g[vtar].length != 1){
					out.println("NO");
					return;
				}
			}
			Node nex = null;
			while(!dq.isEmpty()){
				int[] cur = dq.pollLast();
				int cl = cur[0], r = cur[1];

				Node[] lm_r = split(roots[cl], r+1);
				Node[] l_m = split(lm_r[0], r);
				roots[cl] = merge(l_m[0], lm_r[1]);
				if(nex != null){
					lclus[nex.v] = cl;
					roots[cl] = merge(nex, roots[cl]);
				}
				nex = l_m[1];
			}
			roots[0] = merge(nex, roots[0]);
			assert i == nex.v;
			lclus[i] = 0;

			age += dep[vtar];

			first = true;
		}

		int[] anss = new int[n];
		for(int i = 0;i < n;i++){
			Node tar = nodes[i];
			int vtar = hld.cluspath[lclus[i]][index(tar)];
			anss[vtar] = i+1;
		}
		int[] mins = new int[n];
		int[] maxs = new int[n];
		int[] des = new int[n];
		Arrays.fill(des, 1);
		for(int i = n-1;i >= 1;i--){
			des[par[ord[i]]] += des[ord[i]];
		}
		Arrays.fill(mins, 9999999);
		for(int i = n-1;i >= 0;i--){
			int cur = ord[i];
			for(int e : g[cur]){
				if(par[cur] == e)continue;
				mins[cur] = Math.min(mins[cur], mins[e]);
				maxs[cur] = Math.max(maxs[cur], maxs[e]);
			}
			if(des[cur] != 1 && mins[cur] != anss[cur] + 1){
				out.println("NO");
				return;
			}
			mins[cur] = Math.min(mins[cur], anss[cur]);
			maxs[cur] = Math.max(maxs[cur], anss[cur]);
			if(maxs[cur] - mins[cur] + 1 != des[cur]){
				out.println("NO");
				return;
			}
		}
		out.println("YES");
		out.println(age);
		out.println(anss);
	}
	public static int sumFenwick(int[] ft, int i)
	{
		int sum = 0;
		for(i++;i > 0;i -= i&-i)sum += ft[i];
		return sum;
	}

	public static void addFenwick(int[] ft, int l, int r, int v)
	{
		addFenwick(ft, l, v);
		addFenwick(ft, r, -v);
	}

	public static void addFenwick(int[] ft, int i, int v)
	{
		if(v == 0 || i < 0)return;
		int n = ft.length;
		for(i++;i < n;i += i&-i)ft[i] += v;
	}



	public static Random gen = new Random();

	static public class Node
	{
		public int v; // value
		public long priority;
		public Node left, right, parent;

		public int count;

		public Node(int v)
		{
			this.v = v;
			priority = gen.nextLong();
			update(this);
		}

		@Override
		public String toString() {
			StringBuilder builder = new StringBuilder();
			builder.append("Node [v=");
			builder.append(v);
			builder.append(", count=");
			builder.append(count);
			builder.append(", parent=");
			builder.append(parent != null ? parent.v : "null");
			builder.append("]");
			return builder.toString();
		}
	}

	public static Node update(Node a)
	{
		if(a == null)return null;
		a.count = 1;
		if(a.left != null)a.count += a.left.count;
		if(a.right != null)a.count += a.right.count;

		// TODO
		return a;
	}

	public static void propagate(Node x)
	{
		for(;x != null;x = x.parent)update(x);
	}

	public static Node disconnect(Node a)
	{
		if(a == null)return null;
		a.left = a.right = a.parent = null;
		return update(a);
	}

	public static Node root(Node x)
	{
		if(x == null)return null;
		while(x.parent != null)x = x.parent;
		return x;
	}

	public static int count(Node a)
	{
		return a == null ? 0 : a.count;
	}

	public static void setParent(Node a, Node par)
	{
		if(a != null)a.parent = par;
	}

	public static Node merge(Node a, Node b, Node... c)
	{
		Node x = merge(a, b);
		for(Node n : c)x = merge(x, n);
		return x;
	}

	public static Node merge(Node a, Node b)
	{
		if(b == null)return a;
		if(a == null)return b;
		if(a.priority > b.priority){
			setParent(a.right, null);
			setParent(b, null);
			a.right = merge(a.right, b);
			setParent(a.right, a);
			return update(a);
		}else{
			setParent(a, null);
			setParent(b.left, null);
			b.left = merge(a, b.left);
			setParent(b.left, b);
			return update(b);
		}
	}

	public static Node[] split(Node x)
	{
		if(x == null)return new Node[]{null, null};
		if(x.left != null)x.left.parent = null;
		Node[] sp = new Node[]{x.left, x};
		x.left = null;
		update(x);
		while(x.parent != null){
			Node p = x.parent;
			x.parent = null;
			if(x == p.left){
				p.left = sp[1];
				if(sp[1] != null)sp[1].parent = p;
				sp[1] = p;
			}else{
				p.right = sp[0];
				if(sp[0] != null)sp[0].parent = p;
				sp[0] = p;
			}
			update(p);
			x = p;
		}
		return sp;
	}

	public static Node[] split(Node a, int... ks)
	{
		int n = ks.length;
		if(n == 0)return new Node[]{a};
		for(int i = 0;i < n-1;i++){
			if(ks[i] > ks[i+1])throw new IllegalArgumentException(Arrays.toString(ks));
		}

		Node[] ns = new Node[n+1];
		Node cur = a;
		for(int i = n-1;i >= 0;i--){
			Node[] sp = split(cur, ks[i]);
			cur = sp[0];
			ns[i] = sp[0];
			ns[i+1] = sp[1];
		}
		return ns;
	}

	// [0,K),[K,N)
	public static Node[] split(Node a, int K)
	{
		if(a == null)return new Node[]{null, null};
		if(K <= count(a.left)){
			setParent(a.left, null);
			Node[] s = split(a.left, K);
			a.left = s[1];
			setParent(a.left, a);
			s[1] = update(a);
			return s;
		}else{
			setParent(a.right, null);
			Node[] s = split(a.right, K-count(a.left)-1);
			a.right = s[0];
			setParent(a.right, a);
			s[0] = update(a);
			return s;
		}
	}

	public static Node insertb(Node root, Node x)
	{
		int ind = lowerBound(root, x.v);
		return insert(root, ind, x);
	}

	public static Node insert(Node a, int K, Node b)
	{
		if(a == null)return b;
		if(b.priority < a.priority){
			if(K <= count(a.left)){
				a.left = insert(a.left, K, b);
				setParent(a.left, a);
			}else{
				a.right = insert(a.right, K-count(a.left)-1, b);
				setParent(a.right, a);
			}
			return update(a);
		}else{
			Node[] ch = split(a, K);
			b.left = ch[0]; b.right = ch[1];
			setParent(b.left, b);
			setParent(b.right, b);
			return update(b);
		}
	}

	// delete K-th
	public static Node erase(Node a, int K)
	{
		if(a == null)return null;
		if(K < count(a.left)){
			a.left = erase(a.left, K);
			setParent(a.left, a);
			return update(a);
		}else if(K == count(a.left)){
			setParent(a.left, null);
			setParent(a.right, null);
			Node aa = merge(a.left, a.right);
			disconnect(a);
			return aa;
		}else{
			a.right = erase(a.right, K-count(a.left)-1);
			setParent(a.right, a);
			return update(a);
		}
	}

	public static Node get(Node a, int K)
	{
		while(a != null){
			if(K < count(a.left)){
				a = a.left;
			}else if(K == count(a.left)){
				break;
			}else{
				K = K - count(a.left)-1;
				a = a.right;
			}
		}
		return a;
	}

	public static int index(Node a)
	{
		if(a == null)return -1;
		int ind = count(a.left);
		while(a != null){
			Node par = a.parent;
			if(par != null && par.right == a){
				ind += count(par.left) + 1;
			}
			a = par;
		}
		return ind;
	}

	public static Node mergeTechnically(Node x, Node y)
	{
		if(count(x) > count(y)){
			Node d = x; x = y; y = d;
		}
		// |x|<=|y|
		for(Node cur : nodesdfs(x))y = insertb(y, disconnect(cur));
		return y;
	}

	public static int lowerBound(Node a, int q)
	{
		int lcount = 0;
		while(a != null){
			if(a.v >= q){
				a = a.left;
			}else{
				lcount += count(a.left) + 1;
				a = a.right;
			}
		}
		return lcount;
	}

	public static int search(Node a, int q)
	{
		int lcount = 0;
		while(a != null){
			if(a.v == q){
				lcount += count(a.left);
				break;
			}
			if(q < a.v){
				a = a.left;
			}else{
				lcount += count(a.left) + 1;
				a = a.right;
			}
		}
		return a == null ? -(lcount+1) : lcount;
	}

	public static Node next(Node x)
	{
		if(x == null)return null;
		if(x.right != null){
			x = x.right;
			while(x.left != null)x = x.left;
			return x;
		}else{
			while(true){
				Node p = x.parent;
				if(p == null)return null;
				if(p.left == x)return p;
				x = p;
			}
		}
	}

	public static Node prev(Node x)
	{
		if(x == null)return null;
		if(x.left != null){
			x = x.left;
			while(x.right != null)x = x.right;
			return x;
		}else{
			while(true){
				Node p = x.parent;
				if(p == null)return null;
				if(p.right == x)return p;
				x = p;
			}
		}
	}

	public static Node build(int[] a, int l, int r)
	{
		if(l >= r)return null;

		int h = l+r>>1;
		Node root = new Node(a[h]);

		Node L = build(a, l, h);
		root.left = L;
		if(L != null)L.parent = root;

		Node R = build(a, h+1, r);
		root.right = R;
		if(R != null)R.parent = root;

		return update(root);
	}


	public static Node[] nodes(Node a) { return nodes(a, new Node[count(a)], 0, count(a)); }
	public static Node[] nodes(Node a, Node[] ns, int L, int R)
	{
		if(a == null)return ns;
		nodes(a.left, ns, L, L+count(a.left));
		ns[L+count(a.left)] = a;
		nodes(a.right, ns, R-count(a.right), R);
		return ns;
	}

