//package ecr104;
import java.io.*;
import java.util.ArrayDeque;
import java.util.Arrays;
import java.util.InputMismatchException;
import java.util.Queue;

public class G3 {
	InputStream is;
	FastWriter out;
	String INPUT = "";

	void solve()
	{
		final int mod = 998244353;
		int n = ni();
		int[] a = na(26);
		long all = 26 * 26 * pow(25, n-2, mod) % mod;

		long[][][] dp = new long[3][n+1][n+1];
		dp[0][1][0] = 1;
		dp[1][0][1] = 1;
		dp[2][0][0] = 1;
		for(int i = 0;i < n-1;i++){
			long[][][] ndp = new long[3][n+1][n+1];
			if(i == (n+1)/2-1){
				for (int j = 0; j <= n; j++) {
					for (int k = 0; j+k <= n; k++) {
						if (j + 1 <= n) {
							ndp[0][j + 1][k] += dp[0][j][k] + dp[1][j][k] + dp[2][j][k] * 24;
							ndp[0][j + 1][k] %= mod;
						}
						if (k + 1 <= n) {
							ndp[1][j][k + 1] += dp[0][j][k] + dp[1][j][k] + dp[2][j][k] * 24;
							ndp[1][j][k + 1] %= mod;
						}
						ndp[2][j][k] += dp[0][j][k] + dp[1][j][k] + dp[2][j][k] * 24;
						ndp[2][j][k] %= mod;
					}
				}
			}else {
				for (int j = 0; j <= n; j++) {
					for (int k = 0; j+k <= n; k++) {
						if (j + 1 <= n) {
							ndp[0][j + 1][k] += dp[1][j][k] + dp[2][j][k] * 24;
							ndp[0][j + 1][k] %= mod;
						}
						if (k + 1 <= n) {
							ndp[1][j][k + 1] += dp[0][j][k] + dp[2][j][k] * 24;
							ndp[1][j][k + 1] %= mod;
						}
						ndp[2][j][k] += dp[0][j][k] + dp[1][j][k] + dp[2][j][k] * 23;
						ndp[2][j][k] %= mod;
					}
				}

			}
			dp = ndp;
		}

		long[] sdp = new long[n+1];
		for(int i = 0;i <= n;i++){
			for(int j = 0;j <= n;j++){
				sdp[i] += dp[0][i][j] + dp[1][i][j] + dp[2][i][j] * 24;
			}
			sdp[i] %= mod;
		}

		for(int i = 0;i < 26;i++){
			for(int k = a[i]+1;k <= n;k++){
				all -= sdp[k];
			}
		}

		for(int i = 0;i < 26;i++){
			for(int j = i+1;j < 26;j++){
				for(int k = a[i]+1;k <= n;k++){
					for(int l = a[j]+1;l+k <= n;l++){
						all += (dp[0][k][l] + dp[1][k][l] + dp[2][k][l] * 24);
					}
				}
				all %= mod;
			}
		}
		all %= mod;

		if(all < 0)all += mod;
		out.println(all);
	}

	public static long pow(long a, long n, long mod) {
		//		a %= mod;
		long ret = 1;
		int x = 63 - Long.numberOfLeadingZeros(n);
		for (; x >= 0; x--) {
			ret = ret * ret % mod;
			if (n << 63 - x < 0) ret = ret * a % mod;
		}
		return ret;
	}


	public static long invl(long a, long mod) {
		long b = mod;
		long p = 1, q = 0;
		while (b > 0) {
			long c = a / b;
			long d;
			d = a;
			a = b;
			b = d % b;
			d = p;
			p = q;
			q = d - c * q;
		}
		return p < 0 ? p + mod : p;
	}


	public static long C(int n, int r, int mod, int[][] fif) {
		if (n < 0 || r < 0 || r > n) return 0;
		return (long) fif[0][n] * fif[1][r] % mod * fif[1][n - r] % mod;
	}


	public static int[][] enumFIF(int n, int mod) {
		int[] f = new int[n + 1];
		int[] invf = new int[n + 1];
		f[0] = 1;
		for (int i = 1; i <= n; i++) {
			f[i] = (int) ((long) f[i - 1] * i % mod);
		}
		long a = f[n];
		long b = mod;
		long p = 1, q = 0;
		while (b > 0) {
			long c = a / b;
			long d;
			d = a;
			a = b;
			b = d % b;
			d = p;
			p = q;
			q = d - c * q;
		}
		invf[n] = (int) (p < 0 ? p + mod : p);
		for (int i = n - 1; i >= 0; i--) {
			invf[i] = (int) ((long) invf[i + 1] * (i + 1) % mod);
		}
		return new int[][]{f, invf};
	}


	void run() throws Exception
	{
		is = oj ? System.in : new ByteArrayInputStream(INPUT.getBytes());
		out = new FastWriter(System.out);

		long s = System.currentTimeMillis();
		solve();
		out.flush();
		tr(System.currentTimeMillis()-s+"ms");
	}

