				int p = pp[i - 1], q = qq[i + 2];
				if (p < 0 || q < 0)
					continue;
				if (a >= p && b >= q && a - p == b - q) {
					yes = true;
					break;
				}
				int tmp = a; a = b; b = tmp;
				if (a >= p && b >= q && a - p == b - q) {
					yes = true;
					break;
				}
			}
			println(yes ? "YES" : "NO");
		}
