public class Main1 {
    static int[] a;

    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int t = sc.nextInt();
        for (int i = 0; i < t; i++) {
            a = new int[sc.nextInt()];
            for (int j = 0; j < a.length; j++) {
                a[j] = sc.nextInt();
            }
            if (canClean()) {
                System.out.println("YES");
            } else {
                System.out.println("NO");
            }
        }
    }

    private static boolean canClean() {
        int[] pref = new int[a.length];
        pref[0] = a[0];
        for (int i = 1; i < a.length; i++) {
            if (pref[i - 1] < 0) pref[i] = -1;
            else pref[i] = a[i] - pref[i - 1];
        }

        int[] suff = new int[a.length + 1];
        suff[a.length - 1] = a[a.length - 1];
        for (int i = a.length - 2; i >= 0; i--) {
            if (suff[i + 1] < 0) suff[i] = -1;
            else suff[i] = a[i] - suff[i + 1];
        }
//        System.out.println("pref: " + Arrays.toString(pref));
//        System.out.println("suff: " + Arrays.toString(suff));
        if (pref[pref.length - 1] == 0) return true;

        for (int i = 0; i < a.length - 1; i++) {
            if (getPrefIMinusOne(pref, i) >= 0 && suff[i + 2] >= 0
                    && a[i + 1] - getPrefIMinusOne(pref, i) >= 0
                    && a[i] - a[i + 1] + getPrefIMinusOne(pref, i) == suff[i + 2]) {
                return true;
            }
        }
        return false;
    }

    static int getPrefIMinusOne(int[] pref, int i) {
        if (i == 0) return 0;
        return pref[i - 1];
    }


}
