public class A{
    static PrintWriter out;
    static InputReader in;
    public static void main(String args[]){
        out = new PrintWriter(System.out);
        in = new InputReader();
        new A();
        out.flush(); out.close();
    }   
    A(){
        solve();
    }
    class point{
    	double x, y;
    	point(double a, double b){
    		x = a; y = b;
    	}
    }

    final int max = 200010;
    int n, H;
    point point[] = new point[max];
    double ex, ey;
    double find(double x, double y){
    	return Math.sqrt(x * x + y * y);
    }
    double cross(point p1, point p2){
    	return p1.x * p2.y - p2.x * p1.y;
    }
    double cross(int id1, int id2){
    	return cross(new point(point[id1].x - ex, point[id1].y - ey), new point(point[id2].x - ex, point[id2].y - ey));
    }
    point intersect(point p1, point p2, point p){
    	if(p2.x == p.x && p2.y == p.y)return p2;
    	point AB = new point(p2.x - p1.x, p2.y - p1.y), CD = new point(p.x - ex, p.y - ey);
    	double i = cross(new point(p.x - p1.x, p.y - p1.y), CD) / cross(AB, CD);
    	if(i >= 0 && i <= 1)return new point(p1.x + i * AB.x, p1.y + i * AB.y);
    	return null;
    }
    void solve(){
    	n = in.nextInt(); H = in.nextInt();
    	for(int i = 1; i <= n; i++){
    		point[i] = new point(in.nextInt(), in.nextInt());
    	}
    	ex = point[n].x; ey = point[n].y + H;
    	int id = n; 
    	double tot = 0;
    	for(int i = n - 1; i >= 1; i--){
    		if(cross(i, id) >= 0){
	    		point p = intersect(point[i], point[i + 1], point[id]);
	    		if(p != null){
					tot += find(point[i].x - p.x, point[i].y - p.y);
	    		}
    			id = i;
    		}
    	}
    	out.print(tot);
    }
    public static class InputReader{
