/**
 * Built using CHelper plug-in
 * Actual solution is at the top
 *
 * @author Sparsh Sanchorawala
 */
public class Main {
    public static void main(String[] args) {
        InputStream inputStream = System.in;
        OutputStream outputStream = System.out;
        InputReader in = new InputReader(inputStream);
        PrintWriter out = new PrintWriter(outputStream);
        GHobbits solver = new GHobbits();
        solver.solve(1, in, out);
        out.close();
    }

    static class GHobbits {
        public void solve(int testNumber, InputReader s, PrintWriter w) {
            int n = s.nextInt(), h = s.nextInt();
            long[] x = new long[n];
            long[] y = new long[n];
            for (int i = 0; i < n; i++) {
                x[i] = s.nextInt();
                y[i] = s.nextInt();
            }
            double res = 0;
            long my = h, mx = 0;
            boolean up = false;
            for (int i = n - 2; i >= 0; i--) {
                boolean cond = false;
                long m2y = y[n - 1] + h - y[i], m2x = x[n - 1] - x[i];
                long d = m2x * Math.abs(my) - Math.abs(m2y) * mx;
                //w.println((i + 1) + ": " + (double)mx / my + " " + (double)m2x / m2y);
                //w.println(up);
                if (d == 0) {
                    long m3y = y[i] - y[i + 1];
                    long m3x = x[i] - x[i + 1];
                    if (m3x * m2y - m3y * m2x == 0) {
                        //w.println(i + " // dist: " + sqrt((x[i] - x[i + 1]) * (x[i] - x[i + 1]) + (y[i] - y[i +  1]) * (y[i] - y[i +  1])));
                        res += Math.sqrt((x[i] - x[i + 1]) * (x[i] - x[i + 1]) + (y[i] - y[i + 1]) * (y[i] - y[i + 1]));
                    }
                    continue;
                }
                if (m2y < 0 && !up) {
                    up = true;
                    cond = true;
                } else if (up && d < 0 && m2y < 0) {
                    cond = true;
                } else if (!up && d > 0) {
                    cond = true;
                }
                if (cond) {
                    //w.println((i + 1) + " // " + up);
                    //w.println(mx + " " + my + " slope");
                    if (i != n - 2) {
                        double k1 = y[n - 1] + h - (double) x[n - 1] * my / mx - y[i + 1] + (double) x[i + 1] * (y[i] - y[i + 1]) / (x[i] - x[i + 1]);
                        double k2 = (double) (y[i] - y[i + 1]) / (x[i] - x[i + 1]) - (double) my / mx;
                        double vx = k1 / k2;
                        double vy = (mx * (y[n - 1] + h) - x[n - 1] * my + vx * my) / mx;
                        //w.println(vx + " " + vy);
                        res += Math.sqrt((x[i] - vx) * (x[i] - vx) + (y[i] - vy) * (y[i] - vy));
                        //w.println("dist: " + sqrt((x[i] - vx) * (x[i] - vx) + (y[i] - vy) * (y[i] - vy)));
                    } else {
                        //w.println(x[i] + " " + y[i] + ", " + x[i + 1] + " " + y[i + 1]);
                        //w.println(abs(x[i] - x[i + 1]) + " ::" + abs(y[i] - y[i + 1]));
                        //w.println(sqrt((x[i] - x[i + 1]) * (x[i] - x[i + 1]) + (y[i] - y[i + 1]) * (y[i] - y[i + 1])));
                        res += Math.sqrt((x[i] - x[i + 1]) * (x[i] - x[i + 1]) + (y[i] - y[i + 1]) * (y[i] - y[i + 1]));
                        //w.println("dist: " + sqrt((x[i] - x[i + 1]) * (x[i] - x[i + 1]) + (y[i] - y[i + 1]) * (y[i] - y[i + 1])));
                    }
                    my = m2y;
                    mx = m2x;
                }
            }
            w.println(res);
        }

    }

    static class InputReader {
        private InputStream stream;
        private byte[] buf = new byte[1024];
        private int curChar;
        private int numChars;
        private InputReader.SpaceCharFilter filter;

        public InputReader(InputStream stream) {
            this.stream = stream;
        }

        public int read() {
            if (numChars == -1) {
                throw new InputMismatchException();
            }
            if (curChar >= numChars) {
                curChar = 0;
                try {
                    numChars = stream.read(buf);
                } catch (IOException e) {
                    throw new InputMismatchException();
                }
                if (numChars <= 0) {
                    return -1;
                }
            }
            return buf[curChar++];
        }

        public int nextInt() {
            int c = read();
            while (isSpaceChar(c)) {
                c = read();
            }
            int sgn = 1;
            if (c == '-') {
                sgn = -1;
                c = read();
            }
            int res = 0;
            do {
                if (c < '0' || c > '9') {
                    throw new InputMismatchException();
                }
                res *= 10;
                res += c - '0';
                c = read();
            } while (!isSpaceChar(c));
            return res * sgn;
        }

        public boolean isSpaceChar(int c) {
            if (filter != null) {
                return filter.isSpaceChar(c);
            }
            return isWhitespace(c);
        }

        public static boolean isWhitespace(int c) {
            return c == ' ' || c == '
' || c == '' || c == '	' || c == -1;
        }

        public interface SpaceCharFilter {
            public boolean isSpaceChar(int ch);

        }

    }
}

