	public void solve() {
		int n = in.nextInt();
		int h = in.nextInt();
		Point[] p = new Point[n];
		for (int i = 0; i < p.length; i++) {
			p[i] = new Point(in.nextLong(), in.nextLong());
		}
		double ans = 0;
		Point end = new Point(p[n - 1].x, p[n - 1].y + h);
		Vector v = new Vector(p[n - 1], end);
		for (int i = n - 2; i >= 0; i--) {
			Vector v1 = new Vector(p[i], end);
			if (cp(v1, v) >= 0) {
				Vector v2 = new Vector(p[i], p[i + 1]);
				if (cp(new Vector(p[i + 1], end), v) >= 0) {
					ans += v2.len();
					v = v1;
					continue;
				}
				ans += cp(v1, v) * v2.len() / cp(v2, v);
				v = v1;
			}

		}
		out.print(ans);
	}

