import java.util.*;
import java.io.*;
public class d {
	static final FS sc = new FS();
	static final PrintWriter pw = new PrintWriter(System.out);

	static final int mod = 1_000_000_007;

	static int n, k;
	static int[] arr;
	static long[][] dp;
	static long[] numPaths;
	public static void main(String[] args) {
		n = sc.nextInt();
		k = sc.nextInt();
		int q = sc.nextInt();

		arr = new int[n];
		for(int i = 0; i < n; ++i) arr[i] = sc.nextInt();

		dp = new long[n][k + 1];
		for(long[] a : dp) Arrays.fill(a, -1);

		long total = 0;
		numPaths = new long[n];
		for(int i = 0; i < n; ++i) {
			for(int j = 0; j <= k; ++j) numPaths[i] = (numPaths[i] + go(i, j) * go(i, k - j)) % mod;

			total = (total + numPaths[i] * arr[i]) % mod;
		}

		for(int qq = 0; qq < q; ++qq) {
			int i = sc.nextInt() - 1, x = sc.nextInt();

			long sub = (numPaths[i] * arr[i]) % mod;
			total = (total - sub + mod) % mod;

			arr[i] = x;

			total = (total + numPaths[i] * arr[i]) % mod;

			pw.println(total);
		}

		pw.flush();
	}
	static long go(int idx, int num) {
		if(dp[idx][num] != -1) return dp[idx][num];

		if(num == k) return dp[idx][num] = 1;

		return dp[idx][num] = ((idx > 0 ? go(idx - 1, num + 1) : 0) + (idx < n - 1 ? go(idx + 1, num + 1) : 0)) % mod;
	}
	static class FS {
		BufferedReader br = new BufferedReader(new InputStreamReader(System.in));
		StringTokenizer st = new StringTokenizer("");
		String next() {
			while(!st.hasMoreElements()) {
				try {
					st = new StringTokenizer(br.readLine());
				} catch(Exception e) {}
			}
			return st.nextToken();
		}
		int nextInt() {
			return Integer.parseInt(next());
		}
		long nextLong() {
			return Long.parseLong(next());
		}
	}
