	void solve()
	{
		int n = ni(), m = ni();
		int[] from = new int[m];
		int[] to = new int[m];
		for(int i = 0;i < m;i++){
		    from[i] = ni()-1;
		    to[i] = ni()-1;
		}
		int[][] g = packD(n ,from, to);
		int[][] ig = packD(n, to, from);

		int I = Integer.MAX_VALUE / 3;
		int[] minflip = new int[2*n];
		Arrays.fill(minflip, I);
		Deque<Integer> q = new ArrayDeque<>();
		q.add(0);
		minflip[0] = 0;
		while(!q.isEmpty()){
			int cur = q.poll();
			if(cur < n) {
				for (int e : g[cur]) {
					if (minflip[e] > minflip[cur]) {
						minflip[e] = minflip[cur];
						q.addFirst(e);
					}
				}
				for (int e : ig[cur]) {
					if (minflip[e+n] > minflip[cur] + 1) {
						minflip[e+n] = minflip[cur] + 1;
						q.addLast(e+n);
					}
				}
			}else{
				cur -= n;
				for (int e : g[cur]) {
					if (minflip[e] > minflip[cur+n] + 1) {
						minflip[e] = minflip[cur+n] + 1;
						q.addLast(e);
					}
				}
				for (int e : ig[cur]) {
					if (minflip[e+n] > minflip[cur+n]) {
						minflip[e+n] = minflip[cur+n];
						q.addFirst(e+n);
					}
				}
			}
		}

		int[][] ds = new int[20][2*n];
		for(int i = 0;i < 20;i++){
			Arrays.fill(ds[i], I);
		}
		ds[0][0] = 0;
		q.add(0<<20|0);
		while(!q.isEmpty()){
			int code = q.poll();
			int fl = (code>>>20) , cur = code&(1<<20)-1;

			if(cur < n) {
				for (int e : g[cur]) {
					int nfl = fl + minflip[cur] - minflip[e];
					if(nfl < 20 && ds[nfl][e] > ds[fl][cur] + 1){
						ds[nfl][e] = ds[fl][cur] + 1;
						q.addLast(nfl<<20|e);
					}
				}
				for (int e : ig[cur]) {
					int nfl = fl + minflip[cur] - minflip[e+n] + 1;
					if(nfl < 20 && ds[nfl][e+n] > ds[fl][cur] + 1){
						ds[nfl][e+n] = ds[fl][cur] + 1;
						q.addLast(nfl<<20|e+n);
					}
				}
			}else{
				cur -= n;
				for (int e : g[cur]) {
					int nfl = fl + minflip[cur+n] - minflip[e] + 1;
					if(nfl < 20 && ds[nfl][e] > ds[fl][cur+n] + 1){
						ds[nfl][e] = ds[fl][cur+n] + 1;
						q.addLast(nfl<<20|e);
					}
				}
				for (int e : ig[cur]) {
					int nfl = fl + minflip[cur+n] - minflip[e+n];
					if(nfl < 20 && ds[nfl][e+n] > ds[fl][cur+n] + 1){
						ds[nfl][e+n] = ds[fl][cur+n] + 1;
						q.addLast(nfl<<20|e+n);
					}
				}
			}
		}

		final int mod = 998244353;
		if(minflip[n-1] < minflip[n-1+n] && minflip[n-1] >= 20){
			out.println((pow(2, minflip[n-1], mod) - 1 + ds[0][n-1]) % mod);
			return;
		}
		if(minflip[n-1+n] < minflip[n-1] && minflip[n-1+n] >= 20){
			out.println((pow(2, minflip[n-1+n], mod) - 1 + ds[0][n-1+n]) % mod);
			return;
		}
		if (minflip[n - 1] == minflip[n - 1 + n] && minflip[n - 1] >= 209) {
			out.println((pow(2, minflip[n-1+n], mod) - 1 + Math.min(ds[0][n-1], ds[0][n-1+n])) % mod);
			return;
		}

		long ans = Long.MAX_VALUE;
		for(int i = 0;i < 20;i++){
			if(ds[i][n-1] < I && minflip[n-1] <= 40)ans = Math.min(ans, (1L<<minflip[n-1]+i) - 1 + ds[i][n-1]);
			if(ds[i][n-1+n] < I && minflip[n-1+n] <= 40)ans = Math.min(ans, (1L<<minflip[n-1+n]+i) - 1 + ds[i][n-1+n]);
		}
		out.println(ans % mod);
	}

	public static long pow(long a, long n, long mod) {
		//		a %= mod;
		long ret = 1;
		int x = 63 - Long.numberOfLeadingZeros(n);
		for (; x >= 0; x--) {
			ret = ret * ret % mod;
			if (n << 63 - x < 0) ret = ret * a % mod;
		}
		return ret;
	}


	public static int[][] packD(int n, int[] from, int[] to) {
		return packD(n, from, to, from.length);
	}

	public static int[][] packD(int n, int[] from, int[] to, int sup) {
		int[][] g = new int[n][];
		int[] p = new int[n];
		for (int i = 0; i < sup; i++) p[from[i]]++;
		for (int i = 0; i < n; i++) g[i] = new int[p[i]];
		for (int i = 0; i < sup; i++) {
			g[from[i]][--p[from[i]]] = to[i];
		}
		return g;
	}


