				a += aa[i] = sc.nextInt();
			if (a % n != 0) {
				println(-1);
				continue;
			}
			a /= n;
			k = 0;
			for (int i = 2; i <= n; i++) {
				int r = aa[i] % i;
				if (r > 0)
					move(1, i, i - r);
				move(i, 1, aa[i] / i);
			}
			for (int i = 2; i <= n; i++)
				move(1, i, a);
			println(k);
