import java.io.*;
import java.util.*;
import java.math.*;

public class G {
    static final boolean RUN_TIMING = false;
    static char[] inputBuffer = new char[1 << 20];
    static PushbackReader in = new PushbackReader(new BufferedReader(new InputStreamReader(System.in)), 1 << 20);
    static PrintWriter out = new PrintWriter(new BufferedWriter(new OutputStreamWriter(System.out)));

    public void go() throws IOException {
        // in = new PushbackReader(new BufferedReader(new FileReader(new File("test.txt"))), 1 << 20);
        // out = new PrintWriter(new FileWriter(new File("output.txt")));
        int n = ipar()+1;
        int x = ipar();
        int y = ipar();
        int[] segments = iapar(n);
        HashSet<Integer> lengths = getLengths(segments, x);
        int[] maxDivisor = new int[1000001];
        Arrays.fill(maxDivisor, -1);
        for (int l : lengths) {
            for (int i = (l+y)*2; i < maxDivisor.length; i += (l+y)*2) {
                maxDivisor[i] = Math.max(maxDivisor[i], (l+y)*2);
            }
        }
        int q = ipar();
        while (q-- > 0) {
            int l = ipar();
            out.print(maxDivisor[l]);
            out.print(" ");
        }
        out.println();
    }

    public HashSet<Integer> getLengths(int[] segments, int x) {
        int n = segments.length;
        int nn = 1;
        while (nn <= x*2) {
            nn *= 2;
        }
        Complex[] a = new Complex[nn];
        Complex[] b = new Complex[nn];
        for (int i = 0; i < nn; i++) {
            a[i] = new Complex();
            b[i] = new Complex();
        }
        for (int i = 0; i < n; i++) {
            a[segments[i]].set(1, 0);
            b[x-segments[i]].set(1, 0);
        }
        fft(a, false);
        fft(b, false);
        for (int i = 0; i < nn; i++) {
            a[i].multiply(b[i]);
        }
        fft(a, true);
        HashSet<Integer> lengths = new HashSet<>();
        for (int i = x+1; i < nn; i++) {
            if (a[i].a > 0.5) {
                lengths.add(i-x);
            }
        }
        return lengths;
    }

    public void fft(Complex[] f, boolean inverse) {
        int n = f.length;
        int logn = 0;
        while ((1 << logn) < n) {
            logn++;
        }
        for (int i = 0; i < n; i++) {
            int rev = reverse(i, logn);
            if (i < rev) {
                Complex temp = f[i];
                f[i] = f[rev];
                f[rev] = temp;
            }
        }
        Complex w = new Complex();
        Complex rot = new Complex();
        Complex temp  = new Complex();
        for (int len = 2; len <= n; len *= 2) {
            double angle = Math.PI * 2 / len * (inverse ? -1 : 1);
            rot.set(Math.cos(angle), Math.sin(angle));
            for (int offset = 0; offset < n; offset += len) {
                w.set(1, 0);
                for (int i = 0; i < len/2; i++) {
                    Complex a = f[offset+i];
                    Complex b = f[offset+i+len/2];
                    temp.set(w);
                    temp.multiply(b);
                    b.set(a);
                    b.subtract(temp);
                    a.add(temp);
                    w.multiply(rot);
                }
            }
        }
        if (inverse) {
            for (int i = 0; i < n; i++) {
                f[i].a /= n;
                f[i].b /= n;
            }
        }
    }

    public int reverse(int x, int logn) {
        int rev = 0;
        while (logn > 0) {
            rev *= 2;
            rev += x%2;
            x /= 2;
            logn--;
        }
        return rev;
    }

    private class Complex {
        double a, b;

        public Complex() {}

        public Complex(double a, double b) {
            this.a = a;
            this.b = b;
        }

        public void set(double a, double b) {
            this.a = a;
            this.b = b;
        }

        public void set(Complex other) {
            a = other.a;
            b = other.b;
        }

        public void add(Complex other) {
            a += other.a;
            b += other.b;
        }

        public void subtract(Complex other) {
            a -= other.a;
            b -= other.b;
        }

        public void multiply(Complex other) {
            double aa = a * other.a - b * other.b;
            double bb = a * other.b + b * other.a;
            a = aa;
            b = bb;
        }

        public String toString() {
            return String.format("(%.3f,%.3f)", a, b);
        }
    }

    public int ipar() throws IOException {
        return Integer.parseInt(spar());
    }

    public int[] iapar(int n) throws IOException {
        int[] arr = new int[n];
        for (int i = 0; i < n; i++) {
            arr[i] = ipar();
        }
        return arr;
    }

    public long lpar() throws IOException {
        return Long.parseLong(spar());
    }

    public long[] lapar(int n) throws IOException {
        long[] arr = new long[n];
        for (int i = 0; i < n; i++) {
            arr[i] = lpar();
        }
        return arr;
    }

    public double dpar() throws IOException {
        return Double.parseDouble(spar());
    }

    public String spar() throws IOException {
        int len = 0;
        int c;
        do {
            c = in.read();
        } while (Character.isWhitespace(c) && c != -1);
        if (c == -1) {
            throw new NoSuchElementException("Reached EOF");
        }
        do {
            inputBuffer[len] = (char)c;
            len++;
            c = in.read();
        } while (!Character.isWhitespace(c) && c != -1);
        while (c != '
' && Character.isWhitespace(c) && c != -1) {
            c = in.read();
        }
        if (c != -1 && c != '
') {
            in.unread(c);
        }
        return new String(inputBuffer, 0, len);
    }

    public String linepar() throws IOException {
        int len = 0;
        int c;
        while ((c = in.read()) != '
' && c != -1) {
            if (c == '') {
                continue;
            }
            inputBuffer[len] = (char)c;
            len++;
        }
        return new String(inputBuffer, 0, len);
    }

    public boolean haspar() throws IOException {
        String line = linepar();
        if (line.isEmpty()) {
            return false;
        }
        in.unread('
');
        in.unread(line.toCharArray());
        return true;
    }

    public static void main(String[] args) throws IOException {
        long time = 0;
        time -= System.nanoTime();
        new G().go();
        time += System.nanoTime();
        if (RUN_TIMING) {
            System.out.printf("%.3f ms%n", time / 1000000.0);
        }
        out.flush();
        in.close();
    }
}
