import java.io.*;
import java.util.*;
import static java.lang.Math.*;

public class G_RunningCompetitionNTT {
    static FastScanner sc = new FastScanner();
    static PrintWriter out = new PrintWriter(System.out);

    public static void main(String[] args) {
        int N = sc.nextInt();
        sc.nextInt();
        int h = sc.nextInt();
        int MAX = (int) 2e5;
        long[] positive = new long[MAX + 1];
        long[] negative = new long[MAX + 1];
        for (int i = 0; i <= N; i++) {
            int x = sc.nextInt();
            positive[x] = 1;
            negative[MAX - x] = 1;
        }
        long[] ways = multiplyPolynomials(positive, negative);
        int Q = sc.nextInt();
        int[] queries = new int[Q];
        int[] answers = new int[500000 + 1];
        for (int i = 0; i < Q; i++) {
            queries[i] = sc.nextInt();
        }
        Arrays.fill(answers, -1);
        for (int d = h + 1; d <= MAX + h; d++) {
            for (int m = d; m <= 500000; m += d) {
                if (ways[MAX + d - h] > 0) {
                    answers[m] = max(answers[m], d);
                }
            }
        }
        StringBuilder ans = new StringBuilder();
        for (int i = 0; i < Q; i++) {
            int res = answers[queries[i] / 2];
            ans.append(res == -1 ? -1 : 2 * res).append(" ");
        }
        out.println(ans);
        out.close();
    }

    static long[] multiplyPolynomials(long[] a, long[] b) {
        int N = 1;
        // this forces it to a power of 2 greater than/equal the total length
        while (N < a.length + b.length) {
            N <<= 1;
        }
        long[] A = new long[N];
        long[] B = new long[N];
        System.arraycopy(a, 0, A, 0, a.length);
        System.arraycopy(b, 0, B, 0, b.length);
        FastFourierTransform(A, false);
        FastFourierTransform(B, false);
        long[] C = new long[N];
        for (int i = 0; i < N; i++) {
            C[i] = A[i] * B[i] % mod;
        }
        FastFourierTransform(C, true);
        return C;
    }

    static void FastFourierTransform(long[] A, boolean inverse) {
        int N = A.length;
        // Rearrange via bit-reversal sorting
        int lg = 0; // highest one bit (since we only use bits under N, a power of two)
        while ((1 << (lg + 1)) <= N) {
            lg++;
        }
        for (int i = 0; i < N; i++) {
            int j = reverse(i, lg);
            if (i < j) {
                long temp = A[i];
                A[i] = A[j];
                A[j] = temp;
            }
        }
        // shift it down to nth roots of unity (remove the extra rotation we don't need)
        int shift = twoPow / N * (inverse ? -1 : 1);
        long principal = fastExpo(ROOT, shift);
        for (int half = 1; half <= N >> 1; half <<= 1) {
            // solve layer of size 2 * pow by building on the children of size pow
            int full = half << 1;
            long fullPrincipal = fastExpo(principal, N / full);
//        assert(fastExpo(fullPrincipal, half) == mod - 1);
            for (int block = 0; block < N / full; block++) {
                int i = block * full;
                long currRoot = 1; // KEY BUG: start from w^0 = 1
                for (int j = 0; j < half; j++) {
                    long even = A[i + j];
                    long odd = currRoot * A[i + j + half] % mod;
                    A[i + j] = (even + odd) % mod;
                    A[i + j + half] = (even - odd + mod) % mod;
                    currRoot = currRoot * fullPrincipal % mod;
                }
            }
        }
        if (inverse) {
            long norm = fastExpo(N, -1);
            for (int i = 0; i < N; i++) {
                A[i] = A[i] * norm % mod;
            }
        }
    }

    static int reverse(int i, int lg) {
        int j = 0;
        for (int b = 0; b < lg; b++) {
            if (((1 << b) & i) > 0) {
                j += 1 << (lg - 1 - b);
            }
        }
        return j;
    }

    // 2^23*7*17+1
    static final long mod = 998244353; // 7340033

    //highest power of 2 that is a factor of MOD-1
    static final int twoPow = 1 << 23; // 20

    // any number such that ROOT^(2^twoPow)=1 & ROOT^(2^(twoPow-1))!=1
    // 2^(7*17*2^23) === 1, but actually isn't a primitive root (the second
    // condition above fails. Turns out 3 works though!
    // So, below is 3^(7*17) mod 998244353.
    static final int ROOT = 15311432; // 5
    static final int PRIMITIVE_ROOT = 3;

    static long fastExpo(long x, long k) {
        long ans = 1;
        for (k = (k + mod - 1) % (mod - 1); k > 0; k >>= 1, x = x * x % mod) {
            if ((k & 1) > 0) {
                ans = ans * x % mod;
            }
        }
        return ans;
    }

    static class FastScanner {
        private int BS = 1 << 16;
        private char NC = (char) 0;
        private byte[] buf = new byte[BS];
        private int bId = 0, size = 0;
        private char c = NC;
        private double cnt = 1;
        private BufferedInputStream in;

        public FastScanner() {
            in = new BufferedInputStream(System.in, BS);
        }

        public FastScanner(String s) {
            try {
                in = new BufferedInputStream(new FileInputStream(new File(s)), BS);
            } catch (Exception e) {
                in = new BufferedInputStream(System.in, BS);
            }
        }

        char getChar() {
            while (bId == size) {
                try {
                    size = in.read(buf);
                } catch (Exception e) {
                    return NC;
                }
                if (size == -1) return NC;
                bId = 0;
            }
            return (char) buf[bId++];
        }

        int nextInt() {
            return (int) nextLong();
        }

        long nextLong() {
            cnt = 1;
            boolean neg = false;
            if (c == NC) c = getChar();
            for (; (c < '0' || c > '9'); c = getChar()) {
                if (c == '-') neg = true;
            }
            long res = 0;
            for (; c >= '0' && c <= '9'; c = getChar()) {
                res = (res << 3) + (res << 1) + c - '0';
                cnt *= 10;
            }
            return neg ? -res : res;
        }

        double nextDouble() {
            boolean neg = false;
            if (c == NC) c = getChar();
            for (; (c < '0' || c > '9'); c = getChar()) {
                if (c == '-') neg = true;
            }
            double cur = nextLong();
            if (c != '.') {
                return neg ? -cur : cur;
            } else {
                double frac = nextLong() / cnt;
                return neg ? -cur - frac : cur + frac;
            }
        }

        String next() {
            StringBuilder res = new StringBuilder();
            while (c <= 32) c = getChar();
            while (c > 32) {
                res.append(c);
                c = getChar();
            }
            return res.toString();
        }

        String nextLine() {
            StringBuilder res = new StringBuilder();
            while (c <= 32) c = getChar();
            while (c != '
') {
                res.append(c);
                c = getChar();
            }
            return res.toString();
        }

        boolean hasNext() {
            if (c > 32) return true;
            while (true) {
                c = getChar();
                if (c == NC) return false;
                else if (c > 32) return true;
            }
        }
    }

    static void ASSERT(boolean assertion, String message) {
        if (!assertion) throw new AssertionError(message);
    }

    static void ASSERT(boolean assertion) {
        if (!assertion) throw new AssertionError();
    }
},"bitmasks,fft,math,number theory"

