            for (int i = 1; i < safe.size() && !drown; ++i)
            {
                int tide = k; boolean down = true;
                for (int j = safe.get(i-1) + 1; j < safe.get(i); j++)
                {
                    tide += down ? -1 : +1;
                    if (down) tide -= Math.max(0, a[j] + tide - l);
                    if (tide < 0 || a[j] + tide > l) { drown = true; break; }
                    if (tide == 0) down = false;
