    void updateIndexA(int node, int start, int end, int index, int value) {
        if (start > end || start > index || end < index) // Current segment is not within range [l, r]
            return;
        if (start >= index && end <= index) { // Segment is fully within range
            a[node] = value;
            return;
        }
        int mid = (start + end) / 2;
        updateIndexA(node * 2, start, mid, index, value); // Updating left child
        updateIndexA(node * 2 + 1, mid + 1, end, index, value); // Updating right child
        a[node] = Math.min(a[node * 2], a[node * 2 + 1]);
        flag[node] = a[node * 2] > b[node * 2 + 1] && flag[node * 2] && flag[node * 2 + 1];
    }

    void updateIndexB(int node, int start, int end, int index, int value) {
        if (start > end || start > index || end < index) // Current segment is not within range [l, r]
            return;
        if (start >= index && end <= index) { // Segment is fully within range
            b[node] = value;
            return;
        }
        int mid = (start + end) / 2;
        updateIndexB(node * 2, start, mid, index, value); // Updating left child
        updateIndexB(node * 2 + 1, mid + 1, end, index, value); // Updating right child
        b[node] = Math.max(b[node * 2], b[node * 2 + 1]);
        flag[node] = a[node * 2] > b[node * 2 + 1] && flag[node * 2] && flag[node * 2 + 1];
    }

