//            }
//            System.out.println();
//        }
       // System.out.println(doit_(65,2));
        int n = nextInt();
        int k = nextInt();
        powers = new HashSet<Integer>();
        int pow = 1;
        while(pow-1 <= bound) {
            powers.add(pow-1);
            pow = pow*2;
        }
        if(n == 1 && k == 0) {
            out.println("YES");
            out.println(0);
        }
        else if(n%2 == 1 && k <= (n-3)/2) {
            if(powers.contains(n) && k == 1) out.println("NO");
            else if(!powers.contains(n) && k == 0) out.println("NO");
            else if(n == 9 && k == 2) out.println("NO");
            else {

                Node res = doit(n,k);

                d = new int[n];
                p = new int[n];
                idx = 0;
                visit(res, -1);
                System.out.println("YES");          
                for(int x : p) out.print((x+1) + " ");
            }
        } else out.println("NO");
    }
    int[] d;
    int[] p;
    int idx;

    void visit(Node u, int par){
        int cur = idx++;
        p[cur] = par;
        if(u.left == null) return;
        visit(u.left, cur);
        visit(u.right, cur);
    }

    HashSet<Integer> powers;

    boolean possible = true;

    Node doit(int n, int k) {
        if(n <= N && k <= N) {
            possible = possible && doit_(n,k);
            return nodes[n][k];
        } else if(k <= 1) {
            int pow = 1;
            int l = 0;
            int r = n-1;
            while(l <= n-1) {
                l = pow-1;
                r = n-1-l;
                if(l >= 0 && r >= 0 && ((l <= r && r < 2*l) || (r <= l && l < 2*r)) ) {
                    break;
                } else if(r >= 2*l && powers.contains(l) && powers.contains(r)) {
                    Node node = new Node();
                    node.left = doit(l,0);
                    node.right = doit(r,0);
                    return node;
                }
                pow = 2*pow;
            }

            Node node = new Node();
            node.left = doit(l,0);
            node.right = doit(r,k);
            return node;


        } else if(k == 2 && powers.contains(n-2)) {

            Node node = new Node();
            node.left = doit(3,0);
            node.right = doit(n-4, k-1);
            return node;
        } else {
            Node node = new Node();
            node.left = doit(1,0);
            node.right = doit(n-2, k-1);
            return node;
        }
    }

    Boolean[][] memo;

    Node[][] nodes;

    boolean doit_(int n, int k) {
        if(memo[n][k] == null) {
            if(n == 1 && k == 0) {
                nodes[n][k] = new Node();
                memo[n][k] = true;
            } else {
                boolean res = false;
                for(int l = 1; l <= (n-1)/2 && !res; l++) {
                    int r = n-1-l;
                    int kk = k;
                    if(r >= 2*l) kk--;
                    for(int j = 0; j <= kk && !res; j++) {
                        boolean cur = (doit_(l,j) && doit_(r,kk-j));
                        res = res || cur;
                        if(res) {
                            nodes[n][k] = new Node();
                            nodes[n][k].left = nodes[l][j];
                            nodes[n][k].right = nodes[r][kk-j];
                        }
                    }
                }
                memo[n][k] = res;
            }
        }
        return memo[n][k];
    }




    public static void main(String[] args) {
        new Thread(null, new Runnable() {
            public void run() {
                new Solution().run();
            }
        }, "1", 1 << 27).start();
    }

