    public static void main(String args[]) throws IOException {
        FastScanner in = new FastScanner(System.in);
        BufferedWriter out = new BufferedWriter(new OutputStreamWriter(System.out));
        solve(in, out);
        out.flush();
    }


    private static void solve(FastScanner in, BufferedWriter out) throws IOException {
        int n = in.nextInt();
        int mod = 998244353;
        Set<Integer>[] e = new Set[n];
        boolean[] visited = new boolean[n];
        int[] parent = new int[n];
        for (int i = 0; i < n; i++) {
            e[i] = new HashSet<>();
        }
        for (int i = 0; i < n - 1; i++) {
            int a = in.nextInt() - 1;
            int b = in.nextInt() - 1;
            e[a].add(b);
            e[b].add(a);
        }
        long[][] dp = new long[n][3];
        Stack<Integer> s = new Stack<>();
        s.push(0);
        while (!s.isEmpty()) {
            int cur = s.peek();
            if (!visited[cur]) {
                for (Integer adj : e[cur]) {
                    if (!visited[adj]){
                        s.push(adj);
                        parent[adj] = cur;
                    }
                }
                visited[cur] = true;
            } else {
                s.pop();
                dp[cur][0] = 1;
                dp[cur][1] = 1;
                dp[cur][2] = 1;
                for (Integer adj : e[cur]) {
                    if (parent[cur] == adj) continue;
                    dp[cur][0] = (dp[cur][0] * ((2 * dp[adj][0] + 2 * dp[adj][1] - dp[adj][2]) % mod)) % mod;
                    dp[cur][1] = (dp[cur][1] * ((2 * dp[adj][0] + dp[adj][1] - dp[adj][2]) % mod)) % mod;
                    dp[cur][2] = (dp[cur][2] * ((dp[adj][0] + dp[adj][1] - dp[adj][2]) % mod)) % mod;
                }
            }
        }
        System.out.println((dp[0][0] + dp[0][1] - dp[0][2] - 1 + 2 * mod) % mod);
    }


