import java.io.IOException;
import java.io.InputStreamReader;
import java.io.PrintWriter;
import java.io.Reader;
import java.util.ArrayList;
import java.util.Comparator;
import java.util.HashMap;
import java.util.LinkedList;
import java.util.List;
import java.util.StringTokenizer;

public class C1332F {

    static final boolean DEBUG = false;

    public static void main(String[] args) {
        var scanner = new BufferedScanner();
        var writer = new PrintWriter(new BufferedOutputStream(System.out));

        var n = scanner.nextInt();
        var edges = new Edges[n + 1];
        for (int i = 1; i <= n; i++) {
            edges[i] = new Edges();
        }
        for (int i = 0; i < n - 1; i++) {
            var u = scanner.nextInt();
            var v = scanner.nextInt();
            edges[u].to.add(v);
            edges[v].to.add(u);
        }
        if (DEBUG) {
            for (int root = 1; root <= n; root++) {
                debug("----------root: %d-----------", root);
                debug("w(H): %d", solve(root, n, edges));
            }
        } else {
            writer.println(solve(1, n, edges));
        }

        scanner.close();
        writer.flush();
        writer.close();
    }

    static final long MODULO = 998244353;
    static final long MAX_N = (long) 3e5;

    private static long solve(int root, int n, Edges[] edges) {
        var depth = new int[n + 1];
        var parent = new int[n + 1];
        var children = new Edges[n + 1];
        for (int i = 1; i <= n; i++) {
            children[i] = new Edges();
        }
        bfs(edges, root, depth, parent, children);
        var leafToRoot = new ArrayList<Integer>();
        for (int i = 1; i <= n; i++) {
            leafToRoot.add(i);
        }
        leafToRoot.sort(Comparator.comparingInt(o -> depth[(int) o]).reversed());

        var f0 = new long[n + 1]; // f0[u]:uIS
        var f1 = new long[n + 1]; // f1[u]:uIS
        var f2 = new long[n + 1]; // f2[u]:uu

        for (var u : leafToRoot) {
            if (children[u].to.isEmpty()) {
                f0[u] = 1;
                f1[u] = 1;
                f2[u] = 1;
            } else {
                f0[u] = 1;
                f1[u] = 1;
                f2[u] = 1;
                for (var c : children[u].to) {
                    f0[u] = f0[u] * (2 * f0[c] + 2 * f1[c] + MODULO - f2[c]) % MODULO;
                    f1[u] = f1[u] * (2 * f0[c] + f1[c] + MODULO - f2[c]) % MODULO;
                    f2[u] = f2[u] * (f0[c] + f1[c] + MODULO - f2[c]) % MODULO;
                }
            }
        }
//        printW(n, w, depth);
//        countH(n, root, leafToRoot, parent, children);
        return (f0[root] + f1[root] + 2 * MODULO - f2[root] - 1) % MODULO;
    }

    static void debug(String fmt, Object... args) {
        if (DEBUG) {
            System.out.println(String.format(fmt, args));
        }
    }

    private static void countH(int n, int root, List<Integer> leafToRoot, int[] parent, Edges[] children) {
        // h[i][j]w[i][j]edge-induced subgraph
        var h = new HashMap<Long, Long>() {
            long get(int u, int v) {
                return get(hash(u, v));
            }

            void put(int u, int v, long value) {
                put(hash(u, v), value);
            }

            private long hash(int u, int v) {
                return u * (MAX_N + 1) + v;
            }
        };
        var h2 = new long[n + 1];

        for (var v : leafToRoot) {
            var p = parent[v];
            if (children[v].to.isEmpty()) { // vHIS(H)w(H)==0
                h.put(p, v, 0L);
                h2[v] = 1L;
            } else {
                var acc = 1L;
                var acc2 = 1L;
                for (var c : children[v].to) {
                    acc = mul(acc, h.get(v, c) // v-c(v,c)H
                            + h.get(v, c) // v-c(v,c)H
                            + 1 // v-cH{v-c}
                            + 1 // 
                    );
                    acc2 *= 2 * h2[c];
                }
                h.put(p, v, minus(acc, 1));
                h2[v] = acc2;
            }
        }

        debug("h: %d, h2: %d", h.get(root, root), h2[root] - 1);
    }

    private static void printW(int n, long[][] w, int[] depth) {
        var printList = new ArrayList<long[]>();
        for (int vStatus = 0; vStatus < 3; vStatus++) {
            for (int v = 1; v <= n; v++) {
                printList.add(new long[]{v, vStatus, w[vStatus][v]});
            }
        }
        printList.sort(Comparator.comparingInt(o -> depth[(int) o[0]]));
        for (long[] longs : printList) {
            debug("w[%d,%d]=%d", longs[0], longs[1], longs[2]);
        }
    }

    private static long add(long... a) {
        var ans = 0L;
        for (long x : a) {
            ans = (ans + x) % MODULO;
        }
        return ans;
    }

    private static long minus(long a, long b) {
        return (a + MODULO - b) % MODULO;
    }

    private static long mul(long... a) {
        var ans = 1L;
        for (long x : a) {
            ans = ans * x % MODULO;
        }
        return ans;
    }

    private static void bfs(Edges[] edges, int root, int[] depth, int[] parent, Edges[] children) {
        var q = new LinkedList<Integer>();
        q.add(root);
        depth[root] = 0;
        parent[root] = root;
        while (q.size() > 0) {
            var h = q.poll();
            for (var v : edges[h].to) {
                if (parent[v] == 0) {
                    children[h].to.add(v);
                    depth[v] = depth[h] + 1;
                    parent[v] = h;
                    q.add(v);
                }
            }
        }
    }

    static class Edges {
        List<Integer> to = new ArrayList<>();
    }

    public static class BufferedScanner {
        BufferedReader br;
        StringTokenizer st;

        public BufferedScanner(Reader reader) {
            br = new BufferedReader(reader);
        }

        public BufferedScanner() {
            this(new InputStreamReader(System.in));
        }

        String next() {
            while (st == null || !st.hasMoreElements()) {
                try {
                    st = new StringTokenizer(br.readLine());
                } catch (IOException e) {
                    e.printStackTrace();
                }
            }
            return st.nextToken();
        }

        int nextInt() {
            return Integer.parseInt(next());
        }

        long nextLong() {
            return Long.parseLong(next());
        }

        double nextDouble() {
            return Double.parseDouble(next());
        }

        String nextLine() {
            String str = "";
            try {
                str = br.readLine();
            } catch (IOException e) {
                e.printStackTrace();
            }
            return str;
        }

        void close() {
            try {
                br.close();
            } catch (IOException e) {
                e.printStackTrace();
            }
        }

    }

    static long gcd(long a, long b) {
        if (a < b) {
            return gcd(b, a);
        }
        while (b > 0) {
            long tmp = b;
            b = a % b;
            a = tmp;
        }
        return a;
    }

    static long inverse(long a, long m) {
        long[] ans = extgcd(a, m);
        return ans[0] == 1 ? (ans[1] + m) % m : -1;
    }

    private static long[] extgcd(long a, long m) {
        if (m == 0) {
            return new long[]{a, 1, 0};
        } else {
            long[] ans = extgcd(m, a % m);
            long tmp = ans[1];
            ans[1] = ans[2];
            ans[2] = tmp;
            ans[2] -= ans[1] * (a / m);
            return ans;
        }
    }

    private static List<Integer> primes(double upperBound) {
        var limit = (int) Math.sqrt(upperBound);
        var isComposite = new boolean[limit + 1];
        var primes = new ArrayList<Integer>();
        for (int i = 2; i <= limit; i++) {
            if (isComposite[i]) {
                continue;
            }
            primes.add(i);
            int j = i + i;
            while (j <= limit) {
                isComposite[j] = true;
                j += i;
            }
        }
        return primes;
    }


