			for (Node nn:nodes) 
				if (nn.lift[e-1]!=null) 
					nn.lift[e]=nn.lift[e-1].lift[e-1];

		int nQueries=fs.nextInt();
		for (int qq=0; qq<nQueries; qq++) {
			clearVT();

			int nViruses=fs.nextInt();
			int nImportant=fs.nextInt();
			TreeSet<Node> relevant=new TreeSet<>();
			for (int i=0; i<nViruses; i++) {
				int getVir=fs.nextInt()-1, travelSpeed=fs.nextInt();
				nodes[getVir].gotVirusFrom=nodes[getVir];
				nodes[getVir].travelSpeed=travelSpeed;
				nodes[getVir].virusNumber=i;
				relevant.add(nodes[getVir]);
			}
			Node[] importantNodes=new Node[nImportant];
			for (int i=0; i<nImportant; i++) importantNodes[i]=nodes[fs.nextInt()-1];
			for (Node nn:importantNodes) relevant.add(nn);

			buildVirtualTree(relevant);

			Node root=inVirtualTree.first();
			root.virtualDFS1();
			root.virtualDFS2();
			for (Node query:importantNodes) {
				System.out.print(query.gotVirusFrom.virusNumber+1+" ");
			}
			System.out.println();
		}

	}

	static ArrayDeque<Node> bfs=new ArrayDeque<>();
	static TreeSet<Node> inVirtualTree=new TreeSet<>();

	static void buildVirtualTree(TreeSet<Node> specialNodes) {

		for (Node nn:specialNodes)
			addToVT(nn);

		while (!bfs.isEmpty()) {
			Node next=bfs.remove();
			Node previous=inVirtualTree.lower(next);
			Node after=inVirtualTree.higher(next.rightmostKid);
			Node lcaPar=null;
			if (previous!=null) {
				Node lca=previous.lca(next, 19);
				addToVT(lca);
				if (lcaPar==null || lcaPar.depth<lca.depth) lcaPar=lca;
			}
			if (after!=null) {
				Node lca=next.lca(after, 19);
				addToVT(lca);
				if (lcaPar==null || lcaPar.depth<lca.depth) lcaPar=lca;
			}
			if (lcaPar!=null && lcaPar!=next) {
				next.parInVT=lcaPar;
				lcaPar.virtualAdj.add(next);
			}
		}
	}

	static void clearVT() {
		bfs.clear();
		for (Node nn:inVirtualTree) {
			nn.parInVT=null;
			nn.virtualAdj.clear();
			nn.gotVirusFrom=null;
		}
		inVirtualTree.clear();
	}

	static void addToVT(Node n) {
		if (inVirtualTree.contains(n)) return;
		inVirtualTree.add(n);
		bfs.add(n);
	}

	static class Node implements Comparable<Node> {
		Node[] lift=new Node[20];
		ArrayList<Node> adj=new ArrayList<>();
		int preorder, postorder, depth, index;
		Node rightmostKid;

		Node parInVT;
		ArrayList<Node> virtualAdj=new ArrayList<>();
		Node gotVirusFrom;
		int travelSpeed, virusNumber;

		public Node(int index) {
			this.index=index;
			rightmostKid=this;
		}

		public int dfs0(Node par, int counter, int depth) {
			this.preorder=counter;
			this.depth=depth;
			lift[0]=par;
			if (par!=null)
				adj.remove(par);

			for (Node nn:adj) {
				counter=nn.dfs0(this, counter+1, depth+1);
				rightmostKid=nn.rightmostKid;
			}

			return this.postorder=counter;
		}

		public void virtualDFS1() {
			for (Node nn:virtualAdj) {
				nn.virtualDFS1();
				getSickFromIfScarier(nn.gotVirusFrom);
			}
		}

		public void virtualDFS2() {
			if (parInVT!=null) {
				getSickFromIfScarier(parInVT.gotVirusFrom);
			}
			for (Node nn:virtualAdj) {
				nn.virtualDFS2();
			}
		}

		public int compareTo(Node o) {
			return Integer.compare(preorder, o.preorder);
		}

		Node goUp(int toGoUp) {
			if (toGoUp==0) return this;
			int lowest=Integer.lowestOneBit(toGoUp);
			int exp=Integer.numberOfTrailingZeros(lowest);
			return lift[exp].goUp(toGoUp-lowest);
		}

		Node lca(Node o, int maxJump) {
			if (this==o) return this;
			if (depth!=o.depth) {
				if (depth>o.depth) return goUp(depth-o.depth).lca(o, 19);
				return lca(o.goUp(o.depth-depth), 19);
			}
			if (lift[0]==o.lift[0]) return lift[0];
			while (lift[maxJump]==o.lift[maxJump]) maxJump--;
			return lift[maxJump].lca(o.lift[maxJump], maxJump);
		}

		boolean contains(Node o) {
			return o.preorder>=preorder && o.preorder<=postorder;
		}

		static int dist(Node n1, Node n2) {
			Node lca=n1.lca(n2, 19);
			return n1.depth+n2.depth-2*lca.depth;
		}

		void getSickFromIfScarier(Node cand) {
			if (cand==null) return;
			if (gotVirusFrom==null) {
				gotVirusFrom=cand;
				return;
			}
			int curDist=dist(this, gotVirusFrom);
			int curTurns=(curDist+gotVirusFrom.travelSpeed-1)/gotVirusFrom.travelSpeed;
			int nextDist=dist(this, cand);
			int nextTurns=(nextDist+cand.travelSpeed-1)/cand.travelSpeed;
			//TODO: don't overwrite things you start with
			if (nextTurns < curTurns || (curTurns==nextTurns && gotVirusFrom.virusNumber>cand.virusNumber)) {
				gotVirusFrom=cand;
			}
		}

		public String toString() {
			return index+1+"";
		}
	}

