			int j = oj[o];
			if (j != p) {
				dfs1(i, j);
				int d = d1[j] + 1, c = c1[j];
				if (d1[i] < d) {
					d3[i] = d2[i]; d2[i] = d1[i]; d1[i] = d;
					c3[i] = c2[i]; c2[i] = c1[i]; c1[i] = c;
				} else if (d2[i] < d) {
					d3[i] = d2[i]; d2[i] = d;
					c3[i] = c2[i]; c2[i] = c;
				} else if (d3[i] < d) {
					d3[i] = d;
					c3[i] = c;
				}
			}
		}
	}
	int ans, a_, b_, c_;
	void dfs2(int p, int i, int d, int c) {
		int sum = d1[i] + d2[i] + Math.max(d3[i], d);
		if (ans < sum) {
			ans = sum;
			a_ = c1[i]; b_ = c2[i]; c_ = d3[i] >= d ? c3[i] : c;
		}
		int d23, d13, d12, c23, c13, c12;
		d23 = d13 = d12 = d;
		c23 = c13 = c12 = c;
		if (d23 < d2[i]) {
			d23 = d2[i];
			c23 = c2[i];
		}
		if (d23 < d3[i]) {
			d23 = d3[i];
			c23 = c3[i];
		}
		if (d13 < d1[i]) {
			d13 = d1[i];
			c13 = c1[i];
		}
		if (d13 < d3[i]) {
			d13 = d3[i];
			c13 = c3[i];
		}
		if (d12 < d1[i]) {
			d12 = d1[i];
			c12 = c1[i];
		}
		if (d12 < d2[i]) {
			d12 = d2[i];
			c12 = c2[i];
		}
		d23++; d13++; d12++;
		for (int o = ae[i]; o != 0; o = oo[o]) {
			int j = oj[o];
			if (j != p) {
				if (c1[j] == c1[i])
					dfs2(i, j, d23, c23);
				else if (c1[j] == c2[i])
					dfs2(i, j, d13, c13);
				else
					dfs2(i, j, d12, c12);
			}
		}
	}
	int distinct(int a, int b) {
		for (int c = 0; c < 3; c++)
			if (a != c && b != c)
				return c;
		return -1;
	}
	void main() {
		int n = sc.nextInt();
		init(n);
		for (int h = 0; h < n - 1; h++) {
			int i = sc.nextInt() - 1;
			int j = sc.nextInt() - 1;
			ae[i] = link(ae[i], j);
			ae[j] = link(ae[j], i);
		}
		dfs1(-1, 0);
		dfs2(-1, 0, 0, 0);
		if (a_ == b_)
			b_ = distinct(a_, c_);
		if (c_ == a_ || c_ == b_)
			c_ = distinct(a_, b_);
		println(ans);
		println((a_ + 1) + " " + (b_ + 1) + " " + (c_ + 1));
	}
}
