import java.io.*;
import java.util.*;

public class E {

	static ArrayList<Integer>[] adj;
	static boolean[] visited, inPath;
	static int[] par;

	static int[] dfs(int u, int p) {
		visited[u] = true;
		par[u] = p;

		int[] ans = new int[] { u, 0 };
		for (int v : adj[u]) {
			if (visited[v])
				continue;
			if (inPath[v])
				continue;
			int[] cand = dfs(v, u);
			if (cand[1] + 1 > ans[1]) {
				ans = cand;
				ans[1]++;
			}
		}
		return ans;
	}

	public static void main(String[] args) throws IOException {
		Scanner sc = new Scanner();
		PrintWriter out = new PrintWriter(System.out);
		int n = sc.nextInt();
		adj = new ArrayList[n];
		inPath = new boolean[n];

		visited = new boolean[n];
		par = new int[n];
		for (int i = 0; i < n; i++) {
			adj[i] = new ArrayList();
		}
		for (int i = 1; i < n; i++) {
			int u = sc.nextInt() - 1, v = sc.nextInt() - 1;
			adj[u].add(v);
			adj[v].add(u);
		}
		int[] farthest;
		farthest = dfs(0, 0);
		int root = farthest[0];
		Arrays.fill(visited, false);
		farthest = dfs(root, root);
		Arrays.fill(visited, false);
		int end = farthest[0];
		for (int curr = end;; curr = par[curr]) {
			inPath[curr] = true;
			if (curr == root)
				break;
		}
		int diameter = farthest[1];
		if (diameter == n - 1) {
			int third = -1;
			for (int i = 0; i < n; i++)
				if (i != root && i != end)
					third = i;
			System.out.printf("%d
%d %d %d
", diameter, root + 1, end + 1, third + 1);
			return;

		}
		Arrays.fill(farthest, 0);
		for (int i = 0; i < n; i++) {
			if (inPath[i]) {
				int[] cand = dfs(i, i);
				if (cand[1] > farthest[1])
					farthest = cand;
			}
		}
//		System.out.println(Arrays.toString(farthest));
		out.printf("%d
%d %d %d
", diameter + farthest[1], root + 1, end + 1, farthest[0] + 1);
		out.close();

	}

	static class Scanner {
		BufferedReader br;
		StringTokenizer st;

		Scanner() {
			br = new BufferedReader(new InputStreamReader(System.in));
		}

		Scanner(String fileName) throws FileNotFoundException {
			br = new BufferedReader(new FileReader(fileName));
		}

		String next() throws IOException {
			while (st == null || !st.hasMoreTokens())
				st = new StringTokenizer(br.readLine());
			return st.nextToken();
		}

		String nextLine() throws IOException {
			return br.readLine();
		}

		int nextInt() throws IOException {
			return Integer.parseInt(next());
		}

		long nextLong() throws NumberFormatException, IOException {
			return Long.parseLong(next());
		}

		double nextDouble() throws NumberFormatException, IOException {
			return Double.parseDouble(next());
		}

		boolean ready() throws IOException {
			return br.ready();
		}

	}

	static void sort(int[] a) {
		shuffle(a);
		Arrays.sort(a);
	}

	static void shuffle(int[] a) {
		int n = a.length;
		Random rand = new Random();
		for (int i = 0; i < n; i++) {
			int tmpIdx = rand.nextInt(n);
			int tmp = a[i];
			a[i] = a[tmpIdx];
			a[tmpIdx] = tmp;
		}
	}

