      if (d[tt] >= oo) break;
      for (Edge e = prev[tt]; e != null; e = prev[e.i])
        e.rev.flow = -(e.flow += width[tt]);
    }
    long flow = 0, cost = 0;
    for (Edge e : adj[s]) if (e.flow > 0) flow += e.flow;
