			int n = arr.length;
			int j = 1;
			while (j < n && arr[j - 1] <= arr[j])
				j++;
			int i = j - 1;
			if (j < n) {
				for (int k = j + 1; k < n; k++)
					if (arr[j] >= arr[k])
