        int[] a = new int[n];
        int[] x = new int[n];
        int[] y = new int[n];
        for (int i = 0; i < n; i++) {
            a[i] = sc.nextInt();
            x[i] = a[i] % (1 << 15);
            y[i] = a[i] / (1 << 15);
        }

        Comparator<int[]> com = (int[] a1, int[] a2) -> {
            for (int i = 0; i < a.length; i++)
                if (a1[i] < a2[i])
                    return -1;
                else if (a1[i] > a2[i])
                    return 1;
            return 0;
        };

        Map<int[], Integer> res = new TreeMap<>(com);
        for (int msk = 0; msk < (1 << 15); msk++) {
            res.put(apply(msk, x), msk);
        }
        for (int msk = 0; msk < (1 << 15); msk++) {
            int[] vals = apply(msk, y);
            for (int first = 0; first <= 15; first++) {
                int[] req = new int[n];
                for (int i = 0; i < n; i++)
                    req[i] = vals[0] + first - vals[i];
                if (res.containsKey(req)) {
                    int ans = res.get(req) + (1 << 15) * msk;
                    pw.println(ans);
                    pw.flush();
                    return;
                }
            }
        }
        pw.println(-1);

        pw.close();
    }

    static int[] apply(int msk, int[] nums) {
        int[] arr = new int[nums.length];
        for (int i = 0; i < nums.length; i++)
