public class F76 {
    static long mod = (long) 939302203913L;
    public static void main(String[] args) {
        MyScanner sc = new MyScanner();
        PrintWriter out = new PrintWriter(new BufferedOutputStream(System.out));
        int n = sc.nextInt();
        long time = System.currentTimeMillis();
        int [] a = new int[n];
        for (int i = 0; i < n; i++) a[i] = sc.nextInt();
        int [] upper = new int[n];
        int [] lower = new int[n];
        for (int i = 0; i < n; i++) {
            int mask = (1 << 15) - 1;
            lower[i] = mask & a[i];
            upper[i] = ((mask << 15) & a[i]) >> 15;
        }
        Map<Long, Integer> map = new HashMap<>();
        for (int x = 0; x < (1 << 15); x++) {
            long pow = 1;
            long cur = 0;
            for (int i = 0; i < n; i++) {
                int bit = Integer.bitCount(x ^ upper[i]);
                cur = (cur + (pow * bit) % mod) % mod;
                pow = (pow * 137) % mod;
            }
            map.put(cur, x);
        }
        int ret = -1;
        for (int x = 0; x < (1 << 15); x++) {
            if (System.currentTimeMillis() - time >= 3000) {
                out.println(-1);
                out.close();
                return;
            }
            int [] res = new int[n];
            int max = 0;
            for (int i = 0; i < n; i++) {
                res[i] = Integer.bitCount(x ^ lower[i]);
                max = Math.max(max, res[i]);
            }
            for (int make = max; make <= 30; make++) {
                long pow = 1;
                long cur = 0;
                for (int i = 0; i < n; i++) {
                    int add = make - res[i];
                    cur = (cur + (pow * add) % mod) % mod;
                    pow = (pow * 137) % mod;
                }
                if (map.containsKey(cur)) {
                    ret = (map.get(cur) << 15) + x;
                    break;
                }
            }
            if (ret >= 0) break;
        }
        out.println(ret);
        //for (int i = 0; i < n; i++) out.print(Integer.bitCount(ret ^ a[i]) + " ");
        out.close();
    }


