	int[] dsu, rr;
	int find(int i) {
		return dsu[i] < 0 ? i : (dsu[i] = find(dsu[i]));
	}
	boolean join(int i, int j) {
		i = find(i);
		j = find(j);
		if (i == j)
			return false;
		if (dsu[i] > dsu[j])
			dsu[i] = j;
		else {
			if (dsu[i] == dsu[j])
				dsu[i]--;
			dsu[j] = i;
		}
		rr[i] = rr[j] = Math.max(rr[i], rr[j]);
		return true;
	}
	void main() {
		int n = sc.nextInt();
		int m = sc.nextInt();
		dsu = new int[n]; Arrays.fill(dsu, -1);
		rr = new int[n];
		for (int i = 0; i < n; i++)
			rr[i] = i;
		while (m-- > 0) {
			int i = sc.nextInt() - 1;
			int j = sc.nextInt() - 1;
			join(i, j);
		}
		int ans = 0;
		for (int i = 0; i < n; i = rr[find(i)] + 1)
			for (int j = i + 1; j <= rr[find(i)]; j++)
				if (join(i, j))
					ans++;
		println(ans);
	}
}
