class dsu{
	private ArrayList<Integer> sz = new ArrayList<Integer>();
	private ArrayList<Integer> p = new ArrayList<Integer>();

	dsu(int n){
		for(int i = 0; i < n+5; ++i){
			sz.add(i,1);
			p.add(i,i);
		}
	}

	public int find(int a){
		if(p.get(a) != a) p.set(a,find(p.get(a)));
		return p.get(a);
	}
	public void join(int a, int b){
		a = find(a);
		b = find(b);
		if(a != b){
			if(a > b){
				p.set(b,a);
				sz.set(a, sz.get(a)+sz.get(b));
			}else{
				p.set(a,b);
				sz.set(b,  sz.get(a)+sz.get(b));
			}
		}
	}
}
