class DSU {
	int parent[];
	int rank[];
	int totalComponents;
	public DSU(int n) {
		parent=new int[n];
		rank=new int[n];
		for(int i=0;i<n;i++) {
			parent[i]=i;
		}
		totalComponents=n;
	}

	int get(int a) {

		if(a==parent[a])
			return a;

		return  parent[a]= get(parent[a]);
	}

	void union(int a, int b) {
		a=this.get(a); //leader of a
		b=this.get(b); //leader of b
		if(a!=b) {
			if(rank[a]<rank[b]) {
				int tmp=rank[a];   //swapping
				rank[a]=rank[b];
				rank[b]=tmp;
			}
			parent[b]=a;

			if(rank[a]==rank[b]) //agr equal h to bhada denge 
				rank[a]++;

			totalComponents--;   //every time ek component decrease hoga
		}
	}

}
