public class cf1244f {

	public static void main(String[] args) throws IOException {
		BufferedReader bf=new BufferedReader(new InputStreamReader(System.in));
		PrintWriter out=new PrintWriter(new BufferedWriter(new OutputStreamWriter(System.out)));
		StringTokenizer st=new StringTokenizer(bf.readLine());
		int n=Integer.parseInt(st.nextToken());
		int k=Integer.parseInt(st.nextToken());
		String s=bf.readLine();
		int[] a=new int[n];
		Arrays.fill(a, Integer.MAX_VALUE-5);
		for(int i=0;i<n;i++) {
			if(s.charAt(i)==s.charAt((i+1)%n)||s.charAt(i)==s.charAt((i-1+n)%n)) a[i]=0;
		}
		for(int i=0;i<2*n;i++) {
			a[i%n]=Math.min(a[i%n], a[(i-1+n)%n]+1);
		}
		for(int i=2*n-1;i>=0;i--) {
			a[i%n]=Math.min(a[i%n], a[(i+1)%n]+1);
		}
		for(int i=0;i<n;i++) {
			if(Math.min(k,a[i])%2==1) {
				out.print(s.charAt(i)=='W'?"B":"W");
			}
			else {
				out.print(s.charAt(i));
			}
		}
		out.close();
	}
