import java.awt.*;
import java.io.*;
import java.util.StringTokenizer;
import java.util.Queue;
import java.util.LinkedList;

public class Main {
    static class FastReader {
        BufferedReader br;
        StringTokenizer st;

        public FastReader()
        {
            br = new BufferedReader(
                    new InputStreamReader(System.in));
        }

        String next()
        {
            while (st == null || !st.hasMoreElements()) {
                try {
                    st = new StringTokenizer(br.readLine());
                }
                catch (IOException e) {
                    e.printStackTrace();
                }
            }
            return st.nextToken();
        }

        int nextInt() { return Integer.parseInt(next()); }

        long nextLong() { return Long.parseLong(next()); }

        double nextDouble()
        {
            return Double.parseDouble(next());
        }

        String nextLine()
        {
            String str = "";
            try {
                str = br.readLine();
            }
            catch (IOException e) {
                e.printStackTrace();
            }
            return str;
        }
    }

    public static char change(char ch){
        if(ch=='B') return 'W';
        return 'B';
    }

    public static void main(String[] args) throws IOException {
        FastReader r=new FastReader();
        PrintWriter pw = new PrintWriter(System.out);
        int n=r.nextInt();
        int k=r.nextInt();
        String s=r.next();
        int[] a=new int[n];
        for(int i=0;i<n;++i) a[i]=-1;
//        for(int i=0;i<n;++i){
//            System.out.print(a[i]+" ");
//        }
//        System.out.println();
        Queue<Integer> Q=new LinkedList<>();
        for(int i=0;i<n;++i){
            if(s.charAt((i-1+n)%n)==s.charAt(i)||s.charAt((i+1)%n)==s.charAt(i)){
                a[i]=0;
                Q.add(i);
            }
        }
//        System.out.println(Q);
        while(!Q.isEmpty()){
            int u=Q.peek();
            Q.poll();
            int left=(u-1+n)%n;
            int right=(u+1)%n;
            if(a[left]==-1){
                a[left]=a[u]+1;
                Q.add(left);
            }
            if(a[right]==-1){
                a[right]=a[u]+1;
                Q.add(right);
            }
        }
        StringBuilder ans=new StringBuilder();
//        for(int i=0;i<n;++i){
//            System.out.print(a[i]+" ");
//        }
//        System.out.println();
        for(int i=0;i<n;++i){
            int timee;
            if(a[i]==-1) timee=k;
            else timee=Math.min(k,a[i]);
            if(timee%2==1) ans.append(change(s.charAt(i)));
            else ans.append(s.charAt(i));
        }
        pw.println(ans.toString());
        pw.close();
    }
}
