import java.io.*;
import java.util.*;
public class Sol{
	static class pair {
		int l;
		int r;
		public pair(int l, int r) {
			this.l = l;
			this.r = r;
		}
	}
	public static int n, k;
	public static int arr[];
	public static boolean circ[];
	public static pair seg[];
	public static void main(String[] args) throws IOException{
		Scanner sc = new Scanner(System.in);
		PrintWriter out = new PrintWriter(System.out);
		n = sc.nextInt();
		k = sc.nextInt();
		String str = sc.next();
		arr = new int[n];
		seg = new pair[n];
		circ = new boolean[2*n+1];
		int first = Integer.MAX_VALUE;
		for(int i=0; i<n; ++i) {
			if(str.charAt(i)=='B') {
				arr[i] = 1;
			}else {
				arr[i] = 0;
			}
		}
		if(arr[0]!=arr[n-1]&&arr[0]!=arr[1]) {
			circ[0] = false;
		}else {
			circ[0] = true;
			first = 0;
		}
		if(arr[n-1]!=arr[n-2]&&arr[n-1]!=arr[0]) {
			circ[n-1] = false;
		}else {
			circ[n-1] = true;
			first = n-1;
		}
		for(int i=1; i<n-1; ++i) {
			if(arr[i]!=arr[i-1]&&arr[i]!=arr[i+1]) {
				circ[i] = false;
			}else {
				circ[i] = true;
				first = Math.min(first, i);
			}
		}
		for(int i=n; i<2*n; ++i) {
			circ[i] = circ[i-n];
		}
		if(first==Integer.MAX_VALUE) {
			for(int i=0; i<n; ++i) {
				if(k%2==1) {
					if(arr[i]==0) arr[i]++;
					else arr[i]--;
				}
				if(arr[i]==1) {
					out.print("B");
				}else {
					out.print("W");
				}
			}
			out.close();
			System.exit(0);
		}
		int idx = 0;
		int left = -1;
		for(int i=first; i<n+first+1; ++i) {

			if(left==-1) {
				if(!circ[i]) left = i;
				continue;
			}else {
				if(circ[i]) {
					seg[idx] = new pair(left, i-1);
					left = -1;
					idx++;
				}
				continue;
			}
		}
		idx = 0;
		for(int i=first; i<n+first+1; ++i) {
			if(circ[i]) {
				if(seg[idx]!=null&&i>seg[idx].r)idx++;
				continue;
			}
			int dist= Math.min(i-seg[idx].l, seg[idx].r-i);
			dist = Math.min(dist+1, k);
			if(dist%2==1) {
				if(arr[i%n]==0) {
					arr[i%n]++;
				}else {
					arr[i%n]--;
				}
			}
		}
		for(int i=0; i<n; ++i) {
			if(arr[i]==1) {
				out.print("B");
			}else {
				out.print("W");
			}
		}
		out.close();
	}
	static class FastIO {

		// Is your Fast I/O being bad?

		InputStream dis;
		byte[] buffer = new byte[1 << 17];
		int pointer = 0;

		public FastIO(String fileName) throws IOException {
			dis = new FileInputStream(fileName);
		}

		public FastIO(InputStream is) throws IOException {
			dis = is;
		}

		int nextInt() throws IOException {
			int ret = 0;

			byte b;
			do {
				b = nextByte();
			} while (b <= ' ');
			boolean negative = false;
			if (b == '-') {
				negative = true;
				b = nextByte();
			}
			while (b >= '0' && b <= '9') {
				ret = 10 * ret + b - '0';
				b = nextByte();
			}

			return (negative) ? -ret : ret;
		}

		long nextLong() throws IOException {
			long ret = 0;

			byte b;
			do {
				b = nextByte();
			} while (b <= ' ');
			boolean negative = false;
			if (b == '-') {
				negative = true;
				b = nextByte();
			}
			while (b >= '0' && b <= '9') {
				ret = 10 * ret + b - '0';
				b = nextByte();
			}

			return (negative) ? -ret : ret;
		}

		byte nextByte() throws IOException {
			if (pointer == buffer.length) {
				dis.read(buffer, 0, buffer.length);
				pointer = 0;
			}
			return buffer[pointer++];
		}

		String next() throws IOException {
			StringBuffer ret = new StringBuffer();

			byte b;
			do {
				b = nextByte();
			} while (b <= ' ');
			while (b > ' ') {
				ret.appendCodePoint(b);
				b = nextByte();
			}

			return ret.toString();
		}

	}
},"constructive algorithms,implementation"

