import java.io.*;
import java.util.*;

public class CF1238G extends PrintWriter {
	CF1238G() { super(System.out); }
	static class Scanner {
		Scanner(InputStream in) { this.in = in; } InputStream in;
		int k, l; byte[] bb = new byte[1 << 15];
		byte getc() {
			if (k >= l) {
				k = 0;
				try { l = in.read(bb); } catch (IOException e) { l = 0; }
				if (l <= 0) return -1;
			}
			return bb[k++];
		}
		int nextInt() {
			byte c = 0; while (c <= 32) c = getc();
			int a = 0;
			while (c > 32) { a = a * 10 + c - '0'; c = getc(); }
			return a;
		}
	}
	Scanner sc = new Scanner(System.in);
	public static void main(String[] $) {
		CF1238G o = new CF1238G(); o.main(); o.flush();
	}

	static final int INF = 0x3f3f3f3f;
	int[] tr, lz; int h_, n_;
	void put(int i, int x) {
		tr[i] += x;
		if (i < n_)
			lz[i] += x;
	}
	void pul(int i) {
		tr[i] = Math.max(tr[i << 1], tr[i << 1 | 1]);
	}
	void push(int i) {
		for (int h = h_; h > 0; h--) {
			int a = i >> h;
			if (lz[a] != 0) {
				put(a << 1, lz[a]);
				put(a << 1 | 1, lz[a]);
				lz[a] = 0;
			}
		}
	}
	void pull(int i) {
		while (i > 1) {
			i >>= 1;
			if (lz[i] == 0)
				pul(i);
		}
	}
	void build(int[] tt, int n) {
		h_ = 0;
		while (1 << h_ < n)
			h_++;
		n_ = 1 << h_;
		tr = new int[n_ * 2];
		lz = new int[n_];
		for (int i = 0; i < n_; i++)
			tr[n_ + i] = i < n ? -tt[i] : -INF;
		for (int i = n_ - 1; i > 0; i--)
			pul(i);
	}
	void update(int i, int x) {
		push(i += n_);
		for (int l = i, r = n_ + n_ - 1; l <= r; l >>= 1, r >>= 1)
			if ((l & 1) == 1)
				put(l++, x);
		pull(i);
	}
	int query(int i) {
		push(i += n_);
		int x = -INF;
		for (int l = i, r = n_ + n_ - 1; l <= r; l >>= 1, r >>= 1)
			if ((l & 1) == 1)
				x = Math.max(x, tr[l++]);
		return x;
	}
	static class V {
		int t, a, b;
		V(int t, int a, int b) {
			this.t = t; this.a = a; this.b = b;
		}
	}
	V[] vv;
	int[] pq, iq; int cnt;
	boolean less(int u, int v) { return vv[u].b < vv[v].b; }
	int i2(int i) {
		return (i *= 2) > cnt ? 0 : i < cnt && less(pq[i + 1], pq[i]) ? i + 1 : i;
	}
	void pq_up(int u) {
		int i, j, v;
		for (i = iq[u]; (j = i / 2) > 0 && less(u, v = pq[j]); i = j)
			pq[iq[v] = i] = v;
		pq[iq[u] = i] = u;
	}
	void pq_dn(int u) {
		int i, j, v;
		for (i = iq[u]; (j = i2(i)) > 0 && less(v = pq[j], u); i = j)
			pq[iq[v] = i] = v;
		pq[iq[u] = i] = u;
	}
	void pq_add(int u) {
		iq[u] = ++cnt; pq_up(u);
	}
	void pq_remove_first() {
		int v = pq[cnt--];
		iq[v] = 1; pq_dn(v);
	}
	void main() {
		int q = sc.nextInt();
		while (q-- > 0) {
			int n = sc.nextInt() + 2;
			int m = sc.nextInt();
			int c = sc.nextInt();
			int c0 = sc.nextInt();
			vv = new V[n];
			vv[0] = new V(0, c0, 0);
			for (int i = 1; i < n - 1; i++) {
				int t = sc.nextInt();
				int a = sc.nextInt();
				int b = sc.nextInt();
				vv[i] = new V(t, a, b);
			}
			vv[n - 1] = new V(m, 0, 0);
			Arrays.sort(vv, (u, v) -> u.t - v.t);
			int[] tt = new int[n];
			m = 0;
			for (int i = 0; i < n; i++) {
				tt[m] = vv[i].t;
				vv[i].t = i + 1 == n || vv[i + 1].t != vv[i].t ? m++ : m;
			}
			build(tt, m);
			pq = new int[1 + n]; iq = new int[n]; cnt = 0;
			long ans = 0;
out:
			for (int j = 0, t = 0; t < m; t++) {
				while (j < n && vv[j].t < t)
					pq_add(j++);
				int a_ = query(t);
				while (a_ < 0) {
					if (cnt == 0) {
						ans = -1;
						break out;
					}
					int i = pq[1];
					int a = c - query(vv[i].t);
					int x = Math.min(-a_, a);
					if (vv[i].a > x) {
						vv[i].a -= x;
						if (x == a)
							vv[i].a = 0;
					} else {
						x = vv[i].a;
						vv[i].a = 0;
					}
					update(vv[i].t, x);
					a_ += x;
					ans += (long) x * vv[i].b;
					if (vv[i].a == 0)
						pq_remove_first();
				}
			}
			println(ans);
		}
	}
