public class G implements Runnable {
	public static void main (String[] args) {new Thread(null, new G(), "_cf", 1 << 28).start();}

	public void run() {
		FastScanner fs = new FastScanner();
		PrintWriter out = new PrintWriter(System.out);
		System.err.println("");

		int T = fs.nextInt();
		tests: while(T-->0) {

			int numFriends = fs.nextInt(), totalTime = fs.nextInt();
			int maxCap = fs.nextInt(), startCap = fs.nextInt();
			Friend[] friends = new Friend[numFriends+1];
			for(int i = 0; i < numFriends; i++) friends[i] = new Friend(fs.nextInt(), fs.nextInt(), fs.nextInt());
			friends[numFriends] = new Friend(totalTime, -1, -1);
			Arrays.sort(friends);

			TreeSet<Pair> set = new TreeSet<>();
			set.add(new Pair(0, startCap, -1));
			int lastTime = 0;

			long res = 0;
			long totCount = startCap;
			for(int i = 0; i <= numFriends; i++) {
				long timeDiff = friends[i].time-lastTime;
				while(timeDiff > 0) {
					if(set.isEmpty()) {
						out.println(-1);
						continue tests;
					}
					Pair who = set.first();
					long sub = Math.min(timeDiff, who.canTake);
					res += sub*who.cost;
					timeDiff -= sub;
					totCount -= sub;
					who.canTake -= sub;
					if(who.canTake == 0) set.pollFirst();
				}
				//add him
				set.add(new Pair(friends[i].cost, friends[i].max, i));
				totCount += friends[i].max;
				while(totCount > maxCap) {
					Pair last = set.last();
					long sub = Math.min(totCount-maxCap, last.canTake);
					totCount -= sub;
					last.canTake -= sub;
					if(last.canTake == 0) {
						set.pollLast();
					}
				}

				lastTime = friends[i].time;
			}

			out.println(res);
		}

		out.close();
	}

	class Pair implements Comparable<Pair> {
		long cost, canTake;
		int id;
		Pair(long c, long t, int i) {
			cost = c; canTake = t;
			id = i;
		}
		public int compareTo(Pair p) {
			int c = Long.compare(cost, p.cost);
			if(c == 0) c = Integer.compare(id, p.id);
			return c;
		}
		public String toString() {
			return String.format("(%d, %d)", cost, canTake);
		}
	}

	class Friend implements Comparable<Friend> {
		int time;
		long max, cost;
		Friend(int a, int b, int c) {
			time = a; max = b; cost = c;
		}
		public int compareTo(Friend f) {
			int c = Integer.compare(time, f.time);
			if(c == 0) c = Long.compare(cost, f.cost);
			if(c == 0) c = Long.compare(f.max, max);
			return c;
		}
	}

	class FastScanner {
		public int BS = 1<<16;
		public char NC = (char)0;
		byte[] buf = new byte[BS];
		int bId = 0, size = 0;
		char c = NC;
		double num = 1;
		BufferedInputStream in;

		public FastScanner() {
			in = new BufferedInputStream(System.in, BS);
		}

		public FastScanner(String s) {
			try {
				in = new BufferedInputStream(new FileInputStream(new File(s)), BS);
			}
			catch (Exception e) {
				in = new BufferedInputStream(System.in, BS);
			}
		}

		public char nextChar(){
			while(bId==size) {
				try {
					size = in.read(buf);
				}catch(Exception e) {
					return NC;
				}                
				if(size==-1)return NC;
				bId=0;
			}
			return (char)buf[bId++];
		}

		public int nextInt() {
			return (int)nextLong();
		}

		public long nextLong() {
			num=1;
			boolean neg = false;
			if(c==NC)c=nextChar();
			for(;(c<'0' || c>'9'); c = nextChar()) {
				if(c=='-')neg=true;
			}
			long res = 0;
			for(; c>='0' && c <='9'; c=nextChar()) {
				res = (res<<3)+(res<<1)+c-'0';
				num*=10;
			}
			return neg?-res:res;
		}

		public double nextDouble() {
			double cur = nextLong();
			return c!='.' ? cur:cur+nextLong()/num;
		}

		public String next() {
			StringBuilder res = new StringBuilder();
			while(c<=32)c=nextChar();
			while(c>32) {
				res.append(c);
				c=nextChar();
			}
			return res.toString();
		}

		public String nextLine() {
			StringBuilder res = new StringBuilder();
			while(c<=32)c=nextChar();
			while(c!='
') {
				res.append(c);
				c=nextChar();
			}
			return res.toString();
		}

		public boolean hasNext() {
			if(c>32)return true;
			while(true) {
				c=nextChar();
				if(c==NC)return false;
				else if(c>32)return true;
			}
		}

		public int[] nextIntArray(int n) {
			int[] res = new int[n];
			for(int i = 0; i < n; i++) res[i] = nextInt();
			return res;
		}

	}

