import java.io.*;
import java.util.*;

public class CF1238F extends PrintWriter {
	CF1238F() { super(System.out); }
	Scanner sc = new Scanner(System.in);
	public static void main(String[] $) {
		CF1238F o = new CF1238F(); o.main(); o.flush();
	}

	int[] ll, jj; int $;
	int link(int l, int j) {
		ll[$] = l; jj[$] = j;
		return $++;
	}
	int[] ae, dd;
	void init(int n, int m) {
		ll = new int[1 + m * 2]; jj = new int[1 + m * 2];
		ae = new int[n];
		dd = new int[n]; Arrays.fill(dd, -1);
		$ = 1;
	}
	int d_, i_;
	void dfs(int p, int i, int d) {
		d += dd[i];
		if (d_ < d) {
			d_ = d; i_ = i;
		}
		for (int l = ae[i]; l != 0; l = ll[l]) {
			int j = jj[l];
			if (j != p)
				dfs(i, j, d);
		}
	}
	void main() {
		int q = sc.nextInt();
		while (q-- > 0) {
			int n = sc.nextInt();
			init(n, n - 1);
			for (int h = 0; h < n - 1; h++) {
				int i = sc.nextInt() - 1;
				int j = sc.nextInt() - 1;
				ae[i] = link(ae[i], j); dd[i]++;
				ae[j] = link(ae[j], i); dd[j]++;
			}
			d_ = -1;
			dfs(-1, 0, 0);
			dfs(-1, i_, 0);
			println(d_ + 2);
		}
	}
}
