import java.io.*;
import java.util.*;

public class CF1237F extends PrintWriter {
	CF1237F() { super(System.out, true); }
	Scanner sc = new Scanner(System.in);
	public static void main(String[] $) {
		CF1237F o = new CF1237F(); o.main(); o.flush();
	}

	static final int MD = 998244353;
	int[] solve(boolean[] aa, int n, int k) {
		int[] dp1 = new int[k + 1];
		int[] dp2 = new int[k + 1];
		int[] dp = new int[k + 1];
		dp2[0] = dp1[0] = 1;
		for (int i = 1; i < n; i++) {
			dp[0] = 1;
			for (int j = 1; j <= k; j++)
				dp[j] = !aa[i - 1] && !aa[i] ? (dp2[j - 1] + dp1[j]) % MD : dp1[j];
			int[] tmp = dp2; dp2 = dp1; dp1 = dp; dp = tmp;
		}
		return dp1;
	}
	int d_, x_, y_;
	void gcd_(int a, int b) {
		if (b == 0) {
			d_ = a;
			x_ = 1; y_ = 0;
		} else {
			gcd_(b, a % b);
			int t = x_ - a / b * y_; x_ = y_; y_ = t;
		}
	}
	int inv(int a) {
		gcd_(a, MD);
		return x_;
	}
	int[] ff, gg;
	void init(int n) {
		ff = new int[n + 1];
		gg = new int[n + 1];
		long f = 1;
		for (int i = 0; i <= n; i++) {
			gg[i] = inv(ff[i] = (int) f);
			f = f * (i + 1) % MD;
		}
	}
	long ch(int n, int k) {
		return (long) ff[n] * gg[k] % MD * gg[n - k] % MD;
	}
	void main() {
		int n = sc.nextInt();
		int m = sc.nextInt();
		int k = sc.nextInt();
		boolean[] aa = new boolean[n];
		boolean[] bb = new boolean[m];
		while (k-- > 0) {
			int i1 = sc.nextInt() - 1;
			int j1 = sc.nextInt() - 1;
			int i2 = sc.nextInt() - 1;
			int j2 = sc.nextInt() - 1;
			aa[i1] = aa[i2] = true;
			bb[j1] = bb[j2] = true;
		}
		int n_ = n;
		for (int i = 0; i < n; i++)
			if (aa[i])
				n_--;
		int m_ = m;
		for (int j = 0; j < m; j++)
			if (bb[j])
				m_--;
		int[] da = solve(aa, n, n_ / 2);
		int[] db = solve(bb, m, m_ / 2);
		init(Math.max(n_, m_));
		long ans = 0;
		for (int k2 = 0; k2 * 2 <= n_; k2++) {
			int x = da[k2];
			if (x == 0)
				continue;
			for (int k1 = 0; k1 * 2 + k2 <= m_ && k2 * 2 + k1 <= n_; k1++) {
				int y = db[k1];
				if (y == 0)
					continue;
				long cnt = (long) x * y % MD * ch(n_ - k2 * 2, k1) % MD * ch(m_ - k1 * 2, k2) % MD * ff[k2] % MD * ff[k1] % MD;
				ans += cnt;
			}
		}
		ans %= MD;
		if (ans < 0)
			ans += MD;
		println(ans);
	}
}
