/**
 * Problem Cf1237C
 */
public class Cf1237C {

    int n,D = 3;
    int[][] p;

    public void run() {
        n = in.nextInt();
        p = new int[n][D];
        for(int i = 0; i < n; ++i){
            for(int j = 0; j < D; ++j){
                p[i][j]=in.nextInt();
            }
        }
        List<Integer> ids = new ArrayList<>();
        for(int i = 0; i < n; ++i)
            ids.add(i);
        solve(ids,0);
    }

    int solve(List<Integer> ids, int d){
        if(d==D){
            return ids.get(0);
        }
        Map<Integer, List<Integer>> map = new TreeMap<>();
        for(Integer id : ids) {
            map.computeIfAbsent(p[id][d], key -> new ArrayList<>()).add(id);
        }
        List<Integer> a = new ArrayList<>();
        for(List<Integer> list : map.values()){
            int ret = solve(list, d+1);
            if(ret!=-1){
                a.add(ret);
            }
        }
        for(int i = 0; i+1 < a.size(); i+=2){
            out.println((a.get(i)+1) + " " + (a.get(i+1)+1));
        }
        return a.size() % 2 == 0 ? -1 : a.get(a.size() - 1);
    }




