        Scanner sc = new Scanner(System.in);
        int n = sc.nextInt();
        List<Point> points = new ArrayList<>();

        for (int i = 0; i < n; i++) {
            points.add(new Point(sc.nextInt(), sc.nextInt(), sc.nextInt(), i + 1));
        }

        Map<Integer, List<Point>> groupByZ = points.stream()
                .collect(Collectors.groupingBy(a -> a.z));
        List<Point> leftOvers = new ArrayList<>();
        for (Map.Entry<Integer, List<Point>> e : groupByZ.entrySet()) {
            solve2d(e.getValue()).ifPresent(leftOvers::add);
        }
        leftOvers.sort(Comparator.comparingInt(o -> o.z));
        printPoints(leftOvers);

        System.out.println(sb);
    }

    static Optional<Point> solve2d(List<Point> points) {
        Map<Integer, List<Point>> groupByY = points.stream()
                .collect(Collectors.groupingBy(a -> a.y));
        List<Point> leftOvers = new ArrayList<>();
        for (Map.Entry<Integer, List<Point>> e : groupByY.entrySet()) {
            solve1d(e.getValue()).ifPresent(leftOvers::add);
        }
        leftOvers.sort(Comparator.comparingInt(o -> o.y));
        printPoints(leftOvers);
        if (leftOvers.size() % 2 == 0) {
            return Optional.empty();
        } else {
            return Optional.of(leftOvers.get(leftOvers.size() - 1));
        }
    }

    static Optional<Point> solve1d(List<Point> points) {
        points.sort(Comparator.comparingInt(o -> o.x));
        printPoints(points);
        if (points.size() % 2 == 0) {
            return Optional.empty();
        } else {
            return Optional.of(points.get(points.size() - 1));
        }
    }

    private static void printPoints(List<Point> points) {
        for (int i = 0; i < points.size() - 1; i += 2) {
            sb.append(points.get(i).index).append(' ').append(points.get(i + 1).index).append('
');
        }
    }

    static boolean isInside(Point a, Point b, Point c) {
        return Math.min(a.x, b.x) <= c.x && c.x <= Math.max(a.x, b.x)
                && Math.min(a.y, b.y) <= c.y && c.y <= Math.max(a.y, b.y)
                && Math.min(a.z, b.z) <= c.z && c.z <= Math.max(a.z, b.z);
    }
}
