	public boolean can(int n1, int n2, int n3, boolean odd) {
		while (true) {
			if (odd) {
				if (n2 > 0) {
					n2--;
				} else if (n3 > 0) {
					n3--;
				} else {
					break;
				}
			} else {
				if (n1 > 0) {
					n1--;
				} else if (n3 > 0) {
					n3--;
				} else {
					break;
				}
			}
			odd = !odd;
		}
		return n1 == 0 && n2 == 0 && n3 == 0;
	}

