    static class TaskE {
        final int MOD = 998244353;

        int pow(int a, int b) {
            if (b == 0)
                return 1;
            if ((b & 1) == 1) {
                return mul(a, pow(a, b - 1));
            } else {
                int aux = pow(a, b >> 1);
                return mul(aux, aux);
            }
        }

        int mul(int a, int b) {
            return (int) ((1L * a * b) % MOD);
        }

        int add(int a, int b) {
            return ((int) (1L * a + b) % MOD);
        }

        int sub(int a, int b) {
            long ans = a;
            ans -= b;
            ans %= MOD;
            if (ans < 0) ans += MOD;
            return (int) ans;
        }

        int inv(int a) {
            return pow(a, MOD - 2);
        }

