                    int l = in.nextInt() - 1;
                    int r = in.nextInt() - 1;
                    int d = in.nextInt();
                    for (int j = 0; j < n; j++) {
                        b[j] = l <= j && j <= r ? sub(q, add(a[j], d)) : sub(q, a[j]);
                    }
                }
                int[] ans = fft.get(0, n - 1, b);
                out.println(k >= ans.length ? 0 : ans[k]);
            }
        }

        class FFT {
            final int maxN = 4 * 4 * 10000;
            final int G = 3;
            int[] rev;

            FFT() {
                rev = new int[maxN];
            }

            void FFT(int[] a, boolean inverse) {
                int n = a.length;
                for (int i = 0; i < a.length; i++) {
                    if (i < rev[i]) {
                        int temp = a[i];
                        a[i] = a[rev[i]];
                        a[rev[i]] = temp;
                    }
                }
                for (int i = 1; i < n; i *= 2) {
                    int wn = pow(G, ((MOD - 1) / i) >> 1);
                    if (inverse == true) wn = inv(wn);
                    for (int j = 0; j < n; j += i * 2) {
                        int w = 1;
                        for (int k = j; k < j + i; k++) {
                            int x = a[k], y = mul(w, a[k + i]);
                            a[k] = add(x, y);
                            a[k + i] = sub(x, y);
                            w = mul(w, wn);
                        }
                    }
                }
                if (inverse == true) {
                    int nInv = inv(n);
                    for (int i = 0; i < n; i++) {
                        a[i] = mul(a[i], nInv);
                    }
                }
            }

            int[] multiply(int[] a, int[] b) {
                int n = Math.max(a.length, b.length);
                int n2 = 1;
                int log = 0, m = n * 2;
                while (n2 < m) {
                    n2 *= 2;
                    log++;
                }
                for (int i = 0; i < n2; i++) {
                    rev[i] = (rev[i >> 1] >> 1) ^ ((i & 1) << (log - 1));
                }
                a = Arrays.copyOf(a, n2);
                b = Arrays.copyOf(b, n2);
                FFT(a, false);
                FFT(b, false);
                for (int i = 0; i < a.length; i++) a[i] = mul(a[i], b[i]);
                FFT(a, true);
                return a;
            }

            int[] get(int l, int r, int[] a) {
                if (l == r) {
                    int[] res = new int[2];
                    res[0] = 1;
                    res[1] = a[l];
                    return res;
                }
                int mid = (l + r) >> 1;
                int[] f1 = get(l, mid, a);
                int[] f2 = get(mid + 1, r, a);
                int[] g = multiply(f1, f2);
                int size = g.length;
                while (size > 0 && g[size - 1] == 0) {
                    size--;
                }
                g = Arrays.copyOf(g, size);
                return g;
            }

        }

    }

    static class InputReader {
        private byte[] buf = new byte[1024];
        private int curChar;
        private int numChars;
        private InputStream stream;

        public InputReader(InputStream stream) {
            this.stream = stream;
        }

        private boolean isWhitespace(int c) {
            return c == ' ' || c == '
' || c == '' || c == '	' || c == -1;
        }

        private int read() {
            if (numChars == -1)
                throw new InputMismatchException();
            if (curChar >= numChars) {
                curChar = 0;
                try {
                    numChars = stream.read(buf);
                } catch (IOException e) {
                    throw new InputMismatchException();
                }
                if (numChars <= 0)
                    return -1;
            }
            return buf[curChar++];
        }

        public int nextInt() {
            int c = read();
            while (isWhitespace(c))
                c = read();
            int sgn = 1;
            if (c == '-') {
                sgn = -1;
                c = read();
            }
            int res = 0;
            do {
                if (c < '0' || c > '9')
                    throw new InputMismatchException();
                res *= 10;
                res += c - '0';
                c = read();
            } while (!isWhitespace(c));
            return res * sgn;
        }

    }
}

