    {   
         long inf = 100000000;
         inf = inf*inf;
        if(left>=l&&right<=r)
        {
            return seg[index];
        }
        if(l>right||left>r)
            return inf;
        int mid = left+(right-left)/2;
        return Math.min(query(seg,left,mid,2*index+1,l,r),query(seg,mid+1,right,2*index+2,l,r));

    }

    public int value (int seg[], int left , int right ,int index, int l, int r)
    {

            if(left>right)
