public class S {
    static class point {
        int need;
        int change;

        public point(int need, int change) {
            this.need = need;
            this.change = change;
        }
    }
    public static void main(String[] args) {
        Scanner in = new Scanner(System.in);
        int n = in.nextInt();
        int r = in.nextInt();
        point[] a = new point[n];
        point[] b = new point[n];
        int indexA = 0, indexB = 0;
        for (int i = 0; i < n; i++) {
            int x = in.nextInt();
            int y = in.nextInt();
            if (y >= 0) {
                a[indexA++] = new point(x, y);
            } else {
                b[indexB++] = new point(x, y);
            }
        }
        Arrays.sort(a, 0,indexA,new Comparator<point>() {
            @Override
            public int compare(point o1, point o2) {
                return o1.need >= o2.need ? 1 : -1;
            }
        });
        Arrays.sort(b, 0,indexB,new Comparator<point>() {
            @Override
            public int compare(point o1, point o2) {
                return o1.need+o1.change <= o2.need+o2.change ? 1 : -1;
            }
        });
        for (int i = 0; i < indexA; i++) {
            if (a[i].need > r) {
                System.out.println("NO");
                return;
            }
            r += a[i].change;
        }
        for (int i = 0; i < indexB; i++) {
            if (b[i].need > r) {
                System.out.println("NO");
                return;
            }
            r += b[i].change;
        }
        if (r >= 0) {
            System.out.println("YES");
        } else {
            System.out.println("NO");
        }

    }
}

