public class G{
	static List<Pair> neg; 
	static int[][] dp;
	static int len;
	static int solve(int o, int t) {
		if (t == 0) return 0;
		if (t < 0) return -1;
		if (o >= len) return 0;
		if (dp[o][t] == -1) {
			// Either take, or do not take.
			dp[o][t] = solve(o+1, t);
			if (t >= neg.get(o).a && t + neg.get(o).b >= 0) {
				dp[o][t] = Integer.max(dp[o][t], solve(o+1,t+neg.get(o).b)+1);
			}
		}
		return dp[o][t];
	}
	public static void main(String[] args) throws IOException {
		// br = new BufferedReader(new FileReader(".in"));
		// out = new PrintWriter(new FileWriter(".out"));
		//new Thread(null, new (), "peepee", 1<<28).start();
		int n = readInt();
		int r = readInt();
		List<Pair> pos = new ArrayList<Pair>();
		neg = new ArrayList<Pair>();
		for (int i = 0; i < n; i++) {
			Pair p = new Pair(readInt(),readInt());
			if (p.b >= 0) pos.add(p);
			else {
				p.a = Integer.max(p.a, -p.b);
				neg.add(p);
			}
		}
		// Optimally, take all positive in ascending order
		while (!pos.isEmpty()) {
			int c = -1;
			for (int i = 0; i < pos.size(); i++) if (pos.get(i).a <= r) c = i;
			if (c == -1) break;
			r += pos.remove(c).b;
		}
		// DP on neg
		Collections.sort(neg, (i,j)-> -((i.a + i.b) - (j.a + j.b))); 
		//for (Pair p: neg) System.out.println(p.a + " " + p.b);
		len = neg.size();
		dp = new int[len][(int)r+1];
		for (int[] d: dp) Arrays.fill(d, -1);
		int max = solve(0,r);
		out.println(pos.isEmpty() && len == max  ?"YES":"NO");
		out.close();
	}

