public class Main{
	static ArrayList<int[]>neg;
	static int[][]memo;
	static int dp(int i,int rating) {
		if(rating<0)return -10000000;
		if(i>=neg.size())return 0;
		if(memo[i][rating]!=-1)return memo[i][rating];

		int leave=dp(i+1,rating);
		int take=rating>=neg.get(i)[0]?(1+dp(i+1,rating+neg.get(i)[1])):-10000000;

		return memo[i][rating]=Math.max(leave, take);
	}
	static void main() throws Exception{
		int n=sc.nextInt(),r=sc.nextInt();
		ArrayList<int[]>pos=new ArrayList<>();
		neg=new ArrayList<>();

		for(int i=0;i<n;i++) {
			int rating=sc.nextInt(),delta=sc.nextInt();
			if(delta>=0) {
				pos.add(new int[] {rating,delta});
			}
			else {
				neg.add(new int[] {Math.max(rating, -delta),delta});
			}
		}
		boolean[]taken=new boolean[pos.size()];
		int ans=0;
		while(true) {
			int maxB=-500,idx=-1;
			for(int i=0;i<pos.size();i++) {
				if(taken[i] || pos.get(i)[0]>r)continue;
				if(pos.get(i)[1]>maxB) {
					maxB=pos.get(i)[1];
					idx=i;
				}
			}
			if(idx==-1)break;
			if(r+maxB<0)break;

			ans++;
			r+=pos.get(idx)[1];
			taken[idx]=true;
		}
		memo=new int[neg.size()][r+1];
		for(int i=0;i<memo.length;i++) {
			Arrays.fill(memo[i], -1);
		}


		Collections.sort(neg,(x,y)->(y[0]+y[1])-(x[0]+x[1]));
		int ansNeg=Math.max(0, dp(0, r));

		pw.println((ans+ansNeg)==n?"YES":"NO");
	}
