import java.io.*;
import java.util.*;

public class CF1166F {
	static HashMap[] mm;
	static HashSet[] ss;
	static int[] dsu;
	static void add(int i, int c, int j) {
		HashMap<Integer, Integer> map = mm[i];
		int j_ = map.getOrDefault(c, -1);
		if (j_ == -1)
			map.put(c, j);
		else
			join(j_, j);
	}
	static void link(int i, int j, int c) {
		HashSet<Integer> si = ss[find(i)];
		si.add(j);
		HashSet<Integer> sj = ss[find(j)];
		sj.add(i);
		add(i, c, j);
		add(j, c, i);
	}
	static int find(int i) {
		return dsu[i] < 0 ? i : (dsu[i] = find(dsu[i]));
	}
	static void join(int i, int j) {
		i = find(i);
		j = find(j);
		if (i == j)
			return;
		HashSet<Integer> s, t;
		if (ss[i].size() <= ss[j].size()) {
			s = ss[i]; t = ss[j];
		} else {
			s = ss[j]; t = ss[i];
		}
		for (int x : s)
			t.add(x);
		if (dsu[i] > dsu[j]) {
			dsu[i] = j;
			ss[j] = t;
		} else {
			if (dsu[i] == dsu[j])
				dsu[i]--;
			dsu[j] = i;
			ss[i] = t;
		}
	}
	public static void main(String[] args) throws IOException {
		BufferedReader br = new BufferedReader(new InputStreamReader(System.in));
		PrintWriter pw = new PrintWriter(System.out);
		StringTokenizer st = new StringTokenizer(br.readLine());
		int n = Integer.parseInt(st.nextToken());
		int m = Integer.parseInt(st.nextToken());
		int q = Integer.parseInt(st.nextToken());
		q = Integer.parseInt(st.nextToken());
		mm = new HashMap[n];
		ss = new HashSet[n];
		for (int i = 0; i < n; i++) {
			mm[i] = new HashMap<Integer, Integer>();
			ss[i] = new HashSet<Integer>();
		}
		dsu = new int[n];
		Arrays.fill(dsu, -1);
		for (int h = 0; h < m; h++) {
			st = new StringTokenizer(br.readLine());
			int i = Integer.parseInt(st.nextToken()) - 1;
			int j = Integer.parseInt(st.nextToken()) - 1;
			int c = Integer.parseInt(st.nextToken());
			link(i, j, c);
		}
		while (q-- > 0) {
			st = new StringTokenizer(br.readLine());
			String tp = st.nextToken();
			int i = Integer.parseInt(st.nextToken()) - 1;
			int j = Integer.parseInt(st.nextToken()) - 1;
			if (tp.charAt(0) == '+') {
				int c = Integer.parseInt(st.nextToken());
				link(i, j, c);
			} else {
				boolean yes = false;
				int i_ = find(i);
				int j_ = find(j);
				if (i_ == j_)
					yes = true;
				else {
					HashSet<Integer> set = ss[i_];
					if (set.contains(j))
						yes = true;
				}
				pw.println(yes ? "Yes" : "No");
			}
		}
		pw.close();
	}
}
