    public void addEdge(int x, int y, int color) {
//        boolean f = false;
        if (roads.get(x).containsKey(color)) {
            dsu.union(roads.get(x).get(color), y);
            dsu.getSet(y).remove(roads.get(x).get(color));
//            f = true;
        }
        if (roads.get(y).containsKey(color)) {
