    public static class DSU {
        public HashMap<Integer, Integer> parent = new HashMap<>();
        public HashMap<Integer, Integer> rank = new HashMap<>();
        public HashMap<Integer, HashSet<Integer>> sets = new HashMap<>();

        DSU() {
        }

        public HashSet<Integer> getSet(int v) {
            v = getRoot(v);
            if (!sets.containsKey(v)) {
                sets.put(v, new HashSet<>());
            }
            return sets.get(v);
        }

        public int getRoot(int i) {
            if (parent.getOrDefault(i, i) != i) {
                int root = getRoot(parent.getOrDefault(i, i));
                parent.put(i, root);
            }
            return parent.getOrDefault(i, i);
        }

        public void union(int i, int j) {
            int rootI = getRoot(i);
            int rootJ = getRoot(j);
            if (rootI == rootJ) return;
            if (getSet(rootI).size() > getSet(rootJ).size()) {
                int c = rootI;
                rootI = rootJ;
                rootJ = c;
            }
