import java.util.*;
import java.io.*;

public class Main {
	public static void main(String args[]) { new Main().WORK(); }

	Scanner in = new Scanner(System.in);
	PrintWriter out = new PrintWriter(System.out);

	final int INF = 0x3f3f3f3f;

	char[][] s = new char[3][];
	int[][] f = new int[3][55];
	int[][][] dp = new int[1010][55][55];

	void getFail(char[] s, int[] f) {
		int n = s.length;
		f[0] = f[1] = 0;
		for(int i = 1; i < n; i++) {
			int j = f[i];
			while(j!=0 && s[j]!=s[i]) j = f[j];
			f[i+1] = s[j]==s[i]?j+1:0;
		}
	}

	int dfs(int i, int j, int k) {
		if(i == s[0].length) return 0;
		if(dp[i][j][k] != -INF) return dp[i][j][k];
		char st = 'a', ed = 'z';
		if(s[0][i] != '*') st = ed = s[0][i];
		for(char c = st; c <= ed; c++) {
			int x = j, y = k;
			for(; x!=0 && s[1][x+1]!=c; x = f[1][x]);
			if(s[1][x+1] == c) x++;
			for(; y!=0 && s[2][y+1]!=c; y = f[2][y]);
			if(s[2][y+1] == c) y++;
			int tmp = 0;
			if(x == s[1].length-1) { x = f[1][x]; tmp++; }
			if(y == s[2].length-1) { y = f[2][y]; tmp--; }
			dp[i][j][k] = Math.max(dp[i][j][k], dfs(i+1, x, y)+tmp);
		}
		return dp[i][j][k];
	}

	void WORK() {
		for(int i = 0; i < 3; i++) s[i] = in.next().toCharArray();
		getFail(s[1], f[1]); getFail(s[2], f[2]);
		s[1] = ("A"+String.valueOf(s[1])).toCharArray();
		s[2] = ("A"+String.valueOf(s[2])).toCharArray();
		for(int a[][]:dp) for(int b[]:a) Arrays.fill(b, -INF);
		out.println(dfs(0, 0, 0));
		out.flush();
	}
},"dp,strings"

