import java.io.*;
import java.util.*;

public class CF1153F {
	static final int MD = 998244353;
	static int[][] ch;
	static void init(int n) {
		ch = new int[1 + n][1 + n];
		ch[0][0] = 1;
		for (int i = 1; i <= n; i++) {
			ch[i][0] = 1;
			for (int j = 1; j <= i; j++)
				ch[i][j] = (ch[i - 1][j] + ch[i - 1][j - 1]) % MD;
		}
	}
	static long power(int a, int k) {
		if (k == 0)
			return 1;
		long p = power(a, k / 2);
		p = p * p % MD;
		if (k % 2 == 1)
			p = p * a % MD;
		return p;
	}
	public static void main(String[] args) throws IOException {
		BufferedReader br = new BufferedReader(new InputStreamReader(System.in));
		StringTokenizer st = new StringTokenizer(br.readLine());
		int n = Integer.parseInt(st.nextToken());
		int k = Integer.parseInt(st.nextToken());
		int l = Integer.parseInt(st.nextToken());
		init(n);
		long[] pp = new long[1 + n + n];
		long[] qq = new long[1 + n + n];
		pp[n] = power(2, n);
		for (int i = 0; i < n; i++)
			for (int j = n + n; j > 0; j--)
				pp[j] = (pp[j] - pp[j - 1]) % MD;
		long[] aa = new long[1 + n + n];
		for (int j = 0; j <= n + n; j++)
			aa[j] = pp[j];
		long inv2 = (MD + 1) / 2;
		for (int i = 1; i <= n - k; i++) {
			// qq := pp / p, where p = 2x (1 - x)
			// divide by 2x
			for (int j = 0; j < n + n; j++)
				qq[j] = pp[j + 1] * inv2 % MD;
			qq[n + n] = 0;
			// divide by 1 - x is multiply by 1 + x + x^2 + x^3 + ...
			for (int j = 1; j <= n + n; j++)
				qq[j] = (qq[j] + qq[j - 1]) % MD;
			// pp := pp * (1 - p) / p = pp / p - pp = qq - pp
			for (int j = 0; j <= n + n; j++)
				pp[j] = (qq[j] - pp[j]) % MD;
			long a = ch[n][i];
			for (int j = 0; j <= n + n; j++)
				aa[j] = (aa[j] + a * pp[j]) % MD;
		}
		// integrate x^i to x^{i + 1} / (i + 1)
		long a = 0;
		for (int i = 0; i <= n + n; i++)
			a = (a + aa[i] * power(i + 1, MD - 2)) % MD;
		a = (a * l % MD + MD) % MD;
		System.out.println(a);
	}
}
