import java.io.*;
import java.util.*;

public class Codeforces1153F {

	public static void main(String[] args) throws IOException {
		int P = 998244353;

		BufferedReader br = new BufferedReader(new InputStreamReader(System.in));
		StringTokenizer st = new StringTokenizer(br.readLine());
		int n = Integer.parseInt(st.nextToken());
		int real_k = Integer.parseInt(st.nextToken());
		int l = Integer.parseInt(st.nextToken());

		//generate factorials
		int[] factorials = new int[2*n+2];
		factorials[0] = 1;
		for (int i = 1; i <= 2*n+1; i++) {
			factorials[i] = multiply(factorials[i-1], i, P);
		}

		//number of ways to choose k pairs from 2k elements
		//where order doesn't matter
		//equals (2k)!/(2^n)/k! = (2k-1)!!
		int[] doublefact = new int[n+1];
		doublefact[0] = 1;
		for (int i = 1; i <= n; i++) {
			doublefact[i] = multiply(doublefact[i-1], (2*i-1), P);
		}

		//list[r][k] stores for rth segment, exactly k of the n segments covering it 
		int[][] list = new int[2*n+2][n+1];

		for (int r = 1; r <= 2*n+1; r++) {
			for (int k = 1; k <= n; k++) {
				if (((r%2) != (k%2)) && (r-1 >= k) && (2*n+1-r >= k)) {
					int num = multiply(factorials[r-1], factorials[2*n+1-r], P);
					num = multiply(num, doublefact[(r-k-1)/2], P);
					num = multiply(num, doublefact[(2*n+1-r-k)/2], P);

					int denom = multiply(factorials[r-k-1], factorials[2*n+1-r-k], P);
					denom = multiply(denom, factorials[k], P);

					list[r][k] = multiply(num, inverse(multiply(denom, doublefact[n], P), P), P);
				}

			}
		}

		int ans = 0;
		for (int r = 1; r <= 2*n+1; r++) {
			for (int k = real_k; k <= n; k++) {
				ans += list[r][k];
				ans %= P;
			}
		}

		ans = multiply(ans, l, P);
		ans = multiply(ans, inverse(2*n+1, P), P);

		System.out.println(ans);

	}

	public static int multiply (int a, int b, int n) {
		long ab = (long) a * (long) b;
		return ((int) (ab%n));
	}

	public static int inverse (int a, int n) {
		int m = n;
		int r1 = 1;
		int r2 = 0;
		int r3 = 0;
		int r4 = 1;
		while ((a > 0) && (n > 0)) {
			if (n >= a) {
				r3 -= r1*(n/a);
				r4 -= r2*(n/a);
				n = n%a;
			}
			else {
				int tmp = a;
				a = n;
				n = tmp;
				tmp = r1;
				r1 = r3;
				r3 = tmp;
				tmp = r2;
				r2 = r4;
				r4 = tmp;
			}
		}
		if (a == 0) {
			if (r3 >= 0)
				return (r3%m);
			else
				return (m+(r3%m));
		}
		else {
			if (r1 >= 0)
				return (r1%m);
			else
				return (m+(r1%m));
		}

	}

}
