public class Main {
    public static class Task {
        // a1 * dx + b1
        public class Pair { // p.a * deltaA + p.b + deltaB
            long a, b;
            public Pair(long a, long b) {
                this.a = a;
                this.b = b;
            }

            public long evalB() {
                return b + a * deltaA + deltaB;
            }
        }

        public boolean check(Pair a, Pair b, Pair c) { // a -> b -> c
//            long intersect1 = (c.evalB() - b.evalB()) / (b.a - c.a);
//            long intersect2 = (b.evalB() - a.evalB()) / (a.a - b.a);
//            System.err.println(a.a + " " + a.evalB());
//            System.err.println(b.a + " " + b.evalB());
//            System.err.println(c.a + " " + c.evalB());
//            System.err.println("A " + (c.evalB() - b.evalB()) * (a.a - b.a));
//            System.err.println("B " + (b.evalB() - a.evalB()) * (b.a - c.a));
            return (c.evalB() - b.evalB()) * (a.a - b.a) >= (b.evalB() - a.evalB()) * (b.a - c.a);
        }

        public boolean check2(Pair a, Pair b) {
            return a.evalB() <= b.evalB();
        }

        Pair[] convexHull;
        int idx = 0;
        long deltaA, deltaB;
        public void addPair(Pair p) {
            if (idx >= 1 && p.evalB() >= convexHull[idx - 1].evalB()) return;
//            System.err.println("Add " + p.a + " " + p.evalB());
            while (idx >= 2 && check(convexHull[idx - 2], convexHull[idx - 1], p)) {
                idx--;
            }
            convexHull[idx++] = p;
        }

        public void globalAdd(long da, long db) {
            deltaA += da;
            deltaB += db;
            while (idx >= 2 && check2(convexHull[idx - 2], convexHull[idx - 1])) {
                idx--;
            }
        }

        public void solve(Scanner sc, PrintWriter pw) throws IOException {
            convexHull = new Pair[300010];
            addPair(new Pair(0, 0));
            int n = sc.nextInt();
            int m = sc.nextInt();
            for (int i = 0; i < m; i++) {
                int t = sc.nextInt();
                if (t == 1) {
                    int k = sc.nextInt();
                    n += k;
                    idx = 0;
                    deltaA = deltaB = 0;
                    addPair(new Pair(0, 0));
                } else if (t == 2) {
                    int k = sc.nextInt();
                    Pair p = new Pair(n, 0);
                    long negB = p.evalB();
                    p.b -= negB;
                    addPair(p);
                    n += k;
                } else {
                    int b = sc.nextInt();
                    int s = sc.nextInt();
                    globalAdd(s, b);
                }
                pw.println((convexHull[idx - 1].a + 1) + " " + convexHull[idx - 1].evalB());

//                pw.print((convexHull[idx - 1].a + 1) + " " + convexHull[idx - 1].evalB() + " ----- ");
//                if (idx >= 2)
//                    pw.println((convexHull[idx - 2].a + 1) + " " + convexHull[idx - 2].evalB());
//                else
//                    pw.println();
            }
        }
    }

