import java.io.BufferedReader;
import java.io.InputStreamReader;
import java.io.PrintWriter;
import java.util.StringTokenizer;
import java.util.TreeSet;

public class E {
	static PrintWriter out = new PrintWriter(System.out);

	static long totalSize, totalM, totalB;
	public static void main(String[] args) {
		FS in = new FS();
		totalSize = in.nextLong();
		int Q = in.nextInt();

		Node last = new Node(0, 0);
		TreeSet<Node> ts = new TreeSet<Node>();

		for(int qq = 0; qq < Q; qq++) {
			int type = in.nextInt();
			if(type == 1) {
				long k = in.nextLong();
				totalSize += k;
				ts.clear();
				last = new Node(0, 0);
			}
			if(type == 2) {
				long k = in.nextLong();
				last.update();
				if(last.val > 0) {
					Node next = new Node(totalSize, 0);
					last.left = next;
					next.right = last;
					ts.add(last.calc());
					last = next;
				}
				totalSize += k;
			}
			if(type == 3) {
				long b = in.nextLong();
				long m = in.nextLong();

				totalM += m;
				totalB += b;
				while(!ts.isEmpty() && totalM >= ts.first().takeover) {
					// Node x takesover his neighbor
					Node x = ts.pollFirst();
					x.update();
					ts.remove(x.left);
					x.left.update();

					x.left = x.left.left;
					if(x.left == null) {
						last = x;
					}
					else {
						x.left.right = x;
						ts.add(x.calc());
					}

				}

			}
			last.update();

			out.println((last.index+1)+" "+last.val);
		}
		out.close();
	}

	static class Node implements Comparable<Node> {
		long index, val;
		long lastm, lastb; // vals to push
		long takeover;
		Node left, right;
		public Node(long ind, long v) {
			index = ind;
			val = v;
			lastm = totalM;
			lastb = totalB;
			takeover = -1;
		}

		void update() {
			val += (totalB-lastb) + index * (totalM - lastm);
			lastm = totalM;
			lastb = totalB;
		}

		Node calc() {
			// find when I beat the guy to the left of me
			update();
			left.update();

			long ma = (left.val - val) / (index - left.index);
			while(val + ma*index > left.val + ma*left.index) ma++;

			takeover = lastm + ma;
			return this;
		}

		@Override
		public int compareTo(Node o) {
			if(takeover != o.takeover) return Long.compare(takeover, o.takeover);
			return Long.compare(index, o.index);
		}

		@Override
		public String toString() {
			return "[id = "+index+" val = "+val+"  take = "+takeover+"]";
		}
	}

	static class FS{
		BufferedReader br;
		StringTokenizer st;
		public FS() {
			br = new BufferedReader(new InputStreamReader(System.in));
		}
		String next() {
			while(st == null || !st.hasMoreElements()) {
				try {st = new StringTokenizer(br.readLine());}
				catch(Exception e) { throw null;}
			}
			return st.nextToken();
		}
		int nextInt() { return Integer.parseInt(next());}
		double nextDouble() { return Double.parseDouble(next());}
		long nextLong() { return Long.parseLong(next());}
		int[] NIA(int n) {
			int r[] = new int[n];
			for(int i = 0; i < n; i++) r[i] = nextInt();
			return r;
		}
		long[] NLA(int n) {
			long r[] = new long[n];
			for(int i = 0; i < n; i++) r[i] = nextLong();
			return r;
		}
		char[][] grid(int r, int c){
			char res[][] = new char[r][c];
			for(int i = 0; i < r; i++) {
				char l[] = next().toCharArray();
				for(int j = 0; j < c; j++) {
					res[i][j] = l[j];
				}
			}
			return res;
		}
	}

}
