	void fwhtMod(int[] a) {
		int n = a.length;
		for (int s = 1; s < n; s <<= 1) {
			for (int i = 0; i < n; i += s << 1) {
				for (int j = i; j < i + s; j++) {
					int k = j + s;

					int v = a[j];
					int u = a[k];

					a[j] += u;
					if (a[j] >= P) {
						a[j] -= P;
					}

					a[k] = v - u;
					if (a[k] < 0) {
						a[k] += P;
					}

				}
			}
		}
	}

