			int[] tmp = new int[M];
			for (int j = 0; j < M; j++) {
				tmp[j] = nextInt();
			}

			for (int mask = 0; mask < 1 << M; mask++) {
				int idx = mask << k;
				for (int j = 0; j < M; j++) {
					if (test(mask, j)) {
						idx ^= tmp[j];
					}
				}
				// System.err.println(mask + " " + idx);
				arr[idx]++;
			}
		}

		fwhtMod(arr);

		int[][] ps = new int[1 << M][];

		for (int i = 0; i < 1 << M; i++) {
			int sum = 0;
			for (int j = 0; j < M; j++) {
				if (test(i, j)) {
					sum -= xs[j];
					if (sum < 0) {
						sum += P;
					}
				} else {
					sum += xs[j];
					if (sum >= P) {
						sum -= P;
					}
				}

			}
			ps[i] = pows(sum, n);
		}

		int i2m = 1;
		for (int i = 0; i < M; i++) {
