public class cfGlobal2H {

	static final int P = 998244353;
	static final int INV2 = (P + 1) / 2;

	void fwhtJust(int[] a) {
		int n = a.length;
		for (int s = 1; s < n; s <<= 1) {
			for (int i = 0; i < n; i += s << 1) {
				for (int j = i; j < i + s; j++) {
					int k = j + s;

					int v = a[j];
					int u = a[k];

					a[j] += u;
//					if (a[j] >= P) {
//						a[j] -= P;
//					}

					a[k] = v - u;
//					if (a[k] < 0) {
//						a[k] += P;
//					}

				}
			}
		}
	}

	void fwhtMod(int[] a) {
		int n = a.length;
		for (int s = 1; s < n; s <<= 1) {
			for (int i = 0; i < n; i += s << 1) {
				for (int j = i; j < i + s; j++) {
					int k = j + s;

					int v = a[j];
					int u = a[k];

					a[j] += u;
					if (a[j] >= P) {
						a[j] -= P;
					}

					a[k] = v - u;
					if (a[k] < 0) {
						a[k] += P;
					}

				}
			}
		}
	}

	void submit() {
		int n = nextInt();
		int k = nextInt();

		long x = nextInt();
		long y = nextInt();
		long z = nextInt();

		int[] m1 = new int[n];
		int[] m2 = new int[n];

		int xorAll = 0;

		for (int i = 0; i < n; i++) {
			int a = nextInt();
			int b = nextInt();
			int c = nextInt();
			xorAll ^= a;
			m1[i] = a ^ b;
			m2[i] = a ^ c;
		}

		int[] justB = new int[1 << k];
		int[] justC = new int[1 << k];
		int[] justXor = new int[1 << k];
		for (int i = 0; i < n; i++) {
			justB[m1[i]]++;
			justC[m2[i]]++;
			justXor[m1[i] ^ m2[i]]++;
		}

		fwhtJust(justB);
		fwhtJust(justC);
		fwhtJust(justXor);

		int[][] ps = { pows(f(x + y + z), n), pows(f(x - y + z), n),
				pows(f(x + y - z), n), pows(f(x - y - z), n) };

		int[] arr = new int[1 << k];
		for (int i = 0; i < 1 << k; i++) {
			int[] xs = solve(n, justB[i], justC[i], justXor[i]);
			arr[i] = 1;
			for (int j = 0; j < 4; j++) {
				arr[i] = (int) ((long) arr[i] * ps[j][xs[j]] % P);
			}
		}

		fwhtMod(arr);

		long inv2k = 1;
		for (int i = 0; i < k; i++) {
			inv2k = inv2k * INV2 % P;
		}

		for (int i = 0; i < arr.length; i++) {
			out.print(arr[i ^ xorAll] * inv2k % P + " ");
		}
		out.println();
	}

	int[] solve(int all, int yw, int zw, int yz) {
		yw = (all - yw) / 2;
		zw = (all - zw) / 2;
		yz = (all - yz) / 2;

		int yzw = (yw + zw + yz) / 2;
		int y = yzw - zw;
		int z = yzw - yw;
		int w = yzw - yz;

		int x = all - y - z - w;
		return new int[] { x, y, z, w };
	}

