public class magicship {
 static long dx,dy;
 static int x1,y1,x2,y2;
 public static void main(String[] args) {
  Scanner scan=new Scanner(System.in);
  x1=scan.nextInt();
  y1=scan.nextInt();
  x2=scan.nextInt();
  y2=scan.nextInt();
  int n=scan.nextInt();
  char[] s=scan.next().toCharArray();
  dx=0L;dy=0L;
  for(int i=0;i<n;i++) {
   if(s[i]=='U') dy++;
   if(s[i]=='D') dy--;
   if(s[i]=='R') dx++;
   if(s[i]=='L') dx--;
  }
  long lo=0, hi=(long)1e18;
  while(hi>=lo) {
   long mid=(hi+lo)/2;
   if(!good(mid,s)) lo=mid+1;
   else hi=mid-1;
  }
  if(lo>=1e15) System.out.println(-1);
  else System.out.println(lo);
 }
 public static boolean good(long test, char[] s) {
  long full=test/s.length;
  long posx=x1+dx*full, posy=y1+dy*full;
  for(int id=0;;id++) {
   if(full*s.length+id==test) break;
   if(s[id]=='U') posy++;
   if(s[id]=='D') posy--;
   if(s[id]=='L') posx--;
   if(s[id]=='R') posx++;

  }
  return Math.abs(posx-x2)+Math.abs(posy-y2)<=test;
 }
