import java.util.*;
import java.io.*;

public class magic_ship {

	public static void main(String[] args)
	{
		Scanner sc =new Scanner(System.in);

			long x1=sc.nextLong();
			long y1=sc.nextLong();
			long x2=sc.nextLong();
			long y2=sc.nextLong();
			int n=sc.nextInt();
			String s=sc.next();int l=0,u=0,d=0,r=0;
			for(int i=0;i<s.length();i++)
			{
				if(s.charAt(i)=='L')
					l++;
				if(s.charAt(i)=='U')
					u++;
				if(s.charAt(i)=='D')
					d++;
				if(s.charAt(i)=='R')
					r++;
			}
			long x=r-l;
			long y=u-d;

			long beg=1;
			long last=(long)Math.pow(10,14);

			if(CalDist(last,x,y,x1,y1,x2,y2,s)==-1)
			{
				System.out.println("-1");
				return;
			}
			long mid=0;int v;
			while(beg<=last)
			{
              	if(mid==(beg+last)/2)
                	break;
				mid=(beg+last)/2;
				v=CalDist(mid,x,y,x1,y1,x2,y2,s);
				if(v==1)
				{
					last=mid;
				}
				else
				{
					beg=mid+1;
				}

			}
			System.out.println(mid);

	}
	static int CalDist(long dist,long x,long y,long x1,long y1,long x2,long y2,String s)
	{
      	int n=s.length();
		long k=dist/n;
		x1=x1+k*(x);
		y1=y1+k*(y);
		long m=dist%n;
		for(int i=0;i<m;i++)
			{
				if(s.charAt(i)=='L')
					x1--;
				if(s.charAt(i)=='U')
					y1++;
				if(s.charAt(i)=='D')
					y1--;
				if(s.charAt(i)=='R')
					x1++;
			}


		long v=(Math.abs(x2-x1)+Math.abs(y2-y1));
		if(v<=dist)
			return 1;
		else
			return -1;
	} 

}
