        for (int i = 0; i < s.length(); i++) {
            char d = s.charAt(i);
            if (d == 'U') {
                cy += 1;
            } else if (d == 'D') {
                cy -= 1;
            } else if (d == 'L') {
                cx -= 1;
            } else cx += 1;
            posWindOnly[i+1] = new long[2];
            posWindOnly[i+1][0] = cx; posWindOnly[i+1][1] = cy;
        }
        long lo = 1, hi = (long)1e18, ans = -1;
