            long mid = lo+(hi-lo)/2;
            long x = x1+posWindOnly[(int)(mid%n)][0]+(mid/n)*posWindOnly[n][0];
            long y = y1+posWindOnly[(int)(mid%n)][1]+(mid/n)*posWindOnly[n][1];
            long d = Math.abs(x2-x)+Math.abs(y2-y);
            if (d <= mid) {
                ans = mid; hi = mid-1;
            } else lo = mid+1;
        }
        System.out.println(ans);
    }
}
