    class NTT{
        private int MAGIC = 8;
        long root, mod;
        public NTT(long m){
            mod = m;
            long[] s = pFact();
            for(root = 3; true; root++){
                boolean f = true;
                for(long x:s)if(pow(root, (mod-1)/x) == 1)f = false;
                if(f)break;
            }
