import java.util.*;

public class numerical_sequence_easy {

	public static void main(String[] args) throws Exception {

		BufferedReader in = new BufferedReader(new InputStreamReader(System.in));

        int q = Integer.parseInt(in.readLine());
        while (q-- > 0) {
            long k = Long.parseLong(in.readLine()) - 1;
            solve(k);
        }
    }

	static long checksum(long mid) {
        if (mid == 0) {
            return 0;
        }

        int l = Long.toString(mid).length();
        long count = 0;
        for (int i = 1; i < l; i++) {
            long p = (long) (Math.pow(10, i) - Math.pow(10, i - 1));
            long t1 = i * ((p * (p + 1)) / 2);

            long t2 = (long) (Math.pow(10, i) - Math.pow(10, i - 1)) * i * (mid - ((long) Math.pow(10, i) - 1));

            count += t1 + t2;
        }
        long p = mid - (long) Math.pow(10, l - 1) + 1;
        count += l * ((p * (p + 1)) / 2);
        return count;
    }

    static void solve(long k) {
        long l = 0;
        long r = 1000_000_000L;
        while (l < r) {
            long mid = (l + r) / 2;
            if (k >= checksum(mid)) {
                l = mid + 1;
            } else {
                r = mid;
            }
        }

        k -= checksum(l - 1);
        for (int i = 1; i <= l; i++) {
            String x = Long.toString(i);
            if (k >= x.length()) {
            	k -= x.length();
            } else {
                System.out.println(x.charAt((int) k));
                return;
            }
        }
    }

}
