    BufferedReader f = new BufferedReader(new InputStreamReader(System.in));
    int ttttt = Integer.parseInt(f.readLine());
    for(int aaa = 0; aaa < ttttt; aaa++){
        StringTokenizer s = new StringTokenizer(f.readLine());
        int N = Integer.parseInt(s.nextToken());
        int a = Integer.parseInt(s.nextToken());
        int b = Integer.parseInt(s.nextToken());
        String str = "0" + f.readLine();
        long[][] dp = new long[N + 10][2];
        for(int i = 0; i <= N; i++){
            Arrays.fill(dp[i], Long.MAX_VALUE/2);
        }

        dp[0][1] = Long.MAX_VALUE/2;
        dp[0][0] = b;
        for(int i = 1; i <= N; i++){
            if(str.charAt(i) == '1'){
                dp[i][1] = Math.min(dp[i][1], dp[i - 1][1] + a + b * 2);
            }else{
                dp[i][0] = Math.min(dp[i][0], Math.min(dp[i - 1][0] + a + b, dp[i - 1][1] + 2 * a + b));
                dp[i][1] = Math.min(dp[i][1], Math.min(dp[i - 1][0] + 2 * a + 2 * b, dp[i - 1][1] + a + b * 2));
            }
        }
        System.out.println(dp[N][0]);
    }
  }
