            }
            r += a[i].change;
        }
        for (int i = 0; i < indexB; i++) {
            if (b[i].need > r) {
                System.out.println("NO");
                return;
            }
            r += b[i].change;
        }
        if (r >= 0) {
            System.out.println("YES");
        } else {
            System.out.println("NO");
        }

    }
}

