	static int dp(int i,int rating) {
		if(rating<0)return -10000000;
		if(i>=neg.size())return 0;
		if(memo[i][rating]!=-1)return memo[i][rating];

		int leave=dp(i+1,rating);
		int take=rating>=neg.get(i)[0]?(1+dp(i+1,rating+neg.get(i)[1])):-10000000;

		return memo[i][rating]=Math.max(leave, take);
	}
