public class Main
{
	PrintWriter out = new PrintWriter(System.out);
	BufferedReader in = new BufferedReader(new InputStreamReader(System.in));
    StringTokenizer tok = new StringTokenizer("");
    String next() throws IOException {
        if (!tok.hasMoreTokens()) { tok = new StringTokenizer(in.readLine()); }
        return tok.nextToken();
    }
    int ni() throws IOException { return Integer.parseInt(next()); }
    long nl() throws IOException { return Long.parseLong(next()); }

    long mod=1000000007;
    long[][]A,D;
    int n;

    void solve() throws IOException {
        n=ni();
        A=new long[n][7];
        D=new long[n][10];
        for (int i=0;i<n;i++) {
            Arrays.fill(D[i],-1);
            int k=ni();
            ArrayList<Integer>B=new ArrayList();
            int m2=0;
            int m3=0;
            for (int j=0;j<k;j++) {
                int u=ni(),v=ni();
                if (u==1) B.add(v);
                if (u==2) m2=Math.max(m2,v);
                if (u==3) m3=Math.max(m3,v);
            }
            Collections.sort(B,Collections.reverseOrder());
            A[i][1]=Math.max(m3,Math.max(m2,B.size()==0?0:B.get(0)));
            A[i][4]=A[i][1];
            if (B.size()==0 || B.size()==1 && m2==0) A[i][2]=-1;
            else {
                A[i][2]=(long)B.get(0)+Math.max(m2,B.size()==1?0:B.get(1));
                A[i][5]=Math.max(B.get(0),m2);
            }
            if (B.size()<3) A[i][3]=-1;
            else {
                A[i][3]=(long)B.get(0)+B.get(1)+B.get(2);
                A[i][6]=B.get(0);
            }
        }

        out.println(solve(0,0));
        out.flush();
    }

    long solve(int u,int m) {
        if (u==n) return 0;
        if (D[u][m]>-1) return D[u][m];

        long ret=solve(u+1,m);
        ret=Math.max(ret,solve(u+1,(m+1)%10)+A[u][1]+(m==9?A[u][4]:0));
        if (A[u][2]>-1) ret=Math.max(ret,solve(u+1,(m+2)%10)+A[u][2]+(m>=8?A[u][5]:0));
        if (A[u][3]>-1) ret=Math.max(ret,solve(u+1,(m+3)%10)+A[u][3]+(m>=7?A[u][6]:0));

        return D[u][m]=ret;
    }

    int gcd(int a,int b) { return(b==0?a:gcd(b,a%b)); }
    long gcd(long a,long b) { return(b==0?a:gcd(b,a%b)); }
    long mp(long a,long p) { long r=1; while(p>0) { if ((p&1)==1) r=(r*a)%mod; p>>=1; a=(a*a)%mod; } return r; }

    public static void main(String[] args) throws IOException {
        new Main().solve();
    }
