    static void solve(Scanner in, PrintWriter out){
        int n = in.nextInt();
        long[][][] dp = new long[n][4][4];
        for(int i = 0; i < n; i++){
            int k = in.nextInt();
            List<Integer>[] lss = new List[4];
            for (int j = 0; j < 4; j++) {
                lss[j] = new ArrayList<>();
            }
            for (int j = 0; j < k; j++) {
                int l = in.nextInt(), r = in.nextInt();
                lss[l].add(r);
            }
            for (int j = 1; j < 4; j++) {
                Collections.sort(lss[j]);
            }
            for (int j = 1; j <= 3; j++) {
                for (int l = 0; l <= 1; l++) { // l = 0 means no double, else it means at lth position, this value should be doubled
                    if (j == 1){
                        long v1 = Integer.MIN_VALUE, v2 = Integer.MIN_VALUE, v3 = Integer.MIN_VALUE;
                        if (lss[1].size() > 0) v1 = lss[1].get(lss[1].size() - 1);
                        if (lss[2].size() > 0) v2 = lss[2].get(lss[2].size() - 1);
                        if (lss[3].size() > 0) v3 = lss[3].get(lss[3].size() - 1);
                        long mx = Math.max(v1, Math.max(v2, v3));
                        if (l == j){
                            dp[i][j][l] = 2l * mx;
                        }else{
                            dp[i][j][l] = mx;
                        }
                    }else if (j == 2){
                        long mx = 0;
                        if (lss[1].size() > 0 && lss[2].size() > 0){
                            long v1 = lss[1].get(lss[1].size() - 1), v2 = lss[2].get(lss[2].size() - 1);
                            if (l == 0){
                                mx = v1 + v2;
                            }else{
                                mx = Math.max(v1, v2) * 2 + Math.min(v1, v2);
                            }
                        }
                        long st = 0;
                        if (lss[1].size() > 1){
                            long v11 = lss[1].get(lss[1].size() - 1), v12 = lss[1].get(lss[1].size() - 2);
                            if (l == 0){
                                st = v11 + v12;
                            }else{
                                st = Math.max(v11, v12) * 2l + Math.min(v11, v12);
                            }
                        }
                        dp[i][j][l] = Math.max(mx, st);
                    }else{
                        if (lss[1].size() > 2){
                            int v11 = lss[1].get(lss[1].size() - 1), v12 = lss[1].get(lss[1].size() - 2), v13 = lss[1].get(lss[1].size() - 3);
                            long[] arr = new long[]{v11, v12, v13};
                            Arrays.sort(arr);
                            if (l == 0){
                                dp[i][j][l] = arr[0] + arr[1] + arr[2];
                            }else{
                                dp[i][j][l] = arr[0] + arr[1] + arr[2] * 2l;
                            }
                        }
                    }
                }
            }
        }
        long[][] dpp = new long[n + 1][11];
        for (int i = 0; i < dpp.length; i++) {
            Arrays.fill(dpp[i], -1);
        }
        out.println(dfs(0, 0, dpp, dp, n));
    }

    static long dfs(int idx, int count, long[][] dp, long[][][] helper, int n){
        if (idx == n) return 0;
        if (dp[idx][count] != -1) return dp[idx][count];
        long res = dfs(idx + 1, count, dp, helper, n);
        for (int i = 1; i <= 3; i++) {
            if (i + count >= 10 && helper[idx][i][1] > 0){
                res = Math.max(res, dfs(idx + 1, (count + i) % 10, dp, helper, n) + helper[idx][i][1]);
            }
            if (i + count < 10 && helper[idx][i][0] > 0){
                res = Math.max(res, dfs(idx + 1, count + i, dp, helper, n) + helper[idx][i][0]);
            }
        }
        return dp[idx][count] = res;
    }
}
