class dsu {
    int parent[];
    dsu(int n) {
        parent = new int [n];
        for(int i = 0;i < n;i++) parent[i] = i;
    }
    int get(int a) {
        int p = a;
        while(a != parent[a]) a = parent[a];
        while(a != p) {
            int t = parent[p];
            parent[p] = a;
            p = t;
        }
        return a;
    }
    void union(int a, int b) {
        parent[get(a)] = get(b);
    }
