        }

        public HashSet<Integer> getSet(int v) {
            v = getRoot(v);
            if (!sets.containsKey(v)) {
                sets.put(v, new HashSet<>());
            }
            return sets.get(v);
        }

        public int getRoot(int i) {
            if (parent.getOrDefault(i, i) != i) {
                int root = getRoot(parent.getOrDefault(i, i));
                parent.put(i, root);
            }
            return parent.getOrDefault(i, i);
        }

        public void union(int i, int j) {
