public class Main{
	static int[] kmpPreprocess(int m,char[]P) {
		int[]b=new int[m+1];
		int i = 0, j = -1; b[0] = -1;
		while (i < m) {
			while (j >= 0 && P[i] != P[j]) j = b[j];
			i++; j++;
			b[i] = j;
		} 
		return b;
	}

	static byte[][] kmp(int m,char[]P,int[]b) {
		byte[][]nxt=new byte[m+1][26];
		for(int idx=0;idx<=m;idx++) {
			for(int c=0;c<26;c++) {
				if(idx==0) {
					nxt[idx][c]=(byte)((P[idx]-'a')==c?1:0);
				}
				else {
					if(idx==m) {
						nxt[idx][c]=nxt[b[idx]][c];
					}
					else {
						nxt[idx][c]=(byte)((P[idx]-'a')==c?(idx+1):nxt[b[idx]][c]);
					}
				}
			}

		}
		return nxt;
	}
	static char[]in,s,t;
	static byte[][]nxtS,nxtT;
	static Integer[][][]memo;
	static int match(byte idxs,byte idxt) {
		return (idxs==s.length?1:0)-(idxt==t.length?1:0);
	}
	static int dp(int i,byte idxs,byte idxt) {
		if(i>=in.length)return match(idxs, idxt);
		if(memo[i][idxs][idxt]!=null)return memo[i][idxs][idxt];
		if(in[i]!='*') {
			return memo[i][idxs][idxt]=dp(i+1, nxtS[idxs][in[i]-'a'], nxtT[idxt][in[i]-'a'])+match(idxs, idxt);
		}
		int ans=-1001;
		for(int c=0;c<26;c++) {
			ans=Math.max(ans, match(idxs, idxt)+dp(i+1, nxtS[idxs][c], nxtT[idxt][c]));
		}
		return memo[i][idxs][idxt]=ans;
	}
