        }

        int last = 0;
        StringBuilder moves = new StringBuilder();
        int res = 0;
        int left = 0;
        int right = n - 1;
        while(left <= right) {
            if(a[left] > last && a[left] < a[right]) {
                last = a[left++];
                moves.append("L");
            } else if (a[right] > last) {
                last = a[right--];
                moves.append("R");
            } else if(a[left] > last) {
                last = a[left++];
                moves.append("L");
            } else {
                break;
            }
            res++;
        }

        System.out.println(res);
        System.out.println(moves.toString());
    }
