import java.util.*;
public class Sol{
	static class pair {
		int pot;
		int club;
		public pair(int pot, int club) {
			this.pot = pot;
			this.club = club;
		}
	}
	public static int n,m,d;
	public static int p[];
	public static int c[];
	public static int q[];
	public static int match[];
	public static int mex[];
	public static boolean tested[];
	public static List<Integer> adj[];
	public static boolean used[];
	public static void main(String[] args) throws IOException{
		FastIO sc = new FastIO(System.in);
		PrintWriter out = new PrintWriter(System.out);
		n = sc.nextInt();
		m = sc.nextInt();
		match = new int[m];
		p = new int[n];
		c = new int[n];
		tested = new boolean[n];
		used = new boolean[n];
		Arrays.fill(match, -1);
		adj = new ArrayList[5000];
		for(int i=0; i<5000; ++i) {
			adj[i] = new ArrayList<>();
		}
		for(int i=0; i<n; ++i) {
			p[i] = sc.nextInt();
		}
		for(int i=0; i<n; ++i) {
			c[i] = sc.nextInt()-1;
		}
		d = sc.nextInt();
		q = new int[d];
		mex = new int[d];
		for(int i=0; i<d; ++i) {
			q[d-i-1] = sc.nextInt()-1;
			used[q[d-i-1]] = true;
		}
		for(int i=0; i<n; ++i) {
			if(used[i]) continue;
			adj[p[i]].add(c[i]);
		}
		int idx = 0;
		while(augpath(idx)) {
			Arrays.fill(tested, false);
			idx++;
		}
		Arrays.fill(tested, false);
		/*for(int i=0; i<m; ++i) {
			System.out.println(match[i] + " matcgh");
		}*/
		mex[0] = idx;
		for(int i=0; i<d-1; ++i) {
			adj[p[q[i]]].add(c[q[i]]);
			while(augpath(idx)) {
				Arrays.fill(tested, false);
				idx++;
			}
			Arrays.fill(tested, false);
			/*for(int j=0; j<m; ++j) {
				System.out.println(match[j] + " matcgh");
			}*/
			mex[i+1] = idx;
		}
		for(int i=0; i<d; ++i) {
			out.println(mex[d-i-1]);
		}
		out.close();
	}
	public static boolean augpath(int curr) {
		if(curr>n) return false;
		if(tested[curr]) return false;
		tested[curr] = true;
		for(int i : adj[curr]) {
			int nxt = match[i];
			if(nxt==-1) {
				match[i] = curr;
				return true;
			}
			match[i] = curr;
			if(augpath(nxt)) {
				return true;
			}
			match[i] = nxt;
		}
		return false;
	}
	static class FastIO {

		// Is your Fast I/O being bad?

		InputStream dis;
		byte[] buffer = new byte[1 << 17];
		int pointer = 0;

		public FastIO(String fileName) throws IOException {
			dis = new FileInputStream(fileName);
		}

		public FastIO(InputStream is) throws IOException {
			dis = is;
		}

		int nextInt() throws IOException {
			int ret = 0;

			byte b;
			do {
				b = nextByte();
			} while (b <= ' ');
			boolean negative = false;
			if (b == '-') {
				negative = true;
				b = nextByte();
			}
			while (b >= '0' && b <= '9') {
				ret = 10 * ret + b - '0';
				b = nextByte();
			}

			return (negative) ? -ret : ret;
		}

		long nextLong() throws IOException {
			long ret = 0;

			byte b;
			do {
				b = nextByte();
			} while (b <= ' ');
			boolean negative = false;
			if (b == '-') {
				negative = true;
				b = nextByte();
			}
			while (b >= '0' && b <= '9') {
				ret = 10 * ret + b - '0';
				b = nextByte();
			}

			return (negative) ? -ret : ret;
		}

		byte nextByte() throws IOException {
			if (pointer == buffer.length) {
				dis.read(buffer, 0, buffer.length);
				pointer = 0;
			}
			return buffer[pointer++];
		}

		String next() throws IOException {
			StringBuffer ret = new StringBuffer();

			byte b;
			do {
				b = nextByte();
			} while (b <= ' ');
			while (b > ' ') {
				ret.appendCodePoint(b);
				b = nextByte();
			}

			return ret.toString();
		}

	}
},"flows,graph matchings,graphs"

import java.util.*;
import static java.lang.Math.*;

public class SolutionE {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);

        int n = sc.nextInt();
        int m = sc.nextInt();

        int deg[] = new int[m];
        int p[] = new int[n];
        for(int i = 0; i < n; ++i) {
            p[i] = sc.nextInt();
            if(p[i] < m)
                deg[p[i]]++;
        }

        int c[] = new int[n];
        for(int i = 0; i < n; ++i)
            c[i] = sc.nextInt();

        int q = sc.nextInt();
        int qind[] = new int[q];
        int vis[] = new int[n];
        for(int i = 0; i < q; ++i) {
            qind[i] = sc.nextInt() - 1;
            vis[qind[i]] = 1;
        }

        Kunh kunh = new Kunh(2 * m, deg);
        for(int i = 0; i < n; ++i) {    
            if(vis[i] == 0) {
                if(p[i] < m) 
                    kunh.addEdge(p[i], m + c[i] - 1);
            }
        }
        int ans = 0;
        while(ans < m && kunh.addFlow(ans)) 
            ans++;

        int fans[] = new int[q];
        for(int i = q - 1; i >= 0; --i) {
            fans[i] = ans;

            int ind = qind[i];

            if(p[ind] < m) {
                kunh.addEdge(p[ind], m + c[ind] - 1);
            }

            while(ans < m && kunh.addFlow(ans))
                ans++;
        }

        for(int i : fans)
            System.out.println(i);
    }
}
class Kunh {
    int pair[];
    int adj[][];
    int ptr[];
    int vis[];
    int level = 0;
    Kunh(int n, int deg[]) {
        pair = new int[n];
        Arrays.fill(pair, -1);
        adj = new int[n / 2][];
        for(int i = 0; i < n / 2; ++i) {
            adj[i] = new int[deg[i]];
        }
        ptr = new int[n / 2];
        vis = new int[n / 2];
    }
    void addEdge(int i, int j) {
        adj[i][ptr[i]++] = j;
    }
    boolean addFlow(int source) {
        level++;
        return dfs(source);
    }
    boolean dfs(int i) {
        vis[i] = level;

        for(int k = 0; k < ptr[i]; ++k) {
            int j = adj[i][k];
            if(pair[j] == -1) {
                pair[j] = i;
                return true;
            }
            else if(vis[pair[j]] != level && dfs(pair[j])) {
                pair[j] = i;
                return true;
            }
        }

        return false;
    }
},"flows,graph matchings,graphs"

