/**
 * Built using CHelper plug-in
 * Actual solution is at the top
 */
public class Main {
    public static void main(String[] args) {
        InputStream inputStream = System.in;
        OutputStream outputStream = System.out;
        InputReader in = new InputReader(inputStream);
        PrintWriter out = new PrintWriter(outputStream);
        TrainCar solver = new TrainCar();
        solver.solve(1, in, out);
        out.close();
    }

    static class TrainCar {
        public void solve(int testNumber, InputReader in, PrintWriter out) {
            int N = in.nextInt();
            int M = in.nextInt();
            MaintainMin min = new MaintainMin(N);
            while (M-- > 0) {
                int a = in.nextInt();
                if (a == 1) {
                    min.addFront(in.nextInt());
                } else if (a == 2) {
                    min.addBack(in.nextInt());
                } else {
                    min.inc(in.nextInt(), in.nextInt());
                }
                out.println(min.getIndex() + " " + min.getVal());
            }
        }

        long xIntersect(long[] a, long[] b) {
            return Math.floorDiv(a[3] - b[3] - 1, (b[2] - a[2]));
        }

        class Node {
            Node next;
            long[] line;

            Node(long[] line) {
                this.line = line;
            }

        }

        class MaintainMin {
            Node first;
            Node cur;
            long bSum = 0;
            long sSum = 0;
            int N;

            MaintainMin(int N) {
                this.N = N;
                first = new Node(new long[]{-Long.MAX_VALUE, Long.MAX_VALUE, 0, -bSum});
                cur = first;
            }

            void addFront(int k) {
                first = new Node(new long[]{Long.MAX_VALUE, Long.MAX_VALUE, 0, -bSum});
                cur = first;
                N += k;
            }

            void addBack(int k) {
                long[] next = new long[]{Long.MIN_VALUE, 0, N, -bSum - N * sSum};
                N += k;
                upd(first, next);
            }

            void inc(long b, long s) {
                bSum += b;
                sSum += s;
                while (cur.line[1] < sSum) {
                    cur = cur.next;
                }
            }

            long getIndex() {
                return cur.line[2] + 1;
            }

            long getVal() {
                return (cur.line[2] * sSum + cur.line[3] + bSum);
            }

            void upd(Node u, long[] next) {
                long x = xIntersect(u.line, next);
                if (x >= u.line[1]) {
                    upd(u.next, next);
                } else {
                    next[1] = x;
                    first = new Node(next);
                    u.line[0] = x + 1;
                    first.next = u;
                    if (sSum <= first.line[1]) {
                        cur = first;
                    }
                }
            }

        }

    }

    static class InputReader {
        public BufferedReader reader;
        public StringTokenizer tokenizer;

        public InputReader(InputStream stream) {
            reader = new BufferedReader(new InputStreamReader(stream), 32768);
            tokenizer = null;
        }

        public String next() {
            while (tokenizer == null || !tokenizer.hasMoreTokens()) {
                try {
                    tokenizer = new StringTokenizer(reader.readLine());
                } catch (IOException e) {
                    throw new RuntimeException(e);
                }
            }
            return tokenizer.nextToken();
        }

        public int nextInt() {
            return Integer.parseInt(next());
        }

    }
}

