 public static boolean good(long test, char[] s) {
  long full=test/s.length;
  long posx=x1+dx*full, posy=y1+dy*full;
  for(int id=0;;id++) {
   if(full*s.length+id==test) break;
   if(s[id]=='U') posy++;
   if(s[id]=='D') posy--;
   if(s[id]=='L') posx--;
   if(s[id]=='R') posx++;

  }
  return Math.abs(posx-x2)+Math.abs(posy-y2)<=test;
 }
