    static long[][] posWindOnly;
    public static void main(String[] args) {
        Scanner in = new Scanner(System.in);
        x1 = in.nextInt(); y1 = in.nextInt(); in.nextLine();
        x2 = in.nextInt(); y2 = in.nextInt(); in.nextLine();
        if (x1==x2&&y1==y2) {
            System.out.println(0); return;
        }
        n = in.nextInt(); in.nextLine();
        s = in.nextLine();
        posWindOnly = new long[s.length()+1][2];
        posWindOnly[0] = new long[]{0L, 0L};
        int cx = 0, cy = 0;
        for (int i = 0; i < s.length(); i++) {
            char d = s.charAt(i);
            if (d == 'U') {
                cy += 1;
            } else if (d == 'D') {
                cy -= 1;
            } else if (d == 'L') {
                cx -= 1;
            } else cx += 1;
            posWindOnly[i+1] = new long[2];
            posWindOnly[i+1][0] = cx; posWindOnly[i+1][1] = cy;
        }
        long lo = 1, hi = (long)1e18, ans = -1;
        while (lo <= hi) {
            long mid = lo+(hi-lo)/2;
            long x = x1+posWindOnly[(int)(mid%n)][0]+(mid/n)*posWindOnly[n][0];
            long y = y1+posWindOnly[(int)(mid%n)][1]+(mid/n)*posWindOnly[n][1];
            long d = Math.abs(x2-x)+Math.abs(y2-y);
            if (d <= mid) {
                ans = mid; hi = mid-1;
            } else lo = mid+1;
        }
        System.out.println(ans);
    }
}
