		PW = new PrintWriter(System.out);

		int Sum[] = new int[500];
		int Sn = 0;
		for(int i = 0; ; i++) {
			Sum[i] = i * (i + 1) / 2;
			if(Sum[i] > 1e5) {
				Sn = i; break;
			}
		}


		ArrayList<Integer> ans[] = new ArrayList[500];

		int T = nextInt();
		while(T-- > 0) {
			int n = nextInt();
			int k = Arrays.binarySearch(Sum, 0, Sn, n);
			if(k < 0) k = - k - 2;
//			PW.println(k);

			int[] a = new int[n];
			for(int i = 0; i < n; i++)
				a[i] = nextInt();

			int[] b = new int[n];
			int[] pre = new int[n];
			ArrayList<Integer> path[] = new ArrayList[n];

			int m = 0;
			while(n > 0) {

				int n1 = 0;
				for(int i = 0; i < n; i++) {
					int t = Arrays.binarySearch(b, 0, n1, a[i]);
					t = -t-1;
					b[t] = a[i];
					if(t == 0) pre[i] = -1;
					else pre[i] = b[t-1];

					if(t == n1) {
						path[n1] = new ArrayList<>();
						n1++;
					}
					path[t].add(a[i]);
				}

//				PW.println("n = " + n + " n1 = " + n1);
				if(n1 > k) {
					int x = b[n1-1];
					for(int i = n - 1; i >= 0; i--) {
						if(a[i] == x) {
							x = pre[i];
							pre[i] = -100;
						}
					}

					ans[m] = new ArrayList<>();
					int n2 = 0;
					for(int i = 0; i < n; i++) {
						if(pre[i] == -100) ans[m].add(a[i]);
						else a[n2++] = a[i];
					}
					n = n2; m++; k--;
				} else {
					n = 0;
					for(int i = 0; i < n1; i++) ans[m+i] = path[i];
					m += n1;
				}
			}

			PW.println(m);
			for(int i = 0; i < m; i++) {
				PW.print(ans[i].size());
				for(int x : ans[i]) PW.print(" " + x);
				PW.println();
			}
		}

		PW.close();
	}

