// Created by @thesupremeone on 22/05/21
public class BerOSFileSuggestion {
    HashSet<String> getAllSubstrings(String s){
        HashSet<String> set = new HashSet<>();
        for (int start = 0; start < s.length(); start++) {
            for (int end = start; end < s.length(); end++) {
                set.add(s.substring(start, end+1));
            }
        }
        return set;
    }

    static class Res{
        int index;
        int freq;
        public Res(int index, int freq) {
            this.freq = freq;
            this.index = index;
        }
    }

    void solve() throws IOException {
        int n = getInt();
        String[] files = new String[n];
        HashMap<String, Res> map = new HashMap<>();
        for (int i = 0; i < n; i++) {
            files[i] = getLine();
            HashSet<String> set = getAllSubstrings(files[i]);
            for(String s : set){
                Res res;
                if(map.containsKey(s)){
                    res = map.get(s);
                }else {
                    res = new Res(i, 0);
                    map.put(s, res);
                }
                res.freq++;
            }
        }
        int q = getInt();
        for (int i = 0; i < q; i++) {
            String query = getLine();
            Res res = map.get(query);
            if(res==null){
                println("0 -");
            }else {
                println(res.freq+" "+files[res.index]);
            }
        }
    }

    public static void main(String[] args) throws Exception {
        if (isOnlineJudge()) {
