public class I {
	public static void main(String[] args) throws NumberFormatException, IOException {
		Scanner sc = new Scanner();
		int T = sc.nextInt();
		PrintWriter out = new PrintWriter(System.out);
		long[] arr = new long[(int) 1e7];
		long oo = Long.MAX_VALUE;
		while (T-- > 0) {
			int n = sc.nextInt();
			l = sc.nextInt();
			r = sc.nextInt();
			x = sc.nextLong();
			y = sc.nextLong();
			z = sc.nextLong();
			long len = r + 0L - l + 1;
			long b1 = sc.nextLong(), b2 = sc.nextLong();
			arr[0] = (b1 % len) + l;
			arr[1] = (b2 % len) + l;
			for (int i = 2; i < n; i++) {
				long b = add(add(mult(b1, x), mult(b2, y)), z);
				b1 = b2;
				b2 = b;
				arr[i] = (b % len) + l;
			}
			long min = arr[0];
			long global = oo;
			for (int i = 1; i < n; ++i) {
				if (arr[i] <= min) {
					min = arr[i];
					continue;
				}
				global = Math.min(global, min * arr[i]);
//				min = Math.min(arr[i], min);
			}

			long max = arr[n - 1];
			for (int i = n - 2; i >= 0; --i) {
				if (arr[i] >= max) {
					max = arr[i];
					continue;
				}
				global = Math.min(global, max * arr[i]);
//				max = Math.max(max, arr[i]);
			}
			out.println(global == oo ? "IMPOSSIBLE" : global);
		}
		out.close();

	}

	static long MOD = (1l << 32) - 1;

	static long x, y, z;
	static int l, r;

	static long mult(long b, long x) {
		long h = x / 4;
		long one = (b * h) & MOD;
		one *= 3;
		long two = b * (x - 3 * h);
		return add(one & MOD, two & MOD);
	}

	static long add(long a, long b) {
		return (a + b) & MOD;
	}

	static class Scanner {
		BufferedReader br;
		StringTokenizer st;

		Scanner() {
			br = new BufferedReader(new InputStreamReader(System.in));
		}

		String next() throws IOException {
			while (st == null || !st.hasMoreTokens())
				st = new StringTokenizer(br.readLine());
			return st.nextToken();
		}

		int nextInt() throws NumberFormatException, IOException {
			return Integer.parseInt(next());
		}

		long nextLong() throws IOException, NumberFormatException {
			return Long.parseLong(next());
		}
