// Created by @thesupremeone on 22/05/21
public class BerOSFileSuggestion {
    HashSet<String> getAllSubstrings(String s){
        HashSet<String> set = new HashSet<>();
        for (int start = 0; start < s.length(); start++) {
            for (int end = start; end < s.length(); end++) {
                set.add(s.substring(start, end+1));
            }
        }
        return set;
    }

    static class Res{
        int index;
        int freq;
        public Res(int index, int freq) {
            this.freq = freq;
            this.index = index;
        }
    }

    void solve() throws IOException {
        int n = getInt();
        String[] files = new String[n];
        HashMap<String, Res> map = new HashMap<>();
        for (int i = 0; i < n; i++) {
            files[i] = getLine();
            HashSet<String> set = getAllSubstrings(files[i]);
            for(String s : set){
                Res res;
                if(map.containsKey(s)){
                    res = map.get(s);
                }else {
                    res = new Res(i, 0);
                    map.put(s, res);
                }
                res.freq++;
            }
        }
        int q = getInt();
        for (int i = 0; i < q; i++) {
            String query = getLine();
            Res res = map.get(query);
            if(res==null){
                println("0 -");
            }else {
                println(res.freq+" "+files[res.index]);
            }
        }
    }

    public static void main(String[] args) throws Exception {
        if (isOnlineJudge()) {
            in = new BufferedReader(new InputStreamReader(System.in));
            out = new BufferedWriter(new OutputStreamWriter(System.out));
            new BerOSFileSuggestion().solve();
            out.flush();
        } else {
            localJudge = new Thread();
            in = new BufferedReader(new FileReader("input.txt"));
            out = new BufferedWriter(new FileWriter("output.txt"));
            localJudge.start();
            new BerOSFileSuggestion().solve();
            out.flush();
            localJudge.suspend();
        }
    }
    static boolean isOnlineJudge(){
        try {
            return System.getProperty("ONLINE_JUDGE")!=null
                    || System.getProperty("LOCAL")==null;
        }catch (Exception e){
            return true;
        }
    }
    // Fast Input & Output
    static Thread localJudge = null;
    static BufferedReader in;
    static StringTokenizer st;
    static BufferedWriter out;
    static String getLine() throws IOException{
        return in.readLine();
    }
    static String getToken() throws IOException{
        if(st==null || !st.hasMoreTokens())
            st = new StringTokenizer(getLine());
        return st.nextToken();
    }
    static int getInt() throws IOException {
        return Integer.parseInt(getToken());
    }
    static long getLong() throws IOException {
        return Long.parseLong(getToken());
    }
    static void print(Object s) throws IOException{
        out.write(String.valueOf(s));
    }
    static void println(Object s) throws IOException{
        out.write(String.valueOf(s));
        out.newLine();
    }
},"brute force,implementation"

