import java.util.*;
import java.io.*;

public class C2018 {
    public static void main(String[] args) {
        MyScanner sc = new MyScanner();
        PrintWriter out = new PrintWriter(new BufferedOutputStream(System.out));
        int n = sc.nextInt(); int s = sc.nextInt(); int k = sc.nextInt();
        int [] a = new int[n + 1];
        for (int i = 1; i <= n; i++) a[i] = sc.nextInt();
        String color = sc.next(); int [] c = new int[n + 1];
        for (int i = 1; i <= n; i++) c[i] = (color.charAt(i - 1) == 'R' ? 0 : (color.charAt(i - 1) == 'G' ? 1 : 2));
        int [][] dp = new int[n + 1][k + 1];
        for (int [] arr: dp) {
            Arrays.fill(arr, Integer.MAX_VALUE);
        }
        dp[s][a[s]] = 0;
        for (int i = 1; i <= n; i++) {
            dp[i][a[i]] = Math.abs(s - i);
        }
        for (int candies = 0; candies <= k; candies++) {
            for (int pos = 1; pos <= n; pos++) {
                if (dp[pos][candies] == Integer.MAX_VALUE) continue;
                for (int nextPos = 1; nextPos <= n; nextPos++) {
                    if (nextPos == pos) continue;
                    if (a[nextPos] > a[pos] && c[nextPos] != c[pos]) {
                        int newTotal = Math.min(k, candies + a[nextPos]);
                        dp[nextPos][newTotal] = Math.min(dp[nextPos][newTotal], Math.abs(pos - nextPos) + dp[pos][candies]);
                    }
                }
            }
        }
        int ans = Integer.MAX_VALUE;
        for (int i = 1; i <= n; i++) ans = Math.min(ans, dp[i][k]);
        out.println(ans == Integer.MAX_VALUE ? -1 : ans);
        out.close();
    }


    //-----------MyScanner class for faster input----------
    public static class MyScanner {
        BufferedReader br;
        StringTokenizer st;

        public MyScanner() {
            br = new BufferedReader(new InputStreamReader(System.in));
        }

        String next() {
            while (st == null || !st.hasMoreElements()) {
                try {
                    st = new StringTokenizer(br.readLine());
