import java.io.BufferedReader;
import java.io.InputStreamReader;
import java.util.*;

public class C {

    private static final int oo = Integer.MAX_VALUE / 4;

    private void work() {
        Scanner sc = new Scanner(new BufferedReader(new InputStreamReader(System.in)));
        n = sc.nextInt();
        int s = sc.nextInt() - 1;
        k = sc.nextInt();

        r = new int[n];
        for (int i = 0; i < n; i++) r[i] = sc.nextInt();
        char[] c = sc.next().toCharArray();
        sc.close();

        deg = new int[n];
        g = new int[n][n];

        for (int i = 0; i < n; i++) {
            for (int j = i + 1; j < n; j++) {
                if (c[i] != c[j]) {
                    if (r[i] < r[j]) g[i][deg[i]++] = j;
                    if (r[i] > r[j]) g[j][deg[j]++] = i;
                }
            }
        }

        memo = new int[n][k];
        for(int i = 0; i < n; i++){
            Arrays.fill(memo[i], - 1);
        }

        int res = oo;
        for(int i = 0; i < n; i++){
            int t = Math.abs(i - s) + go(i, r[i]);
            if(t < res) res = t;
        }

        System.out.println(res == oo ? -1 : res);
    }

    private int n, k;
    private int[] r, deg;
    private int[][] g, memo;

    private int go(int u, int candies){
        if(candies >= k){
            return 0;
        }
        if(memo[u][candies] >= 0) return memo[u][candies];

        int ret = oo;
        for(int i = 0; i < deg[u]; i++){
            int v = g[u][i];
            int t = Math.abs(u - v) + go(v, candies + r[v]);
            if(t < ret) ret = t;
        }

        return memo[u][candies] = ret;
    }

    public static void main(String[] args) {
        new C().work();
    }
}
