	public static void main(String[] $) {
		CF1054D o = new CF1054D(); o.main(); o.flush();
	}

	void main() {
		int n = sc.nextInt();
		int k = sc.nextInt();
		int m = (1 << k) - 1;
		int[] aa = new int[n];
		for (int i = 0; i < n; i++)
			aa[i] = sc.nextInt();
		long cnt = 0;
		HashMap<Integer, Integer> mp = new HashMap<>();
		mp.put(0, 1);
		for (int x = 0, i = 0; i < n; i++) {
			int a = aa[i], b = a ^ m;
			a ^= x; b ^= x;
			int ka = mp.getOrDefault(a, 0);
			int kb = mp.getOrDefault(b, 0);
			if (ka <= kb) {
				cnt += ka;
				mp.put(x = a, ka + 1);
			} else {
				cnt += kb;
				mp.put(x = b, kb + 1);
			}
		}
		println((long) n * (n + 1) / 2 - cnt);
	}
}
