public class MailD {
    public static void main(String[] args) {
        MyScanner sc = new MyScanner();
        PrintWriter out = new PrintWriter(new BufferedOutputStream(System.out));
        int n = sc.nextInt(); int k = sc.nextInt();
        int [] a = new int[n];
        for (int i = 0; i < n; i++) a[i] = sc.nextInt();
        int [] pref = new int[n + 1];
        for (int i = 1; i <= n; i++) {
            pref[i] = pref[i - 1] ^ a[i - 1];
        }
        int [] reverse = new int[n + 1];
        for (int i = 1; i <= n; i++) reverse[i] = pref[i] ^ ((1 << k) - 1);
        Map<Pair, Integer> map = new HashMap<>();
        for (int i = 1; i <= n; i++) {
            Pair p = new Pair(pref[i], reverse[i]);
            map.put(p, map.getOrDefault(p, 0) + 1);
        }
        long total = nC2(n + 1);
        long min = 0;
        for (Pair p: map.keySet()) {
            int ct = map.get(p);
            if (p.a == 0) {
                ct++;
            }
            int first = ct / 2; int second = ct - first;
            min = min + nC2(first) + nC2(second);
        }
        out.println(total - min);
        out.close();
    }

    static long nC2(long x) {
        return x * (x - 1) / 2;
    }

    static class Pair {
        int a; int b;
        Pair (int a, int b) {
            this.a = Math.min(a, b); this.b = Math.max(a, b);
        }

        @Override
        public boolean equals(Object o) {
            if (this == o) return true;
            if (o == null || getClass() != o.getClass()) return false;
            Pair pair = (Pair) o;
            return a == pair.a &&
                    b == pair.b;
        }

        @Override
        public int hashCode() {
            return Objects.hash(a, b);
        }
    }


