    public static void solver(int n, int[] left, int[] right, PrintWriter out) {
        if(left[0]+right[n-1]>0){
            out.println("NO");
            return;
        }
        boolean isPossible = false;
        for(int i=0;i<n;i++){
            if(left[i]+right[i]==0){
                isPossible = true;
                break;
            }
        }
        if(!isPossible){
            out.println("NO");
            return;
        }
        int[] res = new int[n];
        for(int i=0;i<n;i++){
            res[i] = n-left[i]-right[i];
        }
        for(int i=0;i<n;i++){
            int lcount = 0, rcount = 0;
            for(int j=i+1;j<n;j++){
                if(res[i]<res[j])rcount++;
            }
            for(int j=i-1;j>=0;j--){
                if(res[i]<res[j])lcount++;
            }
            if(left[i]!=lcount || right[i]!=rcount){
                // System.out.println("__"+ i);
                out.println("NO");
                return;
            }
        }

        out.println("YES");
        for(int i=0;i<n;i++){
            out.print(res[i]+" ");
        }
    }
