import java.io.BufferedWriter;
import java.io.IOException;
import java.io.OutputStreamWriter;
import java.io.PrintWriter;
import java.util.Arrays;

import static java.lang.Math.min;

public class Test {

  static PrintWriter writer =
      new PrintWriter(new BufferedWriter(new OutputStreamWriter(System.out)));
  int D = 17;
  int n, tn;
  int N = 1 << D;
  char[] s = new char[N], t = new char[N + N];
  int[] sa = new int[N];
  int[] ra = new int[N];
  int[][] RH = new int[D][N];
  int[][] ST = new int[D][N];

  static int readInt() {
    int ans = 0;
    boolean neg = false;
    try {
      boolean start = false;
      for (int c = 0; (c = System.in.read()) != -1; ) {
        if (c == '-') {
          start = true;
          neg = true;
          continue;
        } else if (c >= '0' && c <= '9') {
          start = true;
          ans = ans * 10 + c - '0';
        } else if (start) break;
      }
    } catch (IOException e) {
    }
    return neg ? -ans : ans;
  }

  static long readLong() {
    long ans = 0;
    boolean neg = false;
    try {
      boolean start = false;
      for (int c = 0; (c = System.in.read()) != -1; ) {
        if (c == '-') {
          start = true;
          neg = true;
          continue;
        } else if (c >= '0' && c <= '9') {
          start = true;
          ans = ans * 10 + c - '0';
        } else if (start) break;
      }
    } catch (IOException e) {
    }
    return neg ? -ans : ans;
  }

  static String readString() {
    StringBuilder b = new StringBuilder();
    try {
      boolean start = false;
      for (int c = 0; (c = System.in.read()) != -1; ) {
        if (Character.isLetterOrDigit(c)) {
          start = true;
          b.append((char) c);
        } else if (start) break;
      }
    } catch (IOException e) {
    }
    return b.toString();
  }

  static int readChars(char[] a) {
    int cnt = 0;
    try {
      boolean start = false;
      for (int c = 0; (c = System.in.read()) != -1; ) {
        if (Character.isLetterOrDigit(c)) {
          start = true;
          a[cnt++] = (char) c;
        } else if (start) break;
      }
    } catch (IOException e) {
    }
    return cnt;
  }

  public static void main(String[] args) {
    Test te = new Test();
    te.start();
    writer.flush();
  }

  void buildSA() {
    int sz = Integer.highestOneBit(n) << 1;
    int[] ord = new int[sz + sz];
    int[] buf = new int[sz + sz];
    Integer[] idx = new Integer[n];
    for (int i = 0; i < n; i++) {
      idx[i] = i;
      ord[i] = s[i];
    }
    for (int i = 1; i < n; i *= 2) {
      final int len = i;
      final int[] od = ord;
      Arrays.sort(
          idx,
          0,
          n,
          (a, b) ->
              od[a] != od[b]
                  ? Integer.compare(od[a], od[b])
                  : od[a + len] != od[b + len]
                      ? Integer.compare(od[a + len], od[b + len])
                      : Integer.compare(a, b));
      buf[idx[0]] = 1;
      for (int j = 1; j < n; j++) {
        int a = idx[j], b = idx[j - 1];
        if (ord[a] == ord[b] && ord[a + len] == ord[b + len]) buf[a] = buf[b];
        else buf[a] = buf[b] + 1;
      }
      int[] tmp = buf;
      buf = ord;
      ord = tmp;
    }
    Arrays.fill(sa, -1);
    Arrays.fill(ra, -1);
    for (int i = 0; i < n; i++) {
      sa[i] = idx[i];
      ra[sa[i]] = i;
    }
  }

  void buildST() {
    int[] c = new int[n];
    for (int d = 0, b = N; b > 1; d++, b >>= 1) {
      for (int i = 0; i < n; i += b) c[i] = 0;
      for (int i = 0; i < n; i++) {
        int j = ra[i] / b * b;
        ST[d][j + c[j]++] = i;
      }
    }
  }

  void buildRH() {
    int l = 0;
    for (int i = 0; i < n; i++) {
      int j = ra[i];
      if (j == 0) {
        RH[0][0] = 0;
        l = 0;
        continue;
      }
      int k = sa[j - 1];
      while (i + l < n && k + l < n && s[i + l] == s[k + l]) l++;
      RH[0][j] = l;
      if (l > 0) l--;
    }
    buildRM(RH, 0, n - 1, n);
  }

  void buildRM(int[][] r, int ll, int rr, int max) {
    for (int d = 1, b = 1; b + b <= rr - ll + 1; d++, b <<= 1)
      for (int i = ll; i <= rr; i++)
        r[d][i] = min(r[d - 1][i], i + b <= rr ? r[d - 1][i + b] : max);
  }

  int getLCP(int i) {
    int j = 0;
    for (; i < n && j < tn; i++, j++) if (s[i] != t[j]) break;
    return j;
  }

  int getLeft(int[][] a, int ll, int rr, int min) {
    for (int d = D - 1, b = 1 << d; d >= 0; d--, b >>= 1)
      if (ll + b - 1 <= rr && a[d][ll] > min) ll += b;
    return ll;
  }

  int findSTFirst(int d, int ll, int rr, int i, int j, int a, int b) {
    if (i > rr || j < ll) return -1;
    if (i <= ll && rr <= j) {
      if (ll == rr) {
        if (sa[ll] < a || sa[ll] > b) return -1;
        return ll;
      }
      int x = ll - 1, y = rr + 1;
      while (y - x > 1) {
        int m = (y + x) / 2;
        if (ST[d][m] >= a) y = m;
        else x = m;
      }
      if (y > rr || ST[d][y] > b) return -1;
    }
    int mid = (ll + rr) / 2;
    int v = findSTFirst(d + 1, ll, mid, i, j, a, b);
    return v == -1 ? findSTFirst(d + 1, mid + 1, rr, i, j, a, b) : v;
  }

  int compare(int i) {
    int j;
    for (j = 0; i < n && j < tn; i++, j++)
      if (s[i] < t[j]) return -1;
      else if (s[i] > t[j]) return 1;
    return i < n ? 1 : j < tn ? -1 : 0;
  }

  int getLUB() {
    int ll = -1, rr = n;
    while (rr - ll > 1) {
      int m = (rr + ll) / 2;
      if (compare(sa[m]) > 0) rr = m;
      else ll = m;
    }
    return rr;
  }

  void start() {
    n = readChars(s);
    buildSA();
    buildRH();
    buildST();
    int q = readInt();
    loop:
    while (q-- > 0) {
      int ll = readInt(), rr = readInt();
      ll--;
      rr--;
      tn = readChars(t);
      int start = getLUB();
      if (start >= n) {
        writer.println(-1);
        continue;
      }
      int lcp = getLCP(sa[start]);
      while (start < n) {
        int next = getLeft(RH, start+1, n - 1, lcp - 1);
        int ans = findSTFirst(0, 0, N - 1, start, next - 1, ll, rr - lcp);
        if (ans != -1) {
          writer.println(new String(s, sa[ans], lcp + 1));
          continue loop;
        }
        start = next;
        lcp = min(lcp, RH[0][start]);
      }
      writer.println("-1");
    }
  }
}
