import java.util.Arrays;
import java.util.HashSet;
import java.util.Scanner;

public class CoveredPoints {
    static class Point{
        int x,y,j;
        Point(int x, int y, int j){
            this.x=x;
            this.y=y;
            this.j=j;
        }
    }
    static long gcd(long a, long b){
        return b==0?a:gcd(b,a%b);
    }
    static long cross(int x1,int y1, int x2, int y2){
        return (long) x1*y2- (long) x2*y1;
    }
    static boolean check(long a, long b){
        if(b<0){
            a=-a;
            b=-b;
        }
        return a>=0 && a<=b;
    }
    static int x1, y1;
    static boolean intersect(int px, int py, int qx, int qy, int rx, int ry, int sx, int sy){
        int x=qx-px;
        int y=qy-py;
        long qpr=cross(x,y,rx,ry);
        long qps= cross(x,y,sx,sy);
        long rs=cross(rx,ry,sx,sy);
        if(rs==0|| !check(qpr,rs) || !check(qps,rs))
            return false;
        long gcd=gcd(qps,rs);
        long a=qps/gcd;
        long b=rs/gcd;
        if(rx%b!=0 || ry%b!=0)
            return false;
        x1=(int) (px+rx/b*a);
        y1=(int) (py+ry/b*a);
        return true;
    }
    public static void main(String[] args) {
        Scanner cin =new Scanner(System.in);
        int n= cin.nextInt();
        int[] ax=new int[n];
        int[] ay=new int[n];
        int[] bx=new int[n];
        int[] by=new int[n];

        for (int i=0;i<n;i++){
            ax[i]=cin.nextInt();
            ay[i]=cin.nextInt();
            bx[i]=cin.nextInt();
            by[i]=cin.nextInt();
        }
        int count=0;
        for(int i=0;i<n;i++){
            int num=1+(int) gcd(Math.abs(ax[i]-bx[i]),Math.abs(ay[i]-by[i]));
            count+=num;
        }
        HashSet<Point> set= new HashSet<>();
        for(int i=0;i<n;i++){
            for (int j=i+1;j<n;j++){
                if(intersect(ax[i],ay[i],ax[j],ay[j],bx[i]-ax[i],by[i]-ay[i],bx[j]-ax[j],by[j]-ay[j])){
                    set.add(new Point(x1,y1,i));
                    set.add(new Point(x1,y1,j));
                }
            }
        }
        int k=set.size();
        Point[] points= set.toArray(new Point[k]);
        Arrays.sort(points,(p1,p2)-> p1.x != p2.x ? p1.x - p2.x : p1.y != p2.y ? p1.y - p2.y : p1.j-p2.j);
        for(int i=0,j;i<k;i=j){
            int x=points[i].x;
            int y=points[i].y;
            j=i;
            while (j<k && points[j].x==x && points[j].y==y)
                j++;
            int num=0;
            for(int l=i;l<j;l++){
                if(l==i || points[l].j!=points[l-1].j)
                    num++;
            }
            count-=num-1;
        }
        System.out.println(count);
    }
}
