import java.io.*;
import java.util.*;
public class cf1015f {
static int mod=(int)1e9+7;
static String s;
	public static void main(String[] args)throws IOException {
		BufferedReader bf=new BufferedReader(new InputStreamReader(System.in));
		StringTokenizer st=new StringTokenizer(bf.readLine());
		int n=Integer.parseInt(st.nextToken());
		s=bf.readLine();
		int sl=s.length();
		StringBuilder sb=new StringBuilder();
		int[][] len=new int[sl+1][2];
		int[][][][] dp=new int[2*n+1][n+1][sl+1][2];
		if(s.charAt(0)=='(') {
			len[0][0]=1;
		}
		else {
			len[0][1]=1;
		}
		for(int i=0;i<sl-1;i++) {
			sb.append(s.charAt(i));
			sb.append('(');
			len[i+1][0]=len(sb.toString());
			sb.deleteCharAt(i+1);
			sb.append(')');
			len[i+1][1]=len(sb.toString());
			sb.deleteCharAt(i+1);
		}
		len[sl][0]=sl;
		len[sl][1]=sl;
		dp[0][0][0][0]=1;
		for(int i=0;i<2*n;i++) {
			for(int j=0;j<=n;j++) {
				for(int k=0;k<=sl;k++) {
					for(int z=0;z<2;z++) {
						if(dp[i][j][k][z]==0) continue;
						if(j<n) {
							dp[i+1][j+1][len[k][0]][z|(len[k][0]==sl?1:0)]=(dp[i+1][j+1][len[k][0]][z|(len[k][0]==sl?1:0)]+dp[i][j][k][z])%mod;
						}
						if(j>0) {
							dp[i+1][j-1][len[k][1]][z|(len[k][1]==sl?1:0)]=(dp[i+1][j-1][len[k][1]][z|(len[k][1]==sl?1:0)]+dp[i][j][k][z])%mod;
						}
					}
				}
			}
		}
		int ans=0;
		for(int i=0;i<=sl;i++) {
			ans=(ans+dp[2*n][0][i][1])%mod;
		}
		System.out.println(ans);
	}
	public static int len(String t) {
		for(int i=t.length();i>0;i--) {
			if(s.substring(0,i).equals(t.substring(t.length()-i,t.length()))) return i;
		}
		return 0;
	}
}
