import java.util.Arrays;
import java.util.StringTokenizer;
import java.io.BufferedReader;
import java.io.InputStreamReader;
import java.io.InputStream;

/**
 * Built using CHelper plug-in
 * Actual solution is at the top
 */
public class Main {
    public static void main(String[] args) {
        InputStream inputStream = System.in;
        OutputStream outputStream = System.out;
        Scanner in = new Scanner(inputStream);
        PrintWriter out = new PrintWriter(outputStream);
        FBracketSubstring solver = new FBracketSubstring();
        solver.solve(1, in, out);
        out.close();
    }

    static class FBracketSubstring {
        int n;
        char[] arr;
        int[] pi;
        long[][][] memo;
        int mod = (int) 1e9 + 7;

        void prefixFunction() {
            int n = arr.length;
            pi = new int[n];
            for (int i = 1, j = 0; i < n; ++i)        //j = pi[i-1] at the beginning of every iteration
            {
                while (j > 0 && arr[i] != arr[j])
                    j = pi[j - 1];
                if (arr[i] == arr[j])
                    ++j;
                pi[i] = j;
            }
        }

        public void readInput(Scanner sc) {
            n = sc.nextInt();
            arr = sc.next().toCharArray();

        }

        public void solve(int testNumber, Scanner sc, PrintWriter pw) {
            int q = 1;
            while (q-- > 0) {
                readInput(sc);
                prefixFunction();
                memo = new long[2 * n][2 * n][2 * n];
                for (long[][] x : memo)
                    for (long[] y : x)
                        Arrays.fill(y, -1);
                pw.println(dp(0, 0, 0));
            }
        }

        private long dp(int idx, int prefix, int match) {
            if (idx == 2 * n)
                return prefix == 0 && match == arr.length ? 1 : 0;
            if (memo[idx][prefix][match] != -1)
                return memo[idx][prefix][match];
            int next = getNext(match, '(');
            long open = dp(idx + 1, prefix + 1, next);
            next = getNext(match, ')');
            long close = prefix > 0 ? dp(idx + 1, prefix - 1, next) : 0;
            return memo[idx][prefix][match] = (open + close) % mod;
        }

        private int getNext(int match, char c) {
            int next = match;
            if (match != arr.length) {
                if (arr[match] == c)
                    next++;
                else {
                    while (match != 0) {
                        match = pi[match - 1];
                        if (arr[match] == c)
                            break;
                    }
                    if (arr[match] == c)
                        next = match + 1;
                    else
                        next = match;
                }
            }
            return next;
        }

    }

    static class Scanner {
        StringTokenizer st;
        BufferedReader br;

        public Scanner(InputStream s) {
            br = new BufferedReader(new InputStreamReader(s));
        }

        public String next() {
            try {
                while (st == null || !st.hasMoreTokens())
                    st = new StringTokenizer(br.readLine());
                return st.nextToken();
            } catch (Exception e) {
                throw new RuntimeException(e);
            }
        }

        public int nextInt() {
            return Integer.parseInt(next());
        }

    }
}

