public class Main {
  static BufferedReader reader;
  static StringTokenizer stoken;
  static PrintWriter out;

  static int ni() throws Exception {
    return Integer.parseInt(ns());
  }

  static long nl() throws Exception {
    return Long.parseLong(ns());
  }

  static double nd() throws Exception {
    return Double.parseDouble(ns());
  }

  static String ns() throws Exception {
    if (stoken == null || !stoken.hasMoreTokens()) stoken = new StringTokenizer(reader.readLine());
    return stoken.nextToken();
  }

  static segtree_sum ss;
  static segtree_or so;

  static int n, x;
  static int INDEX = -1;
  static long DON = -1;
  static int POS;
  static long[] reach;
  static long[] QV;
  static int qc;
  static int[] qrun;

  public static void main(String[] args) throws Exception {
    reader = new BufferedReader(new InputStreamReader(System.in));
    out = new PrintWriter(new BufferedWriter(new OutputStreamWriter(System.out)), true);

    n = ni();
    int q = ni();
    x = ni();
    long[] a = new long[n];
    for (int i = 0; i < n; i++) a[i] = nl();
    QV = new long[200007];
    qrun = new int[200009];
    for (int i = 0; i < 200007; i++) QV[i] = -1;

    reach = new long[n];
    int pt = -1;

    int count[] = new int[20];
    int cor = 0;
    for (int i = 0; i < n; i++) {
      while (pt < n - 1 && (cor < x || pt < i)) {
        ++pt;
        for (int j = 0; j < 20; j++) {
          if ((a[pt] & (1 << j)) > 0) ++count[j];
        }
        cor = 0;
        for (int j = 0; j < 20; j++) {
          if (count[j] > 0) cor += (1 << j);
        }
      }

      reach[i] = pt;
      if (cor < x) reach[i] = n;
      for (int j = 0; j < 20; j++) {
        if ((a[i] & (1 << j)) > 0) --count[j];
      }
      cor = 0;
      for (int j = 0; j < 20; j++) {
        if (count[j] > 0) cor += (1 << j);
      }
    }

    ss = new segtree_sum(n);
    so = new segtree_or(n);
    ss.init(reach);
    so.init(a);

    // for (int i = 0; i < n; i++) out.print(reach[i] + " ");
    // out.println();

    for (int Q = 0; Q < q; Q++) {
      int type = ni();
      if (type == 1) {
        int ind = ni() - 1, val = ni();
        so.update(ind, val);

        int cind = ind;
        cor = val;
        POS = ind;
        int ll = 0, rr = n;
        while (ll < rr) {
          int m = (ll + rr) / 2;

          long v = ss.query(m, m);
          if (v < ind) ll = m + 1;
          else rr = m;
        }
        while (cind >= 0 && (cind == ind || ss.query(cind, cind) >= ind)) {
          INDEX = cind;
          DON = cor;
          qc = 0;
          so.query_left(0, 0, n - 1, cind, cor);
          for (int i = 0; i < qc; i++) QV[qrun[i]] = -1;
          INDEX = Math.max(INDEX, ll);

          int stor = INDEX;
          INDEX = ind - 1;
          qc = 0;
          so.query_right(0, 0, n - 1, ind, cor);
          for (int i = 0; i < qc; i++) QV[qrun[i]] = -1;
          int v = INDEX + 1;
          ss.update(stor, cind, v);

          // out.println("stor " + stor + " " + cind + " " + (INDEX + 1));

          cor = (int)so.query(stor, ind);
          if (stor != 0) cor |= so.query(stor - 1, stor - 1);
          cind = stor - 1;
        }

        // for (int i = 0; i < n; i++) out.print(so.query(i, i) + " ");
        // out.println();
        // for (int i = 0; i < n; i++) out.print(ss.query(i, i) + " ");
        // out.println();
      } else {
        long l = ni() - 1, r = ni() - 1;
        if (l == r) {
          if (so.query((int)l, (int)l) < x) out.println(0);
          else out.println(1);
          continue;
        }

        long ll = l, rr = r + 1;
        while (ll < rr) {
          int m = (int)((ll + rr) / 2);

          long v = ss.query(m, m);
          if (v <= r) ll = m + 1;
          else rr = m;
        }

        long base = ff(r - l + 1) + (ff(r) - ff(l - 1));
        // out.println("base " + base);

        base -= (r - ll + 1) * (r + 1);
        // out.println("base " + base + " " + ll);
        if (ll != l) {
          base -= ss.query((int)l, (int)(ll - 1));
        }
        out.println(base);
      }
    }
  }

  static long ff(long x) {
    if (x < 0) return 0;
    return x * (x + 1) / 2;
  }

  static Point max(Point a, Point b) {
    if (a.x == b.x) {
      if (a.y < b.y) return new Point(b.x, b.y);
      return new Point(a.x, a.y);
    }
    if (a.x < b.x) return new Point(b.x, b.y);
    return new Point(a.x, a.y);
  }

  static class Point implements Comparable<Point> {
    public int x;
    public int y;

    Point() {}
    Point(int a, int b) {x = a; y = b;}

    public int compareTo(Point other) {
      if (x == other.x) return y - other.y;
      return x - other.x;
    }

    public String toString() {
      return "(" + x + ", " + y + ")";
    }
  }

  static abstract class segtree {
    public int n;
    public long[] tree, lazy;

    public segtree(int _n) {
      n = _n;
      tree = new long[4 * _n];
      lazy = new long[4 * _n];
      for (int i = 0; i < 4 * _n; i++) lazy[i] = -1;
    }

    protected abstract long combine(long a, long b);

    protected abstract long nullv();

    protected abstract long lazy_func(int l, int r, long v);

    public void init(long[] arr) {
      init(0, 0, n - 1, arr);
    }

    private long init(int i, int l, int r, long[] arr) {
      if (l == r) return tree[i] = arr[l];

      int mid = (l + r) / 2;
      long a = init(2 * i + 1, l, mid, arr);
      long b = init(2 * i + 2, mid + 1, r, arr);

      return tree[i] = combine(a, b);
    }

    public void update(int l, int r, long val) {
      update(0, 0, n - 1, l, r, val);
    }

    private long update(int i, int tl, int tr, int ql, int qr, long val) {
      if (tr < ql || qr < tl || tl > tr) {
        push_lazy(i, tl, tr);
        return tree[i];
      }
      if (ql <= tl && tr <= qr) {
        lazy[i] = val;
        push_lazy(i, tl, tr);
        return tree[i];
      }

      push_lazy(i, tl, tr);

      int mid = (tl + tr) / 2;
      long a = update(2 * i + 1, tl, mid, ql, qr, val);
      long b = update(2 * i + 2, mid + 1, tr, ql, qr, val);

      return tree[i] = combine(a, b);
    }

    public long query(int l, int r) {
      return query(0, 0, n - 1, l, r);
    }

    private long query(int i, int tl, int tr, int ql, int qr) {
      if (qr < tl || tr < ql || tl > tr) return nullv();

      push_lazy(i, tl, tr);
      if (ql <= tl && tr <= qr) return tree[i];

      int mid = (tl + tr) / 2;
      long a = query(2 * i + 1, tl, mid, ql, qr);
      long b = query(2 * i + 2, mid + 1, tr, ql, qr);

      return combine(a, b);
    }

    private void push_lazy(int i, int l, int r) {
      if (lazy[i] == -1) return;
      tree[i] = (r - l + 1) * lazy[i];

      if (l != r) {
        lazy[2 * i + 1] = lazy[i];
        lazy[2 * i + 2] = lazy[i];
      }

      lazy[i] = -1;
    }
  }

  static class segtree_sum extends segtree {
    public segtree_sum(int _n) {
      super(_n);
    }

    protected long combine(long a, long b) {
      return a + b;
    }

    protected long nullv() {
      return 0;
    }

    protected long lazy_func(int l, int r, long v) {
      return v;
    }
  }

  static class segtree_or {
    public int n;
    public long[] tree;

    public segtree_or(int _n) {
      n = _n;
      tree = new long[4 * _n];
    }

    private long combine(long a, long b) {
      return a | b;
    }

    private long nullv() {
      return 0;
    }

    public void init(long[] arr) {
      init(0, 0, n - 1, arr);
    }

    private long init(int i, int l, int r, long[] arr) {
      if (l == r) return tree[i] = arr[l];

      int mid = (l + r) / 2;
      long a = init(2 * i + 1, l, mid, arr);
      long b = init(2 * i + 2, mid + 1, r, arr);

      return tree[i] = combine(a, b);
    }

    public void update(int loc, long val) {
      update(0, 0, n - 1, loc, val);
    }

    private long update(int i, int l, int r, int loc, long val) {
      if (loc < l || r < loc) return tree[i];
      if (l == r) return tree[i] = val;

      int mid = (l + r) / 2;
      long a = update(2 * i + 1, l, mid, loc, val);
      long b = update(2 * i + 2, mid + 1, r, loc, val);

      return tree[i] = combine(a, b);
    }

    public long query(int l, int r) {
      return query(0, 0, n - 1, l, r);
    }

    private long query(int i, int tl, int tr, int ql, int qr) {
      if (qr < tl || tr < ql || tl > tr || ql > qr) return nullv();
      if (ql <= tl && tr <= qr) return tree[i];

      int mid = (tl + tr) / 2;
      long a = query(2 * i + 1, tl, mid, ql, qr);
      long b = query(2 * i + 2, mid + 1, tr, ql, qr);

      return combine(a, b);
    }

    private long query_left(int i, int tl, int tr, int qr, long ror) {
      if (qr < tl) return 0;
      if (tr <= qr) {
        if ((tree[i] | ror) == DON) {
          INDEX = Math.min(INDEX, tl);
          return tree[i] | ror;
        }
      }
      if (tl == tr) {
        if ((tree[i] | ror) == DON) INDEX = Math.min(INDEX, tl);
        return tree[i] | ror;
      }

      int mid = (tl + tr) / 2;
      if (qr <= mid) return query_left(2 * i + 1, tl, mid, qr, ror);
      long a = query_left(2 * i + 2, mid + 1, tr, qr, ror);
      long b = ror | a;
      if (b == DON) b = query_left(2 * i + 1, tl, mid, qr, b);
      if (tr <= qr) b |= tree[i];
      return b;
    }

    private long query_right(int i, int tl, int tr, int ql, long ror) {
      if (tr < ql) return 0;
      if (ql <= tl) {
        if ((ror | tree[i]) < x) {
          INDEX = Math.max(INDEX, tr);
          return ror | tree[i];
        }
      }
      if (tl == tr) {
        if ((tree[i] | ror) < x) INDEX = Math.max(INDEX, tl);
        return tree[i] | ror;
      }

      int mid = (tl + tr) / 2;
      if (ql > mid) return query_right(2 * i + 2, mid + 1, tr, ql, ror);
      long a = query_right(2 * i + 1, tl, mid, ql, ror);
      long b = ror | a;
      if (b < x) {
        INDEX = Math.max(INDEX, mid);
        b |= query_right(2 * i + 2, mid + 1, tr, ql, b);
      }
      if (ql <= tl) b |= tree[i];
      return b;
    }
  }
},"bitmasks,data structures,divide and conquer"

import java.io.*;
import java.util.*;

public class F {
	public static void main(String[] args) {
		InputStream inputStream = System.in;
		OutputStream outputStream = System.out;
		InputReader in = new InputReader(inputStream);
		PrintWriter out = new PrintWriter(outputStream);
		Task solver = new Task();
		solver.solve(1, in, out);
		out.close();
	}

	static class info {
		int val[] = new int[22];
		int pos[] = new int[22];
		int len = 0;
		public void init() {
			len = 0;
		}
		public void init(int v, int p) {
			val[0] = v;
			pos[0] = p;
			len = 1;
		}
		public void add(info b) {
			int v = 0;
			if (len != 0) v = val[len - 1];
			for (int i = 0; i < b.len; i++) {
				if ((v | b.val[i]) > v || len == 0) {
					v |= b.val[i];
					val[len] = v;
					pos[len] = b.pos[i];
					len++;
				}
			}
		}
	}

	static class Task {
		info candl[];
		info candr[];
		long s[];
		int a[];
		int x = 0;
		int xl = 0;
		long ans = 0;
		info queryl = new info();
		info tmp = new info();

		long merge(int l, int r, info cl, info cr) {
			long ans = 0;
			if (cl.len == 0 || cr.len == 0) return ans;
			int j = 0;
			int val = cl.val[0];
			while (j < cr.len && (cr.val[j] | val) < x)
				j++;
			for (int i = 0; i < cl.len; i++) {
				val = cl.val[i];
				while (j > 0 && (cr.val[j - 1] | val) >= x) --j;
				if (j < cr.len) {
					long h = 0;
					if (i < cl.len - 1)
						h = cl.pos[i] - cl.pos[i + 1];
					else
						h = cl.pos[i] - l + 1;

					ans += (r - cr.pos[j] + 1) * h;
				}
			}
			return ans;
		}
		void upd(int p, int l, int r) {
			candl[p].init();
			candl[p].add(candl[p + p]);
			candl[p].add(candl[p + p + 1]);
			candr[p].init();
			candr[p].add(candr[p + p + 1]);
			candr[p].add(candr[p + p]);
			s[p] = s[p + p] + s[p + p + 1] + merge(l, r, candr[p + p], candl[p + p + 1]);
		}

		void build(int p, int l, int r) {
			candl[p] = new info();
			candr[p] = new info();
			if (l == r) {
				candl[p].init(a[l], l);
				candr[p].init(a[l], l);
				s[p] = (a[l] >= x) ? 1 : 0;
			} else {
				int md = (l + r) >> 1;
				build(p + p, l, md);
				build(p + p + 1, md + 1, r);
				upd(p, l, r);
			}
		}
		void modify(int p, int l, int r, int c, int v) {
			if (l == r) {
				a[l] = v;
				candl[p].init(a[l], l);
				candr[p].init(a[l], l);
				s[p] = (a[l] >= x) ? 1 : 0;
			} else {
				int md = (l + r) >> 1;
				if (c <= md) modify(p + p, l, md, c, v);
				else modify(p + p + 1, md + 1, r, c, v);
				upd(p, l, r);
			}
		}
		void query(int p, int l, int r, int tl, int tr) {
			if (l == tl && r == tr) {
				ans += s[p] + merge(xl, r, queryl, candl[p]);
				tmp.init();
				tmp.add(candr[p]);
				tmp.add(queryl);
				queryl.init();
				queryl.add(tmp);
			} else {
				int md = (l + r) >> 1;
				if (tr <= md) query(p + p, l, md, tl, tr);
				else if (tl > md) query(p + p + 1, md + 1, r, tl, tr);
				else {
					query(p + p, l, md, tl, md);
					query(p + p + 1, md + 1, r, md + 1, tr);
				}
			}
		}

		public void solve(int testNumber, InputReader in, PrintWriter out) {
			int n = in.nextInt();
			int m = in.nextInt();
			a = new int[n + 1];
			candl = new info[4 * n + 10];
			candr = new info[4 * n + 10];
			s = new long [4 * n + 10];
			x = in.nextInt();
			for (int i = 1; i <= n; i++) {
				a[i] = in.nextInt();
			}
			build(1, 1, n);
			for (int i = 0; i < m; i++) {
				int op = in.nextInt();
				int l = in.nextInt();
				int r = in.nextInt();
				if (op == 1) {
					modify(1, 1, n, l, r);
				} else {
					ans = 0;
					queryl.init();
					xl = l;
					query(1, 1, n, l, r);
					out.println(ans);
				}
			}
		}
	}

	static class InputReader {
		public BufferedReader reader;
		public StringTokenizer tokenizer;

		public InputReader(InputStream stream) {
			reader = new BufferedReader(new InputStreamReader(stream), 32768);
			tokenizer = null;
		}

		public String next() {
			while (tokenizer == null || !tokenizer.hasMoreTokens()) {
				try {
					tokenizer = new StringTokenizer(reader.readLine());
				} catch (IOException e) {
					throw new RuntimeException(e);
				}
			}
			return tokenizer.nextToken();
		}

		public int nextInt() {
			return Integer.parseInt(next());
		}

		public long nextLong() {
			return Long.parseLong(next());
		}

	}
},"bitmasks,data structures,divide and conquer"

import java.io.BufferedReader;
import java.io.BufferedWriter;
import java.io.IOException;
import java.io.InputStreamReader;
import java.io.OutputStreamWriter;
import java.io.PrintWriter;
import java.util.ArrayList;
import java.util.StringTokenizer;

public class Div2_495F {

	public static void main(String[] args) throws IOException {
		new Div2_495F().execute();
	}

	int nE;
	int nQ;
	int bound;

	int[] e;

	Data[] tree;

	void execute() throws IOException {
		BufferedReader reader = new BufferedReader(new InputStreamReader(System.in));
		PrintWriter printer = new PrintWriter(new BufferedWriter(new OutputStreamWriter(System.out)));
		StringTokenizer inputData = new StringTokenizer(reader.readLine());
		nE = Integer.parseInt(inputData.nextToken());
		nQ = Integer.parseInt(inputData.nextToken());
		bound = Integer.parseInt(inputData.nextToken());

		e = new int[nE + 1];
		inputData = new StringTokenizer(reader.readLine());
		for (int i = 1; i <= nE; i++) {
			e[i] = Integer.parseInt(inputData.nextToken());
		}

		tree = new Data[nE * 4];
		init(1, 1, nE);

		while (nQ-- > 0) {
			inputData = new StringTokenizer(reader.readLine());
			int t = Integer.parseInt(inputData.nextToken());
			int a = Integer.parseInt(inputData.nextToken());
			int b = Integer.parseInt(inputData.nextToken());
			if (t == 1) {
				update(1, 1, nE, a, b);
			} else {
				Data res = query(1, 1, nE, a, b);
				printer.println(res.tCnt);
			}
		}
		printer.close();
	}

	void init(int nI, int cL, int cR) {
		if (cL == cR) {
			Data nData = new Data();
			nData.states = new int[][] { { e[cL] }, { e[cR] } };
			nData.sCnt = new int[][] { { 1 }, { 1 } };
			nData.tCnt = e[cL] >= bound ? 1 : 0;
			tree[nI] = nData;
		} else {
			int mid = (cL + cR) >> 1;
			init(nI * 2, cL, mid);
			init(nI * 2 + 1, mid + 1, cR);
			tree[nI] = merge(tree[nI * 2], tree[nI * 2 + 1]);
		}
	}

	void update(int nI, int cL, int cR, int uI, int uV) {
		if (cL == cR) {
			Data nData = new Data();
			nData.states = new int[][] { { uV }, { uV } };
			nData.sCnt = new int[][] { { 1 }, { 1 } };
			nData.tCnt = uV >= bound ? 1 : 0;
			tree[nI] = nData;
		} else {
			int mid = (cL + cR) >> 1;
			if (uI <= mid) {
				update(nI * 2, cL, mid, uI, uV);
			} else {
				update(nI * 2 + 1, mid + 1, cR, uI, uV);
			}
			tree[nI] = merge(tree[nI * 2], tree[nI * 2 + 1]);
		}
	}

	Data query(int nI, int cL, int cR, int qL, int qR) {
		if (qR < cL || cR < qL) {
			return new Data();
		}
		if (qL <= cL && cR <= qR) {
			return tree[nI];
		}
		int mid = (cL + cR) >> 1;
		return merge(query(nI * 2, cL, mid, qL, qR), query(nI * 2 + 1, mid + 1, cR, qL, qR));
	}

	Data[] chldn = new Data[2];

	ArrayList<Integer> nStates = new ArrayList<>();
	ArrayList<Integer> nSCnt = new ArrayList<>();

	Data merge(Data l, Data r) {
		if (l.states == null) {
			return r;
		}
		if (r.states == null) {
			return l;
		}

		chldn[0] = l;
		chldn[1] = r;

		Data ret = new Data();
		ret.states = new int[2][];
		ret.sCnt = new int[2][];

		for (int d = 0; d < 2; d++) {
			nStates.clear();
			nSCnt.clear();
			Data ch0 = chldn[d];
			Data ch1 = chldn[d ^ 1];

			for (int i = 0; i < ch0.states[d].length - 1; i++) {
				nStates.add(ch0.states[d][i]);
				nSCnt.add(ch0.sCnt[d][i]);
			}

			int cState = ch0.states[d][ch0.states[d].length - 1];
			int cSCnt = ch0.sCnt[d][ch0.states[d].length - 1];

			int i = 0;
			for (; i < ch1.states[d].length && ((ch1.states[d][i] | cState) == cState); i++) {
				cSCnt += ch1.sCnt[d][i];
			}
			nStates.add(cState);
			nSCnt.add(cSCnt);

			while (i < ch1.states[d].length) {
				cState = cState | ch1.states[d][i];
				cSCnt = ch1.sCnt[d][i];

				i++;
				for (; i < ch1.states[d].length && ((ch1.states[d][i] | cState) == cState); i++) {
					cSCnt += ch1.sCnt[d][i];
				}
				nStates.add(cState);
				nSCnt.add(cSCnt);
			}

			ret.states[d] = new int[nStates.size()];
			for (int j = 0; j < nStates.size(); j++) {
				ret.states[d][j] = nStates.get(j);
			}

			ret.sCnt[d] = new int[nStates.size()];
			for (int j = 0; j < nStates.size(); j++) {
				ret.sCnt[d][j] = nSCnt.get(j);
			}
		}

		long tSum = l.tCnt + r.tCnt;

		int[] lStates = l.states[1];
		int[] lSCnt = l.sCnt[1];

		int[] rStates = r.states[0];
		int[] rSCnt = r.sCnt[0];

		long sSum = 0;
		int j = lStates.length - 1;

		for (int i = 0; i < rStates.length; i++) {
			while (j >= 0 && (lStates[j] | rStates[i]) >= bound) {
				sSum += lSCnt[j];
				j--;
			}
			tSum += rSCnt[i] * sSum;
		}
		ret.tCnt = tSum;
		return ret;
	}

	class Data {
		int[][] states;
		int[][] sCnt;
		long tCnt;
	}

}
