", i + 1, Arrays.toString(dp[i]));
//		}

		log = Integer.numberOfTrailingZeros(Integer.highestOneBit(n))+1;
		depth = new int[n];
		lift = new int[log][n];
		sumDP = new long[log][n];
		sumEdges = new long[log][n];

		for(int[] x : lift) Arrays.fill(x, -1);

		dfs3(0, -1, -1);

		for(int lg = 1; lg < log; lg++) {
			for(int i = 0; i < n; i++) {
				if(lift[lg-1][i] == -1) continue;
				int p = lift[lg-1][i];
				if(lift[lg-1][p] == -1) continue;

				lift[lg][i] = lift[lg - 1][p];
				sumDP[lg][i] = sumDP[lg-1][i] + sumDP[lg-1][p];
				sumEdges[lg][i] = sumEdges[lg-1][i] + sumEdges[lg-1][p];
			}
		}

		for(int qq = 0; qq < q; qq++) {
			int u = fs.nextInt()-1, v = fs.nextInt()-1;
			if(u == v) {
				out.println(dp[u][size[u]] + vals[u]);
				continue;
			}

			int L = LCA(u, v);
			long res;
			if(L == u) {
				res = solve1Path(v, u);
			}
			else if(L == v) {
				res = solve1Path(u, v);
			}
			else {
				res = solveLCA(u, v);
			}

			out.println(res);
		}

		out.close();
	}

	//if LCA(u, v) != u or v
	long solveLCA(int u, int v) {
		if(depth[v] > depth[u]) return solveLCA(v, u);
		int L = LCA(u, v);

		long res = 0;
		Edge fromU = adj[u].get(idxOfParent[u]);
		res += dp[u][idxOfParent[u]] + 2 * fromU.we;
		Edge fromV = adj[v].get(idxOfParent[v]);
		res += dp[v][idxOfParent[v]] + 2 * fromV.we;

		for(int lg = log - 1; lg >= 0; lg--) {
			if(lift[lg][u] == -1) continue;
			int to = lift[lg][u];

			if(depth[to] < depth[v]) continue;

			res += sumDP[lg][u] + sumEdges[lg][u];
			u = to;
		}

		for(int lg = log-1; lg >= 0; lg--) {
			if(lift[lg][u] == -1) continue;
			int to = lift[lg][u];
			if(depth[to] <= depth[L]) continue;

			res += sumDP[lg][u] + sumEdges[lg][u];
			res += sumDP[lg][v] + sumEdges[lg][v];

			u = lift[lg][u];
			v = lift[lg][v];
		}

		int idxU = -1, idxV = -1;
		for(int i = 0; i < size[L]; i++) {
			if(adj[L].get(i).v == u) {
				idxU = i;
			}
			if(adj[L].get(i).v == v) {
				idxV = i;
			}
		}

		long finAdd = dp[L][size[L]];
		finAdd -= Math.max(0, dp[v][idxOfParent[v]]);
		finAdd -= Math.max(0, dp[u][idxOfParent[u]]);
		finAdd += vals[L];
		finAdd -= adj[L].get(idxU).we;
		finAdd -= adj[L].get(idxV).we;

		res += finAdd;
		return res;
	}

	//ONLY if LCA(u, v) = v.
	long solve1Path(int u, int v) {
		long res = 0;
		Edge inc = adj[u].get(idxOfParent[u]);
		res += dp[u][idxOfParent[u]] + 2 * inc.we;

		for(int lg = log-1; lg >= 0; lg--) {
			if(lift[lg][u] == -1) continue;
			int to = lift[lg][u];

			if(depth[to] >= depth[v]+1) {
				res += sumDP[lg][u] + sumEdges[lg][u];
				u = to;
			}
		}

		//lift[0][u] = v
		int idx = -1;
		for(int i = 0; i < size[v]; i++) {
			if(adj[v].get(i).v == u) {
				idx = i;
			}
		}

		res += dp[v][idx] + adj[v].get(idx).we;

		return res;
	}

	int LCA(int u, int v) {
		if(depth[v] > depth[u]) return LCA(v, u);
		for(int lg = log-1; lg >= 0; lg--) {
			if(lift[lg][u] < 0) continue;
			int to = lift[lg][u];
			if(depth[to] >= depth[v]) {
				u = to;
			}
		}

		if(u == v) return u;

		for(int lg = log-1; lg >= 0; lg--) {
			if(lift[lg][u] != lift[lg][v]) {
				u = lift[lg][u];
				v = lift[lg][v];
			}
		}

		return lift[0][v];
	}

	//binary lifting stuff
	void dfs3(int u, int p, int idxIn) {
		for(int i = 0; i < size[u]; i++) {
			Edge e = adj[u].get(i);
			if(e.v == p) continue;

			depth[e.v] = 1+depth[u];
			lift[0][e.v] = u;
			sumEdges[0][e.v] = e.we;

			long val = dp[u][i];
			if(idxIn != -1) val -= Math.max(0, dp[p][idxIn]);

			sumDP[0][e.v] = val;

			dfs3(e.v, u, i);
		}
	}

	//tree re-rooting
	//idxIn = the index of u in adj[p]
	void dfs2(int u, int p, int idxIn) {
		int idx = size[u];
		Edge incoming = null;
		if(p != -1) {
			for(int i = 0; i < size[u]; i++)
				if(adj[u].get(i).v == p) {
					idx = i;
					incoming = adj[u].get(i);
				}

			long cur = dp[u][idx] - vals[u] + 2 * incoming.we;
			if(dp[p][idxIn] > 0) cur += dp[p][idxIn];

			dp[u][size[u]] = cur; //cost of being root
		}

		for(int i = 0; i < size[u]; i++) {
			Edge e = adj[u].get(i);
			if(e.v == p) continue;

			long cur = dp[u][size[u]];
			cur -= Math.max(0, dp[e.v][ idxOfParent[e.v] ]);
			cur += vals[u] - 2 * e.we;

			dp[u][i] = cur;
		}

		for(int i = 0; i < size[u]; i++) {
			Edge e = adj[u].get(i);
			if(e.v == p) continue;

			dfs2(e.v, u, i);
		}
	}

	int dfs(int u, int p) {
		int idx = size[u];
		Edge incoming = null;

		if(p != -1) {
			for(int i = 0; i < size[u]; i++) {
				if(adj[u].get(i).v == p) {
					idx = i;
					incoming = adj[u].get(i);
				}
			}
			idxOfParent[u] = idx;
		}

		if(p != -1) dp[u][idx] = vals[u] - 2 * incoming.we;

		for(int i = 0; i < size[u]; i++) {
			Edge now = adj[u].get(i);
			if(now.v == p) continue;
			int id = dfs(now.v, u);

			if(dp[now.v][id] > 0) {
				dp[u][idx] += dp[now.v][id];
			}
		}

		return idx;
	}

	class Edge {
		int v;
		long we;
		Edge(int vv, int ww) {
			v = vv;
			we = ww;
		}
		public String toString() {
			return String.format("u --> %d WE = %d", v, we);
		}
	}

	class FastScanner {
		public int BS = 1<<16;
		public char NC = (char)0;
		byte[] buf = new byte[BS];
		int bId = 0, size = 0;
		char c = NC;
		double num = 1;
		BufferedInputStream in;

		public FastScanner() {
			in = new BufferedInputStream(System.in, BS);
		}

		public FastScanner(String s) {
			try {
				in = new BufferedInputStream(new FileInputStream(new File(s)), BS);
			}
			catch (Exception e) {
				in = new BufferedInputStream(System.in, BS);
			}
		}

		public char nextChar(){
			while(bId==size) {
				try {
					size = in.read(buf);
				}catch(Exception e) {
					return NC;
				}                
				if(size==-1)return NC;
				bId=0;
			}
			return (char)buf[bId++];
		}

		public int nextInt() {
			return (int)nextLong();
		}

		public long nextLong() {
			num=1;
			boolean neg = false;
			if(c==NC)c=nextChar();
			for(;(c<'0' || c>'9'); c = nextChar()) {
				if(c=='-')neg=true;
			}
			long res = 0;
			for(; c>='0' && c <='9'; c=nextChar()) {
				res = (res<<3)+(res<<1)+c-'0';
				num*=10;
			}
			return neg?-res:res;
		}

		public double nextDouble() {
			double cur = nextLong();
			return c!='.' ? cur:cur+nextLong()/num;
		}

		public String next() {
			StringBuilder res = new StringBuilder();
			while(c<=32)c=nextChar();
			while(c>32) {
				res.append(c);
				c=nextChar();
			}
			return res.toString();
		}

		public String nextLine() {
			StringBuilder res = new StringBuilder();
			while(c<=32)c=nextChar();
			while(c!='
') {
				res.append(c);
				c=nextChar();
			}
			return res.toString();
		}

		public boolean hasNext() {
			if(c>32)return true;
			while(true) {
				c=nextChar();
				if(c==NC)return false;
				else if(c>32)return true;
			}
		}

		public int[] nextIntArray(int n) {
			int[] res = new int[n];
			for(int i = 0; i < n; i++) res[i] = nextInt();
			return res;
		}

	}

