import java.io.*;
import java.util.ArrayList;
import java.util.StringTokenizer;

public class Main {
    public static void main(String[] args) {
        new Main().solve();
    }
    BufferedReader reader;
    BufferedWriter writer;
    StringTokenizer tokenizer;
    public Main() {
        reader = new BufferedReader(new InputStreamReader(System.in));
        writer = new BufferedWriter(new OutputStreamWriter(System.out));
    }
    int ni() {
        if (tokenizer == null || !tokenizer.hasMoreTokens()) {
            try {
                tokenizer = new StringTokenizer(reader.readLine());
            } catch (IOException e) {}
        }
        return Integer.parseInt(tokenizer.nextToken());
    }


    int n, q, vws[], intime[], outtime[], time = -1, parents[][], logN = 19, parentIndex[];
    long ps[], answers[], bit[];
    ArrayList<Integer>[] t, tw;
    ArrayList<Long>[] tp;
    ArrayList<Query>[] queries;
    int[] depths;
    void solve() {
        n = ni();
        q = ni();

        vws = new int[n];
        for (int i = 0; i < n; i++) {
            vws[i] = ni();
        }
        t = new ArrayList[n];
        tw = new ArrayList[n];
        tp = new ArrayList[n];
        depths = new int[n];
        for (int i = 0; i < n; i++) {
            t[i] = new ArrayList<Integer>();
            tw[i] = new ArrayList<Integer>();
            tp[i] = new ArrayList<Long>();
        }
        for (int i = 0; i < n - 1; i++) {
            int from = ni() - 1;
            int to = ni() - 1;
            int w = ni();
            t[from].add(to);
            tw[from].add(w);
            t[to].add(from);
            tw[to].add(w);
        }
        intime = new int[n];
        outtime = new int[n];
        ps = new long[n];
        parents = new int[n][logN];
        parentIndex = new int[n];
        ps[0] = calcRoot(0, 0, 0);
        calcOthers(0, -1, 0);
//        for (int i = 0; i < n; i++) {
//            System.out.println(ps[i]);
//            for (int j = 0; j < tp[i].size(); j++) {
//                System.out.print(t[i].get(j) + 1 + "->" + tp[i].get(j) + "; ");
//            }
//            System.out.println();
//        }
//        System.out.println();

        answers = new long[q];
        queries = new ArrayList[n];
        for (int i = 0; i < n; i++) {
            queries[i] = new ArrayList<>();
        }
        for (int i = 0; i < q; i++) {
            int u = ni() - 1;
            int v = ni() - 1;
            int parent = lca(u, v);
//            System.out.println(parent);
//            System.out.println(depths[parent]);
            Query q = new Query(i, depths[parent]);
            queries[u].add(q);
            queries[v].add(q);
            answers[i] = - ps[parent] + (parent != 0 ? tp[parent].get(parentIndex[parent]) * 2 : 0);
        }

        bit = new long[n];
        calcAnswers(0, 0);

        try {
            for (int i = 0; i < q; i++) {
                writer.write(answers[i] + "
");
            }
            writer.close();
        } catch (IOException e) {}
    }

    long calcRoot(int v, int p, int d) {
        intime[v] = ++time;
        depths[v] = d;
        parents[v][0] = p;
        for (int i = 1; i < logN; i++) {
            parents[v][i] = parents[parents[v][i - 1]][i - 1];
        }
        long cost = vws[v];
        for (int i = 0; i < t[v].size(); i++) {
            int ch = t[v].get(i);
            if (ch != p) {
                long ew = Math.max(0, calcRoot(ch, v, d + 1) - 2 * tw[v].get(i));
                tp[v].add(ew);
                cost += ew;
            } else {
                tp[v].add(0L);
            }
        }
        outtime[v] = ++time;
        return cost;
    }
    void calcOthers(int v, int p, long c) {
        long curCost = c + vws[v];
        for (int i = 0; i < t[v].size(); i++) {
            int ch = t[v].get(i);
            if (ch == p) {
                tp[v].set(i, (long)c);
                parentIndex[v] = i;
            } else {
                curCost += tp[v].get(i);
            }
        }
        ps[v] = curCost;
        for (int i = 0; i < t[v].size(); i++) {
            int ch = t[v].get(i);
            if (ch != p) {
                calcOthers(ch, v, Math.max(0, curCost - tp[v].get(i) - tw[v].get(i) * 2));
            }
        }
    }
    boolean isParent(int p, int v) {
        return intime[p] <= intime[v] && outtime[p] >= outtime[v];
    }
    int lca(int u, int v) {
        if (isParent(u, v)) return u;
        if (isParent(v, u)) return v;
        for (int i = logN - 1; i >=0; i--) {
            if (!isParent(parents[v][i], u)) {
                v = parents[v][i];
            }
        }
        return parents[v][0];
    }

    void set(int i, long dif) {
        while (i < n) {
            bit[i] += dif;
            i = i | (i + 1);
        }
    }
    long get(int i, int j) {
        return sum(j) - sum(i - 1);
    }
    long sum(int i) {
        long res = 0;
        while (i >= 0) {
            res += bit[i];
            i = (i & (i + 1)) - 1;
        }
        return res;
    }

    void calcAnswers(int v, int p) {
        long cur = ps[v];
        if (p != v) {
            cur -= tp[v].get(parentIndex[v]);
        }
        for (Query q : queries[v]) {
            answers[q.i] += cur + get(q.d, depths[v] - 1);
        }
        set(depths[v], cur);
        for (int i = 0; i < t[v].size(); i++) {
            if (t[v].get(i) == p) {
                continue;
            }
            long curSub = tp[v].get(i) + tw[v].get(i);
            set(depths[v], -curSub);
            calcAnswers(t[v].get(i), v);
            set(depths[v], curSub);
        }
        set(depths[v], -cur);
    }

}

class Query {
    public int i;
    public int d;
    public Query(int index, int depth) {
        i = index;
        d = depth;
    }
