import java.io.*;
import java.util.*;

public class Main{
	static LinkedList<int[]>qs[];
	static int[][][]adj;
	static long[]in,ans;
	static long[]up,down,prefNodes,prefEdges;
	static long[]parEdge;
	static void dfsDown(int i,int p,long val) {
		prefNodes[i]=in[i];
		prefEdges[i]=val;
		parEdge[i]=val;
		if(p!=-1) {
			prefNodes[i]+=prefNodes[p];
			prefEdges[i]+=prefEdges[p];
		}
		for(int[]nxt:adj[i]) {
			if(nxt[0]==p)continue;
			int u=nxt[0];
			long w=nxt[1];
			dfsDown(u, i, w);
			down[i]+=Math.max(0, down[u]+in[u]-w-w);
		}

	}
	static void dfsUp(int i,int p) {
		for(int[]nxt:adj[i]) {
			if(nxt[0]==p)continue;
			int u=nxt[0];
			long w=nxt[1];
			long me=down[i]-Math.max(0, down[u]+in[u]-w-w);
			up[u]=Math.max(0, me+in[i]-w-w+up[i]);
			dfsUp(u, i);
		}
	}
	static int log = 19;
	static int[] level, par[];
	static void preLCA(int root,int n) {
		par = new int[n][log];
		level = new int[n];
		dfs(root, root);
	}

	static int lca(int u, int v) {

		if (level[u] < level[v])
			return lca(v, u);
		for (int i = log - 1; i >= 0; i--) {
			int u2 = par[u][i];
			if (level[u2] >= level[v])
				u = u2;
		}
		if (u == v)
			return u;
		for (int i = log - 1; i >= 0; i--) {
			int u2 = par[u][i], v2 = par[v][i];
			if (u2 != v2) {
				u = u2;
				v = v2;
			}
		}
		return par[u][0];
	}
	static int lastChild(int u,int grandPar) {
		for (int i = log - 1; i >= 0; i--) {
			int u2 = par[u][i];
			if (level[u2] > level[grandPar])
				u = u2;
		}
		return u;
	}
	static void dfs(int u, int p) {
		par[u][0] = p;
		for (int i = 1; i < log; i++)
			par[u][i] = par[par[u][i - 1]][i - 1];
		for (int[]v : adj[u])
			if (v[0] != p) {
				level[v[0]] = level[u] + 1;
				dfs(v[0], u);
			}

	}
	static long[]pref;
	static void lastDfs(int i,int p,long curPref) {
		pref[i]=curPref;
		for(int[]q:qs[i]) {
			int lca=q[0],idx=q[1];
			ans[idx]+=curPref-pref[lca];
		}
		for(int[]nxt:adj[i]) {
			if(nxt[0]==p)continue;
			int u=nxt[0];
			long w=nxt[1];
			lastDfs(u, i, curPref+down[i]-Math.max(0, down[u]+in[u]-w-w));
		}
	}
