		in=sc.longArr(n);
		adj=new int[n][][];
		qs=new LinkedList[n];
		int[]sizes=new int[n];
		int[][]edges=new int[n-1][];
		for(int i=0;i<n;i++) {
			qs[i]=new LinkedList<int[]>();
		}
		for(int i=0;i<n-1;i++) {
			int x=sc.nextInt()-1,y=sc.nextInt()-1,w=sc.nextInt();
			edges[i]=new int[] {x,y,w};
			sizes[x]++;
			sizes[y]++;
		}
		for(int i=0;i<n;i++) {
			adj[i]=new int[sizes[i]][];
		}
		for(int i=0;i<n-1;i++) {
			int x=edges[i][0],y=edges[i][1],w=edges[i][2];
			adj[x][--sizes[x]]=new int[] {y,w};
			adj[y][--sizes[y]]=new int[] {x,w};
		}
		ans=new long[q];
		prefNodes=new long[n];
		prefEdges=new long[n];
		down=new long[n];
