		long ans=1;
		while(l<=r) {
			long mid=(l+r)/2;
			if(f(mid)<n) l=mid+1;
			else {
				ans=mid;
				r=mid-1;
			}
		}
		System.out.println(ans);
	}
	private static long min(long n2, long l) {
		return (n2<l?n2:l);
	}
	static long f(long h) {
		if(h<=H) {
			return h*(h+1)/2;
		}
		else {
			long l=h-H-1;
			long M=(h+H)/2;
			if(l%2==1) return (M+H)*(M-H+1)/2+(M-1)*M/2;
			else return (M+H)*(M-H+1)/2+(M+1)*M/2;
		}
	}
