	static boolean[] odd;
	static int oddNum;

	private static void addOrDel(int j) {
		if (odd[j]) {
			odd[j] = false;
			oddNum--;
		} else {
			odd[j] = true;
			oddNum++;
		}
	}

	public static void main(String[] args) {
		Scanner in = new Scanner(new BufferedInputStream(System.in));
		PrintWriter out = new PrintWriter(new OutputStreamWriter(System.out));
		int t = in.nextInt();
		for (int i = 0; i < t; i++) {
			odd = new boolean[10];
			oddNum = 0;
			int flag = 0;
			char[] s = in.next().toCharArray();
			int len = s.length;
			char[] st = new char[len];
			System.arraycopy(s, 0, st, 0, s.length);
			for (int j = 0; j < len; j++) {
				int ord = s[j] - '0';
				addOrDel(ord);
			}

			for (int j = len - 1; j >= 0; j--) {
				if (flag == 1)
					break;
				int ord = s[j] - '0';
				addOrDel(ord);
				int tmp = ord - 1;
				while (tmp > 0 || (tmp == 0 && j != 0)) {
					addOrDel(tmp);
					st[j] = (char) (tmp + '0');
					int rem = (len - j - 1);
					if (oddNum <= rem) {
						if ((rem - oddNum) % 2 == 0) {
							for (int k = 1; k <= rem - oddNum; k++)
								st[j + k] = '9';
							for (int k = j + rem - oddNum + 1; k < len; k++) {
								int n = 9;
								for (int l = 9; l >= 0; l--)
									if (odd[l]) {
										n = l;
										addOrDel(l);
										break;
									}
								st[k] = (char) (n + '0');
							}
							out.println(st);
							flag = 1;
							break;
						}
					}
					addOrDel(tmp);
					tmp--;
				}
			}
			if (flag == 0) {
				for (int j = 0; j < len - 2; j++)
					out.print('9');
				out.println();
			}
			continue;
		}
		out.close();
	}
}
