    static class EPerpetualSubtraction {
        int mod = 998244353;
        Modular modular = new Modular(mod);
        Power pow = new Power(modular);
        Debug debug = new Debug(true);
        NumberTheoryTransform ntt = new NumberTheoryTransform(modular);

        public void solve(int testNumber, FastInput in, FastOutput out) {
            int n = in.readInt();
            long m = in.readLong();

            int[] p = new int[n + 1];
            in.populate(p);

            Factorial factorial = new Factorial(n + 1, mod);
            int[] p0 = p;
            int[] p1 = new int[n + 1];
            int[] p2 = new int[n + 1];
            int[] p3 = new int[n + 1];

            {
                IntegerArrayList a = Polynomials.listBuffer.alloc();
                IntegerArrayList b = Polynomials.listBuffer.alloc();
                IntegerArrayList c = Polynomials.listBuffer.alloc();
                a.expandWith(0, n + 1);
                b.expandWith(0, n + 1);

                for (int i = 0; i <= n; i++) {
                    a.set(i, (int) ((long) factorial.fact(i) * p0[i] % mod));
                    b.set(i, factorial.invFact(i));
                }

                ntt.deltaNTT(a, b, c);
                c.expandWith(0, n + 1);
                for (int i = 0; i <= n; i++) {
                    p1[i] = (int) ((long) c.get(i) * factorial.invFact(i) % mod);
                }

                Polynomials.listBuffer.release(a);
                Polynomials.listBuffer.release(b);
                Polynomials.listBuffer.release(c);
            }

            for (int i = 0; i <= n; i++) {
                p2[i] = (int) ((long) pow.inversePower(i + 1, m) * p1[i] % mod);
            }

            {
                IntegerArrayList a = Polynomials.listBuffer.alloc();
                IntegerArrayList b = Polynomials.listBuffer.alloc();
                IntegerArrayList c = Polynomials.listBuffer.alloc();
                a.expandWith(0, n + 1);
                b.expandWith(0, n + 1);

                for (int i = 0; i <= n; i++) {
                    a.set(i, (int) ((long) factorial.fact(i) * p2[i] % mod));
                    b.set(i, DigitUtils.mod((i % 2 == 0 ? 1 : -1) * factorial.invFact(i), mod));
                }

                ntt.deltaNTT(a, b, c);
                c.expandWith(0, n + 1);
                for (int i = 0; i <= n; i++) {
                    p3[i] = (int) ((long) c.get(i) * factorial.invFact(i) % mod);
                }

                Polynomials.listBuffer.release(a);
                Polynomials.listBuffer.release(b);
                Polynomials.listBuffer.release(c);
            }

            for (int i = 0; i <= n; i++) {
                out.println(p3[i]);
            }

            debug.debug("p0", p0);
            debug.debug("p1", p1);
            debug.debug("p2", p2);
            debug.debug("p3", p3);
        }

    }

    static class PrimitiveRoot {
        private int[] factors;
        private Modular mod;
        private Power pow;
        int phi;

        public PrimitiveRoot(Modular x) {
            phi = x.getMod() - 1;
            mod = x;
            pow = new Power(mod);
            //factors = rho.findAllFactors(phi).keySet().stream().mapToInt(Integer::intValue).toArray();
            factors = Factorization.factorizeNumberPrime(phi).toArray();
        }

        public PrimitiveRoot(int x) {
            this(new Modular(x));
        }

        public int findMinPrimitiveRoot() {
            if (mod.getMod() == 2) {
                return 1;
            }
            return findMinPrimitiveRoot(2);
        }

        private int findMinPrimitiveRoot(int since) {
            for (int i = since; i < mod.m; i++) {
                boolean flag = true;
                for (int f : factors) {
                    if (pow.pow(i, phi / f) == 1) {
                        flag = false;
                        break;
                    }
                }
                if (flag) {
                    return i;
                }
            }
            return -1;
        }

    }

    static class FastInput {
        private final InputStream is;
        private byte[] buf = new byte[1 << 13];
        private int bufLen;
        private int bufOffset;
        private int next;

        public FastInput(InputStream is) {
            this.is = is;
        }

        public void populate(int[] data) {
            for (int i = 0; i < data.length; i++) {
                data[i] = readInt();
            }
        }

        private int read() {
            while (bufLen == bufOffset) {
                bufOffset = 0;
                try {
                    bufLen = is.read(buf);
                } catch (IOException e) {
                    bufLen = -1;
                }
                if (bufLen == -1) {
                    return -1;
                }
            }
            return buf[bufOffset++];
        }

        public void skipBlank() {
            while (next >= 0 && next <= 32) {
                next = read();
            }
        }

        public int readInt() {
            int sign = 1;

            skipBlank();
            if (next == '+' || next == '-') {
                sign = next == '+' ? 1 : -1;
                next = read();
            }

            int val = 0;
            if (sign == 1) {
                while (next >= '0' && next <= '9') {
                    val = val * 10 + next - '0';
                    next = read();
                }
            } else {
                while (next >= '0' && next <= '9') {
                    val = val * 10 - next + '0';
                    next = read();
                }
            }

            return val;
        }

        public long readLong() {
            int sign = 1;

            skipBlank();
            if (next == '+' || next == '-') {
                sign = next == '+' ? 1 : -1;
                next = read();
            }

            long val = 0;
            if (sign == 1) {
                while (next >= '0' && next <= '9') {
                    val = val * 10 + next - '0';
                    next = read();
                }
            } else {
                while (next >= '0' && next <= '9') {
                    val = val * 10 - next + '0';
                    next = read();
                }
            }

            return val;
        }

    }

