		st = new StringTokenizer(sc.nextLine());
		long[] C = new long[31];
		for (int i = 0; i < N; i++) {
			C[i] = Integer.parseInt(st.nextToken());
		}
		for (int i = N; i < C.length; i++) {
			C[i] = C[i - 1] << 1;
		}

		for (int i = 1; i < C.length; i++) {
			C[i] = Math.min(C[i], C[i - 1] << 1);
		}

		long ans = 0;
		for (int i = 0; i < C.length; i++) {
			if (ans > C[i]) {
				L += 1 << i;
				ans = 0;
			}
			if ((L & (1 << i)) != 0) {
				ans += C[i];
			}
		}

		System.out.println(ans);

		sc.close();
	}
}
