import java.io.BufferedReader;
import java.io.InputStreamReader;
import java.io.PrintWriter;
import java.util.Arrays;
import java.util.StringTokenizer;

public class ss {
	int a[];
	boolean can;

	public static void main(String[] args) {
		ss solver = new ss();
		solver.solve();
	}

	void solve() {
		FastScanner in = new FastScanner();
		PrintWriter out = new PrintWriter(System.out);
		int n = in.nextInt(), k = in.nextInt();
		a = new int[n];
		Arrays.fill(a, -1);
		for (int i = 0; i < k; i++) a[i] = in.nextInt();
		can = true;
		solve1(0, n-1, 1, n);
		if (!can) {
			out.println(-1);
		} else {
			for (int i = 0; i < n; i++) out.printf("%d ", a[i]);
			out.println("");
		}
		out.flush();
	}

	void solve1(int l, int r, int from, int to) {
		if (l > r || from > to) return;
		if (a[l] == -1) {
			for (int i = l; i <= r; i++) a[i] = to - (i - l);
			return;
		}
		if (a[l] > to || a[l] < from) {
			can = false;
			return;
		}
		int len_left = a[l] - from;
		int len_right = to - a[l];
		solve1(l + 1, l + len_left, from, a[l] - 1);
		solve1(r - len_right + 1, r, a[l] + 1, to);
	}

	static class FastScanner {
		BufferedReader br = new BufferedReader(new InputStreamReader(System.in));
		StringTokenizer tok = new StringTokenizer("");
		String next() {
			while(!tok.hasMoreTokens()) {
				try {
					tok = new StringTokenizer(br.readLine());
				} catch (Exception e) {
