import java.io.*;
import java.util.*;

public class CF897C extends PrintWriter {
	CF897C() { super(System.out, true); }
	Scanner sc = new Scanner(System.in);
	public static void main(String[] $) {
		CF897C o = new CF897C(); o.main(); o.flush();
	}

	byte[] ff = "What are you doing at the end of the world? Are you busy? Will you save us?".getBytes();
	byte[] aa = "What are you doing while sending "".getBytes();
	byte[] bb = ""? Are you busy? Will you send "".getBytes();
	byte[] cc = ""?".getBytes();
	int nf, na, nb, nc;
	static final int N = 100000;
	long[] ll = new long[N + 1];
	byte get(int n, long k) {
		if (n == 0)
			return ff[(int) k - 1];
		if (k <= na)
			return aa[(int) k - 1];
		k -= na;
		if (k <= ll[n - 1])
			return get(n - 1, k);
		k -= ll[n - 1];
		if (k <= nb)
			return bb[(int) k - 1];
		k -= nb;
		if (k <= ll[n - 1])
			return get(n - 1, k);
		k -= ll[n - 1];
		return cc[(int) k - 1];
	}
	void main() {
		nf = ff.length; na = aa.length; nb = bb.length; nc = cc.length;
		ll[0] = nf;
		for (int n = 1; n <= N; n++)
			ll[n] = Math.min(ll[n - 1] * 2 + na + nb + nc, (long) 2e18);
		int q = sc.nextInt();
		byte[] ans = new byte[q];
		for (int h = 0; h < q; h++) {
			int n = sc.nextInt();
			long k = sc.nextLong();
			ans[h] = k > ll[n] ? (byte) '.' : get(n, k);
		}
		println(new String(ans));
	}
}
