import static java.lang.Math.*;

public class C{

	static long[] num =  new long[(int)1e5+10];
	static boolean[] vis = new boolean[num.length];

	static String base = "What are you doing at the end of the world? Are you busy? Will you save us?";
	// Recur is  "What are you doing while sending "x"? Are you busy? Will you send "x"?"

	static String[] rec = {
			"What are you doing while sending "",
			""? Are you busy? Will you send "",
			""?"
	};

	static char ans(int n, long k) {
		if (n==0) {
			return base.charAt((int)(k-1));
		}

		for (int it =0; it <  3; it++) {
			for (int i = 0; i < rec[it].length(); i++) {
				k--;
				if (k==0) return rec[it].charAt(i);
			}
			if (!vis[n-1] || k-num[n-1] <= 0) return ans(n-1,k);
			k-=num[n-1];
		}

		return '.';
	}

	public static void main(String[] args) throws IOException {
		// br = new BufferedReader(new FileReader(".in"));
		// out = new PrintWriter(new FileWriter(".out"));
