		String recur = "What are you doing while sending ""? Are you busy? Will you send ""?";
		Arrays.fill(num, Long.MAX_VALUE/3);
		num[0] = base.length();
		vis[0]=true;
		for (int i =1; i < num.length; i++) {
			num[i] = recur.length() + 2*num[i-1];
			if (num[i] > Long.MAX_VALUE/8) break;
			vis[i]=true;
		}
		while(q-->0) {
			int n =readInt();
			long  k=readLong();
			//System.out.println(n + "  " + k);
			if (k > num[n]) out.print('.');
			else out.print(ans(n,k));
		}
		out.println();

		out.close();
