import java.io.*;
import java.util.*;
import java.math.*;
public class A {
	public static long length[] = new long[100001];
	public static void main(String[] args)throws IOException {
		FastIO sc = new FastIO(System.in);
		PrintWriter out = new PrintWriter(System.out);
		int q = sc.nextInt();
		String f0 = "What are you doing at the end of the world? Are you busy? Will you save us?";
		String f1 = "What are you doing while sending "";
		String f2 = ""? Are you busy? Will you send "";
		String f3 = ""?";
		length[0] = f0.length();
		for(int i=1; i<100001; ++i) {
			if(length[i-1]>=(long)1e18) {
				length[i] = (long)1e18;
			}else {
				length[i] = length[i-1]*2  + f1.length() + f2.length() + f3.length();
			}
		}
		while(q-->0) {
			int n= sc.nextInt();
			long k = sc.nextLong()-1;
			System.out.print(solve(n, k, f1, f2, f3, f0));
		}
		out.close();
	}
	public static char solve(int n,long k, String a, String b, String c, String d) {
		if(length[n]<=k) return '.';
		if(n==0) {
			return d.charAt((int)k);
		}
		if(k<a.length()) {
			return a.charAt((int)k);
		}
		k-=a.length();
		if(k<length[n-1]) {
			return solve(n-1, k, a, b, c, d);
		}
		k-=length[n-1];
		if(k<b.length()) {
			return b.charAt((int)k);
		}
		k-=b.length();
		if(k<length[n-1]) {
			return solve(n-1, k, a, b, c, d);
		}
		k-=length[n-1];
		return c.charAt((int)k);
	}
	static class FastIO {
		InputStream dis;
		byte[] buffer = new byte[1 << 17];
		int pointer = 0;
		public FastIO(String fileName) throws IOException {
			dis = new FileInputStream(fileName);
		}
		public FastIO(InputStream is) throws IOException {
			dis = is;
		}
		int nextInt() throws IOException {
			int ret = 0;

			byte b;
			do {
				b = nextByte();
			} while (b <= ' ');
			boolean negative = false;
			if (b == '-') {
				negative = true;
				b = nextByte();
			}
			while (b >= '0' && b <= '9') {
				ret = 10 * ret + b - '0';
				b = nextByte();
			}

			return (negative) ? -ret : ret;
		}
		long nextLong() throws IOException {
			long ret = 0;

			byte b;
			do {
				b = nextByte();
			} while (b <= ' ');
			boolean negative = false;
			if (b == '-') {
				negative = true;
				b = nextByte();
			}
			while (b >= '0' && b <= '9') {
				ret = 10 * ret + b - '0';
				b = nextByte();
			}
			return (negative) ? -ret : ret;
		}
		byte nextByte() throws IOException {
			if (pointer == buffer.length) {
				dis.read(buffer, 0, buffer.length);
				pointer = 0;
			}
			return buffer[pointer++];
		}
		String next() throws IOException {
			StringBuffer ret = new StringBuffer();

			byte b;
			do {
				b = nextByte();
			} while (b <= ' ');
			while (b > ' ') {
				ret.appendCodePoint(b);
				b = nextByte();
			}

			return ret.toString();
		}
	}
}
