import java.io.BufferedReader;
import java.io.IOException;
import java.io.InputStreamReader;
import java.math.BigInteger;
import java.util.StringTokenizer;

public class Nephren {

    static String f0 = "What are you doing at the end of the world? Are you busy? Will you save us?";
    static String fb = "What are you doing while sending "";
    public static final int FBL = fb.length();
    static String fm = ""? Are you busy? Will you send "";
    public static final int FML = fm.length();
    static String fe = ""?";
    public static final int FEL = fe.length();

    static BigInteger f0Size = BigInteger.valueOf(f0.length());
    static BigInteger connectorSize = BigInteger.valueOf(fb.length()+fm.length()+fe.length());

    public static long size(int n) {
        if(n>63) return Long.MAX_VALUE;
        BigInteger pow = BigInteger.TWO.pow(n);
        BigInteger f0chars = pow.multiply(f0Size);
        BigInteger connectorChars = pow.subtract(BigInteger.ONE).multiply(connectorSize);
        BigInteger size = f0chars.add(connectorChars);
        if(size.bitLength() > 63) return Long.MAX_VALUE;
        return size.longValue();
    }
    public static char kchar(int n, long k) {
        // 0 base case
        if(n == 0) {
            if(k <= f0.length()) return f0.charAt((int) (k-1));
            else return '.';
        }

        if(k <= fb.length()) return fb.charAt((int) (k-1));
        long kt = k - fb.length();
        if(kt <= size(n-1)) return kchar(n-1, kt);
        kt -= size(n-1);
        if(kt <= fm.length()) return fm.charAt((int) (kt-1));
        kt -= fm.length();
        if(kt <= size(n-1)) return kchar(n-1, kt);
        kt -= size(n-1);
        if(kt <= fe.length()) return fe.charAt((int) (kt-1));

        //k > size(n)
        return '.';
    }

    public static char kchar2(int n, long k) {
        long kt = k;
        while(n>0) {

            if (kt <= FBL) return fb.charAt((int) (kt - 1));
            kt -= fb.length();
            long sn1 = size(n - 1);
            if (kt <= sn1) {
                n--;
                continue;
            }
            kt -= sn1;
            if (kt <= FML) return fm.charAt((int) (kt - 1));
            kt -= fm.length();
            if (kt <= sn1) {
                n--;
                continue;
            }
            kt -= sn1;
            if (kt <= FEL) return fe.charAt((int) (kt - 1));

            //k > size(n)
            return '.';
        }
        if(kt <= f0.length()) return f0.charAt((int) (kt-1));
        else return '.';

    }


    public static void main(String[] args) throws IOException {

//        System.out.println(size(999));
//        System.exit(0);
        BufferedReader f = new BufferedReader(new InputStreamReader(System.in));
        int q = Integer.parseInt(f.readLine());

        for(int i=0; i<q; i++) {
            StringTokenizer st = new StringTokenizer(f.readLine());
            int n = Integer.parseInt(st.nextToken());
            long k = Long.parseLong(st.nextToken());
            System.out.print(kchar2(n,k));
        }



    }
}
