import java.io.*;
import java.util.*;
import static java.lang.Math.*;

public class E implements Runnable{
	// Beginning of SCC template
	static int n;

	static class Edge{
		int to,nxt;
		long w;
		public Edge(int a, long b) {
			to=a;
			w=b;
		}
	}
	static Edge[] g, rg, adj;
	static int[] gh, rgh, adjh;

	static int[] scc;
	static Stack<Integer> stack = new Stack<Integer>();

	static void dfs1(int i) {
		if (scc[i]++!=0)return;
		for (int ind = gh[i]; ind != -1; ind = g[ind].nxt) dfs1(g[ind].to);
		stack.push(i);
	}
	static void dfs2(int i, int v) {
		if (scc[i] != -1) return;
		scc[i]=v;
		for (int ind = rgh[i]; ind != -1; ind = rg[ind].nxt) dfs2(rg[ind].to,v);
	}

	static long[] scc_sum;

	static void solve() {
		scc = new int[n];
		scc_sum = new long[n];
		Arrays.fill(scc, 0);
		for (int i = 0; i < n; i++) dfs1(i);
		Arrays.fill(scc, -1);
		int v = 0;
		while(!stack.isEmpty()) {
			int h =stack.pop();
			if (scc[h]==-1) dfs2(h,v++);
		}
		int outerInd = 0;
		for (int i = 0; i < n; i++) {
			for (int ind = gh[i]; ind != -1; ind = g[ind].nxt) {
				if (scc[g[ind].to] == scc[i]) {
					scc_sum[scc[i]]-=fxn(g[ind].w);
				}
				else {
					adj[outerInd] = new Edge(scc[g[ind].to], -g[ind].w);
					adj[outerInd].nxt = adjh[scc[i]];
					adjh[scc[i]] = outerInd++;
				}
			}
		}
	}
	// End of SCC Template
	static boolean[] vis;
	static Stack<Integer> topo = new Stack<Integer>();

	static void topo(int i) {
		if (vis[i]) return;
		vis[i] = true;
		for (int ind = adjh[i]; ind != -1; ind = adj[ind].nxt) topo(adj[ind].to);
		topo.add(i);
	}


	static long[] dists;

	static long fxn(long input) {
		// So n-1, n-2, n-3, etc. until done.
		 long l = -1, r = (long)1e8;
		 if (input == 0 ) return 0;
		 while(l+1<r) {
			 long m =(l+r)>>>1;
			if (m * (m+1)/2 < input) l = m;
			else r = m;
		 }

		 long sub = pref[(int)l];
		 long res = (l+1)*input - sub;
		 //System.out.println("Yo " + sub + " " + res);
		 //System.out.println("Yo " + res + " " + l);
		 return res;
	}

	static long[] pref;

	public static void main(String[] args) throws IOException {
		// br = new BufferedReader(new FileReader(".in"));
		// out = new PrintWriter(new FileWriter(".out"));
		new Thread(null, new E(), "peepee", 1<<28).start();

	}

	static BufferedReader br = new BufferedReader(new InputStreamReader(System.in));
	static PrintWriter out = new PrintWriter(new BufferedOutputStream(System.out));
	static StringTokenizer st = new StringTokenizer("");
	static String read() throws IOException{return st.hasMoreTokens() ? st.nextToken():(st = new StringTokenizer(br.readLine())).nextToken();}
	static int readInt() throws IOException{return Integer.parseInt(read());}
	static long readLong() throws IOException{return Long.parseLong(read());}
	static double readDouble() throws IOException{return Double.parseDouble(read());}
	@Override
	public void run() {
		// TODO Auto-generated method stub
		try {
			pref = new long[(int)1e5];
			for (int i = 1; i < 1e5; i++) {
				pref[i] += pref[i-1];
				long ans = i;
				ans *= (i+1);
				pref[i] += ans/2;
			}



			n =readInt();
			int m =readInt();
			g = new Edge[m];
			adj = new Edge[m];
			rg = new Edge[m];
			gh = new int[n];
			adjh = new int[n];
			rgh = new int[n];

			for (int i =0 ; i < n; i++) gh[i] = adjh[i] = rgh[i] = -1;
			for (int i =0 ; i < m; i++) {
				int x = readInt()-1;
				int y =readInt()-1;
				int w = readInt();
				g[i] = new Edge(y,w);
				g[i].nxt = gh[x];
				gh[x] = i;

				rg[i] = new Edge(x,w);
				rg[i].nxt = rgh[y];
				rgh[y] = i;
			}
			int start_pt = readInt()-1;
			solve();


			//for (long x: scc_sum) out.println(x);
			dists = new long[n];
			vis = new boolean[n];
			//System.out.println(scc_sum[0]);
			topo(scc[start_pt]);
			while(!topo.isEmpty()) {
				int h = topo.pop();
				dists[h]+=scc_sum[h];
				for (int ind = adjh[h]; ind != -1; ind = adj[ind].nxt) dists[adj[ind].to] = min(adj[ind].w + dists[h], dists[adj[ind].to]);
			}
			long max = 0;
			for (int i =0 ; i < n; i++) {
				max = min(max,dists[i]);
			}
			out.println(-max);

			out.close();
		}
		catch (IOException  e) {}
	}
},"dp,graphs"

