		}
	}
	L[] ao, ai;
	int[] ii, jj, ww;
	int[] po, cc;
	int npo;
	int[] stack;
	void dfs1(int i) {
		int cnt = 0;
		stack[cnt++] = i;
		while (cnt > 0) {
			i = stack[cnt - 1];
			if (cc[i] == 0) {
				cc[i] = 1;
				for (L l = ao[i]; l != null; l = l.next) {
					int h = l.e;
					int j = jj[h];
					if (cc[j] == 0)
						stack[cnt++] = j;
				}
			} else {
				cnt--;
				if (cc[i] == 1) {
					po[npo++] = i;
					cc[i] = -1;
				}
			}
		}
	}
	void dfs2(int c) {
		int cnt = 0;
		cc[c] = c; stack[cnt++] = c;
		while (cnt > 0) {
			int j = stack[--cnt];
			for (L l = ai[j]; l != null; l = l.next) {
				int h = l.e;
				int i = ii[h];
				if (cc[i] == -1) {
					cc[i] = c; stack[cnt++] = i;
				}
			}
		}
	}
	long all(int w) {
		int n = (int) Math.sqrt(w << 1) - 1;
		while ((n + 1) * (n + 2) <= w << 1)
			n++;
		return (long) (n + 1) * w - (long) n * (n + 1) * (n + 2) / 6;
	}
