import java.io.*;
import java.util.*;
public class Pride {

	static int gcd(int a, int b)
	{
		if(a==0)
			return b;
		return gcd(b%a,a);
	}
	public static void main(String[] args) {
		Scanner sc=new Scanner(System.in);
		int n=sc.nextInt();
		int gcd=0,one=0;
		HashSet<Integer> set=new HashSet<>();
		int a[]=new int[n];
		for(int i=0;i<n;i++)
		{
			a[i]=sc.nextInt();
			if(a[i]==1)
				one++;
			set.add(a[i]);
			gcd=gcd(gcd,a[i]);
		}
		if(gcd!=1)
		{
			System.out.println(-1);
			System.exit(0);
		}
		int min=Integer.MAX_VALUE;
		//Minimum number of steps to convert any one number to 1 = (size of minimum subarray with gcd=1)-1
		//Thus to find this minimum steps we iterate through all possible subarrays since n=2000 at max.
		for(int i=0;i<n;i++)
		{
			int x=0;
			for(int j=i;j<n;j++)
			{
				x=gcd(x,a[j]);
				if(x==1 && (j-i+1)<min)
					min=j-i+1;
			}
		}
		if(one==0)
			one++;
		System.out.println((n-1+min-1-(one-1)));

	}

}
