public class Codeforces878D {

	public static void main(String[] args) throws IOException {
		BufferedReader br = new BufferedReader(new InputStreamReader(System.in));
		PrintWriter pw = new PrintWriter(System.out);
		StringTokenizer st = new StringTokenizer(br.readLine());
		int n = Integer.parseInt(st.nextToken());
		int k = Integer.parseInt(st.nextToken());
		int q = Integer.parseInt(st.nextToken());

		int[][] a = new int[k][n];
		for (int i = 0; i < k; i++) {
			st = new StringTokenizer(br.readLine());
			for (int j = 0; j < n; j++) {
				a[i][j] = Integer.parseInt(st.nextToken());
			}
		}

		int numcreatures = k;
		int[][] query = new int[q][3];
		for (int i = 0; i < q; i++) {
			st = new StringTokenizer(br.readLine());
			for (int j = 0; j < 3; j++) {
				query[i][j] = Integer.parseInt(st.nextToken());
			}
			if (query[i][0] < 3) {
				numcreatures++;
			}
		}

		//ok rip now the hard stuff begins
		boolean[][] alloptions = new boolean[numcreatures][(1<<k)];
		for (int i = 0; i < k; i++) {
			for (int j = 0; j < (1<<k); j++) {
				if ((j>>i)%2 == 1) {
					alloptions[i][j] = true;
				}
			}
		}

		int creatureCounter = k;
		for (int i = 0; i < q; i++) {
			if (query[i][0] == 1) {
				for (int j = 0; j < (1<<k); j++) {
					alloptions[creatureCounter][j] = (alloptions[query[i][1]-1][j])||(alloptions[query[i][2]-1][j]);
				}
				creatureCounter++;
			}
			else if (query[i][0] == 2) {
				for (int j = 0; j < (1<<k); j++) {
					alloptions[creatureCounter][j] = (alloptions[query[i][1]-1][j])&&(alloptions[query[i][2]-1][j]);
				}
				creatureCounter++;
			}
			else {
				int[][] hardProblem = new int[k][2];
				for (int j = 0; j < k; j++) {
					hardProblem[j][0] = a[j][query[i][2]-1];
					hardProblem[j][1] = j;
				}
				keysort(hardProblem, 0);

				boolean bool = false;
				int ctr = k-1;
				int ctr2 = 0;
				while(!bool) {
					ctr2 += (1<<hardProblem[ctr][1]);
					if (alloptions[query[i][1]-1][ctr2]) {
						bool = true;
						pw.println(hardProblem[ctr][0]);
					}
					else {
						ctr--;
					}
				}
			}
		}
		pw.close();
	}

	public static void keysort(int[][] array, int index) {
    	int N = array.length;
    	if (N != 1) {
    		int[][] firstHalf = Arrays.copyOfRange(array, 0, N/2);
    		keysort(firstHalf, index);
        	int[][] secondHalf = Arrays.copyOfRange(array, N/2, N);
        	keysort(secondHalf, index);
        	int firstCounter = 0;
        	int secondCounter = 0;
        	for (int i = 0; i < N; i++) {
        		if (firstCounter == N/2) {
        			array[firstCounter+secondCounter] = secondHalf[secondCounter];
        			secondCounter++;
        		}
        		else if ((secondCounter == N-N/2) || firstHalf[firstCounter][index] <= secondHalf[secondCounter][index]) {
        			array[firstCounter+secondCounter] = firstHalf[firstCounter];
        			firstCounter++;
        		}
        		else {
        			array[firstCounter+secondCounter] = secondHalf[secondCounter];
        			secondCounter++;
        		}
        	}
    	}	
    }

}
