        int h = fs.nextInt(), m = fs.nextInt(), s = fs.nextInt(), t1 = fs.nextInt(), t2 = fs.nextInt();
        // Always ensure t1 < t2, else swap them
        if (t1 > t2) {
            int temp = t1;
            t1 = t2;
            t2 = temp;
        }
        int count = 0;
        if (t2 > h && t1 <= h) {
            count++;
        }
        if (t2 * 5 > m && t1 * 5 <= m) {
            count++;
        }
        if (t2 * 5 > s && t1 * 5 <= s) {
            count++;
        }
        if (count == 0 || count == 3) {
            System.out.println("YES");
