/*
4
1 5
5 2
3 7
7 3

1
1 2

For any graph, the # of possible arrangements is 1 (not moving anything) plus the number of nodes that are not part of a cycle plus one (to account for the cycle if there is one, otherwise dont add one), if the connected component size is greater than 1
Multiply all of these together

If it leads to an 'impossible cycle' where an employee wishes to sit in their own seat, cannot move any of the numbers in the connected component
*/
import java.util.*;
import java.io.*;

public class Main {
  public static int nE; //# of engineers
  public static Node[] nodes; 
  public static int[] parent; 
  public static int[] edgeSize; 
  public static int[] nodeSize; 
  public static long mod = 1000000007;  
  public static boolean[] used; 
  public static int find(int a){
    if(parent[a] == a) return a;
    parent[a] = find(parent[a]);
    return parent[a];  
  }
  public static void union(int a, int b){
    int finda = find(a);
    int findb = find(b); 
    if(finda == findb) return; 
    if(nodeSize[finda] < nodeSize[findb]){
      if(used[finda]) used[findb] = true; 
      edgeSize[findb] += edgeSize[finda];
      nodeSize[findb] += nodeSize[finda];
      parent[finda] = findb; 
    }
    else{
      if(used[findb]) used[finda] = true; //do not want any self loops
      edgeSize[finda] += edgeSize[findb];
      nodeSize[finda] += nodeSize[findb];
      parent[findb] = finda; 
    }
  }
  public static void main(String[] args) throws IOException{
    BufferedReader br = new BufferedReader(new InputStreamReader(System.in));

    nE = Integer.parseInt(br.readLine());
    nodes = new Node[nE * 2];
    parent = new int[nE * 2];
    edgeSize = new int[nE * 2]; 
    nodeSize = new int[nE * 2];
    used = new boolean[nE * 2];
    for(int x = 0; x < nE * 2; x++){
      nodes[x] = new Node(x, -1);
      parent[x] = x; 
      nodeSize[x] = 1;
    }

    for(int y = 0; y < nE; y++){
      StringTokenizer edge = new StringTokenizer(br.readLine());
      int first = Integer.parseInt(edge.nextToken()) - 1;
      int second = Integer.parseInt(edge.nextToken()) - 1;
      if(first == second) used[find(first)] = true; 
      union(first, second);
      nodes[first].connection = second;
      edgeSize[find(first)]++; //# of edges
    }

    long ret = 1; 

    for(int y = 0; y < nE * 2; y++){
      if(nodeSize[find(y)] > 1 && !used[find(y)]){
        if(edgeSize[find(y)] == nodeSize[find(y)] - 1){
          //System.out.println(find(y) + " one " + nodeSize[find(y)]);
          ret = (ret * nodeSize[find(y)]) % mod;
        }
        else{
          //System.out.println(find(y) + " two");
          ret = (ret * 2) % mod;
        }
        used[find(y)] = true; 
      }
    }

    System.out.println(ret);

    br.close();
  }
}

