import java.io.*;
import java.util.*;
import java.math.*;

public class Main {
    private static final long mod = (long) (1e9 + 7);

    public static void solve() {
        int n = in.nextInt();
        int m = in.nextInt();

        int l = 1;
        int r = Integer.MAX_VALUE;

        for (int i = 0; i < m; i++) {
            int k = in.nextInt();
            int f = in.nextInt();

            l = Math.max(l, (k / f) + (k % f == 0 ? 0 : 1));

            if (f > 1) {
                r = Math.min(r, (k - 1) / (f - 1));
            }
        }

        if ((n - 1) / l + 1 == (n - 1) / r + 1) {
            out.println((n - 1) / l + 1);
        } else {
            out.println(-1);
        }
    }

    public static InputReader in = new InputReader();
    public static PrintWriter out;

    public static void main(String[] args) {
        out = new PrintWriter(System.out);
        solve();
        out.close();
    }

    private static long pow(long a, long b) {
        if (b == 0)
            return 1L;

        long val = pow(a, b / 2);

        if (b % 2 == 0)
            return val * val % mod;
        else
            return val * val % mod * a % mod;
    }

    private static class Pair<K, V> {
        K first;
        V second;

        public Pair(K first, V second) {
            this.first = first;
            this.second = second;
        }
    }

    static class InputReader {
        public BufferedReader reader;
        public StringTokenizer tokenizer;

        public InputReader() {
            reader = new BufferedReader(new InputStreamReader(System.in));
            tokenizer = null;
        }

        public String next() {
            while (tokenizer == null || !tokenizer.hasMoreTokens()) {
                try {
                    tokenizer = new StringTokenizer(reader.readLine());
                } catch (IOException e) {
                    throw new RuntimeException(e);
                }
            }
            return tokenizer.nextToken();
        }

        public int nextInt() {
            return Integer.parseInt(next());
        }

        public double nextDouble() {
            return Double.parseDouble(next());
        }

        public long nextLong() {
            return Long.parseLong(next());
        }

        /**
         * When you call next(), that entire line will be skipped. No flushing buffers.
         * Doesn't work when you want to scan the remaining line.
         *
         * @return entire line
         */
        public String nextLine() {
            String str = "";
            try {
                str = reader.readLine();
                tokenizer = null;
            } catch (IOException e) {
                throw new RuntimeException(e);
            }
            return str;
        }
    }
