public class p853D 
{
	static final int INF = (int)1e9;
	public static void main(String[] args) throws IOException 
	{
		BufferedReader f = new BufferedReader(new InputStreamReader(System.in));
		PrintWriter out = new PrintWriter(new BufferedWriter(new OutputStreamWriter(System.out)));
		StringTokenizer st;
		int size = Integer.parseInt(f.readLine());
		if(size == 1)
		{
			out.println(f.readLine());
			out.close();
			return;
		}
		st = new StringTokenizer(f.readLine());
		int[] a = new int[size];
		for(int i = 0; i < size; i++)
			a[i] = Integer.parseInt(st.nextToken()) / 100;
		int[][] dp = new int[a.length + 1][31];
		for(int[] temp : dp)
			Arrays.fill(temp, INF);
		dp[0][0] = 0;
		for(int r = 1; r <= size; r++)
		{
			for(int c = 0; c <= 30; c++)
			{
				int bonus = a[r - 1] / 10;
				if(c >= bonus)
					dp[r][c] = Math.min(dp[r][c], dp[r - 1][c - bonus] + a[r - 1]);
				for(int k = 1; k <= Math.min(a[r - 1], 30 - c); k++)
					dp[r][c] = Math.min(dp[r][c], dp[r - 1][c + k] + a[r - 1] - k);
			}
		}
//		for(int[] temp : dp)
//			System.out.println(Arrays.toString(temp));
		out.println(dp[size][0] * 100);
		out.close();
	}
},"binary search,dp,greedy"

import java.io.BufferedReader;
import java.io.BufferedWriter;
import java.io.IOException;
import java.io.InputStreamReader;
import java.io.OutputStreamWriter;
import java.io.PrintWriter;
import java.util.Arrays;
import java.util.StringTokenizer;

public class Div1_433D {

	public static void main(String[] args) throws IOException {
		BufferedReader reader = new BufferedReader(new InputStreamReader(System.in));
		PrintWriter printer = new PrintWriter(new BufferedWriter(new OutputStreamWriter(System.out)));
		int nD = Integer.parseInt(reader.readLine());
		StringTokenizer inputData = new StringTokenizer(reader.readLine());
		int[] req = new int[nD];
		for (int i = 0; i < nD; i++) {
			req[i] = Integer.parseInt(inputData.nextToken()) / 100;
		}

		int[][] dp = new int[nD][36];
		for (int i = 0; i < nD; i++) {
			Arrays.fill(dp[i], Integer.MAX_VALUE);
		}

		dp[0][req[0] / 10] = req[0];
		for (int i = 0; i < nD - 1; i++) {
			for (int j = 0; j <= 35; j++) {
				if (dp[i][j] != Integer.MAX_VALUE) {
					if (j + req[i + 1] / 10 <= 35) {
						dp[i + 1][j + req[i + 1] / 10] = Math.min(dp[i + 1][j + req[i + 1] / 10],
								dp[i][j] + req[i + 1]);
					}
					int delta = Math.min(j, req[i + 1]);
					dp[i + 1][j - delta] = Math.min(dp[i + 1][j - delta], dp[i][j] + req[i + 1] - delta);
				}
			}
		}

		int ans = Integer.MAX_VALUE;
		for (int i = 0; i <= 35; i++) {
			ans = Math.min(ans, dp[nD - 1][i]);
		}
		printer.println(ans * 100);
		printer.close();
	}
}
