import java.io.*;
import java.util.*;

public class CF853D extends PrintWriter {
	CF853D() { super(System.out, true); }
	Scanner sc = new Scanner(System.in);
	public static void main(String[] $) {
		CF853D o = new CF853D(); o.main(); o.flush();
	}

	void main() {
		int n = sc.nextInt();
		int[] aa = new int[n];
		int[] pp = new int[n];
		for (int i = 0; i < n; i++)
			pp[i] = aa[i] = sc.nextInt();
		for (int i = 1; i < n; i++)
			pp[i] += pp[i - 1];
		int[] ip = new int[n];
		int[] iq = new int[n];
		for (int i = 0, i_ = -1; i < n; i++) {
			if (aa[i] == 1000)
				i_ = i;
			ip[i] = i_;
		}
		for (int i = n - 1, i_ = n; i >= 0; i--) {
			if (aa[i] == 1000)
				i_ = i;
			iq[i] = i_;
		}
		int ans = n * 2000;
		for (int i = 0; i < n; i++) {
			int a, b, x, y;
			x = pp[i];
			a = x;
			b = x / 10;
			x = pp[n - 1] - pp[i]; y = Math.min(x, b);
			a += x - y;
			b -= y;
			ans = Math.min(ans, a);
			if (aa[i] == 2000) {
				int i_ = ip[i];
				if (i_ != -1) {
					x = i_ == 0 ? 0 : pp[i_ - 1];
					a = x;
					b = x / 10;
					x = aa[i_]; y = Math.min(x, b);
					a += x - y;
					b -= y;
					x = pp[i] - pp[i_];
					a += x;
					b += x / 10;
					x = pp[n - 1] - pp[i]; y = Math.min(x, b);
					a += x - y;
					b -= y;
					ans = Math.min(ans, a);
				}
				i_ = iq[i];
				if (i_ != n) {
					x = pp[i];
					a = x;
					b = x / 10;
					x = pp[i_ - 1] - pp[i]; y = Math.min(x, b);
					a += x - y;
					b -= y;
					x = aa[i_];
					a += x;
					b += x / 10;
					x = pp[n - 1] - pp[i_]; y = Math.min(x, b);
					a += x - y;
					b -= y;
					ans = Math.min(ans, a);
				}
			}
		}
		println(ans);
