import java.io.BufferedReader;
import java.io.IOException;
import java.io.InputStreamReader;
import java.io.PrintWriter;
import java.util.StringTokenizer;

public class Main {
	static BufferedReader reader;
	static StringTokenizer tokenizer;
	static PrintWriter writer;

	static String nextToken() throws IOException {
		while (tokenizer == null || !tokenizer.hasMoreTokens()) {
			tokenizer = new StringTokenizer(reader.readLine());
		}
		return tokenizer.nextToken();
	}

	static int nextInt() throws NumberFormatException, IOException {
		return Integer.parseInt(nextToken());
	}

	public static void main(String[] args) throws IOException {
		reader = new BufferedReader(new InputStreamReader(System.in));
		writer = new PrintWriter(System.out);
		banana();
		reader.close();
		writer.close();
	}

	static int n;
	static int[] a;
	static final int INF = 100000002;
	static final int MX = 52;

	static void banana() throws NumberFormatException, IOException {
		int n = nextInt();
		// long start = System.currentTimeMillis();
		a = new int[n];
		for (int i = 0; i < n; i++) {
			a[i] = nextInt() / 100;
			// a[i] = Math.random() < 0.5 ? 10 : 20;
		}

		int[][] dp = new int[n + 1][MX];
		for (int i = 0; i <= n; i++) {
			for (int j = 0; j < MX; j++) {
				dp[i][j] = INF;
			}
		}
		dp[0][0] = 0;

		for (int i = 0; i < n; i++) {
			int x = a[i];
			for (int curr = 0; curr < MX; curr++) {
				{
					// cash only
					int bonus = x / 10;
					if (curr + bonus >= MX) {
						break;
					}
					dp[i + 1][curr + bonus] = Math.min(dp[i + 1][curr + bonus], dp[i][curr] + x);
				}
				int sp = Math.min(curr, x);
				for (; sp > 0; sp--) {
					// use
					int left = curr - sp;
					int cand = dp[i][curr] + (x - sp);
					if (dp[i + 1][left] > cand) {
						dp[i + 1][left] = cand;
					}
				}
			}
		}

		int ans = INF;
		for (int curr = 0; curr < MX; curr++) {
			ans = Math.min(ans, dp[n][curr]);
		}
		writer.println(ans * 100);
		// writer.println(System.currentTimeMillis() - start);
	}
},"binary search,dp,greedy"

import java.io.BufferedReader;
import java.io.IOException;
import java.io.InputStreamReader;
import java.util.StringTokenizer;

public class Main {
    static BufferedReader reader;
    static StringTokenizer st;
    private static final int MOD = 1000000007;
    private static void setReader() {
        reader = new BufferedReader(new InputStreamReader(System.in));
    }
    private static void updateST() throws IOException {
        if (st==null || !st.hasMoreElements()) st = new StringTokenizer(reader.readLine());
    }
    private static int nextInt() throws IOException {
        updateST();
        return Integer.parseInt(st.nextToken());
    }
    private static int m;
    public static int[] pow(int[] a, int n) {
        int[] ans = new int[m];
        ans[0] = 1;
        while (n>0) {
            if (n%2==1) ans = multiply(ans, a);
            n/=2;
            a = multiply(a, a);
        }
        return ans;
    }
    public static int[] multiply(int[] a, int[] b) {
        int[] res = new int[m];
        for (int i=0; i<m; i++) {
            for (int j=0; j<m; j++) {
                res[(i + j) % m]+=((a[i] * 1L * b[j]) % MOD);
                res[(i + j) % m]%=MOD;
            }
        }
        return res;
    }
    public static void main(String[] args) throws IOException {
        setReader();
        int n = nextInt(), l = nextInt();
        m = nextInt();
        int[] first = new int[m];
        for (int i=0; i<n; i++) first[nextInt() % m]++;
        int[] mid = new int[n];
        int[] middle = new int[m];
        for (int i=0; i<n; i++) {
            mid[i] = nextInt();
            middle[mid[i] % m]++;
        }
        int[] p = pow(middle, l-2);
        int[] res = multiply(first, p);
        int result = 0;
        for (int i=0; i<n; i++) {
            int x = (mid[i] + nextInt()) % m;
            int rev = (m - x) % m;
            result+=res[rev];
            result%=MOD;
        }
        System.out.println(result);
    }
},"dp,matrices"

import java.io.*;
import java.util.*;

public class B852 {

	public static void main(String[] args) throws IOException {
		IO io = new IO(System.in);

		int n = io.nextInt();
		int l = io.nextInt();
		int m = io.nextInt();
		long MOD = 1000000007;

		int[] d = new int[n];
		long[] a = new long[m];
		long[] b = new long[m];
		int[] c = new int[n];

		for (int i = 0; i < n; i++) {
			a[io.nextInt()%m]++;
		}
		for (int i = 0; i < n; i++) {
			d[i] = io.nextInt();
			b[d[i]%m]++;
		}
		for (int i = 0; i < n; i++) {
			c[i] = io.nextInt();
		}

		// Go to first layer
		long[] res = a;

		long[][] A = new long[m][m];
		for (int i = 0; i < m; i++) {
			for (int j = 0; j < m; j++) {
				A[i][j] = b[(i-j+m)%m];
			}
		}
		long[][] Apow = fme(A,l-2,MOD);

		res = mv(Apow,res,MOD);

		long ans = 0;

		// res[i] is the nr of options for path length i to get to before-last layer
		for (int i = 0; i < n; i++) {
			int last_part = (d[i] + c[i] + m) % m;
			ans = (ans + res[(m-last_part)%m] + MOD) % MOD;
		}

		io.println(ans);

		io.close();
	}

	public static long[] mv(long[][] A, long[] x, long mod) {
		int n = x.length;
		long[] res = new long[n];
		for (int i = 0; i < res.length; i++) {
			for (int j = 0; j < n; j++) {
				res[i] = (res[i] + A[i][j]*x[j] + mod) % mod;
			}
		}
		return res;
	}

	public static long[][] fme(long[][] a, long n, long mod) {
		int l = a.length;
		long[][] res = new long[l][l];
		for (int i = 0; i < l; i++) {
			res[i][i] = 1;
		}

		String bin = Long.toBinaryString(n);
		int exp = 0;
		while (Math.pow(2, exp) <= n) {
			if (bin.charAt(bin.length()-1-exp) == '1') {
				res = mult(res, a, mod);
			}
			a = mult(a,a,mod);
			exp++;
		}

		return res;
	}

	// Multiply 2 matrices
	public static long[][] mult(long[][] a, long[][] b, long mod) {
		int k = a.length;
		int n = a[0].length;
		int m = b[0].length;
		long[][] res = new long[k][m];
		for (int i = 0; i < k; i++) {
			for (int j = 0; j < m; j++) {
				for (int j2 = 0; j2 < n; j2++) {
					res[i][j] = (res[i][j] + (a[i][j2] * b[j2][j])) % mod; 
				}
			}
		}
		return res;
	}

	static class IO extends PrintWriter {
		static BufferedReader r;
		static StringTokenizer t;

		public IO(InputStream i) {
			super(new BufferedOutputStream(System.out));
			r = new BufferedReader(new InputStreamReader(i));
			t = new StringTokenizer("");
		}

		public String next() throws IOException {
			while (!t.hasMoreTokens()) {
				t = new StringTokenizer(r.readLine());
			}
			return t.nextToken();
		}

		public int nextInt() throws IOException{
			return Integer.parseInt(next());
		}

		public long nextLong() throws IOException {
			return Long.parseLong(next());
		}

		public double nextDouble() throws IOException {
			return Double.parseDouble(next());
		}
	}
},"dp,matrices"

