import java.util.*;

public class LubaAndTheTicket
{
	public static void main(String[] args) 
	{
		Scanner scanner = new Scanner(System.in);
		String digit = scanner.next();
		int d1, d2, d3, d4, d5, d6;
		d1 = Character.getNumericValue(digit.charAt(0));
		d2 = Character.getNumericValue(digit.charAt(1));
		d3 = Character.getNumericValue(digit.charAt(2));
		d4 = Character.getNumericValue(digit.charAt(3));
		d5 = Character.getNumericValue(digit.charAt(4));
		d6 = Character.getNumericValue(digit.charAt(5));
		// Sort d1, d2, d3
		if (d2 < d1)
		{
			int t = d1;
			d1 = d2;
			d2 = t;
		}
		if (d3 < d2)
		{
			int t = d3;
			d3 = d2;
			d2 = t;
		}
		if (d2 < d1)
		{
			int t = d1;
			d1 = d2;
			d2 = t;
		}

		// Sort d4, d5, d6
		if (d5 < d4)
		{
			int t = d5;
			d5 = d4;
			d4 = t;
		}
		if (d6 < d5)
		{
			int t = d6;
			d6 = d5;
			d5 = t;
		}
		if (d5 < d4)
		{
			int t = d4;
			d4 = d5;
			d5 = t;
		}

		int sumLeft = d1 + d2 + d3;
		int sumRight = d4 + d5 + d6;
		int dif = sumRight - sumLeft;
		int ans;
		if (dif == 0)
			ans = 0;
		else if (dif > 0)
		{
			ans = Math.min(calMinLeft(d1, d2, d3, dif), calMinRight(d4, d5, d6, dif));
			if (ans == 3 && 9 - d1 + d6 >= dif)
				ans = 2;
		}
		else
		{
			dif *= -1;
			ans = Math.min(calMinRight(d1, d2, d3, dif), calMinLeft(d4, d5, d6, dif));
			if (ans == 3 && 9 - d4 + d3 >= dif)
				ans = 2;
		}
		System.out.print(ans);
	}

	static int calMinLeft(int d1, int d2, int d3, int dif)
	{
		if (dif + d1 <= 9)
			return 1;
		if (dif + d1 + d2 <= 18)
			return 2;
		return 3;
	}

	static int calMinRight(int d1, int d2, int d3, int dif)
	{
		if (d3 - dif >= 0)
			return 1;
		if (d2 + d3 - dif >= 0)
			return 2;
		return 3;
	}
},"brute force,greedy,implementation"

