	}
	static class Node{
		int val=0;
		int id,gcd,dist=-1;
		int ans=0;
		Set<Integer> gcdUsing=new HashSet<>();
		ArrayList<Node> adj=new ArrayList<>();
		Node(int id,int val){
			this.id=id;
			this.val=val;
			gcd=val;
		}

	}
	static void bfs(Node nodes[]) {
		ArrayDeque<Node> bfs=new ArrayDeque<>();
		bfs.add(nodes[0]);
		nodes[0].gcdUsing.add(0);
		nodes[0].dist=0;
		while(!bfs.isEmpty()) {
			Node q=bfs.remove();
			for(Node nn:q.adj) {
				if(nn.dist==-1) {
					nn.dist=q.dist+1;
					bfs.add(nn);
					nn.ans=q.gcd;
					for(int e:q.gcdUsing) {
						int g=gcd(e,nn.val);
						nn.ans=Math.max(gcd(nn.val,e), nn.ans);
						nn.gcdUsing.add(g);
					}
					nn.gcdUsing.add(q.gcd);
					nn.gcd=gcd(q.gcd,nn.val);
				}
			}
		}
	}

	static int gcd(int a,int b) {
		if(b==0)return a;
		else return gcd(b,a%b);
	}




