public class Main {
	public static void main(String args[]) {new Main().run();}

	FastReader in = new FastReader();
	PrintWriter out = new PrintWriter(System.out);
	void run(){
		work();
		out.flush();
	}
	long mod=1000000007;
	long gcd(long a,long b) {
		return a==0?b:b>=a?gcd(b%a,a):gcd(b,a);
	}
	ArrayList<Integer>[] graph;
	int[] ret;
	int[] A;
	Set<Integer>[] dp;
	void work() {
		int n=in.nextInt();
		A=new int[n];
		for(int i=0;i<n;i++) {
			A[i]=in.nextInt();
		}
		ret=new int[n];
		graph=(ArrayList<Integer>[])new ArrayList[n];
		dp=(Set<Integer>[])new Set[n+1];
		for(int i=0;i<=n;i++) {
			dp[i]=new HashSet<>();
		}
		for(int i=0;i<n;i++) {
			graph[i]=new ArrayList<>();
		}
		for(int i=0;i<n-1;i++) {
			int s=in.nextInt()-1,e=in.nextInt()-1;
			graph[s].add(e);
			graph[e].add(s);
		}
		dp[0].add(0);
		dfs(0,new boolean[n],-1,0);
		for(int i=0;i<n;i++) {
			out.print(ret[i]+" ");
		}
	}
	private void dfs(int node, boolean[] vis,int pre,int cur) {
		vis[node]=true;
		int max=cur;
		dp[node+1].add(cur);
		cur=(int)gcd(cur,A[node]);
		for(int k:dp[pre+1]) {
			int b=(int)gcd(k,A[node]);
			dp[node+1].add(b);
			max=Math.max(max, b);
		}
		ret[node]=max;
		for(int nn:graph[node]) {
			if(!vis[nn]) {
				dfs(nn,vis,node,cur);
			}
		}
	}
}	



