public class Main{
  public static void main(String[] args) throws IOException{
      BufferedReader br = new BufferedReader(new InputStreamReader(System.in));

      StringTokenizer details = new StringTokenizer(br.readLine());
      int n = Integer.parseInt(details.nextToken());
      int m = Integer.parseInt(details.nextToken());
      char[][] grid = new char[n][m];
      for(int a = 0; a < n; a++) grid[a] = br.readLine().toCharArray(); 
      if(works(grid, n, m)) System.out.println("YES");
      else{
        //System.out.println();
        char[][] gridTwo = new char[m][n];
        for(int a = 0; a < n; a++){
          for(int b = 0; b < m; b++) gridTwo[b][a] = grid[a][b]; 
        }
        if(works(gridTwo, m, n)) System.out.println("YES");
        else System.out.println("NO");
      }

      br.close();
  }
  public static boolean works(char[][] grid, int n, int m){
    //n by m grid, check if it is valid
    //n must be divisible by 3 (looking for rbg column)
    //for(char[] row : grid) System.out.println(Arrays.toString(row));

    if(n % 3 != 0) return false;  
    HashSet<Character> used = new HashSet<Character>(); 
    char eq = grid[0][0];
    for(int b = 0; b < n; b++){
      if(b % (n/3) == 0) eq = grid[b][0]; 
      used.add(eq);
      for(int a = 0; a < m; a++){
        char val = grid[b][a]; 
        //System.out.println(b + " " + a + " " +eq + " " + n/3);
        if(val != eq) return false; 
        }
    }
    return used.size() == 3; 
  }
