		StringTokenizer st = new StringTokenizer(in.readLine());
		int n = Integer.parseInt(st.nextToken());  
		int m = Integer.parseInt(st.nextToken());  
		if (n%3 != 0 && m%3 != 0) {
			System.out.println("NO");
			return;
		}
		char[][] x = new char[n][];
		for (int i=0; i<n; i++) {
			x[i] = in.readLine().toCharArray();
		}
		boolean[] all = new boolean[3];
			// 0 = r, 1 = g, 2 = b
		if (n%3 == 0) {
			boolean work = true;
			outerloop: for (int c=0; c<3; c++) {
				char cur = x[c*n/3][0];
				if (cur == 'R') all[0] = true;
				else if (cur == 'G') all[1] = true;
				else if (cur == 'B') all[2] = true;
				else {
					work = false;
					break outerloop;
				}
				for (int i= c*n/3; i< (c+1)*n/3; i++) {
					for (int j=0; j<m; j++) {
						if (x[i][j] != cur) {
							work = false;
							break outerloop;
						}
					}
				}
			}
			if (work) {
				for (int i=0; i<3; i++) {
					if (!all[i]) work = false;
				}
			}
			if (work) {
				System.out.println("YES");
