			boolean work = true;
			outerloop: for (int c=0; c<3; c++) {
				char cur = x[0][c*m/3];
				if (cur == 'R') all[0] = true;
				else if (cur == 'G') all[1] = true;
				else if (cur == 'B') all[2] = true;
				else {
					work = false;
					break outerloop;
				}
				for (int i= c*m/3; i< (c+1)*m/3; i++) {
					for (int j=0; j<n; j++) {
						if (x[j][i] != cur) {
							work = false;
							break outerloop;
						}
					}
				}
			}
			if (work) {
				for (int i=0; i<3; i++) {
					if (!all[i]) work = false;
				}
			}
			if (work ) {
				System.out.println("YES");
				return;
			}
		}
		System.out.println("NO");
	}
