import java.io.*;
import java.util.*;
import java.lang.*;

public class Rextester{
    static boolean checkRowWise(char[][] flag,int row,int column){
        if(row%3!=0){
            return false;
        }
        int x = row/3;
        if(flag[0][0]==flag[x][0]||flag[0][0]==flag[2*x][0]||flag[x][0]==flag[2*x][0]){
            return false;
        }
        for(int i=0;i<x;i++){
            for(int j=0;j<column;j++){
                if(flag[i][j]!=flag[0][0]){
                    return false;
                }
            }
        }
        for(int i=x;i<2*x;i++){
            for(int j=0;j<column;j++){
                if(flag[i][j]!=flag[x][0]){
                    return false;
                }
            }
        }
        for(int i=2*x;i<row;i++){
            for(int j=0;j<column;j++){
                if(flag[i][j]!=flag[2*x][0]){
                    return false;
                }
            }
        }
        return true;
    }
    static boolean checkColumnWise(char[][] flag,int row,int column){
        if(column%3!=0){
            return false;
        }
        int x = column/3;
        if(flag[0][0]==flag[0][x]||flag[0][0]==flag[0][2*x]||flag[0][x]==flag[0][2*x]){
            return false;
        }
        for(int i=0;i<x;i++){
            for(int j=0;j<row;j++){
                if(flag[j][i]!=flag[0][0]){
                    return false;
                }
            }
        }
        for(int i=x;i<2*x;i++){
            for(int j=0;j<row;j++){
                if(flag[j][i]!=flag[0][x]){
                    return false;
                }
            }
        }
        for(int i=2*x;i<column;i++){
            for(int j=0;j<row;j++){
                if(flag[j][i]!=flag[0][2*x]){
                    return false;
                }
            }
        }
        return true;
    }
    public static void main(String[] args)throws IOException{
        BufferedReader br = new BufferedReader(new InputStreamReader(System.in));
        StringTokenizer st = new StringTokenizer(br.readLine());
        int n = Integer.parseInt(st.nextToken());
        int m = Integer.parseInt(st.nextToken());
        char[][] flag = new char[n][m];
        for(int i=0;i<n;i++){
            flag[i]=br.readLine().toCharArray();
        }
        br.close();
        if(checkRowWise(flag,n,m)){
            System.out.println("YES");
        }
        else if(checkColumnWise(flag,n,m)){
            System.out.println("YES");
        }
        else{
            System.out.println("NO");
        }
    }
}

