	public static void main(String[] args) throws IOException {
		BufferedReader br = new BufferedReader(new InputStreamReader(System.in));
		PrintWriter out = new PrintWriter(System.out);
		m = new TreeSet<>();
		String [] line = br.readLine().split(" ");
		long x = Long.parseLong(line[0]);
		long y = Long.parseLong(line[1]);
		la = Long.parseLong(line[2]);
		long r = Long.parseLong(line[3]);
		if(2>la)
			m.add(2L);
		pre(x,x,r);
		pre(y,y,r);
		Pre(x,y,x,y,r);
		if(!m.contains(r))
			m.add(r+1);
		if(!m.contains(la))
			m.add(la-1);
		long max =0;
		while(m.size()!=1) {
			long last = m.pollLast();
			if(last-m.last()-1>max)
				max=last-m.last()-1;
		}
		out.print(max);
		out.flush();
	}



	private static void pre(long j, long l, long r) {
		while(l+1<=r) {
			if(l+1>=la) 
				m.add(l+1);
			if(1D*l*j>r)
				return;
			l*=1L*j;
	}	
	}



	private static void Pre(long i,long j ,long n , long l , long r) {
		if(n+l>=r)
			return ;
		long te = l;
		while(n+te<=r) {
			if(n+te>=la) 
				m.add(n+te);
			if(1D*j*te>r)
				break;
			te*=1L*j;
		}
		if(1D*n*i>r)
			return;
		Pre(i,j,n*i,l,r);
		}

}
