public class Test {

  static PrintWriter writer =
      new PrintWriter(new BufferedWriter(new OutputStreamWriter(System.out)));
  int ans = Integer.MAX_VALUE;
  int a, b;
  int[] ar;

  public static void main(String[] args) {
    Test te = new Test();
    te.start();
    writer.flush();
  }

  int readInt() {
    int ans = 0;
    boolean neg = false;
    try {
      boolean start = false;
      for (int c = 0; (c = System.in.read()) != -1; ) {
        if (c == '-') {
          start = true;
          neg = true;
          continue;
        } else if (c >= '0' && c <= '9') {
          start = true;
          ans = ans * 10 + c - '0';
        } else if (start) break;
      }
    } catch (IOException e) {
    }
    return neg ? -ans : ans;
  }

  long readLong() {
    long ans = 0;
    boolean neg = false;
    try {
      boolean start = false;
      for (int c = 0; (c = System.in.read()) != -1; ) {
        if (c == '-') {
          start = true;
          neg = true;
          continue;
        } else if (c >= '0' && c <= '9') {
          start = true;
          ans = ans * 10 + c - '0';
        } else if (start) break;
      }
    } catch (IOException e) {
    }
    return neg ? -ans : ans;
  }

  String readLine() {
    StringBuilder b = new StringBuilder();
    try {
      for (int c = 0; (c = System.in.read()) != -1; ) {
        if (c == '
') {
          break;
        } else {
          b.append((char) (c));
        }
      }
    } catch (IOException e) {
    }
    return b.toString().trim();
  }

  void solve(int p, long x, long y, int c) {
    if (x >= a && y >= b) {
      ans = Math.min(ans, c);
      return;
    }
    if (p < 0) return;
    int s = 1;
    for (int i = p - 1; i >= 0; i--)
      if (ar[i] == ar[i + 1]) s++;
      else break;
    int sx = 0, sy = 0;
    long cx = x, cy = y;
    for (; cx < a; sx++) cx *= ar[p];
    for (; cy < b; sy++) cy *= ar[p];
    if (sx + sy <= s) ans = Math.min(ans, c + sx + sy);
    else {
      cx = x;
      int i = Math.max(s - sy, 0);
      for (int j = 0; j < i; j++) cx *= ar[p];
      for (; i <= s; i++) {
        cy = y;
        for (int j = 0; j < s - i; j++) cy *= ar[p];
        solve(p - s, cx, cy, c + s);
        cx *= ar[p];
      }
    }
  }

  void start() {
    a = readInt();
    b = readInt();
    int h = readInt(), w = readInt(), n = readInt();
    ar = new int[n];
    for (int i = 0; i < n; i++) ar[i] = readInt();
    Arrays.sort(ar);
    solve(n - 1, h, w, 0);
    solve(n - 1, w, h, 0);
    writer.println(ans == Integer.MAX_VALUE ? -1 : ans);
  }
}
