import java.io.OutputStream;
import java.io.IOException;
import java.io.InputStream;
import java.io.PrintWriter;
import java.util.Arrays;
import java.util.InputMismatchException;
import java.util.HashMap;
import java.io.IOException;
import java.util.Comparator;
import java.io.InputStream;

/**
 * Built using CHelper plug-in
 * Actual solution is at the top
 *
 * @author Vaibhav Pulastya
 */
public class Main {
    public static void main(String[] args) {
        InputStream inputStream = System.in;
        OutputStream outputStream = System.out;
        InputReader in = new InputReader(inputStream);
        PrintWriter out = new PrintWriter(outputStream);
        DFieldExpansion solver = new DFieldExpansion();
        solver.solve(1, in, out);
        out.close();
    }

    static class DFieldExpansion {
        Integer[] ai;
        HashMap<String, Integer> H = new HashMap<>();
        long a;
        long b;
        long h;
        long w;
        int n;

        public void solve(int testNumber, InputReader in, PrintWriter out) {
            a = in.nextInt();
            b = in.nextInt();
            h = in.nextInt();
            w = in.nextInt();
            n = in.nextInt();
            ai = in.nextIntOArray(n);
            Arrays.sort(ai, new Comparator<Integer>() {

                public int compare(Integer integer, Integer t1) {
                    return Integer.compare(t1, integer);
                }
            });
            int x = Math.min(dp(h, w, 0), dp(w, h, 0));
            out.print(x > n ? -1 : x);
        }

        int dp(long h, long w, int i) {
            if (h >= a && w >= b) return 0;
            else if (i == n) return 1000000;
            else if (H.containsKey(h + " " + w + " " + i)) return H.get(h + " " + w + " " + i);
            int ans = 1000000;
            if (w < b) {
                ans = 1 + dp(h, w * ai[i], i + 1);
            }
            if (h < a) {
                ans = Math.min(1 + dp(h * ai[i], w, i + 1), ans);
            }
            H.put(h + " " + w + " " + i, ans);
            return ans;
        }

    }

    static class InputReader {
        private InputStream stream;
        private byte[] buf = new byte[1024];
        private int curChar;
        private int numChars;

        public InputReader(InputStream stream) {
            this.stream = stream;
        }

        public int read() {
            if (numChars == -1)
                throw new InputMismatchException();
            if (curChar >= numChars) {
                curChar = 0;
                try {
                    numChars = stream.read(buf);
                } catch (IOException e) {
                    throw new InputMismatchException();
                }
                if (numChars <= 0)
                    return -1;
            }
            return buf[curChar++];
        }

        public int nextInt() {
            int c = read();
            while (isSpaceChar(c))
                c = read();
            int sgn = 1;
            if (c == '-') {
                sgn = -1;
                c = read();
            }
            int res = 0;
            do {
                if (c < '0' || c > '9')
                    throw new InputMismatchException();
                res *= 10;
                res += c - '0';
                c = read();
            } while (!isSpaceChar(c));
            return res * sgn;
        }

        private boolean isSpaceChar(int c) {
            return c == ' ' || c == '
' || c == '' || c == '	' || c == -1;
        }

        public Integer[] nextIntOArray(int size) {
            Integer[] array = new Integer[size];
            for (int i = 0; i < size; i++)
                array[i] = nextInt();
            return array;
        }

    }
}

