/**
 * Built using CHelper plug-in
 * Actual solution is at the top
 */
public class Main {
    public static void main(String[] args) {
        InputStream inputStream = System.in;
        OutputStream outputStream = System.out;
        InputReader in = new InputReader(inputStream);
        PrintWriter out = new PrintWriter(outputStream);
        TaskF solver = new TaskF();
        solver.solve(1, in, out);
        out.close();
    }

    static class TaskF {
        long[] cnt;
        int n;
        long[] a;
        long[] b;

        boolean check(long day) {
            for (int i = 0; i < n; ++i) b[i] = a[i];
            long r = day / (7 * n);
            for (int i = 0; i < n; ++i) {
                b[i] -= r * cnt[i];
                if (b[i] <= 0) return true;
            }
            int mod = (int) (day % (7 * n));
            int th = 0;
            int id = 0;
            for (int i = 0; i < mod; ++i) {
                if (th != 6) {
                    b[id]--;
                    if (b[id] <= 0) return true;
                }
                th = (th + 1) % 7;
                id = (id + 1) % n;
            }
            return false;
        }

        public void solve(int testNumber, InputReader in, PrintWriter out) {
            n = in.nextInt();
            cnt = new long[n];
            a = new long[n];
            b = new long[n];
            for (int i = 0; i < n; ++i) a[i] = in.nextInt();
            int th = 0;
            int id = 0;
            for (int i = 0; i < n * 7; ++i) {
                if (th != 6) cnt[id]++;
                th = (th + 1) % 7;
                id = (id + 1) % n;
            }

            long lo = 1;
            long hi = (long) 1e17;
            long best = -1;
            while (lo <= hi) {
                long mid = (lo + hi) / 2;
                if (check(mid)) {
                    best = mid;
                    hi = mid - 1;
                } else {
                    lo = mid + 1;
                }
            }
            check(best);
            for (int i = 0; i < n; ++i)
                if (b[i] <= 0) {
                    out.println(i + 1);
                    break;
                }
        }

    }

    static class InputReader {
        private InputStream stream;
        private byte[] buf = new byte[1024];
        private int curChar;
        private int numChars;

        public InputReader(InputStream stream) {
            this.stream = stream;
        }

        public int read() {
            if (numChars == -1)
                throw new InputMismatchException();
            if (curChar >= numChars) {
                curChar = 0;
                try {
                    numChars = stream.read(buf);
                } catch (IOException e) {
                    throw new InputMismatchException();
                }
                if (numChars <= 0)
                    return -1;
            }
            return buf[curChar++];
        }

        public int nextInt() {
            int c = read();
            while (isSpaceChar(c))
                c = read();
            int sgn = 1;
            if (c == '-') {
                sgn = -1;
                c = read();
            }
            int res = 0;
            do {
                if (c < '0' || c > '9')
                    throw new InputMismatchException();
                res *= 10;
                res += c - '0';
                c = read();
            } while (!isSpaceChar(c));
            return res * sgn;
        }

        public static boolean isSpaceChar(int c) {
            return c == ' ' || c == '
' || c == '' || c == '	' || c == -1;
        }

    }
}

