        int j = i, x = 0, y = len - 1;
        while (y > 0) {
          x = (x << 1) + (j & 1);
          j >>>= 1;
          y >>>= 1;
        }
        if (i < x) {
          int t = a[off + i];
          a[off + i] = a[off + x];
          a[off + x] = t;
