        a[off + (rr--)] = t;
      }
      fft(a, off, len);
      int inv = pmod(len, M - 2);
      for (int i = 0; i < len; i++) a[off + i] = mul(inv, a[off + i]);
    }

    static int add(int a, int b) {
      return (a + b) % M;
    }

    static int mul(int a, int b) {
      return (int) ((a * (long) b) % M);
    }

    static int inverse(int a, int b) {
      if (b == 0) {
        xy[0] = 1;
        xy[1] = 0;
        return a;
      }
      int d = inverse(b, a % b);
      swap(xy, 0, 1);
      xy[1] -= a / b * xy[0];
      return d;
    }

    static void swap(int[] a, int i, int j) {
      int t = a[i];
      a[i] = a[j];
      a[j] = t;
    }
  }
