public class Main {

	BufferedReader in;
	StringTokenizer str = null;
	PrintWriter out;

	private String next() throws Exception{
		while (str == null || !str.hasMoreElements())
			str = new StringTokenizer(in.readLine());
		return str.nextToken();
	}

	private int nextInt() throws Exception{
		return Integer.parseInt(next());
	}

	private long nextLong() throws Exception{
		return Long.parseLong(next());
	}

	private double nextDouble() throws Exception{
		return Double.parseDouble(next());
	}

	int n, C;
	int [][]g;

	int []bit;

	public void run() throws Exception{
		in =  new BufferedReader(new InputStreamReader(System.in));
		out = new PrintWriter(System.out);
		n = nextInt();
		C = nextInt();
		g = new int[n][];
		for(int i = 0; i < n; ++i) {
			int m = nextInt();
			g[i] = new int[m];
			for(int j = 0; j < m; ++j) {
				g[i][j] = nextInt();
			}
		}

		bit = new int[C + 2];
		int cnt = 0;
		for(int i = 0; i + 1 < n; ++i) {
			int at = 0;
			while(at < g[i].length && at < g[i + 1].length && g[i][at] == g[i + 1][at]) {
				++at;
			}
			if (at == g[i].length) continue;
			if (at == g[i + 1].length) {
				out.println(-1);
				out.close();
				return;
			}
			int d1 = g[i][at], d2 = g[i + 1][at];
			if (d1 < d2) {
				add(0, C - d2, 1);
				add(C - d1 + 1, C, 1);
			} else {
				add(C - d1 + 1, C - d2, 1);
			}
			++cnt;
		}
		for(int i = 1; i <= C; ++i) {
			bit[i] += bit[i-1];
			if (bit[i] == cnt) {
				out.println(i % C);
				out.close();
				return;
			}
		}
		out.println(-1);
		out.close();
	}

	private void add(int l, int r, int d) {
		bit[l] += d;
		bit[r + 1] -= d;
	}

	public static void main(String[] args) throws Exception{
		new Main().run();
	}
}
