import java.io.*;
import java.util.*;

public class CF731D {
	static int c;
	static class T {
		HashMap<Integer,T> map = new HashMap<>();
		int v, x;
		boolean add(int[] ww, int l, int i) {
			if (i == l)
				return v == 0;
			int w = ww[i];
			if (v == 0) {
				v = w;
				x = 0;
			} else {
				int y = (w - v + c) % c;
				if (y < x)
					return false;
				x = y;
			}
			T t = map.get(w);
			if (t == null) {
				t = new T();
				map.put(w, t);
			}
			return t.add(ww, l, i + 1);
		}
		void dfs(ArrayList<T> tt) {
			if (v > 0 && x > 0)
				tt.add(this);
			for (int w : map.keySet()) {
				T t = map.get(w);
				t.dfs(tt);
			}
		}
	}
	static void mark(int[] aa, int l, int r) {	// [l, r]
		aa[l]++;
		aa[r + 1]--;
	}
	public static void main(String[] args) throws IOException {
		BufferedReader br = new BufferedReader(new InputStreamReader(System.in));
		StringTokenizer st = new StringTokenizer(br.readLine());
		int n = Integer.parseInt(st.nextToken());
		c = Integer.parseInt(st.nextToken());
		T trie = new T();
		while (n-- > 0) {
			st = new StringTokenizer(br.readLine());
			int l = Integer.parseInt(st.nextToken());
			int[] ww = new int[l];
			for (int i = 0; i < l; i++)
				ww[i] = Integer.parseInt(st.nextToken());
			if (!trie.add(ww, l, 0)) {
				System.out.println(-1);
				return;
			}
		}
		ArrayList<T> tt = new ArrayList<>();
		trie.dfs(tt);
		int[] aa = new int[c + 2];
		for (T t : tt) {
			int l = t.v + t.x + 1;
			int r = t.v;
			if (l > c)
				l -= c;
			if (l <= r)
				mark(aa, l, r);
			else {
				mark(aa, 1, r);
				mark(aa, l, c);
			}
		}
		int a = 0, b = tt.size(), x = -1;
		for (int i = 1; i <= c; i++)
			if ((a += aa[i]) == b) {
				x = (1 - i + c) % c;
				break;
			}
		System.out.println(x);
	}
}
