    private void solve() throws IOException {

        int n = nextInt();
        long r = nextLong();

        long[] l = new long[n];
        long[] t = new long[n];

        for (int i = 0; i < n; i++)
            l[i] = nextInt();

        for (int i = 0; i < n; i++)
            t[i] = nextInt();

        long time = 0;
        long p = 0;

        ArrayList<Long> ans = new ArrayList<>();

        long used = 0;

        for (int i = 0; i < n; i++) {
            if (t[i] < l[i]) {
                System.out.println(-1);
                return;
            }
            if (p >= l[i]) {
                p -= l[i];
                time += l[i];
                continue;
            }

            long needed = (l[i] - p) * 2;

            if (needed + p <= t[i]) {
                time += p + needed;
                p = 0;
                continue;
            }
            long neededWithMagic = 2 * l[i] - t[i] - p;
            long magic = (neededWithMagic + r - 1) / r;
            time += p + neededWithMagic + (2 * (l[i] - p - neededWithMagic));
            p = magic * r - neededWithMagic;
            used += magic;
            for (long j = time - (r - p), x = 0; x < magic && ans.size() < 100000; j -= r, x++) {
