import java.util.ArrayList;
import java.util.Arrays;
import java.util.Scanner;

public class D {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		Scanner input = new Scanner(System.in);
		int n = input.nextInt();
		long magicDuration = input.nextLong();
		long[] distArr = new long[n];
		for (int a = 0; a < n; a++) {
			distArr[a] = input.nextInt() * 2;
		}
		long[] timeArr = new long[n];
		for (int a = 0; a < n; a++) {
			timeArr[a] = input.nextInt();
		}
		boolean IMPOSSIBLE = false;
		long leftOverPotion = 0;
		long time = 0;
		ArrayList<Long> potions = new ArrayList<Long>();
		long potionCount = 0;
		for (int a = 0; a < n; a++) {
			if (distArr[a] > 2 * timeArr[a]) {
				IMPOSSIBLE = true;
				break;
			} else {
				if (leftOverPotion * 2 > distArr[a]) {
					leftOverPotion -= distArr[a] / 2;
					time += distArr[a] / 2;
					timeArr[a] -= distArr[a] / 2;
					distArr[a] = 0;
				} else {
					distArr[a] -= leftOverPotion * 2;
					time += leftOverPotion;
					timeArr[a] -= leftOverPotion;
					leftOverPotion = 0;
				}
				if (distArr[a] != 0) {
					long remainingTimePotioned = distArr[a] - timeArr[a];
					long timeNotPotioned = timeArr[a] - remainingTimePotioned;
					time += Math.min(distArr[a], timeNotPotioned);
					timeArr[a] -= Math.min(distArr[a], timeNotPotioned);
					distArr[a] -= Math.min(distArr[a], timeNotPotioned);
					while (distArr[a] > 0 && potions.size() < 100000) {
						potions.add(time);
						potionCount++;
						leftOverPotion = magicDuration;
						if (leftOverPotion * 2 > distArr[a]) {
							leftOverPotion -= distArr[a] / 2;
							time += distArr[a] / 2;
							timeArr[a] -= distArr[a] / 2;
							remainingTimePotioned -= distArr[a] / 2;
							distArr[a] = 0;
						} else {
							distArr[a] -= leftOverPotion * 2;
							time += leftOverPotion;
							timeArr[a] -= leftOverPotion;
							remainingTimePotioned -= leftOverPotion;
							leftOverPotion = 0;

						}
					}
					if (distArr[a] != 0) {
						assert (distArr[a] > 0);

						long potionChugged = ((remainingTimePotioned - 1) / magicDuration) + 1;
						potionCount += potionChugged;
						leftOverPotion = potionChugged * magicDuration;
						if (leftOverPotion * 2 > distArr[a]) {
							leftOverPotion -= distArr[a] / 2;
							time += distArr[a] / 2;
							timeArr[a] -= distArr[a] / 2;
							distArr[a] = 0;
						} else {
							distArr[a] -= leftOverPotion * 2;
							time += leftOverPotion;
							timeArr[a] -= leftOverPotion;
							leftOverPotion = 0;
						}
					}
				}
			}
		}
		if (IMPOSSIBLE) {
			System.out.println(-1);
		} else {
			if (potionCount != potions.size()) {
				System.out.println(potionCount);
			} else {
				System.out.println(potions.size());
				for (Long i : potions) {
					System.out.print(i + " ");
				}
				System.out.println();
			}
		}
	}
},"greedy,implementation,math"

