import java.io.OutputStream;
import java.io.IOException;
import java.io.InputStream;
import java.io.OutputStream;
import java.io.PrintWriter;
import java.util.Arrays;
import java.io.BufferedWriter;
import java.io.IOException;
import java.io.InputStreamReader;
import java.util.ArrayList;
import java.util.StringTokenizer;
import java.io.Writer;
import java.io.OutputStreamWriter;
import java.io.BufferedReader;
import java.io.InputStream;

/**
 * Built using CHelper plug-in
 * Actual solution is at the top
 */
public class Main {
    public static void main(String[] args) {
        InputStream inputStream = System.in;
        OutputStream outputStream = System.out;
        InputReader in = new InputReader(inputStream);
        OutputWriter out = new OutputWriter(outputStream);
        CJourney solver = new CJourney();
        solver.solve(1, in, out);
        out.close();
    }

    static class CJourney {
        int[][] dp;
        int[][] par;
        int n;
        int m;
        int T;
        ArrayList<Edge>[] g;
        int[] dist;
        boolean[] vis;

        public void solve(int testNumber, InputReader in, OutputWriter out) {
            pre(in);
            par = new int[n][n];
            // dp(i,j)= min time to reach city i from city 1 such that we have visited total j cities before
            dp = new int[n][n];
            for (int[] r : dp) Arrays.fill(r, T + 1);
            for (int[] r : par) Arrays.fill(r, -1);
            dp[0][0] = 0;
            dfs(0, 0);
            for (int i = n - 1; i >= 0; i--) {
                if (dp[n - 1][i] <= T) {
                    out.println(i + 1);
                    ArrayList<Integer> list = print(n - 1, i);
                    for (int a : list) out.print(a + " ");
                    return;
                }
            }
        }

        ArrayList<Integer> print(int nn, int cv) {
            if (nn == 0) {
                ArrayList<Integer> temp = new ArrayList<>();
                temp.add(1);
                return temp;
            }
            ArrayList<Integer> sans = print(par[nn][cv], cv - 1);
            sans.add(nn + 1);
            return sans;
        }

        void dfs(int nn, int cv) {
            vis[nn] = true;
            for (Edge e : g[nn]) {
                if (dp[nn][cv] + e.cost < dp[e.node][cv + 1]) {
                    par[e.node][cv + 1] = nn;
                    dp[e.node][cv + 1] = dp[nn][cv] + e.cost;
                    dfs(e.node, cv + 1);
                }
            }
        }

        void pre(InputReader in) {
            n = in.nextInt();
            m = in.nextInt();
            T = in.nextInt();
            g = new ArrayList[n];
            dist = new int[n];
            vis = new boolean[n];
            for (int i = 0; i < n; i++) g[i] = new ArrayList<>();
            for (int i = 0; i < m; i++) {
                int a = in.nextInt() - 1, b = in.nextInt() - 1, c = in.nextInt();
                g[a].add(new Edge(b, c));
//            g[b].add(new Edge(a, c));
            }
        }

        class Edge implements Comparable<Edge> {
            int node;
            int cost;

            Edge(int a, int b) {
                node = a;
                cost = b;
            }

            public int compareTo(Edge e) {
                return cost - e.cost;
            }

        }

    }

    static class OutputWriter {
        private final PrintWriter writer;

        public OutputWriter(OutputStream outputStream) {
            writer = new PrintWriter(new BufferedWriter(new OutputStreamWriter(outputStream)));
        }

        public OutputWriter(Writer writer) {
            this.writer = new PrintWriter(writer);
        }

        public void print(Object... objects) {
            for (int i = 0; i < objects.length; i++) {
                if (i != 0) {
                    writer.print(' ');
                }
                writer.print(objects[i]);
            }
        }

        public void close() {
            writer.close();
        }

        public void println(int i) {
            writer.println(i);
        }

    }

    static class InputReader {
        BufferedReader reader;
        StringTokenizer tokenizer;

        public InputReader(InputStream stream) {
            reader = new BufferedReader(new InputStreamReader(stream), 32768);
            tokenizer = null;
        }

        public String next() {
            while (tokenizer == null || !tokenizer.hasMoreTokens()) {
                try {
                    tokenizer = new StringTokenizer(reader.readLine());
                } catch (IOException e) {
                    throw new RuntimeException(e);
                }
            }
            return tokenizer.nextToken();
        }

        public int nextInt() {
            return Integer.parseInt(next());
        }

    }
}

