    void DFSUtil(int s,boolean visited[]){
        visited[s]=true;
       // System.out.println(s+" "+adj[s].size());
        if(s==(V-1))return;
        for(int i=0;i<adj[s].size();i++){
            if(!visited[adj[s].get(i).v]){
               DFSUtil(adj[s].get(i).v,visited);
            }
            for(int j=1;j<V;j++){
                   if(dp[adj[s].get(i).v][j]!=Integer.MIN_VALUE){
                       if(dp[s][j+1]!=Integer.MIN_VALUE)
                   dp[s][j+1]=Math.min(dp[s][j+1],
                   dp[adj[s].get(i).v][j]+(long)adj[s].get(i).w);
                   else
                   dp[s][j+1]=dp[adj[s].get(i).v][j]+(long)adj[s].get(i).w;
                   }
