/**
 * Created by DNs on 15.05.2016.
 */
public class Main implements Runnable {
  static BufferedReader in;
  static PrintWriter out;
  static StringTokenizer tok = new StringTokenizer("");

  public static void main(String[] args) {
    new Thread(new Main()).start();
  }

  @Override
  public void run() {
    Locale.setDefault(Locale.ENGLISH);
    try {
      init();
    } catch (FileNotFoundException e) {
      e.printStackTrace();
    }
    try {
      solve();
    } catch (IOException e) {
      e.printStackTrace();
    }
    out.close();
  }


  private String readString() {
    while (!tok.hasMoreTokens()) {
      try {
        tok = new StringTokenizer(in.readLine());
      } catch (IOException e) {
        e.printStackTrace();
      }
    }
    return tok.nextToken();
  }

  private Integer readInt() {
    return Integer.parseInt(readString());
  }

  private Long readLong() {
    return Long.parseLong(readString());
  }

  private Double readDouble() {
    return Double.parseDouble(readString());
  }

  private void init() throws FileNotFoundException {
    in = new BufferedReader(new InputStreamReader(System.in));
    out = new PrintWriter(System.out);
    /*in = new BufferedReader(new FileReader("stupid_rmq.in"));
    out = new PrintWriter("stupid_rmq.out");*/
  }


  int T = 1_000_001;

  private void solve() throws IOException {
    int n = readInt();
    int e = readInt();
    ArrayList<Integer> trainersToTeams[]  = new ArrayList[n];
    Pair[] haters = new Pair[e];
    for (int i = 0; i < n; i++) {
      trainersToTeams[i] = new ArrayList<>();
    }
    for (int i = 0; i < e; i++) {
      int first = readInt() - 1;
      int second = readInt() - 1;
      haters[i] = new Pair(first, second);
    }
    int maxTeam = 0;
    for (int i = 0; i < n; i++) {
      int countTeams = readInt();
      for (int j = 0; j < countTeams; j++) {
        int team = readInt() - 1;
        maxTeam = Math.max(maxTeam, team);
        trainersToTeams[i].add(team);
      }
    }
    maxTeam++;
    Random rnd = new Random();
    while(true){
      int[] trainerTeam = new int[n];
      for(int i = 0; i < n; i++){
        trainerTeam[i] = trainersToTeams[i].get(Math.abs(rnd.nextInt()) % trainersToTeams[i].size());
      }
      boolean[] isFirstConference = new boolean[maxTeam];
      for(int i = 0; i < maxTeam; i++){
        if(rnd.nextInt()%2 == 0) isFirstConference[i] = true;
      }
      int count = 0;
      for(int i = 0; i < e; i++){
        int firstTeam = trainerTeam[haters[i].x];
        int secondTeam = trainerTeam[haters[i].y];
        if((isFirstConference[firstTeam] ^ isFirstConference[secondTeam]))count++;
      }
      if(count*2 >= e){
        for(int i = 0; i < n; i++){
          out.print(trainerTeam[i] + 1 + " ");
        }
        out.println();
        for(int i = 0; i < maxTeam; i++){
          if(isFirstConference[i]) out.print("1 "); else out.print("2 ");
         // out.print((isFirstConference[i] ? "1 " : "2 "));
        }
        return;
      }
    }
  }

  class Pair{
      int x, y;
      public Pair(int x, int y){
          this.x = x;
          this.y = y;
      }
  }


},"math,probabilities"

import java.awt.Point;
import java.io.BufferedReader;
import java.io.FileReader;
import java.io.InputStreamReader;
import java.io.PrintWriter;
import java.util.ArrayList;
import java.util.List;
import java.util.Random;
import java.util.StringTokenizer;

public class H {

    BufferedReader in;
    PrintWriter out;
    StringTokenizer tok;

    void init() {
        try {
            in = new BufferedReader(new FileReader("input.txt"));
            out = new PrintWriter("output.txt");
        } catch (Exception e) {
            in = new BufferedReader(new InputStreamReader(System.in));
            out = new PrintWriter(System.out);
        }
    }

    String readString() {
        try {
            while (tok == null || !tok.hasMoreTokens()) {
                tok = new StringTokenizer(in.readLine());
            }
            return tok.nextToken();
        } catch (Exception e) {
            return null;
        }
    }

    int readInt() {
        return Integer.parseInt(readString());
    }

    long readLong() {
        return Long.parseLong(readString());
    }

    int[] readIntArray(int n) {
        int[] a = new int[n];
        for (int i = 0; i < n; i++) {
            a[i] = readInt();
        }
        return a;
    }

    public static void main(String[] args) {
        new H().run();
    }

    void run() {
        try {
            long tStart = System.currentTimeMillis();
            init();
            solve();
            in.close();
            out.close();
            long tEnd = System.currentTimeMillis();

            System.err.println(tEnd - tStart);
        } catch (Exception e) {
            e.printStackTrace();
            System.exit(-1);
        }
    }

    void solve() {
        int trainersCount = readInt();
        int edgesCount = readInt();

        Point[] edges = new Point[edgesCount];
        for (int i = 0; i < edgesCount; ++i) {
            int from = readInt() - 1;
            int to = readInt() - 1;
            edges[i] = new Point(from, to);
        }

        List<Integer>[] trainersTeams = new List[trainersCount];
        int teamsCount = 0;

        for (int i = 0; i < trainersCount; ++i){
            int size = readInt();
            List<Integer> trainerTeams = new ArrayList<>(size);

            for (int j = 0; j < size; ++j) {
                int team = readInt() - 1;
                teamsCount = Math.max(teamsCount, team + 1);

                trainerTeams.add(team);
            }

            trainersTeams[i] = trainerTeams;
        }

        Random rnd = new Random();

        int[] mappedTeams = new int[trainersCount];
        boolean[] isEnemyConferences = new boolean[teamsCount];

        while (true) {
            for (int trainer = 0; trainer < trainersCount; ++trainer) {
                List<Integer> trainerTeams = trainersTeams[trainer];
                int trainerTeamIndex = rnd.nextInt(trainerTeams.size());
                mappedTeams[trainer] = trainerTeams.get(trainerTeamIndex);
            }

            for (int team = 0; team < teamsCount; ++team) {
                isEnemyConferences[team] = rnd.nextBoolean();
            }

            int enemyEdgesCount = 0;
            for (Point edge : edges) {
                int fromTeam = mappedTeams[edge.x];
                int toTeam = mappedTeams[edge.y];
                if (isEnemyConferences[fromTeam] != isEnemyConferences[toTeam]) {
                    ++enemyEdgesCount;
                }
            }

            if (enemyEdgesCount * 2 >= edgesCount) {
                break;
            }
        }

        for (int mappedTeam : mappedTeams) {
            out.print((mappedTeam + 1) + " ");
        }
        out.println();

        for (boolean isEnemyConference : isEnemyConferences) {
            int conference = (isEnemyConference ? 1 : 2);
            out.print(conference + " ");
        }
        out.println();
    }
}
