import java.io.BufferedReader;
import java.io.BufferedWriter;
import java.io.IOException;
import java.io.InputStreamReader;
import java.io.OutputStreamWriter;
import java.io.PrintWriter;
import java.util.StringTokenizer;


public class D {

	static StringTokenizer st;
	static BufferedReader br;
	static PrintWriter pw;
	static int[][]dp;
	static int[][][]t;
	static int n, m;
	static int[]log_2;
	static int yy1, yy2;
	public static void main(String[] args) throws IOException {
		br = new BufferedReader(new InputStreamReader(System.in));
		pw = new PrintWriter(new BufferedWriter(new OutputStreamWriter(System.out)));
		n = nextInt();
		m = nextInt();
		int[][]a = new int[n+1][m+1];
		for (int i = 1; i <= n; i++) {
			for (int j = 1; j <= m; j++) {
				a[i][j] = nextInt();
			}
		}
		log_2 = new int[1001];
		for (int i = 1; i <= m; i++) {
			while ((1 << (log_2[i]+1)) <= i)
				log_2[i]++;
		}
		dp = new int[n+1][m+1];
		t = new int[11][m+1][4*n];
		for (int i = 1; i <= n; i++) {
			for (int j = 1; j <= m; j++) {
				if (a[i][j]==1)
					dp[i][j] = Math.min(dp[i-1][j-1], Math.min(dp[i-1][j], dp[i][j-1])) + 1;
			}
		}
		for (int i = 0; i <= 10; i++) {
			for (int j = 1; j <= m; j++) {
				Buildx(1, 1, n, j, i);
			}
		}
		int q = nextInt();
		while (q-->0) {
			int x1 = nextInt();
			int y1 = nextInt();
			int x2 = nextInt();
			int y2 = nextInt();
			int left = 0, right = Math.min(x2-x1, y2-y1) + 2;
			while (right-left > 1) {
				int mid = (left+right) >> 1;
				yy1 = y1+mid-1;
				yy2 = y2;
				if (getMax(1, 1, n, x1+mid-1, x2) >= mid)
					left = mid;
				else
					right = mid;
			}
			pw.println(left);
		}
		pw.close();
	}

	private static int getMax(int v, int tl, int tr, int x1, int x2) {
		if (x1 > x2)
			return -1;
		if (tl==x1 && tr==x2) {
			if (yy1 > yy2)
				return -1;
			int k = log_2[yy2-yy1+1];
			return Math.max(t[k][yy1][v], t[k][yy2-(1 << k)+1][v]);
		}
		int tm = (tl+tr) >> 1;
		return Math.max(getMax(2*v, tl, tm, x1, Math.min(x2, tm)), getMax(2*v+1, tm+1, tr, Math.max(x1, tm+1), x2));
	}

	private static void Buildx(int v, int tl, int tr, int y, int k) {
		if (tl==tr) {
			if (y+(1 << k)-1 > m)
				return;
			if (k==0)
				t[k][y][v] = dp[tl][y];
			else
				t[k][y][v] = Math.max(t[k-1][y][v], t[k-1][y+(1 << (k-1))][v]);	
		}
		else {
			int tm = (tl+tr) >> 1;
			Buildx(2*v, tl, tm, y, k);
			Buildx(2*v+1, tm+1, tr, y, k);
			t[k][y][v] = Math.max(t[k][y][2*v], t[k][y][2*v+1]);
		}
	}

	private static int nextInt() throws IOException {
		return Integer.parseInt(next());
	}
	private static long nextLong() throws IOException {
		return Long.parseLong(next());
	}
	private static double nextDouble() throws IOException {
		return Double.parseDouble(next());
	}
	private static String next() throws IOException {
		while (st==null || !st.hasMoreTokens())
			st = new StringTokenizer(br.readLine());
		return st.nextToken();
	}
