            if (i == -1 && j == n) {
                j = n - 2;
                i = 0;
            } else {
                if (j == n)
                    j = 0;

                if (i < 0)
                    i = n - 1;
            }

            if (grid[i][j] != 0) {
                j -= 2;
                i++;
                continue;
            } else
                grid[i][j] = x++;

            j++;
            i--;
        }

        for (i = 0; i < n; i++) {
            for (j = 0; j < n; j++)
                System.out.print(grid[i][j] + " ");
            System.out.println();
        }
    }
}
