class Trie {
	final static int MAX = (int) 2e5 + 5;
	int next[][] = new int[MAX*30][2];
	int count[] = new int[MAX*30];
	int size;

	public Trie() {

		size = 0;
	}

	int getNewNode() {
		size++;
		return size;
	}

	void build(int op, int elem) {

		int now = 0;

		for (int index = 29; index >= 0; index--) {

			count[now] += op;
			int side = (elem >> index) & 1;
			int target;

			if (next[now][side] == 0) {
				target = getNewNode();
			} else {
				target = next[now][side];
			}
			next[now][side] = target;

			now = target;

		}
		count[now] += op;
		return;
	}

	int search(int query) {
		int now = 0;
		int ret = 0;
		for (int index = 29; index >= 0; index--) {

			int side = (query >> index) & 1;

			if (next[now][(side + 1) % 2] != 0 && count[next[now][(side + 1) % 2]] > 0) {
				side = (side + 1) % 2;
			}

			ret *= 2;
			ret += side;

			now = next[now][side];
		}

		return ret ^ query;
	}
}
