public class Trie_UT {
	InputStream is;
	PrintWriter pr;

	long mod = (long) (1e9 + 7), inf = (long) (3e18);

	class trie {
		int value;
		int count;
		trie[] d;

		trie() {
			d = new trie[2];
			value = count = 0;
		}

		void insert(int n) {
			trie t = this;
			for (int i = 31; i >= 0; i--) {
				int j = ((n >> i) & 1);
				if (t.d[j] == null)
					t.d[j] = new trie();
				t = t.d[j];
				t.count++;
			}
			t.value=n;
		}

		void remove(int n) {
			trie t = this;
			for (int i = 31; i >= 0; i--) {
				int j = ((n >> i) & 1);
				t = t.d[j];
				t.count--;
			}
		}

		int query(int n) {
			trie t = this;
			for (int i = 31; i >= 0; i--) {
				int j = 1 - ((n >> i) & 1);
				if (t.d[j] != null && t.d[j].count > 0)
					t = t.d[j];
				else
					t = t.d[1 - j];
			}
			return t.value ^ n;
		}
	}

	void solve() {
		int q = ni();
		trie t = new trie();
		t.insert(0);
		while (q-- > 0) {
			char c = nc();
			int n = ni();
			if (c == '+') {
				t.insert(n);
			} else if (c == '-')
				t.remove(n);
			else
				pr.println(t.query(n));
		}

	}

	public static void main(String[] args) {
		new Trie_UT().run();
	}

	void run() {
		is = System.in;
		pr = new PrintWriter(System.out);
		solve();
		pr.flush();
	}

	byte input[] = new byte[1024];
	int len = 0, ptr = 0;

	int readByte() {
		if (ptr >= len) {
			ptr = 0;
			try {
				len = is.read(input);
			} catch (IOException e) {
				throw new InputMismatchException();
			}
			if (len <= 0) {
				return -1;
			}
		}
		return input[ptr++];
	}

	boolean isSpaceChar(int c) {
		return !(c >= 33 && c <= 126);
	}

	int skip() {
		int b = readByte();
		while (b != -1 && isSpaceChar(b)) {
			b = readByte();
		}
		return b;
	}

	char nc() {
		return (char) skip();
	}

	String ns() {
		int b = skip();
		StringBuilder sb = new StringBuilder();
		while (!isSpaceChar(b)) {
			sb.appendCodePoint(b);
			b = readByte();
		}
		return sb.toString();
	}

	String nLine() {
		int b = skip();
		StringBuilder sb = new StringBuilder();
		while (!(isSpaceChar(b) && b != ' ')) {
			sb.appendCodePoint(b);
			b = readByte();
		}
		return sb.toString();
	}

	int ni() {
		int n = 0, b = readByte();
		boolean minus = false;
		while (b != -1 && !((b >= '0' && b <= '9') || b == '-')) {
			b = readByte();
		}
		if (b == '-') {
			minus = true;
			b = readByte();
		}
		if (b == -1) {
			return -1;
		} // no input
		while (b >= '0' && b <= '9') {
			n = n * 10 + (b - '0');
			b = readByte();
		}
		return minus ? -n : n;
	}

	long nl() {
		long n = 0L;
		int b = readByte();
		boolean minus = false;
		while (b != -1 && !((b >= '0' && b <= '9') || b == '-')) {
			b = readByte();
		}
		if (b == '-') {
			minus = true;
			b = readByte();
		}
		while (b >= '0' && b <= '9') {
			n = n * 10 + (b - '0');
			b = readByte();
		}
		return minus ? -n : n;
	}

	double nd() {
		return Double.parseDouble(ns());
	}

	float nf() {
		return Float.parseFloat(ns());
	}

	int[] na(int n) {
		int a[] = new int[n];
		for (int i = 0; i < n; i++) {
			a[i] = ni();
		}
		return a;
	}

	char[] ns(int n) {
		char c[] = new char[n];
		int i, b = skip();
		for (i = 0; i < n; i++) {
			if (isSpaceChar(b)) {
				break;
			}
			c[i] = (char) b;
			b = readByte();
		}
		return i == n ? c : Arrays.copyOf(c, i);
	}
},"binary search,bitmasks,data structures,trees"

