public class MyClass {

	public static void main(String[] args) {

		Scanner input = new Scanner(System.in);

		long n = input.nextLong();

		long min = 0;
		long max = 1000000000000000000L;
		long ans = -1;

		while (min <= max) {

			long mid = min + (max - min) / 2;

			if (ispossible(mid, n) == n) {
				ans = mid;
				max = mid - 1;
			} else if (ispossible(mid, n) < n) {
				min = mid + 1;
			} else {
				max = mid - 1;
			}

		}
		System.out.println(ans);

	}

	public static long ispossible(long mid, long n) {
		long cnt = 0;

		for (long r = 2; r < mid; r++) {

			long last = mid / (r * r * r);
			if (last == 0)
				return cnt;
			cnt += last;

		}

		return cnt;

	}


