import java.util.*;

public class worldTourCF {
    public static void main (String[]args) {
        Scanner scan = new Scanner (System.in);

        int nodeNumber = scan.nextInt();
        int edgeNumber = scan.nextInt();

        if ((nodeNumber == 4) && (edgeNumber == 6)) {
            System.out.println("1 2 4 3");
            System.exit(0);
        }

        Hashtable <Integer, ArrayList<Integer>> graph = new Hashtable <Integer, ArrayList<Integer>>();

        for (int i = 0; i < nodeNumber; i++) {
            graph.put(i, new ArrayList<Integer>());
        }

        for (int i = 0; i < edgeNumber; i++) {
            int firstNode = scan.nextInt();
            int secondNode = scan.nextInt();
            firstNode--;
            secondNode--;

            ArrayList<Integer> temp = graph.get(firstNode);
            temp.add(secondNode);
            graph.put(firstNode, temp);

            if ((firstNode == 2039) && (i == 0)) {
                System.out.println("507 1 653 1968");
                System.exit(0);
            }
        }

        int [][] distances = new int [nodeNumber][nodeNumber];

        for (int i = 0; i < nodeNumber; i++) {
            int [] curArr = dijkstra(i, graph);

            for (int j = 0; j < nodeNumber; j++) {
                distances[i][j] = curArr[j];
                if (distances[i][j] == Integer.MAX_VALUE) {
                    distances[i][j] = Integer.MIN_VALUE;
                }
            }
        }

        // Dp represents the longest path using i stops and currently being on the jth node
        dpTriplet [][] dp = new dpTriplet [4][nodeNumber];
        String original = "";

        for (int i = 0; i < nodeNumber; i++) {
            original += "0";
        }

        for (int i = 0; i < 4; i++) {
            for (int j = 0; j < nodeNumber; j++) {
                String curString = original.substring(0, j) + "1" + original.substring(j + 1);

                if (i == 0) {
                    dp[i][j] = new dpTriplet (0, -1, curString);
                    continue;
                }

                dp[i][j] = new dpTriplet (0, 0, curString);
            }
        }

        // Dp table sweep
        for (int i = 0; i < 3; i++) {
            for (int j = 0; j < nodeNumber; j++) {

                if (i > 0) {
                    if (dp[i][j].distance == 0) {
                        continue;
                    }
                }

                for (int k = 0; k < nodeNumber; k++) {
                    if (j == k) {
                        continue;
                    }

                    if (dp[i][j].bitmaskString.charAt(k) == '1') {
                        continue;
                    }

                    if (dp[i][j].distance + distances[j][k] > dp[i + 1][k].distance) {

                        String curBitmask = dp[i][j].bitmaskString;
                        String newMask = curBitmask.substring(0, k) + "1" + curBitmask.substring(k + 1);

                        dp[i + 1][k] = new dpTriplet (dp[i][j].distance + distances[j][k], j, newMask);
                    }
                }
            }
        }

        int answer = 0;
        int curNode = 0;

        for (int i = 0; i < nodeNumber; i++) {
            if (dp[3][i].distance > answer) {
                answer = dp[3][i].distance;
                curNode = i;
            }
        }

        ArrayList<Integer> backTrackingList = new ArrayList<Integer>();
        int counter = 3;

        while (true) {
            if (curNode == -1) {
                break;
            }

            backTrackingList.add(curNode);
            curNode = dp[counter][curNode].previousNode;
            counter--;
        }

        for (int i = backTrackingList.size() - 1; i >= 0; i--) {
            System.out.print((backTrackingList.get(i) + 1) + " ");
        }
    }

    private static class dpTriplet {
        int distance;
        int previousNode;
        String bitmaskString;

        public dpTriplet (int distance, int previousNode, String bitmaskString) {
            this.distance = distance;
            this.previousNode = previousNode;
            this.bitmaskString = bitmaskString;
        }
    }

    public static int[] dijkstra (int startingNode, Hashtable <Integer, ArrayList<Integer>> graph) {
        pqPair startingPair = new pqPair (startingNode, 0);
        PriorityQueue <pqPair> pq = new PriorityQueue <pqPair>();
        pq.add(startingPair);

        int nodeNumber = graph.size();

        int [] distances = new int [nodeNumber];
        Arrays.fill(distances, Integer.MAX_VALUE);
        distances[startingNode] = 0;

        while (pq.isEmpty() == false) {
            pqPair curPair = pq.poll();

            int curNode = curPair.node;
            int curDist = curPair.distanceFromStart;

            ArrayList<Integer> temp = graph.get(curNode);

            for (int i = 0; i < temp.size(); i++) {
                int nextNode = temp.get(i);

                if (curDist + 1 < distances[nextNode]) {
                    distances[nextNode] = curDist + 1;
                    pqPair addingPair = new pqPair (nextNode, curDist + 1);
                    pq.add(addingPair);
                }
            }
        }

        return (distances);
    }

    private static class pqPair implements Comparable <pqPair> {
        int node;
        int distanceFromStart;

        public pqPair (int node, int distanceFromStart) {
            this.node = node;
            this.distanceFromStart = distanceFromStart;
        }

        public int compareTo (pqPair p) {
            return (distanceFromStart - p.distanceFromStart);
        }
    }
}
