public class ProD {
	static int n,m,ans,ee,u,v,s,p1,p2,p3,p4;
	static Pair p;
	static int[] vis=new int[3005];
	static int[] head=new int[3005];
	static int[] next=new int[5005];
	static int[] edge=new int[5005];
	static int[][] aa=new int[3005][3];
	static int[][] bb=new int[3005][3];
	static int[][] dd=new int[3005][3005];
	static Pair[] pp=new Pair[3005];
	static Queue<Pair> q=new LinkedList<Pair>();
	static class Pair implements Comparable<Pair>
	{
		int x,y;
		Pair(int a,int b)
		{
			x=a;y=b;
		}
		public int compareTo(Pair p) {
			return p.x-x;
		}
	}
	static void add(int a,int b)
	{
		edge[ee]=b;next[ee]=head[a];
		head[a]=ee++;
	}

	public static void main(String[] args) {
		Scanner in=new Scanner(System.in);
		n=in.nextInt();m=in.nextInt();
		Arrays.fill(head,-1);
		for(int i=1;i<=m;i++)
			add(in.nextInt(),in.nextInt());
		for(int k=1;k<=n;k++)
		{
			Arrays.fill(vis,0);
			q.add(new Pair(0,k));
			vis[k]=1;
			while(!q.isEmpty())
			{
				p=q.poll();
				dd[k][p.y]=p.x;
				for(int i=head[p.y];i!=-1;i=next[i])
				{
					v=edge[i];
					if(vis[v]==1) continue;
					q.add(new Pair(p.x+1,v));
					vis[v]=1;
				}
			}
			for(int i=1;i<=n;i++)
				if(vis[i]==0) dd[k][i]=-1;
		}
		for(int i=1;i<=n;i++)
		{
			for(int j=1;j<=n;j++)
				pp[j]=new Pair(dd[j][i],j);
			Arrays.sort(pp,1,n+1);
			for(int j=1;j<=3;j++)
				aa[i][j-1]=pp[j].y;
			for(int j=1;j<=n;j++)
				pp[j]=new Pair(dd[i][j],j);
			Arrays.sort(pp,1,n+1);
			for(int j=1;j<=3;j++)
				bb[i][j-1]=pp[j].y;
		}
		ans=0;
		for(int i=1;i<=n;i++)
		for(int j=1;j<=n;j++)
		{
			if(i==j||dd[i][j]==-1) continue;
			for(int a=0;a<3;a++)
			for(int b=0;b<3;b++)
			{
				u=aa[i][a];v=bb[j][b];
				if(u==v||u==i||v==i||u==j||v==j)
					continue;
				s=dd[u][i]+dd[i][j]+dd[j][v];
				if(s>ans)
				{
					ans=s;
					p1=u;p2=i;
					p3=j;p4=v;
				}
			}
		}
		System.out.println(p1+" "+p2+" "+p3+" "+p4);
	}
}
