public class d628 {
    static Long[][][][] dp;
    static String a;
    static String b;
    static int m;
    static int d;
    static final int mod = (int) 1e9+7;
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        m = sc.nextInt();
        d = sc.nextInt();
        a = sc.next();
        b = sc.next();

        dp = new Long[2000][2][2][2000];
        System.out.println(solve(0, 1,1, 0));
    }

    private static long solve(int pos, int stricta, int strictb, int modulo) {

        if (pos == a.length()) {
            return (modulo == 0) ? 1 : 0;
        }

        if (dp[pos][stricta][strictb][modulo] != null) return dp[pos][stricta][strictb][modulo];

        long ans = 0L;

        int start = (stricta == 1) ? a.charAt(pos)-'0' : 0;
        int end = (strictb == 1) ? b.charAt(pos)-'0' : 9;

        for (int i = start; i <= end; i++) {
            if ((pos%2 == 0 && i == d) || (pos%2 == 1 && i != d)) continue;
            int newstricta = (stricta == 1 && i == start) ? 1 : 0;
            int newstrictb = (strictb == 1 && i == end) ? 1 : 0;
            int newmodulo = (modulo*10 + i) % m;
            ans = (ans + solve(pos+1, newstricta, newstrictb, newmodulo)) % mod;
        }

        return dp[pos][stricta][strictb][modulo] = ans;
    }
}
