        if(isPossible)ans = (ans + 1)%mod;
        System.out.println(ans);


    }
    private static void init(){
        for(int i=0;i<dp.length;i++)
            for(int j=0;j<dp[0].length;j++)
                Arrays.fill(dp[i][j],-1);
    }
    private static int memo(int i,int currRemainder,int isBound,int m,int d,char[] digitArray){
        if(i==digitArray.length)return currRemainder == 0?1:0;
        if(dp[i][currRemainder][isBound]!=-1)return dp[i][currRemainder][isBound];
        long ans = 0;
        int maxDigit = isBound == 1?( digitArray[i] - '0') : 9;
        for(int digit = 0;digit <= maxDigit;digit++){
            if(i==0 && digit == 0)continue; // you can not pick a number having digits < digits in l or r
            if((i%2==1 && digit == d ) || (i%2==0 && digit != d)){
                ans += memo(i+1,(currRemainder*10 + digit) % m,(isBound==1 && digit==maxDigit)?1:0,m,d,digitArray);
                ans %= mod;
            }
        }
        return dp[i][currRemainder][isBound] = (int)ans;
    }
