			if(flag==1||d<limit) {
				cnt+=fun(ind+1,1,(10*rem+d)%m,al);
			}
			else if(d==limit) {
				cnt+=fun(ind+1,0,(10*rem+d)%m,al);
			}
			else
				return 0;
		}
		else {
			for(int i=0;i<=limit;i++) {
