public class R625D {

	public static void main(String[] args) {
		Scanner in = new Scanner(System.in);
		String s = in.next();
		if (s.equals("1"))
		{
			System.out.print("0");
			return;
		}
		int[] n = new int[s.length()];
		int[] ans = new int[s.length()];
		for (int i=0; i<s.length(); i++)
			n[s.length()-i-1]=s.charAt(i)-'0';
		int upL, upR, upL_;

		for (int m=n.length-1; m<=n.length; m++)
		{
			upR=0;
			if (m==n.length-1)
			{
				if (n[n.length-1]!=1) continue;
				upL=1;
			}
			else
			{
				upL=0;
			}
			int i;
			for (i=0; i<(m/2+m%2); i++)
			{
				upL_=0;
				int mod=n[i]-upR;
				if (mod==-1) {mod=9; upL_=1;}
				if (i==m-i-1 && (upL*10+mod)%2==1) break;
				if (mod==n[m-i-1])
				{
					if (mod==9 && upL==1) break;
					ans[i]=(upL*10+mod)/2;
					ans[m-i-1]=upL*10+mod-ans[i];
					upR=upL|upL_;
					upL=0;
				}
				else if (mod==(upL*10+n[m-i-1]-1)%10)
				{
					ans[i]=(upL*10+n[m-i-1]-1)/2;
					ans[m-i-1]=upL*10+n[m-i-1]-1-ans[i];
					if (i==0 && ans[m-i-1]==0) break;
					upR=(upL*10+n[m-i-1]-1+upR)/10;
					upL=1;
				}
				else break;
			}
			if (i==m/2+m%2)
			{
				if ((m%2)==0 && (upL!=upR)) break;
				for (i=m-1; i>=0; i--)
					System.out.print(ans[i]);
				return;
			}
		}
		System.out.println("0");

	}

}
