	Scanner sc = new Scanner(System.in);
	public static void main(String[] $) {
		CF625D o = new CF625D(); o.main(); o.flush();
	}

	boolean solve(byte[] cc, byte[] aa, int n) {
		for (int i = 0, j = n - 1; i < j; i++, j--) {
			if (cc[i] == cc[j] + 1 || cc[i] == cc[j] + 11) {
				cc[i]--;
				cc[i + 1] += 10;
			}
			if (cc[i] == cc[j] + 10) {
				int h = j - 1;
				while (h > i && cc[h] == 0) {
					cc[h] = 9;
					h--;
				}
				if (h == i)
					return false;
				cc[h]--;
				cc[j] += 10;
			}
			if (cc[i] != cc[j] || cc[i] > 18)
				return false;
			aa[i] = (byte) Math.min(cc[i], 9);
			aa[j] = (byte) (cc[i] - aa[i]);
		}
		if (n % 2 == 1) {
			if (cc[n / 2] % 2 != 0 || cc[n / 2] > 18)
				return false;
			aa[n / 2] = (byte) (cc[n / 2] / 2);
		}
		return aa[0] != 0;
	}
	void main() {
		byte[] cc = sc.next().getBytes();
		int n = cc.length;
		for (int i = 0; i < n; i++)
			cc[i] -= '0';
		byte[] cc_ = null;
		if (n > 1) {
			cc_ = new byte[n - 1];
			for (int i = 1; i < n; i++)
				cc_[i - 1] = cc[i];
			cc_[0] += cc[0] * 10;
		}
		byte[] aa = new byte[n];
		if (solve(cc, aa, n)) {
			for (int i = 0; i < n; i++)
				aa[i] += '0';
			println(new String(aa));
			return;
		}
		if (n > 1 && solve(cc_, aa, n - 1)) {
			for (int i = 0; i < n - 1; i++)
				aa[i] += '0';
			println(new String(aa, 0, n - 1));
			return;
		}
		println(0);
	}
}
