public class D {
	FastScanner in;
	PrintWriter out;

	char[] a;
	char[] c;
	int n;

	HashMap<Long, Boolean> mem = new HashMap<>();

	long code(int l, int r, int to, int from) {
		return ((l * 1L * n + r) * 2 + to) * 2 + from;
	}

	boolean ans(long id, boolean x) {
		mem.put(id, x);
		return x;
	}

	boolean can(int l, int r, int to, int from) {
		long id = code(l, r, to, from);
		if (mem.containsKey(id)) {
			return mem.get(id);
		}
		if (r < l) {
			return ans(id, to == from);
		}
		if (l == r) {
			for (int x = 0; x < 10; x++) {
				int d = x + x + from;
				c[r] = (char) (x + '0');
				if (d % 10 == a[l] - '0' && d / 10 == to) {
					return ans(id, true);
				}
			}
			return ans(id, false);
		}
		for (int y = 9; y >= 0; y--) {
			for (int x = 0; x < 10; x++) {
				c[r] = (char) (x + '0');
				c[l] = (char) (y + '0');
				int d = x + y + from;
				if (d % 10 == a[r] - '0') {
					int from2 = d / 10;
					for (int to2 = 0; to2 < 2; to2++) {
						int t = x + y + to2;
						if (t % 10 == a[l] - '0' && t / 10 == to) {
							if (can(l + 1, r - 1, to2, from2)) {
								return ans(id, true);
							}
						}
					}
				}
			}
		}
		return ans(id, false);
	}

	void solve() {
		a = in.next().toCharArray();
		n = a.length;
		c = new char[n];
		StringBuffer ans = new StringBuffer();
		if (can(0, n - 1, 0, 0) && c[0] != '0') {
			for (int i = 0; i < n; i++) {
				ans.append(c[i]);
			}
		} else if (a[0] == '1' && can(1, n - 1, 1, 0) && c[1] != '0') {
			for (int i = 1; i < n; i++) {
				ans.append(c[i]);
			}
		}
		if (ans.length() == 0) {
			ans.append(0);
		}
		out.println(ans.toString());
	}

	void run() {
		in = new FastScanner();
		out = new PrintWriter(System.out);

		solve();

		out.close();
	}

	class FastScanner {
		BufferedReader br;
		StringTokenizer st;

		public FastScanner() {
			br = new BufferedReader(new InputStreamReader(System.in));
		}

		String next() {
			while (st == null || !st.hasMoreTokens()) {
				try {
					st = new StringTokenizer(in.br.readLine());
				} catch (IOException e) {
					// TODO Auto-generated catch block
					e.printStackTrace();
				}
			}
			return st.nextToken();
		}

		int nextInt() {
			return Integer.parseInt(next());
		}

		long nextLong() {
			return Long.parseLong(next());
		}

		double nextDouble() {
			return Double.parseDouble(next());
		}
	}

	public static void main(String[] args) {
		new D().run();
	}
