import static java.lang.Integer.parseInt;

import java.io.BufferedReader;
import java.io.IOException;
import java.io.InputStreamReader;

public class D_598D_IgonInTheMuseum {

	static BufferedReader reader = new BufferedReader(new InputStreamReader(System.in));

	static int max = 1001;
	static char[][] museum = new char[max][max];
	static int[][] visited = new int[max][max];
	static int[] cache = new int[100001];
	static int res, n, m, i;

	public static void main(String[] args) throws IOException {
		String[] line = splitLine();
		n = parseInt(line[0]);
		m = parseInt(line[1]);
		int k = parseInt(line[2]);

		for (int i = 1; i <= n; ++i) {
			String s = readLine();
			for (int j = 1; j <= m; ++j) {
				museum[i][j] = s.charAt(j - 1);
			}
		}
		for (i = 1; i <= k; ++i) {
			String[] s = splitLine();
			int x = parseInt(s[0]);
			int y = parseInt(s[1]);

			res = 0;
			if (visited[x][y] == 0) {
				visit(x, y);

				cache[i] = res;
			} else {
				res = cache[visited[x][y]];
			}
			System.out.println(res);
		}
	}

	static void visit(int x, int y) {
		if (x == 0 || y == 0 || x == n + 1 || y == m + 1) {
			return;
		}
		if (museum[x][y] == '*') {
			++res;

			return;
		}
		if (visited[x][y] != 0) {
			return;
		}
		visited[x][y] = i;

		visit(x + 1, y);
		visit(x - 1, y);
		visit(x, y + 1);
		visit(x, y - 1);
	}





	static String[] splitLine() throws IOException {
		return readLine().split(" ");
	}

	static String readLine() throws IOException {
		return reader.readLine();
	}

	static int readInt() throws IOException {
		return parseInt(reader.readLine());
	}
}
