	static InputReader r = new InputReader(System.in);
	static PrintWriter pw = new PrintWriter(System.out);
	static int n,m; static int[][] grid; static int num, count;
	public static void main(String[] args)
	{
		n = r.nextInt(); m = r.nextInt(); int k = r.nextInt();
		grid = new int[n][m];
		num = 2;
		int[] ans = new int[n*m+2];
		for (int i = 0; i < n; i ++)
		{
			String s = r.next();
			for (int j = 0; j < m; j ++)
			{
				grid[i][j] = (s.charAt(j) == '*' ? 0:1);
			}
		}
		for (int i = 0; i < n; i ++)
		{
			for (int j = 0; j < m; j ++)
			{
				if (grid[i][j] == 1)
				{
					floodfill(i,j);
					ans[num] = count;
					num ++;
					count = 0;
				}
			}
		}
		for (int i = 0; i < k; i ++)
		{
			int a = r.nextInt() - 1; int b = r.nextInt() - 1;
			pw.println(ans[grid[a][b]]);
		}
		pw.close();
	}
	static void floodfill(int row, int col)
	{
		if (row < 0 || row >= n || col < 0 || col >= m || grid[row][col] == 0)
		{
			count ++;
			return;
		}
		else if (grid[row][col] != 1)
		{
			return;
		}
		grid[row][col] = num;
		floodfill(row-1,col); floodfill(row+1,col); floodfill(row,col-1); floodfill(row,col+1);
	}
