@SuppressWarnings("Duplicates")
public class D {
    public static void main(String[] args) {

        Scanner sc = new Scanner(System.in);
        PrintWriter pw = new PrintWriter(System.out);

        int rows = sc.nextInt();
        int cols = sc.nextInt();
        int query = sc.nextInt();
        boolean[][] empty = new boolean[rows][cols];
        int[][] comp = new int[rows][cols];
        for (int i = 0; i < rows; i++) {
            String line = sc.next();
            for (int j = 0; j < cols; j++) {
                if (line.charAt(j)=='.')empty[i][j] = true;
            }
        }

        HashMap<Integer,Integer> sol = new HashMap<>();

        int[][] dirs = {
            {1,0},
            {-1,0},
            {0,1},
            {0,-1}
        };

        int compn = 1;
        for (int q = 0; q < query; q++) {
            int r = sc.nextInt()-1;
            int c = sc.nextInt()-1;

            if (comp[r][c]!=0){
                pw.println(sol.get(comp[r][c]));
                continue;
            }

            LinkedList<Integer> que = new LinkedList<>();
            que.add(r*cols+c);
            comp[r][c] = compn;
            int walls = 0;
            while (!que.isEmpty()){
                int aux = que.removeFirst();
                r = aux/cols;
                c = aux%cols;
                for (int i = 0; i < dirs.length; i++) {
                    int nr = r+dirs[i][0];
                    int nc = c+dirs[i][1];
                    if (empty[nr][nc]) {
                        if (comp[nr][nc] == 0) {
                            comp[nr][nc] = compn;
                            que.add(nr * cols + nc);
                        }
                    }
                    else walls++;
                }
            }
            sol.put(compn,walls);
            compn++;
            pw.println(walls);
        }

        pw.flush();
    }
}
