public class Main {

	static int INF = (int)1e9;
	static int n, MAXN;
	static ArrayList<Integer>[] adjList;
	static ArrayList<Integer>[] people;
	static int[] parent, level;
	static int[][] origMin;
	static int[][] min;
	static int[][] lcaP;
	static int[][][] lcaMin;

	public static void dfs(int u, int p) {
		parent[u] = p;
		for(int v : adjList[u])
			if(v != p) {
				level[v] = level[u] + 1;
				min[v] = origMin[u];
				dfs(v, u);
			}
	}

	public static int[] merge(int[] a, int[] b) {
		int[] res = new int[10];
		int i = 0, j = 0;
		for(int u = 0; u < 10; u++)
			if(i == 10)
				res[u] = b[j++];
			else if(j == 10)
				res[u] = a[i++];
			else if(a[i] <= b[j])
				res[u] = a[i++];
			else
				res[u] = b[j++];
		return res;
	}

	public static void preprocess() {
		lcaP[0] = parent;
		lcaMin[0] = min;
		for(int i = 1; i < MAXN; i++)
			for(int j = 0; j < n; j++) {
				lcaP[i][j] = lcaP[i - 1][j] == -1 ? -1 : lcaP[i - 1][lcaP[i - 1][j]];
				lcaMin[i][j] = lcaP[i - 1][j] == -1 ? lcaMin[i - 1][j] : merge(lcaMin[i - 1][j], lcaMin[i - 1][lcaP[i - 1][j]]);
			}
	}

	public static int[] solve(int u, int v) {
		int[] ans = new int[10];
		Arrays.fill(ans, INF);
		if(level[u] < level[v]) {
			int temp = u;
			u = v;
			v = temp;
		}
		ans = merge(ans, origMin[u]);
		if(level[u] > level[v]) {
			int diff = level[u] - level[v];
			for(int i = 0; i < MAXN; i++)
				if((diff & (1 << i)) != 0) {
					ans = merge(ans, lcaMin[i][u]);
					u = lcaP[i][u];
				}
		}

		if(u == v)
			return ans;
		ans = merge(ans, origMin[v]);
		for(int i = MAXN - 1; i >= 0; i--) {
			if(lcaP[i][u] != lcaP[i][v]) {
				ans = merge(ans, lcaMin[i][u]);
				ans = merge(ans, lcaMin[i][v]);
				u = lcaP[i][u];
				v = lcaP[i][v];
			}
		}
		ans = merge(ans, lcaMin[0][u]);
		return ans;
	}

	public static void main(String[] args) throws Exception {
		Scanner sc = new Scanner(System.in);
		PrintWriter pw = new PrintWriter(System.out);

		MAXN = 18;
		n = sc.nextInt();
		int m = sc.nextInt();
		int q = sc.nextInt();

		adjList = new ArrayList[n];
		for(int i = 0; i < n; i++)
			adjList[i] = new ArrayList<>();

		people = new ArrayList[n];
		for(int i = 0; i < n; i++)
			people[i] = new ArrayList<>();

		for(int i = 0; i < n - 1; i++) {
			int u = sc.nextInt() - 1, v = sc.nextInt() - 1;
			adjList[u].add(v);
			adjList[v].add(u);
		}

		for(int i = 0; i < m; i++)
			people[sc.nextInt() - 1].add(i + 1);

		parent = new int[n];
		level = new int[n];
		origMin = new int[n][10];
		for(int i = 0; i < n; i++) {
			Arrays.fill(origMin[i], INF);
			Collections.sort(people[i]);
			for(int j = 0; j < Math.min(10, people[i].size()); j++)
				origMin[i][j] = people[i].get(j);
		}
		min = new int[n][10];
		Arrays.fill(min[0], INF);
		dfs(0, -1);

		lcaP = new int[MAXN][n];
		lcaMin = new int[MAXN][n][10];
		preprocess();

		while(q-->0) {
			int u = sc.nextInt() - 1, v = sc.nextInt() - 1, a = sc.nextInt();
			int[] ans = solve(u, v);
			int cnt = 0;
			for(int i = 0; i < Math.min(a, 10); i++)
				if(ans[i] == INF)
					break;
				else
					cnt++;
			pw.print(cnt);
			for(int i = 0; i < cnt; i++)
				pw.print(" " + ans[i]);
			pw.print("
");
		}

		pw.flush();
	}

