		if(b == 0) return a;
		if(a >= b) {
			long t = a/b;
			if(a % b == 0)
				t--;
			ans.append(t);
			ans.append(c);
		}
		c = (char) ('A' + 'B' - c);
		return gcd(b,a%b);
	}
