public class Main {
	static int mod = 1000000007;

	public static void main(String[] args) {
		// code
		Scanner scn = new Scanner(System.in);

		int t = 1;
		while (t > 0) {
			t--;
			int n = scn.nextInt();
			if (n == 3) {
				System.out.println(1 + "
" + 3);
				continue;
			}

			int p = n - 2;

			while (checkprime(p) == false) {
				p--;
				continue;
			}
			//System.out.println(p);
			int x = n - p;
			for (int i = 2; i <= x; i++) {
				if (checkprime(i) && checkprime(x - i)) {
					if (x - i == 0) {
						System.out.print("2" + "
" + p + " " + i);
					} else {
						System.out.print("3" + "
" + p + " " + i + " " + (x - i));
					}
					break;
				}
			}

		}
	}

	public static boolean checkprime(int n) {
		for (int i = 2; i <= Math.pow(n, 0.5); i++) {
			if (n % i == 0) {
				return false;
			}
		}
		return true;
	}
}
