import java.util.Scanner;

public class Main {

	public void solve() {
		Scanner scanner = new Scanner(System.in);
		char[] string = scanner.next().toCharArray();
		int L = string.length;// 

		int K = scanner.nextInt();
		scanner.close();

		// dp[i][j]:= ij
		boolean[][] dp = new boolean[L][L];

		// deques[x]:= x
		MyDeque[] deques = new MyDeque[L];
		for (int i = 0; i < L; i++) {
			deques[i] = new MyDeque(L);
		}

		// 
		for (int length = 0; length < L; length++) {
			for (int x = 0; x + length < L; x++) {
				int y = x + length;
				if (string[x] == string[y] && (length <= 3 || dp[x + 2][y - 2])) {
					dp[x][x + length] = true;
					deques[x].add(x + length);
				}
			}
		}

		StringBuilder ans = new StringBuilder();
		for (int i = 0; i < L; i++) {
			// i
			int finished = 0;// i-1i-1
			int a = 0;// i 'a' 
			for (int x = 0; x < L; x++) {
				if (deques[x].isEmpty()) {
					continue;
				}
				if (deques[x].peek() < x + i) {
					// i
					finished++;
					deques[x].poll();
				}
				if (!deques[x].isEmpty() && string[x + i] == 'a') {
					a += deques[x].size();
				}
			}

			if (K <= finished) {
				break;
			}
			K -= finished;

			if (K <= a) {
				// ia
				ans.append('a');
				for (int x = 0; x + i < L; x++) {
					// i 'b'
					if (!deques[x].isEmpty() && string[x + i] == 'b') {
						deques[x].clear();
					}
				}
			} else {
				// ib
				K -= a;
				ans.append('b');
				for (int x = 0; x + i < L; x++) {
					// ia
					if (!deques[x].isEmpty() && string[x + i] == 'a') {
						deques[x].clear();
					}
				}
			}
		}
		System.out.println(ans.toString());
	}

	public static void main(String[] args) {
		new Main().solve();
	}
}

// ArrayDeque
class MyDeque {
	int[] nums;
	int size, cur;

	public MyDeque(int N) {
		this.nums = new int[N];
		this.size = 0;
		this.cur = 0;
	}

	public void add(int a) {
		nums[size] = a;
		size++;
	}

	public int poll() {
		if (size == 0) {
			return -1;
		}
		cur++;
		size--;
		return nums[cur - 1];
	}

	public int size() {
		return size;
	}

	public boolean isEmpty() {
		return size == 0;
	}

	public int peek() {
		if (size == 0) {
			return -1;
		}
		return nums[cur];
	}

	public void clear() {
		size = 0;
		cur = 0;
	}
},"data structures,dp,graphs,string suffix structures,strings,trees"

