		// dp[i][j]:= ij
		boolean[][] dp = new boolean[L][L];

		// deques[x]:= x
		Node[] deques = new Node[L];
		for (int i = 0; i < L; i++) {
			deques[i] = new Node(L);
		}

		// 
		for (int length = 0; length < L; length++) {
			for (int x = 0; x + length < L; x++) {
				if (string[x] == string[x + length] && (length <= 3 || dp[x + 2][x + length - 2])) {
					dp[x][x + length] = true;
					deques[x].add(x + length);
				}
			}
		}

		StringBuilder ans = new StringBuilder();
		for (int i = 0; i < L; i++) {
			// i
			int finished = 0;// i-1i-1
			int a = 0;// i 'a' 
			for (int x = 0; x < L; x++) {
				if (deques[x].isEmpty()) {
					continue;
				}
				if (deques[x].peek() < x + i) {
					// i
					finished++;
					deques[x].poll();
				}
				if (!deques[x].isEmpty() && string[x + i]) {
					a += deques[x].size();
				}
			}

			if (K <= finished) {
				break;
			}
			K -= finished;

			if (K <= a) {
				// ia
				ans.append('a');
				for (int x = 0; x + i < L; x++) {
					// i 'b'
					if (!deques[x].isEmpty() && !string[x + i]) {
						deques[x].clear();
					}
				}
			} else {
				// ib
				K -= a;
				ans.append('b');
				for (int x = 0; x + i < L; x++) {
					// ia
					if (!deques[x].isEmpty() && string[x + i]) {
						deques[x].clear();
					}
				}
			}
		}
		System.out.println(ans.toString());
	}

	public static void main(String[] args) {
		new Main().solve();
	}
