class Node {
	int[] nums;
	int size, cur;

	public Node(int N) {
		this.nums = new int[N];
		this.size = 0;
		this.cur = 0;
	}

	public void add(int a) {
		nums[size] = a;
		size++;
	}

	public int poll() {
		cur++;
		size--;
		return nums[cur - 1];
	}

	public int size() {
		return size;
	}

	public boolean isEmpty() {
		return size == 0;
	}

	public int peek() {
		return nums[cur];
	}

	public void clear() {
		Arrays.fill(nums, 0);
		size = 0;
		cur = 0;
	}
