import java.io.PrintWriter;
import java.util.ArrayList;
import java.util.Arrays;
import java.util.StringTokenizer;

public class C {


	static int N, Q, L, B;
	static Point[][] arr;
	static long[] add;

	static void update(int l, int r, long val) {
		int bL = l / L;
		int bR = r / L;

		if(bL == bR)
			updateBlock(l, r, bL, val);
		else {
			updateBlock(l, r, bL, val);
			updateBlock(l, r, bR, val);

			for (int i = bL + 1; i < bR; i++)
				add[i] += val;
		}
	}

	static void updateBlock(int l, int r, int idx, long val) {
		ArrayList<Point> a1 = new ArrayList<>();
		ArrayList<Point> a2 = new ArrayList<>();
		for (int i = 0; i < L; i++) {
			if(arr[idx][i].idx >= l && arr[idx][i].idx <= r) {
				arr[idx][i].v += val;
				a1.add(arr[idx][i]);
			}else
				a2.add(arr[idx][i]);
		}

		Point[] newB = new Point[L];
		int p1 = 0;
		int p2 = 0;
		int p = 0;
		for (int i = 0; i < L; i++) 
			if(p1 < a1.size() && (p2 >= a2.size() || a1.get(p1).compareTo(a2.get(p2)) < 0))
				newB[p++] = a1.get(p1++);
			else
				newB[p++] = a2.get(p2++);

		arr[idx] = newB;
	}

	static int first(long val) {
		int ans = -1;
		for (int i = 0; i < B; ++i) {
			int l = 0;
			int h = L - 1;
			if(i == B - 1)
				h = (N - 1) % L;
			while(l <= h) {
				int mid = ((l + h) >> 1);
				if(arr[i][mid].v + add[i] == val) {
					ans = arr[i][mid].idx;
					h = mid - 1;
				}else if(arr[i][mid].v + add[i] > val)
					h = mid - 1;
				else
					l = mid + 1;
			}

			if(ans != -1)
				return ans;
		}

		return ans;
	}

	static int last(long val) {
		int ans = -1;
		for (int i = B - 1; i >= 0; --i) {
			int l = 0;
			int h = L - 1;
			if(i == B - 1)
				h = (N - 1) % L;
			while(l <= h) {
				int mid = ((l + h) >> 1);

				if(arr[i][mid].v + add[i] == val) {
					ans = arr[i][mid].idx;
					l = mid + 1;
				}else if(arr[i][mid].v + add[i] > val)
					h = mid - 1;
				else
					l = mid + 1;
			}

			if(ans != -1)
				return ans;
		}

		return ans;
	}

	public static void main(String[] args) throws IOException {
		Scanner sc = new Scanner(System.in);
		PrintWriter out = new PrintWriter(System.out);

		N = sc.nextInt();
		Q = sc.nextInt();

		L = 1000;

		B = (N + 999) / L;

		arr = new Point[B][L];
		add = new long[B];
		for (int i = 0; i < N; i++) 
			arr[i / L][i % L] = new Point(sc.nextLong(), i);

		for (int i = N; i < L * B; i++) 
			arr[i / L][i % L] = new Point(Long.MAX_VALUE, i);

		for (int i = 0; i < B; i++) 
			Arrays.sort(arr[i]);



		for (int i = 0; i < Q; i++) {
			int t = sc.nextInt();
			if(t == 1) {
				int l = sc.nextInt() - 1;
				int r = sc.nextInt() - 1;
				long x = sc.nextLong();

				update(l, r, x);
			} else {
				long y = sc.nextLong();
				int f = first(y);
				if(f == -1)
					out.println(-1);
				else
					out.println(last(y) - f);
			}

		}

		out.flush();
	}


	static class Point implements Comparable<Point> {
		long v;
		int idx;

		Point(long v, int idx) {
			this.v = v;
