import java.util.Arrays;
import java.io.InputStream;
import java.io.InputStreamReader;
import java.io.BufferedReader;
import java.io.OutputStream;
import java.io.PrintWriter;
import java.io.Writer;
import java.io.FileReader;
import java.io.IOException;
import java.util.StringTokenizer;

/**
 * Built using CHelper plug-in
 * Actual solution is at the top
 * @author Agostinho Junior (junior94)
 */
public class Main {
	public static void main(String[] args) {
		InputStream inputStream = System.in;
		OutputStream outputStream = System.out;
		InputReader in = new InputReader(inputStream);
		OutputWriter out = new OutputWriter(outputStream);
		TaskE solver = new TaskE();
		solver.solve(1, in, out);
		out.close();
	}
}

class TaskE {

	static class Data implements Comparable<Data> {
		int idx;
		long value;

		public Data(int idx, int value) {
			this.idx = idx;
			this.value = value;
		}

		public int compareTo(Data other) {
			return Long.compare(value, other.value);
		}
	}

	public void solve(int testNumber, InputReader in, OutputWriter out) {
		int N = in.readInt();
		int Q = in.readInt();

		Data[] data = new Data[N];
		for (int i = 0; i < N; i++) {
			data[i] = new Data(i, in.readInt());
		}

		final int blockSize = (int)Math.sqrt(N);

		int[] block = new int[N];
		int count = 1;
		for (int i = 1; i < N; i++) {
			block[i] = block[i - 1];
			if (count == blockSize) {
				block[i]++;
				count = 0;
			}
			count++;
		}

		long[] added = new long[block[N - 1] + 1];

		for (int i = 0; i < N; i += blockSize) {
			int end = Math.min(N, i + blockSize);
			Arrays.sort(data, i, end);
		}


		while (Q-- > 0) {
			int t = in.readInt();

			if (t == 1) {
				int L = in.readInt() - 1;
				int R = in.readInt() - 1;
				long X = in.readInt();

				int firstIn = block[L];
				if (L > 0 && firstIn == block[L - 1]) {
					firstIn++;
				}

				int lastIn = block[R];
				if (R < N - 1 && lastIn == block[R + 1]) {
					lastIn--;
				}

				int end = Math.min(N - 1, blockSize * (block[R] + 1) - 1);

				for (int i = block[L] * blockSize; i <= end; ) {
					if (firstIn <= block[i] && block[i] <= lastIn) {
						added[block[i]] += X;
						i += blockSize;
					} else {
						if (L <= data[i].idx && data[i].idx <= R) {
							data[i].value += X;
						}
						if (i == N - 1 || block[i] < block[i + 1]) {
							int start = block[i] * blockSize;
							Arrays.sort(data, start, i + 1);
						}
						i++;
					}
				}

			} else {
				int X = in.readInt();
				int first = -1;
				int last = -1;

				for (int i = 0; i < N; i += blockSize) {
					int low = i;
					int high = Math.min(N - 1, i + blockSize - 1);
					while (low <= high) {
						int mid = low + high >> 1;
						long value = data[mid].value + added[block[i]];
						if (value == X) {
							if (first == -1) {
								first = block[i];
							}
							last = block[i];
							break;
						}
						if (value < X) {
							low = mid + 1;
						} else {
							high = mid - 1;
						}
					}
				}

				if (first == -1) {
					out.println(-1);
				} else {
					int[] temp = {first, last};
					first = N - 1;
					last = 0;
					for (int b: temp) {
						int start = b * blockSize;
						int end = Math.min(N - 1, start + blockSize - 1);
						for (int i = start; i <= end; i++) {
							if (data[i].value + added[block[i]] == X) {
								first = Math.min(first, data[i].idx);
								last = Math.max(last, data[i].idx);
							}
						}
					}
					out.println(last - first);
				}

			}
		}

	}


}

class InputReader {
	private BufferedReader input;
	private StringTokenizer line = new StringTokenizer("");

	public InputReader(InputStream in) {input = new BufferedReader(new InputStreamReader(in));
	}

	public void fill() {
		try {
			if(!line.hasMoreTokens()) line = new StringTokenizer(input.readLine());
		} catch(IOException io) { io.printStackTrace(); System.exit(0);}
	}

	public int readInt() {
		fill();
		return Integer.parseInt(line.nextToken());
	}

}

class OutputWriter {
	private PrintWriter output;

	public OutputWriter(OutputStream out) {
		output = new PrintWriter(out);
	}

	public void println(Object o) {
		output.println(o);
	}

	public void close() {
		output.close();
	}
}

