class TaskE {
	public void solve(int testNumber, FastScanner in, PrintWriter out) {
		int n = in.nextInt();
		Line[] lines = new Line[n];
		for (int i = 0; i < n; i++) {
			int a = in.nextInt();
			int b = in.nextInt();
			int c = in.nextInt();
			lines[i] = new Line(a, b, c);
		}
		Arrays.sort(lines, new Comparator<Line>() {
			public int compare(Line l1, Line l2) {
				boolean u1 = l1.b > 0 || l1.b == 0 && l1.a > 0;
				boolean u2 = l2.b > 0 || l2.b == 0 && l2.a > 0;
				if (u1 != u2) {
					return u1 ? 1 : -1;
				}
				double cr = l1.a*l2.b - l2.a*l1.b;
				return -Double.compare(cr, 0);
			}
		});
		double ans = 0;
		for (int i = 0; i < n; i++) {
			Point sum = new Point(0, 0);
			for (int step = 1; step < n; step++) {
				int j = (i + step) % n;
				Point p = intersect(lines[i], lines[j]);
				ans += sum.x * p.y - p.x * sum.y;
				sum.x += p.x;
				sum.y += p.y;
			}
		}
		double total = (double) n * (n - 1) * (n - 2) / 6.0;
		ans /= total;
		ans /= 2;
		out.printf("%.10f
", ans);
	}

	final double eps = 1e-8;

	private Point intersect(Line l1, Line l2) {
		double det = l1.a*l2.b - l1.b*l2.a;
		if (Math.abs(det) < eps) {
			return null;
		}
		double x = (l1.c*l2.b - l1.b*l2.c) / det;
		double y = (l1.a*l2.c - l1.c*l2.a) / det;
		return new Point(x, y);
	}

	class Point {
		double x, y;
		Point(double x, double y) {
			this.x = x;
			this.y = y;
		}
	}

	class Line {
		double a, b, c;
		Line(double a, double b, double c) {
			if (a < 0) {
				a = -a;
				b = -b;
				c = -c;
			}
			this.a = a;
			this.b = b;
			this.c = c;
		}
	}
}

