import java.io.*;
import static java.lang.Math.*;
import java.util.*;

public class C {
    public static void main(String[] args) throws Exception {
        BufferedReader in = new BufferedReader(new InputStreamReader(System.in));
        StringTokenizer stok = new StringTokenizer(in.readLine());
        int N = Integer.valueOf(stok.nextToken());
        int K = Integer.valueOf(stok.nextToken());
        String S = in.readLine().trim();

        fact = new long[N];
        fact[0] = 1;
        invFact = new long[N];
        invFact[0] = 1;
        for (int i = 1; i < N; i++) {
            fact[i] = (fact[i - 1] * i) % MOD;
            invFact[i] = (pow(i, MOD - 2) * invFact[i-1]) % MOD;
        }

        long ans = ((S.charAt(N - 1) - '0') * choose(N - 1, K)) % MOD;
        //System.out.println(ans+" "+(S.charAt(N-1)-'0')+" "+choose(N-1, K));
        long old = 0;
        long p10 = 1;
        for (int i = 1; i < N; i++) {
            long v = S.charAt(N - i - 1) - '0';
            old = (old + choose(N - i - 1, K - 1) * p10) % MOD;
            //System.out.println(v+" "+i+" "+old +" "+ans);
            p10 = (p10 * 10) % MOD;
            ans = (ans + v * old) % MOD;
            ans = (ans + v * choose(N - i - 1, K) * p10) % MOD;
        }
        System.out.println(ans);
    }
    static long MOD = 1_000_000_007L;
    static long[] fact, invFact;
    static long pow(long a, long b) {
        long ans = 1;
        while (b > 0) {
            if (b % 2 == 1) {
                ans = (ans * a) % MOD;
            }
            a = (a * a) % MOD;
            b /= 2;
        }
        return ans;
    }
    static long choose(int a, int b) {
        if (b < 0 || b > a)
            return 0;
        long ans = (fact[a] * invFact[b]) % MOD;
        ans = (ans * invFact[a - b]) % MOD;
        return ans;
    }
}
