import java.io.InputStream;
import java.io.InputStreamReader;
import java.util.ArrayList;
import java.util.Arrays;
import java.util.Collections;
import java.util.List;
import java.util.Scanner;

public class E {
	static int n, k, QM;
	public static void main(String[] args) {
		Scanner in = new Scanner(System.in);
		n = in.nextInt();
		k = in.nextInt();
		QM = Integer.MAX_VALUE;
		String reg;
		List<Integer>[] sseq = new ArrayList[k];
		for (int i=0; i<n; i++) {
			int j = i%k;
			if (sseq[j] == null) {
				sseq[j] = new ArrayList<Integer>();
			}
			reg = in.next();

			if (reg.equals("?")) {
				sseq[j].add(QM);
			} else {
				sseq[j].add(Integer.valueOf(reg));
			}
		}
		for (int i=0; i<sseq.length; i++) {
			sseq[i] = solve(sseq[i]);
			if (sseq[i]==null) {
				System.out.println("Incorrect sequence");
				return;
}		}

		for (int i=0; i<n; i++) {
			System.out.print(sseq[i%k].get(i/k)+" ");
		}
	}
	private static List<Integer> solve(List<Integer> seq) {
		seq.add(0, (int)-2e9);
		seq.add((int) 2e9);

		List<Integer> result = new ArrayList<>();
		int b, e, cnt;

		for (b=0; b<seq.size()-1;) {
			e = b+1;

			while (e<seq.size() && seq.get(e) == QM) {
				e++;
			}
			cnt = e-b-1;
			if (seq.get(b) + cnt >= seq.get(e)) {
				return null;
			}

			int from  = seq.get(b);
			int to = seq.get(e);
			result.add(from);

			if (from >=0 && to >=0) {
				for (int i1=0; i1<cnt; i1++) {
					result.add(from + i1 + 1);
				}
			} else if (from <=0 && to <=0){
				for (int i1=0; i1<cnt; i1++) {
					result.add(to-cnt+i1);
				}
			} else {
				List<Integer> list = new ArrayList<Integer>();
				for (int x=0; cnt>0; x++) {
					if (cnt>0 && from < x && x < to){
						list.add(x);
						cnt--;
					}
					if (x==0) {
						continue;
					}
					if (cnt>0 && from < -x && -x < to) {
						list.add(-x);
						cnt--;
					}
				}
				Collections.sort(list);
				result.addAll(list);
			}
			b = e;
		}
		result.remove(0);
		for (int i=0; i<result.size()-1; i++) {
			if (result.get(i) >= result.get(i+1)) {
				return null;
			}
		}
		return result;
	}

},"greedy,implementation,math,ternary search"

