public class Div2_293_E{
	static final int MIN = -2000000010;
	static final int MAX = 2000000010;
	public static void main(String[] args) throws IOException{
		BufferedInputStream bis = new BufferedInputStream(System.in);
		BufferedReader br = new BufferedReader(new InputStreamReader(bis));
		PrintWriter prnt = new PrintWriter(System.out);
		StringTokenizer tok = new StringTokenizer(br.readLine());
		int n = Integer.parseInt(tok.nextToken());
		int k = Integer.parseInt(tok.nextToken());
		ArrayList <Integer> [] chains = new ArrayList [k];
		tok = new StringTokenizer(br.readLine());
		for(int i = 0;i < n;i++) {
			String curr = tok.nextToken();
			if(chains[i%k] == null) {
				chains[i%k] = new ArrayList<Integer>();
				chains[i%k].add(MIN);
			}
			if(curr.charAt(0)!='?') {
				chains[i%k].add(Integer.parseInt(curr));
			} else
				chains[i%k].add(Integer.MAX_VALUE); 
		}

		ArrayList<Integer> chain;
		for(int i = 0;i < k;i++) {
			chains[i].add(MAX);
			ArrayList<Integer> res = new ArrayList<Integer>();
			int from = 0, to = from;
			chain = chains[i];
			while(from < chain.size()-1) {
				for(to = from+1;to < chain.size() && chain.get(to) == Integer.MAX_VALUE;to ++);
				int len = (to-from)-1;
				int maxVal = chain.get(to), minVal = chain.get(from);
				res.add(minVal);
				if(maxVal <= minVal+len) {
					System.out.println("Incorrect sequence");
					return;
				}
				if(minVal >= 0 && maxVal >= 0) {
					for(int j = 1;j <= len;j++) {
						res.add(minVal+j);
					}
				}else if(maxVal <= 0 && minVal <= 0) {
					for(int j = 0;j < len;j++)
						res.add(maxVal-len+j);
				}else if(len != 0){
					ArrayList<Integer> temp = new ArrayList<Integer>();	
					if(minVal < 0 && maxVal > 0) {
						temp.add(0);
						len--;
					}
					for(int cnt = 1;len > 0;cnt++) {
						if(minVal < cnt && maxVal > cnt && len > 0) {
							temp.add(cnt);
							len--;
						}
						if(minVal < -cnt && maxVal > -cnt && len > 0) {
							temp.add(-cnt);
							len--;
						}
					}
					Collections.sort(temp);
					res.addAll(temp);
				}
				from = to;
			}
			res.remove(0);
			for(int j = 0;j < res.size()-1;j++) {
				if(res.get(j) >= res.get(j+1)) {
					prnt.println("Incorrect sequence");
					return;
				}
			}
			chains[i] = res;
		}
		prnt.print(chains[0].get(0));
		for(int i = 1;i < n;i++)
			prnt.print(" "+chains[i%k].get(i/k));
		prnt.println();
		prnt.close();
	}
}
