public class Rockethon15 {

    public static double countInv(int[] p){
        int c=0;

        for(int i=0;i<p.length;i++){
            for(int j=i+1;j<p.length;j++){
                if(p[i]>p[j])
                    c++;
            }
        }

        return c;
    }

    static double deno=0;
    public static double solve(int[] perm, int m){

        if(m==0){
            deno++;
            return countInv(perm);
        }

        int n=perm.length;
        double ans=0;

        int[] cur;

        for(int i=0;i<n;i++){
            cur=new int[n];
            for(int j=0;j<n;j++){
                cur[j]=perm[j];
            }

            for(int j=i;j<n;j++){

                for(int k=i;k<=j;k++){
                    cur[k]=perm[j-k+i];
                }
                ans+=solve(cur, m-1);
            }
        }

        return ans;
    }
    public static void main(String[] args) {
        Scanner sc=new Scanner(System.in);

        int n=sc.nextInt();
        int m=sc.nextInt();

        int[] in=new int[n];

        for(int i=0;i<n;i++)
            in[i]=sc.nextInt();


        double nume=solve(in, m);

        System.out.println(nume/deno);

    }
}
