			}
		}
		for (int i = 0; i < n; i ++)
		{
			for (int j = 0; j < m; j ++)
			{
				if (grid[i][j] == 1)
				{
					floodfill(i,j);
					ans[num] = count;
					num ++;
					count = 0;
				}
			}
		}
		for (int i = 0; i < k; i ++)
		{
			int a = r.nextInt() - 1; int b = r.nextInt() - 1;
			pw.println(ans[grid[a][b]]);
		}
		pw.close();
	}
	static void floodfill(int row, int col)
	{
		if (row < 0 || row >= n || col < 0 || col >= m || grid[row][col] == 0)
		{
			count ++;
			return;
		}
		else if (grid[row][col] != 1)
		{
			return;
		}
		grid[row][col] = num;
		floodfill(row-1,col); floodfill(row+1,col); floodfill(row,col-1); floodfill(row,col+1);
	}
