public class SolutionB extends Thread {
    static class FastReader {
        BufferedReader br;
        StringTokenizer st;

        public FastReader() {
            br = new BufferedReader(new
                                            InputStreamReader(in));
        }

        String next() {
            while (st == null || !st.hasMoreElements()) {
                try {
                    st = new StringTokenizer(br.readLine());
                } catch (IOException e) {
                    e.printStackTrace();
                }
            }
            return st.nextToken();
        }

        int nextInt() {
            return parseInt(next());
        }

        long nextLong() {
            return parseLong(next());
        }

        double nextDouble() {
            return parseDouble(next());
        }

        String nextLine() {
            String str = "";
            try {
                str = br.readLine();
            } catch (IOException e) {
                e.printStackTrace();
            }
            return str;
        }
    }

    private static final FastReader scanner = new FastReader();
    private static final PrintWriter out = new PrintWriter(System.out);

    public static void main(String[] args) {
        new Thread(null, new SolutionB(), "Main", 1 << 28).start();
    }

    public void run() {
        solve();
        out.close();
    }

    static class Line {
        int index;
        long m;
        long t;

        public Line(int index, int m, int t) {
            this.index = index;
            this.m = m;
            this.t = t;
        }
    }


    private static void solve() {
        int n = scanner.nextInt();
        int x1 = scanner.nextInt();
        int x2 = scanner.nextInt();

        Line[] linesA = new Line[n];
        Line[] linesB = new Line[n];
        for (int i = 0; i < n; i++) {
            int ki = scanner.nextInt();
            int bi = scanner.nextInt();
            linesA[i] = new Line(i, ki, bi);
            linesB[i] = new Line(i, ki, bi);
        }

        Arrays.sort(linesA, (o1, o2) -> {
            long yOnX1Line1 = o1.t + o1.m * x1;
            long yOnX1Line2 = o2.t + o2.m * x1;
            if (yOnX1Line1 == yOnX1Line2) {
                return Long.compare(o1.m, o2.m);
            } else {
                return Long.compare(yOnX1Line1, yOnX1Line2);
            }
        });

        Arrays.sort(linesB, (o1, o2) -> {
            long yOnX2Line1 = o1.t + o1.m * x2;
            long yOnX2Line2 = o2.t + o2.m * x2;
            if (yOnX2Line1 == yOnX2Line2) {
                return Long.compare(o2.m, o1.m);
            } else {
                return Long.compare(yOnX2Line1, yOnX2Line2);
            }
        });

        for (int i = 0; i < n; i++) {
            if (linesA[i].index != linesB[i].index) {
                out.println("YES");
                return;
            }
        }
        out.println("NO");
    }
