public class CF593B {
	static class Line {
		long m, b;
		public Line(long mm, long bb) {m = mm; b = bb;}
		long y(long x) {return (m * x) + b;}
	}
	public static void main(String[] args) {
		Scanner scan = new Scanner(System.in);
		int n = scan.nextInt();
		int x1 = scan.nextInt(), x2 = scan.nextInt();
		Line[] l = new Line[n];
		for(int i = 0 ; i < n ; i++) {
			long m = scan.nextLong();
			long b = scan.nextLong();
			l[i] = new Line(m, b);
		}
		Arrays.sort(l , (a, b) -> (a.y(x1) != b.y(x1)) ? Long.compare(a.y(x1), b.y(x1)) : Long.compare(a.y(x2), b.y(x2)));
		boolean passed = false;
		for(int i = 0 ; i < n - 1 ; i++)
			if(l[i].y(x2) > l[i + 1].y(x2))
				passed = true;
		System.out.println(passed ? "YES" : "NO");
	}
}
