    static long gcd(long a, long b)
    {
        if (a == 0)
            return b;
        return gcd(b % a, a);
    }
    static long lcm(long a, long b)
    {
        long r = a/gcd(a,b);
        try {
            long j = Math.multiplyExact(r,b);
            return j;
        }catch (ArithmeticException e){
            return t+1;
        }
    }

    public static String asFraction(long a, long b) {
        long gcd = gcd(a, b);
        return (a / gcd) + "/" + (b / gcd);
    }

