public class TheBigRace {

    /**
     * @param args the command line arguments
     */
    public static void main(String[] args) {
        Scanner scanner = new Scanner(System.in);
        BigInteger t,w,b;
        t = scanner.nextBigInteger();
        w = scanner.nextBigInteger();
        b = scanner.nextBigInteger();
        BigInteger mn;
        if(w.compareTo(b) == -1) {
            mn = w;
        }
        else {
            mn = b;
        }
        BigInteger num;
        if(w.compareTo(b) == 0) {
            num = t;
        }
        else {
            BigInteger lcm = w.multiply(b);
            BigInteger gcd = w.gcd(b);
            lcm = lcm.divide(gcd);
            BigInteger ans = t.divide(lcm);
            ans = ans.multiply(mn);
            /*
            if(w.compareTo(b) == -1) {
                ans = ans.multiply(w);
            }
            else {
                ans = ans.multiply(b);
            }*/
            ans = ans.add(mn.subtract(BigInteger.ONE));
            /*if(w.compareTo(BigInteger.ONE) != 0 && b.compareTo(BigInteger.ONE) != 0) {
                ans = ans.add(BigInteger.ONE);
            }*/
            BigInteger ratio = t.divide(lcm);
            BigInteger closest = lcm.multiply(ratio);
            //System.out.println("ans is " + ans);
            BigInteger outside = closest.add(mn).subtract(t).subtract(BigInteger.ONE);
            if(outside.compareTo(BigInteger.ZERO) != -1) {
                ans = ans.subtract(outside);
            }
            //System.out.println("ans is " + ans);

            if(t.compareTo(ans) == -1) {
                num = t;
            }
            else {
                num = ans;
            }
        }

        //System.out.println("num is " + num);
        BigInteger denum = t;
        BigInteger d = num.gcd(denum);
        num = num.divide(d);
        denum = denum.divide(d);
        System.out.println(num + "/" + denum);
    }

}
