import java.util.*;
import java.io.*;
public class DuffInTheArmy {
    public static void main(String[] args) throws IOException {
        Reader in = new Reader();
        PrintWriter out = new PrintWriter(System.out);

        int N = in.nextInt(), M = in.nextInt(), Q = in.nextInt();
        List<Integer>[] adj = new ArrayList[N];
        for (int i = 0; i < N; i++) {
            adj[i] = new ArrayList<>();
        }
        for (int i = 0; i < N - 1; i++) {
            int u = in.nextInt() - 1, v = in.nextInt() - 1;
            adj[u].add(v);
            adj[v].add(u);
        }

        Queue<Integer> queue = new LinkedList<>();
        queue.offer(0);
        int[][] jump = new int[N][20];
        jump[0][0] = -1;
        int[] depth = new int[N];
        while (!queue.isEmpty()) {
            int current = queue.poll();
            for (int i : adj[current]) {
                if (current == 0 || i != jump[current][0]) {
                    jump[i][0] = current;
                    depth[i] = depth[current] + 1;
                    queue.offer(i);
                }
            }
        }

        List<Integer>[][] dp = new ArrayList[N][20];
        for (int i = 0; i < N; i++) {
            dp[i][0] = new ArrayList<>();
        }
        for (int i = 0; i < M; i++) {
            dp[in.nextInt() - 1][0].add(i + 1);
        }
        for (int i = 0; i < N; i++) {
            Collections.sort(dp[i][0]);
            while (dp[i][0].size() > 10) {
                dp[i][0].remove(dp[i][0].size() - 1);
            }
        }
        for (int j = 1; j < 20; j++) {
            for (int i = 0; i < N; i++) {
                dp[i][j] = new ArrayList<>();
                jump[i][j] = jump[i][j - 1] == -1 ? -1 : jump[jump[i][j - 1]][j - 1];
                List<Integer> l1 = dp[i][j - 1], l2 = jump[i][j - 1] == -1 ? new ArrayList<>() : dp[jump[i][j - 1]][j - 1];
                int i1 = 0, i2 = 0;
                while (i1 < l1.size() && i2 < l2.size() && dp[i][j].size() < 10) {
                    if (l1.get(i1) < l2.get(i2)) {
                        dp[i][j].add(l1.get(i1++));
                    } else {
                        dp[i][j].add(l2.get(i2++));
                    }
                }
                while (i1 < l1.size() && dp[i][j].size() < 10) {
                    dp[i][j].add(l1.get(i1++));
                }
                while (i2 < l2.size() && dp[i][j].size() < 10) {
                    dp[i][j].add(l2.get(i2++));
                }
            }
        }

        for (int q = 0; q < Q; q++) {
            int u = in.nextInt() - 1, v = in.nextInt() - 1, K = in.nextInt();
            int u2 = u, v2 = v;
            Queue<Integer> pq = new PriorityQueue<>();
            for (int j = 19; j >= 0; j--) {
                if (depth[u2] > depth[v2] && jump[u2][j] != -1 && depth[jump[u2][j]] >= depth[v2]) {
                    for (int i : dp[u2][j]) {
                        pq.offer(i);
                    }
                    u2 = jump[u2][j];
                }
                if (depth[u2] < depth[v2] && jump[v2][j] != -1 && depth[jump[v2][j]] >= depth[u2]) {
                    for (int i : dp[v2][j]) {
                        pq.offer(i);
                    }
                    v2 = jump[v2][j];
                }
            }
            for (int j = 19; j >= 0; j--) {
                if (jump[u2][j] != -1 && jump[u2][j] != jump[v2][j]) {
                    for (int i : dp[u2][j]) {
                        pq.offer(i);
                    }
                    u2 = jump[u2][j];
                    for (int i : dp[v2][j]) {
                        pq.offer(i);
                    }
                    v2 = jump[v2][j];
                }
            }
            if (u2 != v2) {
                for (int i : dp[u2][0]) {
                    pq.offer(i);
                }
                for (int i : dp[v2][0]) {
                    pq.offer(i);
                }
            }
            int lca = u2 == v2 ? u2 : jump[u2][0];
            for (int i : dp[lca][0]) {
                pq.offer(i);
            }
            out.print(Math.min(pq.size(), K));
            for (int i = 0; i < K; i++) {
                if (pq.isEmpty()) {
                    break;
                }
                out.print(" " + pq.poll());
            }
            out.println();
        }

        out.close();
    }
    static class Reader {
        BufferedReader in;
        StringTokenizer st;
        public Reader() {
            in = new BufferedReader(new InputStreamReader(System.in));
            st = new StringTokenizer("");
        }
        public String nextLine() throws IOException {
            st = new StringTokenizer("");
            return in.readLine();
        }
        public String next() throws IOException {
            while (!st.hasMoreTokens()) {
                st = new StringTokenizer(in.readLine());
            }
            return st.nextToken();
        }
        public int nextInt() throws IOException {
            return Integer.parseInt(next());
        }
        public long nextLong() throws IOException {
            return Long.parseLong(next());
        }
    }
    public static void sort(int[] arr) {
        List<Integer> list = new ArrayList<>();
        for (int i : arr) {
            list.add(i);
        }
        Collections.sort(list);
        for (int i = 0; i < arr.length; i++) {
            arr[i] = list.get(i);
        }
    }
