public class Main {
	static long x,y,p;
	static String s;
	static long gcd(long a,long b)
	{
		if(a==0) return b;
		return gcd(b%a,a);
	}

	public static void main(String[] args) {
		Scanner in=new Scanner(System.in);
		x=in.nextLong();y=in.nextLong();
		if(gcd(x,y)!=1) System.out.println("Impossible");
		else
		{
			s="";
			while(x!=1&&y!=1)
			{
				if(x>y)
				{
					p=x/y;x=x%y;
					s+=p+"A";
				}
				else
				{
					p=y/x;y=y%x;
					s+=p+"B";
				}
			}
			if(y==1) s+=(x-1)+"A";
			else s+=(y-1)+"B";
			System.out.println(s);
		}
	}
}
