import java.util.ArrayList;
import java.util.Scanner;

public class Main {

	private ArrayList<ArrayList<Integer>> graph;
	private boolean[] del;
	private int[] legs;

	public void solve() {
		Scanner scanner = new Scanner(System.in);
		int N = scanner.nextInt();
		graph = new ArrayList<>();
		for (int i = 0; i < N; i++) {
			graph.add(new ArrayList<Integer>());
		}
		del = new boolean[N];
		legs = new int[N];

		for (int i = 0; i < N - 1; i++) {
			int a = scanner.nextInt() - 1;
			int b = scanner.nextInt() - 1;
			graph.get(a).add(b);
			graph.get(b).add(a);
		}
		scanner.close();

		for (int i = 0; i < N; i++) {
			if (graph.get(i).size() == 1) {
				dfs(i, -1);
			}
		}
		for (int i = 0; i < N; i++) {
			for (int b : graph.get(i)) {
				if (del[b]) {
					legs[i] = Math.min(legs[i] + 1, 2);
				}
			}
		}
		for (int i = 0; i < N; i++) {
			if (!del[i]) {
				int cnt = 0;
				for (int b : graph.get(i)) {
					if (!del[b] && graph.get(b).size() - legs[b] > 1) {
						cnt++;
					}
					if (cnt > 2) {
						System.out.println("No");
						return;
					}
				}
			}
		}
		System.out.println("Yes");
		return;

	}

	private void dfs(int now, int parent) {
		if (graph.get(now).size() > 2) {
			return;
		}

		del[now] = true;
		for (int b : graph.get(now)) {
			if (b != parent) {
				dfs(b, now);
			}
		}
	}

	public static void main(String[] args) {
		new Main().solve();
	}
},"constructive algorithms,dfs and similar,trees"

