    static boolean[] dfs(int x) {
	boolean[] R = new boolean[4];
	F[x] = true;
	int cnt = 0, c2 = 0;
	R[0] = R[1] = R[2] = R[3] = true;
	for (Integer y : G[x]) {
	    if (!F[y]) {
		boolean[] C = dfs(y);
		++cnt;
		if (cnt > 1 || !C[3]) R[3] = false;
		if (cnt > 2 || !C[3]) R[2] = false;
		if (!C[2]) ++c2;
		if (c2 > 1 || !C[1]) {if (firstfail < 0) firstfail = x; R[1] = false;}
		if (c2 > 2 || !C[1]) R[0] = false;
	    }
	}
