            for(int i=1;i<n;i++) {
                int u , v;
                u = in.nextInt() - 1;
                v = in.nextInt() - 1;
                g[u].add(v);
                g[v].add(u);
                degree[u] ++;
                degree[v] ++;
            }
            for(int i=0;i<n;i++) {
                if(!del[i] && degree[i] == 1) {
                    dfs(i, -1);
                }
            }
            for(int u=0;u<n;u++) {
                if(!del[u] && degree[u] - Math.min(legs[u], 2) > 1) {
                    int cnt = 0;
                    for(int v : g[u]) {
                        if(!del[v] && degree[v] - Math.min(legs[v], 2) > 1) {
                            cnt ++;
                            if(cnt > 2) {
                                System.out.println("No");
                                return;
                            }
                        }
                    }
                }
            }
            System.out.println("Yes");
            return;
        }
    }
},"constructive algorithms,dfs and similar,trees"

