        }
    }

    public static void main(String[] args) {
        InputStream inputStream = System.in;
        OutputStream outputStream = System.out;
        InputReader in = new InputReader(inputStream);
        OutputWriter out = new OutputWriter(outputStream);
        Task t = new Task();
        t.solve(in, out);
        out.close();
    }

    static class Task {

        static class AbstractGraphBuilder {
            int[] whereIsNode;
            int iterator;

            public AbstractGraphBuilder(int n, int m) {
                whereIsNode = new int[n + 1];
                iterator = n;
                for (int i = 1; i <= n; i++) {
                    whereIsNode[i] = i;
                }
            }

            public int askWhereIsNode(int x) {
                return whereIsNode[x];
            }

            public void union(int x, int y) {
                int z = (++iterator);
                whereIsNode[x] = z;
            }

            public int howManyVertices() {
                return iterator;
            }

            public void clear() {
                whereIsNode = null;
            }
        }

        static class GraphBuilder {
            AbstractGraphBuilder agb;
            ArrayList<Integer>[] adj;
            public int[] leafsCnt;
            public int[] subtreeSz;
            public int[] posInEuler;
            boolean[] used;
            int eulerIt;

            @SuppressWarnings("unchecked")
            public GraphBuilder(int n, int m) {
                int tmp = n + m + 1;
                adj = (ArrayList<Integer>[])new ArrayList[tmp];
                for (int i = 0; i < adj.length; i++) {
                    adj[i] = new ArrayList<Integer>();
                }
                agb = new AbstractGraphBuilder(n, m);
            }

            void addDirectedEdge(int x, int y) {
                adj[x].add(y);
            }

            public void union(int x, int y) {
                int a = agb.askWhereIsNode(x);
                int b = agb.askWhereIsNode(y);
                agb.union(x, y);
                int z = agb.askWhereIsNode(x);
                addDirectedEdge(z, a);
                addDirectedEdge(z, b);
            }

            public int askWhereIsNode(int x) {
                return agb.askWhereIsNode(x);
            }

            public int howManyVertices() {
                return agb.howManyVertices();
            }

            void dfs(int v, int p) {
                used[v] = true;
                subtreeSz[v] = 1;
                posInEuler[v] = eulerIt++;
                leafsCnt[v] = 0;

                for (int to : adj[v]) {
                    if (to == p) continue;
                    dfs(to, v);
                    subtreeSz[v] += subtreeSz[to];
                    leafsCnt[v] += leafsCnt[to];
                }

                if (subtreeSz[v] == 1) leafsCnt[v] = 1;
            }

            void clear() {
                agb.clear();
                used = null;
                adj = null;
            }

            public void doCalculations() {
                int n = howManyVertices();
                eulerIt = 0;
                leafsCnt = new int[n + 1];
                subtreeSz = new int[n + 1];
                posInEuler = new int[n + 1];
                used = new boolean[n + 1];

                for (int v = n; v >= 1; v--) {
                    if (!used[v]) {
                        dfs(v, -1);
                    }
                }

                clear();
            }
        }

        static class Query {
            final char type;
            final int x;
            final int y;

            public Query(char type, int x, int y) {
                this.type = type;
                this.x = x;
                this.y = y;
            }
        }

        static class AskValueQuery {
            int x;
            long result;
            AskValueQuery(int x) {
                this.x = x;
            }
            public int getX() {
                return x;
            }
            public void setResult(long result) {
                this.result = result;
            }
            public long getResult() {
                return result;
            }
        }

        static class FullAskQuery {
            AskValueQuery l, r;
            public FullAskQuery(AskValueQuery l, AskValueQuery r) {
                this.l = l;
                this.r = r;
            }
            public long getResult() {
                return r.getResult() - l.getResult();
            }
        }

        Query[] queries;
        ArrayList<AskValueQuery>[] askValueQueries;
        FullAskQuery[] fullAskQueries;
        GraphBuilder university, military;
        int[] militaryTree;

        void buildMilitaryTree() {
            militaryTree = new int[military.howManyVertices() * 4];
        }

        void pushInMilitaryTree(int v) {
            int l = v * 2 + 1;
            int r = v * 2 + 2;
            if (militaryTree[l] < militaryTree[v]) {
                militaryTree[l] = militaryTree[v];
            }
            if (militaryTree[r] < militaryTree[v]) {
                militaryTree[r] = militaryTree[v];
            }
        }

        void raidToMilitaryTreeRec(int v, int tl, int tr, int l, int r, int idx) {
            if (tl == l && tr == r) {
                militaryTree[v] = idx;
                return;
            }
            pushInMilitaryTree(v);
            int tm = (tl + tr) / 2;
            if (r <= tm) {
                raidToMilitaryTreeRec(v * 2 + 1, tl, tm, l, r, idx);
            }
            else if (l > tm) {
                raidToMilitaryTreeRec(v * 2 + 2, tm + 1, tr, l, r, idx);
            }
            else {
                raidToMilitaryTreeRec(v * 2 + 1, tl, tm, l, tm, idx);
                raidToMilitaryTreeRec(v * 2 + 2, tm + 1, tr, tm + 1, r, idx);
            }
        }

        void raidToMilitaryTree(int l, int r, int idx) {
            raidToMilitaryTreeRec(0, 0, military.howManyVertices() - 1, l, r, idx);
        }

        int militaryTreeGet(int v, int tl, int tr, int pos) {
            if (tl == tr) {
                return militaryTree[v];
            }
            pushInMilitaryTree(v);
            int tm = (tl + tr) / 2;
            if (pos <= tm) {
                return militaryTreeGet(v * 2 + 1, tl, tm, pos);
            }
            else {
                return militaryTreeGet(v * 2 + 2, tm + 1, tr, pos);
            }
        }

        int getIdxOfLastRaid(int x) {
            return militaryTreeGet(0, 0, military.howManyVertices() - 1, military.posInEuler[x]);
        }

        long[] universityTree;

        void buildUniversityTree() {
            universityTree = new long[university.howManyVertices() * 4];
        }

        void addToUniversityTreeRec(int v, int tl, int tr, int l, int r, long val) {
            if (tl == l && tr == r) {
                universityTree[v] += val;
                return;
            }
            int tm = (tl + tr) / 2;
            if (r <= tm) {
                addToUniversityTreeRec(v * 2 + 1, tl, tm, l, r, val);
            }
            else if (l > tm) {
                addToUniversityTreeRec(v * 2 + 2, tm + 1, tr, l, r, val);
            }
            else {
                addToUniversityTreeRec(v * 2 + 1, tl, tm, l, tm, val);
                addToUniversityTreeRec(v * 2 + 2, tm + 1, tr, tm + 1, r, val);
            }
        }

        long universityTreeGet(int v, int tl, int tr, int pos) {
            if (tl == tr) {
                return universityTree[v];
            }
            int tm = (tl + tr) / 2;
            if (pos <= tm) {
                return universityTree[v] + universityTreeGet(v * 2 + 1, tl, tm, pos);
            }
            else {
                return universityTree[v] + universityTreeGet(v * 2 + 2, tm + 1, tr, pos);
            }
        }

        long getValueInUniversity(int x) {
            return universityTreeGet(0, 0, university.howManyVertices() - 1, university.posInEuler[x]);
        }

        void addToUniversityTree(int l, int r, long val) {
            addToUniversityTreeRec(0, 0, university.howManyVertices() - 1, l, r, val);
        }

        @SuppressWarnings("unchecked")
        public void solve(InputReader in, OutputWriter out) {
            int n = in.nextInt();
            int m = in.nextInt();

            queries = new Query[m + 1];
            askValueQueries = (ArrayList<AskValueQuery>[])new ArrayList[m + 1];
            for (int i = 0; i < askValueQueries.length; i++) {
                askValueQueries[i] = new ArrayList<AskValueQuery>();
            }
            fullAskQueries = new FullAskQuery[m + 1];

            for (int i = 1; i <= m; i++) {
                char type = in.next().charAt(0);
                int x = 0, y = 0;
                if (type == 'U' || type == 'M') {
                    x = in.nextInt();
                    y = in.nextInt();
                }
                else {
                    x = in.nextInt();
                }
                queries[i] = new Query(type, x, y);
            }

            university = new GraphBuilder(n, m);

            for (int i = 1; i <= m; i++) {
                if (queries[i].type == 'U') {
                    university.union(queries[i].x, queries[i].y);
                }
            }

            university.doCalculations();

            military = new GraphBuilder(n, m);

            for (int i = 1; i <= m; i++) {
                if (queries[i].type == 'M') {
                    military.union(queries[i].x, queries[i].y);
                }
            }

            military.doCalculations();

            buildMilitaryTree();

            AbstractGraphBuilder abstractMilitary = new AbstractGraphBuilder(n, m);

            for (int i = 1; i <= m; i++) {
                if (queries[i].type == 'M') {
                    abstractMilitary.union(queries[i].x, queries[i].y);
                }
                else if (queries[i].type == 'Z') {
                    int x = abstractMilitary.askWhereIsNode(queries[i].x);
                    raidToMilitaryTree(military.posInEuler[x], military.posInEuler[x] + military.subtreeSz[x] - 1, i);
                }
                else if (queries[i].type == 'Q') {
                    int x = queries[i].x;
                    int idxOfLastRaid = getIdxOfLastRaid(queries[i].x);
                    askValueQueries[idxOfLastRaid].add(new AskValueQuery(x));
                    askValueQueries[i].add(new AskValueQuery(x));
                    fullAskQueries[i] = new FullAskQuery(askValueQueries[idxOfLastRaid].get(askValueQueries[idxOfLastRaid].size() - 1),
                                                        askValueQueries[i].get(askValueQueries[i].size() - 1));
                }
            }

            buildUniversityTree();

            AbstractGraphBuilder abstractUniversity = new AbstractGraphBuilder(n, m);

            for (int i = 1; i <= m; i++) {
                if (queries[i].type == 'U') {
                    abstractUniversity.union(queries[i].x, queries[i].y);
                }
                else if (queries[i].type == 'A') {
                    int x = abstractUniversity.askWhereIsNode(queries[i].x);
                    addToUniversityTree(university.posInEuler[x], university.posInEuler[x] + university.subtreeSz[x] - 1, university.leafsCnt[x]);
                }
                for (AskValueQuery q : askValueQueries[i]) {
                    q.setResult(getValueInUniversity(q.getX()));
                }
            }

            for (FullAskQuery q : fullAskQueries) {
                if (q != null) {
                    out.println(q.getResult());
                }
            }

            out.close();
        }
    }
