class MyDeque {
	int[] nums;
	int size, cur;

	public MyDeque(int N) {
		this.nums = new int[N];
		this.size = 0;
		this.cur = 0;
	}

	public void add(int a) {
		nums[size] = a;
		size++;
	}

	public int poll() {
		if (size == 0) {
			return -1;
		}
		cur++;
		size--;
		return nums[cur - 1];
	}

	public int size() {
		return size;
	}

	public boolean isEmpty() {
		return size == 0;
	}

	public int peek() {
		if (size == 0) {
			return -1;
		}
		return nums[cur];
	}

	public void clear() {
		size = 0;
		cur = 0;
	}
},"data structures,dp,graphs,string suffix structures,strings,trees"

