public class CF557E {
	int[] last;
	boolean[][] isPalin; // is half Palindrome
	void findPalindromes() {
		int n = s.length;
		last = new int[n];
		isPalin = new boolean[n][n];
		for(int i =  0 ; i < n ; i++) { // base cases
			isPalin[i][i] = true; // check all length 1's
			last[i] = i;
			if(i < n - 1 && s[i] == s[i + 1]) { // check all length 2's
				isPalin[i][i + 1] = true;
				last[i] = i + 1;
			}
			if(i < n - 2 && s[i] == s[i + 2]) { // check all length 3's
				isPalin[i][i + 2] = true;
				last[i] = i + 2;
			}
			if(i < n - 3 && s[i] == s[i + 3]) { // check all length 4's
				isPalin[i][i + 3] = true;
				last[i] = i + 3;
			}
		}
		for(int len = 4 ; len < n ; len++) {
			for(int i = 0 ; i < n - len ; i++) {
				int j = i + len;
				if(s[i] == s[j] && isPalin[i + 2][j - 2]) {
					isPalin[i][j] = true;
					last[i] = j;
				}
			}
		}
	}
	void addStrings() {
		int n = s.length;
		numNodes = 1 + ((n * (n + 1)) / 2);
		next = 1;
		cnt = new int[numNodes];
		end = new int[numNodes];
		prev = new int[numNodes];
		trie = new int[2][numNodes];
		int node = 0;
		for(int i = 0 ; i < n ; i++) {
			for(int j = i ; j <= last[i] ; j++) {
				int let = s[j] - 'a';
				if(trie[let][node] == 0)
					trie[let][node] = next++;
				prev[trie[let][node]] = node;
				node = trie[let][node];
				if(isPalin[i][j]) end[node]++;
			}
			while(true) {
				int newcnt = 0;
				for(int let = 0 ; let < 2 ; let++)
					if(trie[let][node] != 0)
						newcnt += cnt[trie[let][node]];
				cnt[node] = end[node] + newcnt;
				if(node == 0) break;
				node = prev[node];
			}
		}
	}
	char[] s;
	int next, numNodes, prev[], cnt[], end[], trie[][];
	public CF557E() {
		FS scan = new FS();
		PrintWriter out = new PrintWriter(System.out);
		s = scan.next().toCharArray();
		int k = scan.nextInt();
		findPalindromes();
		addStrings();
		int node = 0;
		int numStrings = 0;
		StringBuilder res = new StringBuilder();
		char[] letter = {'a', 'b'};
		while(true) {
			numStrings += end[node];
			if(numStrings >= k) break;
			for(int let = 0 ; let < 2 ; let++) {
				if(trie[let][node] != 0) {
					if(numStrings + cnt[trie[let][node]] >= k) {
						res.append(letter[let]);
						node = trie[let][node];
						break;
					} else {
						numStrings += cnt[trie[let][node]];
					}
				}
			}
		}
		out.println(res);
		out.close();
	}
	class FS {
		BufferedReader br = new BufferedReader(new InputStreamReader(System.in));
		StringTokenizer st = new StringTokenizer("");
		public String next() {
			while(!st.hasMoreTokens()) {
				try { st = new StringTokenizer(br.readLine()); }
				catch(Exception e) { e.printStackTrace(); }
			}
			return st.nextToken();
		}
		public int nextInt() { return Integer.parseInt(next()); }
	}
	public static void main(String[] args) { new CF557E(); }
}
