import java.util.Scanner;

public class Main {

	public void solve() {
		Scanner scanner = new Scanner(System.in);
		char[] S = scanner.next().toCharArray();
		int L = S.length;// 
		boolean[] string = new boolean[L];
		for (int i = 0; i < L; i++) {
			if (S[i] == 'a') {
				string[i] = true;
			}
		}

		int K = scanner.nextInt();
		scanner.close();

		// dp[i][j]:= ij
		boolean[][] dp = new boolean[L][L];

		// deques[x]:= x
		MyDeque[] deques = new MyDeque[L];
		for (int i = 0; i < L; i++) {
			deques[i] = new MyDeque(L);
		}

		// 
		for (int length = 0; length < L; length++) {
			for (int x = 0; x + length < L; x++) {
				if (string[x] == string[x + length] && (length <= 3 || dp[x + 2][x + length - 2])) {
					dp[x][x + length] = true;
					deques[x].add(x + length);
				}
			}
		}

		StringBuilder ans = new StringBuilder();
		for (int i = 0; i < L; i++) {
			// i
			int finished = 0;// i-1i-1
			int a = 0;// i 'a' 
			for (int x = 0; x < L; x++) {
				if (deques[x].isEmpty()) {
					continue;
				}
				if (deques[x].peek() < x + i) {
					// i
					finished++;
					deques[x].poll();
				}
				if (!deques[x].isEmpty() && string[x + i]) {
					a += deques[x].size();
				}
			}

			if (K <= finished) {
				break;
			}
			K -= finished;

			if (K <= a) {
				// ia
				ans.append('a');
				for (int x = 0; x + i < L; x++) {
					// i 'b'
					if (!deques[x].isEmpty() && !string[x + i]) {
						deques[x].clear();
					}
				}
			} else {
				// ib
				K -= a;
				ans.append('b');
				for (int x = 0; x + i < L; x++) {
					// ia
					if (!deques[x].isEmpty() && string[x + i]) {
						deques[x].clear();
					}
				}
			}
		}
		System.out.println(ans.toString());
	}

	public static void main(String[] args) {
		new Main().solve();
	}
}

// ArrayDeque
class MyDeque {
	int[] nums;
	int size, cur;

	public MyDeque(int N) {
		this.nums = new int[N];
		this.size = 0;
		this.cur = 0;
	}

	public void add(int a) {
		nums[size] = a;
		size++;
	}

	public int poll() {
		if (size == 0) {
			return -1;
		}
		cur++;
		size--;
		return nums[cur - 1];
	}

	public int size() {
		return size;
	}

	public boolean isEmpty() {
		return size == 0;
	}

	public int peek() {
		if (size == 0) {
			return -1;
		}
		return nums[cur];
	}

	public void clear() {
		size = 0;
		cur = 0;
	}
},"data structures,dp,graphs,string suffix structures,strings,trees"

import java.io.BufferedReader;
import java.io.IOException;
import java.io.InputStreamReader;
import java.io.PrintWriter;
import java.util.StringTokenizer;

public class Solution{
    static class IScanner {
        BufferedReader br;
        StringTokenizer st;

        public IScanner() {
            br = new BufferedReader(new InputStreamReader(System.in));
        }

        String next() {
            while (st == null || !st.hasMoreElements()) {
                try {
                    st = new StringTokenizer(br.readLine());
                } catch (IOException e) {
                    e.printStackTrace();
                }
            }
            return st.nextToken();
        }

        int nextInt() {
            return Integer.parseInt(next());
        }

        long nextLong() {
            return Long.parseLong(next());
        }

        double nextDouble() {
            return Double.parseDouble(next());
        }

        String nextLine() {
            String str = "";
            try {
                str = br.readLine();
            } catch (IOException e) {
                e.printStackTrace();
            }
            return str;
        }
    }
    static Solution.IScanner in = new IScanner();
    static PrintWriter out = new PrintWriter(System.out);

    public static void main(String[] args) {
        int n = in.nextInt();
        int[] H = new int[100001];
        int[][] E = new int[201][100001];

        int[] L = new int[n];
        for (int i = 0; i < n; i++){
             L[i] = in.nextInt();
             H[L[i]]++;
        }

        for (int i = 0; i < n; i++){
            E[in.nextInt()][L[i]]++;
        }

        for (int i = 0; i < E.length; i++){
            for (int j = 1; j < E[i].length; j++){
                E[i][0] += E[i][j];
            }
        }

        int ans = Integer.MAX_VALUE;
        int suffix = 0, count = 0;
        for (int max = 100000; max >= 1; max--){
            if(H[max] != 0){
                int toBeDeleted = n - (H[max] + H[max] - 1) - count;
                int minEnergy = suffix;
                for (int j = 1; j <= 200 && toBeDeleted > 0; j++){
                    int temp = E[j][0] - E[j][max];
                    if(temp >= toBeDeleted){
                        minEnergy += toBeDeleted * j;
                        toBeDeleted = 0;
                    }else{
                        toBeDeleted -= temp;
                        minEnergy += temp * j;
                    }
                }

                if(toBeDeleted <= 0)
                    ans = Math.min(ans, minEnergy);

                for (int j = 1; j <= 200; j++){
                    E[j][0] -= E[j][max];
                    count += E[j][max];
                    suffix += j * E[j][max];
                }
            }
        }
        out.println(ans);
        out.flush();
        out.close();
    }
},"brute force,data structures,dp,greedy,math,sortings"

