import java.util.*;
public class Main
{
	int n,k;
	private void solve()throws IOException
	{
		fact();
		n=nextInt();
		k=nextInt();
		String s=nextLine();
		int a[]=new int[n+1];
		for(int i=1;i<=n;i++)
			a[i]=s.charAt(i-1)-'0';
		if(k==0)
		{
			long ans=0;
			long pow=1;
			for(int i=n;i>=1;i--)
			{
				ans=(ans+(a[i]*pow)%mod)%mod;
				pow=(pow*10)%mod;
			}
			out.println(ans);
			return;
		}
		long sum[]=new long[n+1];
		long pow[]=new long[n+1];
		pow[0]=1;
		for(int i=0;i<=n;i++)
		{
			if(i!=0)
			{
				sum[i]=sum[i-1];
				pow[i]=(pow[i-1]*10)%mod;
			}
			int gaps=n-2-i;//no of gaps to put k-1 pluses
			if(gaps>=k-1)
				sum[i]+=(choose(gaps,k-1)*pow[i])%mod;
		}
		long ans=0;
		for(int i=1;i<=n;i++)
		{
			int r=n-i;//highest base with which this number can appear
			if(r-1>=0)
			ans=(ans+(sum[r-1]*a[i])%mod)%mod;
			if(i-1>=k)
			ans=(ans+(a[i]*(pow[r]*choose(i-1,k))%mod)%mod)%mod;
		}
		out.println(ans);
	}

	final long mod=(long)(1e9+7);
	final int maxn=(int)(1e5);
	long choose(int n,int r)
	{
		return (((fact[n]*modinv(fact[r]))%mod)*modinv(fact[n-r]))%mod;
	}
	long modinv(long x){
	    return modpow(x,mod-2);
	}
	long modpow(long a,long b){
	    long ret=1;
	    while(b!=0)
	    {
	        if(b%2==1)
	            ret=(ret*a)%mod;
	        a=(a*a)%mod;
	        b=b/2;
	    }
	    return ret;
	} 
	long fact[];
	void fact(){
		fact=new long[maxn+1];
		fact[0]=1;
		for(int i=1;i<=maxn;i++)
			fact[i]=(fact[i-1]*i)%mod;
	}


	///////////////////////////////////////////////////////////

	public void run()throws IOException
	{
		br=new BufferedReader(new InputStreamReader(System.in));
		st=null;
		out=new PrintWriter(System.out);

		solve();

		br.close();
		out.close();
	}
	public static void main(String args[])throws IOException{
		new Main().run();
	}
	BufferedReader br;
	StringTokenizer st;
	PrintWriter out;
	String nextToken()throws IOException{
		while(st==null || !st.hasMoreTokens())
		st=new StringTokenizer(br.readLine());
		return st.nextToken();
	}
