	{
		long p = 1;
		for(int i= 1 ; i <= y; i<<=1 )
		{
			if((y & i) != 0) p= (1L*p*x) %mod;
			x = (1L*x*x) %mod;
		}
		return p;
	}

	static long nCk(long n,long m)
	{
	    if(n < 0 || m < 0 || m > n)
	    return 0;

		return (1L * fac[(int)n] * put( (1L * fac[(int)m] * fac[(int)(n-m)] ) % mod, mod - 2 ))%mod;
	}
	static int n,k;
	public static void main(String[]args)throws Throwable
	{
