		long cho = nCk(n - l - 2,k - 1);
		cho %= mod;
		cho *= pow10[l];
		cho %= mod;
		cho *= 1L*sum[n - l - 2];
		cho %= mod;
		ans += 1L*cho;
		ans %= mod;
	}
	for(int i = 0 ; i < n ; ++i) {
		int l = n - i - 1;
		if(l < 0)
			continue;
		long tmp = pow10[l];
		tmp %= mod;
		tmp *= (d[i] - '0');
		tmp %= mod;
		tmp *= nCk(n - l - 1,k);
		tmp %= mod;
		ans += 1L*tmp;
		ans %= mod;
	}
	System.out.println(ans);



