public class E {
    static long inf = (long) 1e10;
    public static void main(String[] args) {
        Scanner cin = new Scanner(System.in);
        int n = cin.nextInt();
        int k = cin.nextInt();
        long[] lower = new long[n];
        long[] up = new long[n];
        Arrays.fill(lower, -inf);
        Arrays.fill(up, inf);
        long[] a = new long[n];
        for (int i = 0; i < n; ++i) {
            String s = cin.next();
            if (s.equals("?")) a[i] = -inf;
            else a[i] = Long.parseLong(s);
        }
        for(int rem = 0; rem < k; ++rem){
            ArrayList<Integer> pos = new ArrayList<Integer>();
            long low = -inf; long high = inf;
            for(int i = rem; i < n; i += k){
                if( a[i] == -inf ){
                    pos.add(i);
                }else {
                    high = a[i] - 1;
                    int cnt = pos.size();
                    if (high - low + 1 < cnt) {
                        System.out.println("Incorrect sequence");
                        return;
                    }
                    if (cnt > 0) {
                        long lf = low + cnt / 2;
                        long rt = high - (cnt - 1 - cnt / 2);
                        long base = 0;
                        if (lf > 0) base = lf;
                        else if (rt < 0) base = rt;
                        else base = 0;
                        for (int j = 0; j < cnt; ++j) a[pos.get(j)] = j - cnt / 2 + base;
                        pos.clear();
                    }
                    low = a[i] + 1;
                    high = inf;
                }
            }
            //check last one
            int cnt = pos.size();
            if( high  - low + 1 < cnt ){
                System.out.println("Incorrect sequence");
                return;
            }
            if( cnt > 0 ) {
//                System.out.println(pos.size() + "--" + rem);
                long lf = low + cnt / 2;
                long rt = high - (cnt - 1 - cnt/2);
                long base = 0;
                if( lf > 0 ) base = lf;
                else if(rt < 0 ) base = rt;
                else base = 0;
                for(int j = 0; j < cnt; ++j) a[ pos.get(j) ] = j - cnt / 2 + base;
                pos.clear();
            }
        }
        for(int i = 0; i < n; ++i)
            System.out.print(a[i] + " ");
        System.out.println();
    }
}
