import java.util.Arrays;
import java.util.Scanner;

public class G1 {

    static int n;
    static int k;
    static double ans;
    static double c;

    public static void main(String[] args) {
        Scanner in = new Scanner(System.in);
        n = in.nextInt();
        k = in.nextInt();
        int[] a = new int[n];
        for (int i = 0; i < n; i++) {
            a[i] = in.nextInt();
        }
        c = 1 / Math.pow((n * n + n) / 2, k);
        go(0, a);
        System.out.println(ans);
        in.close();
    }

    public static void go(int cnt, int[] a) {
        if (cnt == k) {
            int sum = 0;
            for (int i = 0; i < n; i++) {
                for (int j = i; j < n; j++) {
                    if (a[i] > a[j]) {
                        sum++;
                    }
                }
            }
            ans += (double) sum * c;
            return;
        }
        for (int i = 0; i < n; i++) {
            for (int j = i; j < n; j++) {
                for (int r = i; r <= (i + j) / 2; r++) {
                    int tmp = a[j - (r - i)];
                    a[j - (r - i)] = a[r];
                    a[r] = tmp;
                }
                go(cnt + 1, a);
                for (int r = i; r <= (i + j) / 2; r++) {
                    int tmp = a[j - (r - i)];
                    a[j - (r - i)] = a[r];
                    a[r] = tmp;
                }
            }
        }
    }

}
