                    if (bs[j][0].get(bit)) {
                        bs[j][0].xor(bs[i][0]);
                        bs[j][1].xor(bs[i][1]);
                    }
            } else {
                StringBuilder sb = new StringBuilder();
                sb.append(bs[i][1].cardinality());
                for (int j = bs[i][1].nextSetBit(0); j >= 0; j = bs[i][1].nextSetBit(j + 1))
                    sb.append(" " + j);
                System.out.println(sb);
            }
        }
    }
}
