class TaskC {
    public void solve(int testNumber, InputReader in, OutputWriter out) {
        int n=in.readInt(), k=in.readInt();
        char[] str1=IOUtils.readCharArray(in, n), str2= IOUtils.readCharArray(in, n), ret=new char[k];
        int[][] table=new int[k][k];
        for (int i=0; i<n; i++) table[id(str1[i])][id(str2[i])]++;
        Graph graph=new Graph(2*k+2);
        for (int i=0; i<k; i++) {
            graph.addFlowWeightedEdge(0, i+1, 0, 1);
            graph.addFlowWeightedEdge(k+1+i, 2*k+1, 0, 1);
            for (int j=0; j<k; j++) graph.addFlowWeightedEdge(i+1, k+j+1, -table[i][j], Long.MAX_VALUE);
        }
        out.printLine(-MinCostFlow.minCostMaxFlow(graph, 0, 2*k+1, true).first);
        for (int i=0; i<graph.edgeCount(); i++){
            int u=graph.source(i), v=graph.destination(i);
            //out.printLine(u, v, graph.weight(i), graph.flow(i), graph.capacity(i));
            if (u>=1 && u<=k && v>=k+1 && v<=2*k && graph.flow(i)>0) ret[u-1]=id(v-k-1);
        }
        out.printLine(ret);
    }

    int id(char c) {
        if (c>='a'&& c<='z') return c-'a';
        return c-'A'+26;
    }

    char id(int i) {
        return (char)(i<26?i+'a':i-26+'A');
    }
}

class InputReader {

    private InputStream stream;
    private byte[] buf = new byte[1024];
    private int curChar;
    private int numChars;
    private SpaceCharFilter filter;

    public InputReader(InputStream stream) {
        this.stream = stream;
    }

    public int read() {
        if (numChars == -1)
            throw new InputMismatchException();
        if (curChar >= numChars) {
            curChar = 0;
            try {
                numChars = stream.read(buf);
            } catch (IOException e) {
                throw new InputMismatchException();
            }
            if (numChars <= 0)
                return -1;
        }
        return buf[curChar++];
    }

    public int readInt() {
        int c = read();
        while (isSpaceChar(c))
            c = read();
        int sgn = 1;
        if (c == '-') {
            sgn = -1;
            c = read();
        }
        int res = 0;
        do {
            if (c < '0' || c > '9')
                throw new InputMismatchException();
            res *= 10;
            res += c - '0';
            c = read();
        } while (!isSpaceChar(c));
        return res * sgn;
    }

    public boolean isSpaceChar(int c) {
        if (filter != null)
            return filter.isSpaceChar(c);
        return isWhitespace(c);
    }

    public static boolean isWhitespace(int c) {
        return c == ' ' || c == '
' || c == '' || c == '	' || c == -1;
    }

    public char readCharacter() {
        int c = read();
        while (isSpaceChar(c))
            c = read();
        return (char) c;
    }

    public interface SpaceCharFilter {
        public boolean isSpaceChar(int ch);
    }
}

