			in = new BufferedReader(new FileReader("input.txt"));
		else
			in = new BufferedReader(new InputStreamReader(System.in));
		if (new File("output.txt").exists())
			out = new PrintWriter("output.txt");
		else
			out = new PrintWriter(System.out);

		solve();

		in.close();
		out.close();
	}

	final int maxn = 1000 * 1000 + 100;

	int n, m;
	char s[];
	char temp[] = new char[maxn];

	int a[] = new int[maxn];

	int ans[] = new int[maxn];
	int swap[] = new int[maxn];

	void pow(int a[], int d) {
		for (int i = 0; i < n; i++)
			ans[i] = i;

		while (d > 0) {
			if ((d & 1) > 0) {
				for (int i = 0; i < n; i++)
					swap[i] = ans[a[i]];
				System.arraycopy(swap, 0, ans, 0, n);
			}

			for (int i = 0; i < n; i++)
				swap[i] = a[a[i]];
			System.arraycopy(swap, 0, a, 0, n);

			d >>= 1;
		}

		System.arraycopy(ans, 0, a, 0, n);

	}

	void shift(int a[], int n, int sh) {
		System.arraycopy(a, 0, swap, 0, sh);
		for (int i = 0, j = sh; j < n; i++, j++)
			a[i] = a[j];
		System.arraycopy(swap, 0, a, n - sh, sh);
	}

	void print(int a[], int n) {
		for (int i = 0; i < n; i++)
			System.err.print(a[i]);
		System.err.println();
	}

	void solve() throws IOException {
		s = nextToken().toCharArray();
		n = s.length;
		m = nextInt();
		for (int test = 0; test < m; test++) {
			final int k = nextInt();
			final int d = nextInt();

//			for (int i = 0; i < n; i++)
//				a[i] = i;
//			shift(a, n, 2);
//			print(a, n);
//			pow(a, 6);
//			print(a, n);
//			System.err.println();

			int r = 0;
			int next = 0;
			for (int i = 0; i < k; i++) {
				a[i] = next;
				next += d;
				if (next >= k)
					next = ++r;
			}
			for (int i = k; i < n; i++)
				a[i] = i;
			shift(a, n, 1);

//			print(a, n);

			pow(a, n - k + 1);
			shift(a, n, k - 1);

			for (int i = 0; i < n; i++)
				temp[i] = s[a[i]];

			char swap[] = s;
			s = temp;
			temp = swap;

			for (int i = 0; i < n; i++)
				out.print(s[i]);
			out.println();

		}
	}

	class MyComparator implements Comparator<Integer> {

		int d;

		@Override
		public int compare(Integer o1, Integer o2) {
			int cmp = Integer.compare(o1 % d, o2 % d);
			if (cmp != 0)
				return cmp;
			return Integer.compare(o1, o2);
		}

	}

	String nextLine() throws IOException {
		st = new StringTokenizer("");
		return in.readLine();
	}

	String nextToken() throws IOException {
		while (!st.hasMoreTokens()) {
			st = new StringTokenizer(in.readLine());
		}
		return st.nextToken();
	}

	int nextInt() throws IOException {
		return Integer.parseInt(nextToken());
	}

	long nextLong() throws IOException {
		return Long.parseLong(nextToken());
	}

	double nextDouble() throws IOException {
		return Double.parseDouble(nextToken());
	}

	boolean EOF() throws IOException {
		while (!st.hasMoreTokens()) {
			String str = in.readLine();
			if (str == null)
				return true;
			st = new StringTokenizer(str);
		}
		return false;
	}

}
