class TaskC {
    public void solve(int testNumber, InputReader in, OutputWriter out) {
        char[] s = in.nextToken().toCharArray();
        int n = s.length;
        int m = in.nextInt();
        for (int it = 0; it < m; ++it) {
            int k = in.nextInt();
            int d = in.nextInt();
            int[] p = new int[2 * n];
            int[] P = new int[k];
            int cnt = 0;
            for (int i = 0; i < d; ++i) {
                for (int j = i; j < k; j += d)
                    P[cnt++] = j;
            }
            for (int i = 0; i < k; ++i)
                p[n + i - 1] = P[i] + n;
            for (int i = 0; i < n - 1; ++i)
                p[i] = i + 1;
            for (int i = k - 1; i < n; ++i)
                p[n + i] = (n + i + 1) % (2 * n);
            p = calcPow(p, n - k + 1);
            char[] ns = new char[n];
            for (int i = 0; i < n; ++i)
               ns[i] = s[p[i  + k - 1] - n];
            s = ns;
            out.printLine(new String(s));
        }
    }

    private int[] calcPow(int[] p, int k) {
        int n = p.length;
        int[] res = new int[n];
        for (int i = 0; i < n; ++i)
            res[i] = i;
        while (k > 0) {
            if (k % 2 == 1) {
                res = mult(res, p);
                --k;
            } else {
                p = mult(p, p);
                k /= 2;
            }
        }
        return res;
    }

    private int[] mult(int[] p1, int[] p2) {
        int n = p1.length;
        int[] res = new int[n];
        for (int i = 0; i < n; ++i)
            res[i] = p2[p1[i]];
        return res;
    }
}

class InputReader {
    private InputStream stream;
    private byte[] buffer = new byte[10000];
    private int cur;
    private int count;

    public InputReader(InputStream stream) {
        this.stream = stream;
    }

    public static boolean isSpace(int c) {
        return c == ' ' || c == '
' || c == '' || c == '	' || c == -1;
    }

    public int read() {
        if (count == -1) {
            throw new InputMismatchException();
        }
        try {
            if (cur >= count) {
                cur = 0;
                count = stream.read(buffer);
                if (count <= 0)
                    return -1;
            }
        } catch (IOException e) {
            throw new InputMismatchException();
        }
        return buffer[cur++];
    }

    public int readSkipSpace() {
        int c;
        do {
            c = read();
        } while (isSpace(c));
        return c;
    }

    public String nextToken() {
        int c = readSkipSpace();
        StringBuilder sb = new StringBuilder();
        while (!isSpace(c)) {
            sb.append((char) c);
            c = read();
        }
        return sb.toString();
    }

    public int nextInt() {
        int sgn = 1;
        int c = readSkipSpace();
        if (c == '-') {
            sgn = -1;
            c = read();
        }
        int res = 0;
        do {
            if (c < '0' || c > '9') {
                throw new InputMismatchException();
            }
            res = res * 10 + c - '0';
            c = read();
        } while (!isSpace(c));
        res *= sgn;
        return res;
    }

}

class OutputWriter {
    private final PrintWriter writer;

    public OutputWriter(OutputStream outputStream) {
        writer = new PrintWriter(new BufferedWriter(new OutputStreamWriter(outputStream)));
    }

    public OutputWriter(Writer writer) {
        this.writer = new PrintWriter(writer);
    }

    public void print(Object... objects) {
        for (int i = 0; i < objects.length; i++) {
            if (i != 0) {
                writer.print(' ');
            }
            writer.print(objects[i]);
        }
    }

    public void printLine(Object... objects) {
        print(objects);
        writer.println();
    }

    public void close() {
        writer.close();
    }

}
