public class hello {
	public static Scanner sc = new Scanner(System.in);
	public static void take_array(int arr[], int size) {
		for (int i = 0; i < size; i++)
			arr[i] = sc.nextInt();
	}
	public static void print_arr(int arr[]) {
		for (int x : arr)
			System.out.print(x + " ");
	}
	public static void modulo(int arr[], int n) {
		int Max = 1000000;
		boolean[] mat = new boolean[2 * Max + 1];
		for (int i = 0; i < n; i++)
			mat[arr[i]] = true;
		int[] maxLast = new int[2 * Max + 1];
		maxLast[0] = -1;
		for (int i = 1; i < maxLast.length; i++) {
			if (mat[i])
				maxLast[i] = i;
			else
				maxLast[i] = maxLast[i - 1];
		}
		Arrays.sort(arr);
		int res = 0;
		for (int i = 0; i < n; i++) {
			if (i > 0 && arr[i] == arr[i - 1])
				continue;
			int val = arr[i];
			for (int j = 2 * val - 1; j <= 2 * Max; j = j + val) {
				int last = maxLast[j];
				res = Math.max(res, last % val);
			}
		}
		System.out.print(res);
	}
	public static void main(String[] args) throws IOException {
		// int t = sc.nextInt();
		// while (t-- > 0) {
		int size = sc.nextInt();
		int arr[] = new int[size];
		take_array(arr, size);
		modulo(arr, size);
