public class RedGreenTowers {

	private static final int MOD = 1000000007;

	public static void main(String[] args) {
		Scanner scan = new Scanner(System.in);

		int R = scan.nextInt();
		int G = scan.nextInt();

		int[][] dp = new int[2][R + 1];
		int curr = 0;
		int res = 0;
		dp[1][0] = 1;
		for (int h = 1, sum = 1; sum <= R + G; sum += ++h) {
			int prev = 1 - curr;
			res = 0;
			for (int r = Math.max(0, sum - G); r <= R; ++r) {
				dp[curr][r] = dp[prev][r];
				if (r - h >= 0) {
					dp[curr][r] = (dp[curr][r] + dp[prev][r - h]) % MOD;
				}
				res = (res + dp[curr][r]) % MOD;
			}
			curr = prev;
		}
		System.out.println(res);
	}
