/**
 * @author Tran Anh Tai
 * @template for CP codes
 * What a trick prob!
 */
public class ProbB {
    public static void main(String[] args) {
        InputStream inputStream = System.in;
        OutputStream outputStream = System.out;
        InputReader in = new InputReader(inputStream);
        PrintWriter out = new PrintWriter(outputStream);
        Task solver = new Task();
        solver.solve(in, out);
        out.close();
    }
    // main solver
    static class Task {
        static int MOD = 1000000007;
        public void solve(InputReader in, PrintWriter out) {
            int r = in.nextInt();
            int g = in.nextInt();
            int h = (int)(Math.sqrt((r + g) << 1));
            if ((h) * (h + 1) / 2 > (r + g)){
                h--;
            }
            long result = 0;
            int beg = Math.max(0, h * (h + 1) / 2 - g);
            int end = Math.min(r, h *(h + 1) / 2);
            long dp[] = new long[end + 1];
            dp[0] = 1;
            for (int level = 1; level <= h; level++){
                for (int red = end; red >= 0; red--){
                    if (red >= level){
                        dp[red] = mod(dp[red] + dp[red - level]);
                    }
                }
            }
            for (int red = beg; red <= end; red++){
                result = mod(result + dp[red]);
            }
            out.println(result);
        }

        private long mod(long l) {
            if (l >= MOD){
                l -= MOD;
            }
            return l;
        }
    }
    // fast input reader class;
    static class InputReader {
        BufferedReader br;
        StringTokenizer st;

        public InputReader(InputStream stream) {
            br = new BufferedReader(new InputStreamReader(stream));
        }

        public String nextToken() {
            while (st == null || !st.hasMoreTokens()) {
                String line = null;
                try {
                    line = br.readLine();
                } catch (IOException e) {
                    throw new RuntimeException(e);
                }
                if (line == null) {
                    return null;
                }
                st = new StringTokenizer(line);
            }
            return st.nextToken();
        }

        public int nextInt() {
            return Integer.parseInt(nextToken());
        }
        public long nextLong(){
            return Long.parseLong(nextToken());
        }
    }
