import java.io.*;
import java.util.*;

public class D478 implements Runnable {

    private static final int MAX = 2*(int) (1E5 + 5);
    private static final int MOD = (int) (1E9 + 7);
    private static final long Inf = (long) (1E14 + 10);

    private void solve() throws IOException {
        int r =reader.nextInt();
        int g =reader.nextInt();
        if(r > g)
            r = swap(g, g=r);
        int n = r+g;
        int h = 0;
        while(true ){
            int sum = h*(h+1)/2;
            if(sum > n)break;
            h++;
        }
        h--;
        int ex = (n) - (h*(h+1))/2;
        int[][] dp = new int[2][MAX];
        dp[0][0] =1;
        int cur=0 , prev =1;
        for(int i =1;i<=h;i++){
            int sum = Math.min((i*(i+1))/2, MAX-1 );
            cur =prev;
            prev = cur==1 ?0:1;
            for(int j=0;j<=sum;j++){
                if(j<i) dp[cur][j] = dp[prev][j];
                else dp[cur][j] = (dp[prev][j] + dp[prev][j-i] ) %MOD;
            }

        }
        long ans = 0;
        for(int i=0;i<=ex && g-i>=0;i++){
            ans =(ans+ dp[cur][g-i]) %MOD;
        }
        writer.println(ans);

    }

    private int swap(int g, int i) {
        return g;
    }

    public static void main(String[] args) throws IOException {
        try (Input reader = new StandardInput(); PrintWriter writer = new PrintWriter(System.out)) {
            new D478().run();
        }
    }

    StandardInput reader;
    PrintWriter writer;

    @Override
    public void run() {
        try {
            reader = new StandardInput();
            writer = new PrintWriter(System.out);
            solve();
            reader.close();
            writer.close();
        } catch (Exception e) {
            e.printStackTrace();
        }
    }

    interface Input extends Closeable {
        String next() throws IOException;

        default int nextInt() throws IOException {
            return Integer.parseInt(next());
        }

        default long nextLong() throws IOException {
            return Long.parseLong(next());
        }

        default double nextDouble() throws IOException {
            return Double.parseDouble(next());
        }

        default int[] readIntArray() throws IOException {
            return readIntArray(nextInt());
        }

        default int[] readIntArray(int size) throws IOException {
            int[] array = new int[size];
            for (int i = 0; i < array.length; i++) {
                array[i] = nextInt();
            }
            return array;
        }

        default long[] readLongArray(int size) throws IOException {
            long[] array = new long[size];
            for (int i = 0; i < array.length; i++) {
                array[i] = nextLong();
            }
            return array;
        }
    }

    private static class StandardInput implements Input {
        private final BufferedReader reader = new BufferedReader(new InputStreamReader(System.in));

        private StringTokenizer stringTokenizer;

        @Override
        public void close() throws IOException {
            reader.close();
        }

        @Override
        public String next() throws IOException {
            if (stringTokenizer == null || !stringTokenizer.hasMoreTokens()) {
                stringTokenizer = new StringTokenizer(reader.readLine());
            }
            return stringTokenizer.nextToken();
        }
    }
}
