import java.io.*;
import java.util.*;
public class Main
{
	int n;
	HashMap<String,Word> map;
	String[] essay;
	private void solve()throws IOException
	{
		n=nextInt();
		essay=new String[n+1];
		map=new HashMap<>();
		for(int i=1;i<=n;i++)
		{
			essay[i]=nextToken().toLowerCase();
			map.put(essay[i],new Word(essay[i]));
		}
		int m=nextInt();
		while(m-->0)
		{
			String u=nextToken().toLowerCase();
			String v=nextToken().toLowerCase();
			if(!map.containsKey(u))
				map.put(u,new Word(u));
			if(!map.containsKey(v))
				map.put(v,new Word(v));
			map.get(v).adjList.add(map.get(u));
		}
		ArrayList<Word> words=new ArrayList<>(map.values());
		Collections.sort(words,new Comparator<Word>(){
			public int compare(Word a,Word b){
				return a.rcnt==b.rcnt?a.len-b.len:a.rcnt-b.rcnt;
			}
		});

		for(Word w:words)
		{
			if(w.best!=null)
				continue;
			w.best=w;
			Queue<Word> queue=new LinkedList<>();
			queue.add(w);
			while(!queue.isEmpty())
			{
				Word x=queue.remove();
				for(Word ww:x.adjList)
					if(ww.best==null)
					{
						ww.best=w;
						queue.add(ww);
					}
			}
		}

		long totalr=0,totall=0;
		for(int i=1;i<=n;i++)
		{
			Word syn=map.get(essay[i]).best;
			totalr+=syn.rcnt;
			totall+=syn.len;
		}
		out.println(totalr+" "+totall);
	}
	class Word
	{
		int rcnt,len;
		Word best;
		ArrayList<Word> adjList;
		Word(String s)
		{
			len=s.length();
			rcnt=0;
			for(int i=0;i<len;i++)
				if(s.charAt(i)=='r')
					rcnt++;
			best=null;
			adjList=new ArrayList<>();
		}
	}


	///////////////////////////////////////////////////////////

	public void run()throws IOException
	{
		br=new BufferedReader(new InputStreamReader(System.in));
		st=null;
		out=new PrintWriter(System.out);

		solve();

		br.close();
		out.close();
	}
	public static void main(String args[])throws IOException{
		new Main().run();
	}
