import java.io.*;
import java.util.*;
public class  Main{
	static int[]rs,ls,r,len;
	static ArrayList<Integer>[] adjList;
	static int V, counter, SCC, dfs_num[], dfs_low[];
	static boolean[] inSCC;
	static Stack<Integer> stack;
	static LinkedList<Integer>[]comp;

	static void tarjanSCC()	 	//O(V + E)
	{
		for(int i = 0; i < V; ++i)
			if(dfs_num[i] == 0)
				tarjanSCC(i);
	}

	static void tarjanSCC(int u)
	{
		dfs_num[u] = dfs_low[u] = ++counter;
		stack.push(u);

		for(int v: adjList[u])
		{
			if(dfs_num[v] == 0)
				tarjanSCC(v);
			if(!inSCC[v])
				dfs_low[u] = Math.min(dfs_low[u], dfs_low[v]);	
		}
		if(dfs_num[u] == dfs_low[u])
		{
			//SCC found
			while(true)
			{
				int v = stack.pop();
				inSCC[v] = true;
				comp[SCC].add(v);
				mapc.put(v, SCC);
				if(v == u)
					break;
			}
			SCC++;
		}
	}
	static HashMap<Integer, Integer>mapc;
	static boolean[]vis;
	static void dfs(int i) {
		if(vis[i])return;
		vis[i]=true;
		for(int o:comp[i]) {

			for(int j:adjList[o]) {
				dfs(mapc.get(j));
				if(rs[mapc.get(j)]<rs[i]) {
					rs[i]=rs[mapc.get(j)];
					ls[i]=ls[mapc.get(j)];
				}
				else {
					if(rs[mapc.get(j)]==rs[i] && ls[mapc.get(j)]<ls[i]) {
						ls[i]=ls[mapc.get(j)];
					}
				}
			}
		}
	}
	public static void main(String[] args) throws Exception{
		MScanner sc=new MScanner(System.in);
		PrintWriter pw=new PrintWriter(System.out);
		int n=sc.nextInt();
		int c=0;
		HashMap<String, Integer>map=new HashMap<String, Integer>();
		r=new int[300000];
		len=new int[300000];
		String[]in=new String[n];
		for(int i=0;i<n;i++) {
			String x=sc.next().toLowerCase();
			in[i]=x;
			if(map.containsKey(x))continue;
			char[]s=x.toCharArray();
			len[c]=x.length();
			for(char o:s) {
				if(o=='r') {
					r[c]++;
				}
			}
			map.put(x, c++);
		}
		int m=sc.nextInt();
		adjList=new ArrayList[m*2+n];
		mapc=new HashMap<Integer, Integer>();
		comp=new LinkedList[m*2+n];
		for(int i=0;i<adjList.length;i++)adjList[i]=new ArrayList<Integer>();
		for(int i=0;i<adjList.length;i++)comp[i]=new LinkedList<Integer>();

		for(int i=0;i<m;i++) {
			String s1=sc.next().toLowerCase();
			String s2=sc.next().toLowerCase();
			char[]s11=s1.toCharArray();
			char[]s22=s2.toCharArray();
			if(!map.containsKey(s1)) {
				len[c]=s1.length();
				for(char o:s11) {
					if(o=='r') {
						r[c]++;
					}
				}
				map.put(s1, c);
				c++;
			}
			if(!map.containsKey(s2)) {
				len[c]=s2.length();
				for(char o:s22) {
					if(o=='r') {
						r[c]++;
					}
				}
				map.put(s2, c);
				c++;
			}
			adjList[map.get(s1)].add(map.get(s2));
		}
		V=c;counter=0;SCC=0;dfs_num=new int[V];dfs_low=new int[V];
		inSCC=new boolean[V];
		stack=new Stack<Integer>();
		tarjanSCC();
		rs=new int[c];
		ls=new int[c];
		Arrays.fill(rs, 10000000);
		for(int i=0;i<SCC;i++) {
			int minr=10000000,minl=10000000;
			for(int j:comp[i]) {
				if(r[j]<minr) {
					minr=r[j];
					minl=len[j];
				}
				else {
					if(r[j]==minr && len[j]<minl) {
						minl=len[j];
					}
				}
			}
			rs[i]=minr;
			ls[i]=minl;
		}
		vis=new boolean[V];
		long ansr=0,ansl=0;
		for(int i=0;i<n;i++) {
			int key=mapc.get(map.get(in[i]));
			dfs(key);
			ansr+=rs[key];
			ansl+=ls[key];
		}
		pw.println(ansr+" "+ansl);
		pw.flush();
	}
