			v[i] = sc.next().toLowerCase();
		}
		Node[] node = new Node[2*n];
		int j = 0;
		for(int i=0;i<n;++i) {
			node[j++] = new Node(u[i],cntr(u[i]),u[i].length());
			node[j++] = new Node(v[i],cntr(v[i]),v[i].length());
		}
		Arrays.sort(node);

		edges = new ArrayList[2*n];
		Map<String,Integer> map = new HashMap<>();
		j = 0;
		for(int i=0;i<edges.length;++i) {
			map.put(node[i].s,j++); // mapping
			edges[i] = new ArrayList<>();
		}

		for(int i=0;i<n;++i) {
			int uu = map.get(u[i]);
			int vv = map.get(v[i]);
			edges[vv].add(uu); // reverse graph
		}

		vis = new boolean[2*n];
		dp = new int[2*n];
		for(int i=0;i<node.length;++i) {
			int vv = map.get(node[i].s);
			if(!vis[vv]) {
				dfs(vv,vv);
			}
		}

		long r=0,len=0;

		for(int i=0;i<m;++i) {
			if(map.containsKey(str[i])) {
				int idx = map.get(str[i]);
				r+=node[dp[idx]].r;
				len+=node[dp[idx]].len;
			}else {
			    r+=cntr(str[i]);
			    len+=str[i].length();
			}
		}
		out.print(r+" "+len);
		out.close();
	}
	private static void dfs(int v, int minIdx) {
		vis[v] = true;
		dp[v] = minIdx;
		for(int child : edges[v]) {
			if(!vis[child])
				dfs(child,minIdx);
		}

	}
	private static int cntr(String s) {
		int ans = 0;
		for(int i=0;i<s.length();++i) 
			if(s.charAt(i) == 'r') ++ans;
		return ans;
	}
	static class Node implements Comparable<Node>{
		int r,len;
		String s;

		Node(String s,int r, int len) {
			this.s = s;
			this.r = r;
			this.len = len;
		}

		@Override
		public int compareTo(Node o) {
			if(this.r!=o.r) return this.r-o.r;
			return this.len-o.len;
		}

	}

}



