public class Task {

    static Point[] a;
    static int sum;
    static int[] took;
    static int[] ans;
    static int size;

    static void go(int need, int last) {
        if (need == 0) {
            int ret = 0;
            for (int i = 0; i < size; ++i) {
                for (int j = i + 1; j < size; ++j) {
                    ret += a[took[i]].sub(a[took[j]]).len2();
                }
            }
            if (ret > sum) {
                sum = ret;
                ans = Arrays.copyOf(took, size);
            }
        } else {
            ++size;
            for (int i = last; i < a.length; ++i) {
                took[size - 1] = i;
                go(need - 1, i);
            }
            --size;
        }
    }

    public void solve() throws IOException {
        int n = in.nextInt();
        int r = in.nextInt();
        a = new Point[3000];
        int s = 0;
        for (int i = 0; i <= r; ++i) {
            for (int j = 0; i * i + j * j <= r * r; ++j) {
                a[s++] = new Point(i, j);
                if (i > 0) a[s++] = new Point(-i, j);
                if (i > 0 & j > 0) a[s++] = new Point(-i, -j);
                if (j > 0) a[s++] = new Point(i, -j);
            }
        }
        a = Point.convexHull(Arrays.copyOf(a, s));
        took = new int[n];
        for (int i = 0; i < n / 2 - 1; ++i) {
            took[size++] = 0;
        }
        go(n - n / 2 + 1, 0);
        out.println(sum);
        for (int i : ans) {
            out.println(a[i].x + " " + a[i].y);
        }
