class Point implements Comparable<Point> {
    int x;
    int y;

    public Point(int x, int y) {
        this.x = x;
        this.y = y;
    }

    public int mulv(Point a) {
        return this.x * a.y - this.y * a.x;
    }

    public int len2() {
        return x * x + y * y;
    }

    public int compareTo(Point o) {
        if (o == null) {
            return -1;
        }
        int m = this.mulv(o);
        if (m != 0) {
            return m > 0 ? -1 : 1;
        }
        int d = this.len2() - o.len2();
        return d > 0 ? 1 : d < 0 ? -1 : 0;
    }

    public Point sub(Point a) {
        return new Point(this.x - a.x, this.y - a.y);
    }

    public Point add(Point a) {
        return new Point(this.x + a.x, this.y + a.y);
    }

    public static Point[] convexHull(Point[] a) {
        int n = a.length;
        int mn = 0;
        for (int i = 1; i < n; ++i) {
            if (a[i].x < a[mn].x || (a[i].x == a[mn].x && a[i].y < a[mn].y)) {
                mn = i;
            }
        }
        Point start = a[mn];
        a[mn] = a[0];
        a[0] = start;
        Point[] b = new Point[n - 1];
        for (int i = 0; i < n - 1; ++i) {
            b[i] = a[i + 1].sub(start);
        }
        Arrays.sort(b);
        for (int i = 0; i < n - 1; ++i) {
            a[i + 1] = b[i].add(start);
        }
        Point[] h = new Point[n];
        int size = 0;
        for (int i = 0; i < n; ++i) {
            while (size > 1 && h[size - 1].sub(h[size - 2]).compareTo(a[i].sub(h[size - 2])) == 1) {
                --size;
            }
            h[size++] = a[i];
        }
        return Arrays.copyOf(h, size);
    }
}
