import java.io.*;
import java.util.*;

public class pashmak {
    public static class FenwickTree {
        long[] ft;
        public FenwickTree(int n) {
            ft = new long[n + 1];
        }

        long rsq(int b) {
            long sum = 0;
            for (; b > 0; b -= (b & (-b))){
                sum += ft[b];
            }
            return sum;
        }

        long rsq(int a, int b) {
            return rsq(b) - rsq(a - 1);
        }

        void update(int k, long v) {
            for (; k < ft.length; k += (k & (-k))) ft[k] += v;
        }
    }

    public static void main (String[] args) throws IOException{
        BufferedReader in = new BufferedReader(new InputStreamReader(System.in));
        PrintWriter out = new PrintWriter(System.out);

        String[] d = in.readLine().split(" ");
        int N = Integer.parseInt(d[0]);

        int[] arr = new int[N];
        int[] copy = new int[N];

        d = in.readLine().split(" ");

        for (int i = 0; i < N; i++){
            arr[i] = Integer.parseInt(d[i]);
            copy[i] = arr[i];
        }

        HashMap<Integer, Integer> map = new HashMap<>();
        int curr = 1;

        for (int i = 0; i < N; i++){
            if (!map.containsKey(copy[i])){
                map.put(copy[i], curr);
                curr++;
            }
        }
        for (int i = 0; i < N; i++){
            arr[i] = map.get(arr[i]);
        }

        int[] upd = new int[N+1];

        int[] pref = new int[N];
        int[] suff = new int[N];

        for (int i = 0; i < N; i++){
             upd[arr[i]]++;
             pref[i] = upd[arr[i]];
        }

        upd = new int[N+1];

        for (int i = N-1; i >= 0; i--){
            upd[arr[i]]++;
            suff[i] = upd[arr[i]];
        }

        FenwickTree ft = new FenwickTree(N);
        long ans = 0;

        for (int i = N-1; i >= 0; i--){
            ans += ft.rsq(pref[i]-1);
            ft.update(suff[i], 1);
        }

        System.out.println(ans);

    }
}
