    private static void update(int index, int val) {
        while (index <= n) {
            fenwick[index] += val;
            index += (index & (-index));
        }
    }

    private static int get(int p) {
        int ans = 0;
        while (p > 0) {
            ans += fenwick[p];
            p -= (p & (-p));
        }
        return ans;
    }

