public class pashmacksproblem {
	public static void main(String args[]) throws IOException {
		FastScanner in = new FastScanner(System.in);
		PrintWriter out = new PrintWriter(System.out);
		int n = in.nextInt();
		int[] vals = new int[n];

		int[][] sort = new int[n][2];
		for (int i = 0; i < n; i++) {
			vals[i] = in.nextInt();
			sort[i] = new int[] {vals[i], i};
		}

		Arrays.sort(sort, (a,b)->a[0]-b[0]);

		int[] index = new int[n];
		Arrays.fill(index, -1);
		int c = -1;
		int last = -1;
		for (int i = 0; i < n; i++) {
			if (sort[i][0] != last) {
				c++;
				last = sort[i][0];
			}
			vals[sort[i][1]] = c;
		}

		int[] cnt = new int[n];
		int[] pre = new int[n];

		for (int i = 0; i < n; i++) {
			cnt[vals[i]]++;
			pre[i] = cnt[vals[i]];
		}
		cnt = new int[n];
		int[] suff = new int[n];
		for (int i = n - 1; i >= 0; i--) {
			cnt[vals[i]]++;
			suff[i] = cnt[vals[i]];
		}

		// System.out.println(Arrays.toString(pre));
		// System.out.println(Arrays.toString(suff));

		BIT bit = new BIT(n);
		long ans = 0;
		for (int i = n - 1; i >= 0; i--) {
			long amt = bit.query(1, pre[i] - 1);
			bit.update(suff[i], 1);
			ans += amt;
			// System.out.println(i + " " + amt);
		}

		out.println(ans);

		out.close();
	}


	static class BIT {
		int n;
		long tree[];

		public String toString() {
			return Arrays.toString(tree);
		}

		public BIT(int N) {
			n = N;  tree = new long[N + 1];
		}
		void update(int i, long val) {
			for (i++; i <= n; i += i & -i) tree[i] += val;
		}
		long read(int i) {
			long sum = 0;
			for (i++; i > 0; i -= i & -i) sum += tree[i];
			return sum;
		}
		// query sum of [l, r] inclusive
		long query(int l, int r) { return read(r) - read(l - 1); }
		// if the BIT is a freq array, returns the index of the
		// kth item (0-indexed), or n if there are <= k items.
		int getKth(int k) {
			if (k < 0) return -1;
			int i = 0;
			for (int pw = Integer.highestOneBit(n); pw > 0; pw >>= 1)
				if (i + pw <= n && tree[i + pw] <= k) k -= tree[i += pw];
			return i;
		}
	}


	static class FastScanner {
		BufferedReader br;
		StringTokenizer st;

		public FastScanner(InputStream i) {
			br = new BufferedReader(new InputStreamReader(i));
			st = new StringTokenizer("");
		}

		public String next() throws IOException {
			if (st.hasMoreTokens())
				return st.nextToken();
			else
				st = new StringTokenizer(br.readLine());
			return next();
		}

		public int nextInt() throws IOException {
			return Integer.parseInt(next());
		}

		public long nextLong() throws IOException {
			return Long.parseLong(next());
		}

		public double nextDouble() throws IOException {
			return Double.parseDouble(next());
		}
	}
}
