class TaskC {


    class Pair implements Comparable<Pair> {
        int num, cost;
        public int compareTo(Pair rhs) {
            return cost > rhs.cost ? -1 : cost == rhs.cost ? 0 : 1;
        }
        public Pair(int num, int cost) {
            this.num = num;
            this.cost = cost;
        }
    }

    Pair[] a;
    int[] b = new int[100333];
    int n;
    boolean[] used;

    int get(int votes) {
        Arrays.fill(b, 0);
        Arrays.fill(used, false);
        int res = 0;
        for (int i = 0; i < n; i++) {
            if (a[i].num == 0) {
                b[0]++;
                used[i] = true;
                continue;
            }
            if (b[a[i].num] + 1 == votes) {
                res += a[i].cost;
                b[0]++;
                used[i] = true;
            }
            else {
                b[a[i].num]++;
            }
        }
        for (int i = n - 1; i >= 0 && b[0] < votes; i--) {
            if (used[i]) continue;
            res += a[i].cost;
            b[0]++;
        }
        return res;
    }


    public void solve(int testNumber, InputReader in, PrintWriter out) {
        n = in.nextInt();
        a = new Pair[n];
        used = new boolean[n];
        for (int i = 0; i < n; i++) {
            int num = in.nextInt();
            int cost = in.nextInt();
            a[i] = new Pair(num, cost);
        }
        Arrays.sort(a);
        int l = 1;
        int r = n;
        while (l + 2 < r) {
            int m = (r - l) / 3;
            int c1 = l + m;
            int c2 = r - m;
            int f1 = get(c1);
            int f2 = get(c2);
            if (f1 < f2) r = c2;
            else l = c1;
        }
        int ans = get(l);
        l++;
        while (l <= r) {
            ans = Math.min(ans, get(l));
            l++;
        }
        out.println(ans);
    }
}

