class TaskD {

    final int MAXN = 100001;

    int[] forWhom;
    int[] priceToChange;
    int[] votesForCandidate;

    int forMe;

    class Vote implements Comparable<Vote> {
        int price;
        int id;

        boolean mark = false;

        Vote(int price, int id) {
            this.price = price;
            this.id = id;
        }


        public int compareTo(Vote o) {
            if (price != o.price) return price - o.price;
            return id - o.id;
        }
    }

    List<Vote> votes;

    public void solve(int testNumber, InputReader in, PrintWriter out) {
        int n = in.nextInt();
        votesForCandidate = new int[MAXN];
        forMe = 0;
        forWhom = new int[n];
        votes = new ArrayList<Vote>();
        priceToChange = new int[n];

        for (int i = 0; i < n; ++i) {
            forWhom[i] = in.nextInt();
            priceToChange[i] = in.nextInt();
            if (forWhom[i] == 0) {
                ++forMe;
            } else {
                votesForCandidate[forWhom[i]]++;
                votes.add(new Vote(priceToChange[i], forWhom[i]));
            }
        }
        Collections.sort(votes);
        long res = Long.MAX_VALUE;
        int S = 1, F = n;
        while (S + 10 <= F) {
            int delta = (F - S) / 3;
            int e1 = S + delta;
            int e2 = F - delta;
            long f1 = f(e1);
            long f2 = f(e2);
            if (f1 < f2) {
                F = e2;
            } else {
                S = e1;
            }
        }
        for (int i = S; i <= F; ++i) {
            res = Math.min(res, f(i));
        }
        out.println(res);
    }

    private long f(int needVotes) {
        int curForMe = forMe;
        long res = 0;
        int[] curVotes = new int[MAXN];
        for (Vote v : votes) {
            v.mark = false;
        }
        System.arraycopy(votesForCandidate, 1, curVotes, 1, MAXN - 1);
        for (Vote v : votes) {
            if (curVotes[v.id] >= needVotes) {
                res += v.price;
                v.mark = true;
                ++curForMe;
                curVotes[v.id]--;
            }
        }
        int need = needVotes - curForMe;
        if (need > 0) {
            for (Vote v : votes) {
                if (!v.mark) {
                    --need;
                    res += v.price;
                    if (need == 0) break;
                }
            }
        }
        return res;
    }
}

