class TaskE {
    private static final int MODULO = 1051131;
    private long days;

    public void solve(int testNumber, InputReader in, PrintWriter out) {
        int n = 1 << in.nextInt();
        days = in.nextLong();
        int s = in.nextInt();
        int[] a = new int[n];
        for (int i = 0; i < s; ++i)
            a[i] = in.nextInt() % MODULO;
        for (int i = s; i < n; ++i)
            a[i] = (101 * a[i - s] + 10007) % MODULO;
        a = doIt(a, 1, 0);
        int res = 0;
        for (int i = 0; i < n; ++i) {
            if (a[i] < 0)
                a[i] += MODULO;
            res ^= a[i];
        }
        out.println(res);
    }

    private int[] doIt(int[] a, int p, int q) {
        int n = a.length;
        assert (n & (n - 1)) == 0;
        if (n == 1) {
            a[0] = (int) (a[0] * IntegerUtils.powerModulo(p + q, days, MODULO) % MODULO);
            return a;
        }
        n /= 2;
        int[] b = new int[n];
        for (int i = 0; i < n; ++i) {
            b[i] = a[i] + a[i + n];
            if (b[i] >= MODULO)
                b[i] -= MODULO;
        }
        b = Arrays.copyOf(doIt(b, 2 * p % MODULO, (int) (((n - 1L) * p + q) % MODULO)), 2 * n);
        System.arraycopy(b, 0, b, n, n);
        long multiplier = IntegerUtils.powerModulo(((1L - n) * p + q) % MODULO, days, MODULO);
        for (int i = 0; i < n; ++i) {
            b[i] = (int) ((b[i] + (a[i] - a[i + n]) * multiplier) % MODULO);
            b[i + n] = (int) ((b[i + n] - (a[i] - a[i + n]) * multiplier) % MODULO);
        }
        for (int i = 0; i < 2 * n; ++i)
            b[i] = (int) (b[i] * (MODULO + 1L) / 2 % MODULO);
        return b;
    }
}

