    }
}

class IntegerUtils {

    public static long powerModulo(long a, long n, long mod) {
        long res = 1;
        for(; n > 0; n >>= 1) {
            if((n & 1) != 0) res = res * a % mod;
            a = a * a % mod;
        }
        return res;
    }

    }

