                ft.add(where[i]-move);
                sc.add(where[i]);
                int tmp = where[i];
                where[i] = where[i]-move;
                where[arr[where[i]]] = tmp;
                arr[tmp] = arr[where[i]];
                arr[where[i]] = i;
            }
        }
        ans.append(ft.size()).append("
");
        for(int i = 0; i < ft.size(); i++)
            ans.append(ft.get(i)+1).append(" ").append(sc.get(i)+1).append("
");

        System.out.print(ans);

    }
    public static ArrayList<Integer> getPrimeList(int n){
        ArrayList<Integer> arrl = new ArrayList<>();
        boolean[] prime = new boolean[n + 1];
        for (int i = 0; i <= n; i++)
            prime[i] = true;

        for (int p = 2; p * p <= n; p++)
        {
            if (prime[p])
            {
                for (int i = p * p; i <= n; i += p)
                    prime[i] = false;
            }
        }

        for (int i = 2; i <= n; i++)
        {
            if (prime[i])
                arrl.add(i-1);
        }
        return arrl;
    }
}
