	static int solve(int temp[],int index,int num,int arr[],StringBuilder ans,HashMap<Integer,Integer> map)
	{
		if(index==temp.length)
		{
			return 0;
		}
		int count=0;
		if(temp[index]==num)
		{
			count=count+solve(temp,index+1,num+1,arr,ans,map);
		}
		else
		{
			count++;
			int small=map.get(num);
