			map.put(temp[small],ind);map.put(temp[ind],small);
			temp[small]=temp[ind];
			temp[ind]=prev;
			ans.append((ind+1)+" "+(small+1)+"
");
			count=count+solve(temp,index,num,arr,ans,map);
		}
		return count;
	}

