                dp[i][j][0] = Math.max(dp[i-1][j][0], dp[i][j-1][0]) + arr[i][j];
            }
        }
        for(int i = n ; i >= 1; i--) {
            for(int j = m; j >= 1; j--) {
                dp[i][j][1] = Math.max(dp[i+1][j][1], dp[i][j+1][1]) + arr[i][j];
