        for (int i = 1; i <= n; i++)
            for (int j = m; j >= 1; j--)
                dp[2][i][j] = a[i][j] + max(dp[2][i - 1][j], dp[2][i][j + 1]);

        for (int i = n; i >= 1; i--) {
            for (int j = 1; j <= m; j++)
                dp[3][i][j] = a[i][j] + max(dp[3][i + 1][j], dp[3][i][j - 1]);
        }

        for (int i = n; i >= 1; i--) {
            for (int j = m; j >= 1; j--)
                dp[4][i][j] = a[i][j] + max(dp[4][i + 1][j], dp[4][i][j + 1]);
        }
