public class CF200E extends PrintWriter {
	CF200E() { super(System.out, true); }
	Scanner sc = new Scanner(System.in);
	public static void main(String[] $) {
		CF200E o = new CF200E(); o.main(); o.flush();
	}

	int d_, x_, y_;
	void gcd_(int a, int b) {
		if (b == 0) {
			d_ = a;
			x_ = 1; y_ = 0;
		} else {
			gcd_(b, a % b);
			int t = x_ - a / b * y_; x_ = y_; y_ = t;
		}
	}
	int div(int a, int b) {	// b > 0
		return a >= 0 ? a / b : -((-a + b - 1) / b);
	}
	void main() {
		int n = sc.nextInt();
		int s = sc.nextInt();
		int c3 = 0, c4 = 0, c5 = 0;
		for (int i = 0; i < n; i++) {
			int a = sc.nextInt();
			if (a == 3)
				c3++;
			else if (a == 4)
				c4++;
			else
				c5++;
		}
		gcd_(c4, c5);
		int c4_ = c4 / d_, c5_ = c5 / d_;
		int ans = -1, a3 = -1, a4 = -1, a5 = -1;
		for (int k3 = 0; k3 * n <= s; k3++) {
			int t = s - c3 * k3;
			if (t % d_ != 0)
				continue;
			t /= d_;
			int k4_ = x_ * t, k5_ = y_ * t;
			// k4 = k4_ + c5_ * k
			// k5 = k5_ - c4_ * k

			// k4 >= k3
			// k4_ + c5_ * k >= k3
			// k4_ + c5_ * k > k3 - 1
			// c5_ * k > k3 - k4_ - 1
			// k > (k3 - k4_ - 1) / c5_
			// k >= (k3 - k4_ - 1) / c5_ + 1
			int lower = div(k3 - k4_ - 1, c5_) + 1;

			// k5 >= k4
			// k5_ - c4_ * k >= k4_ + c5_ * k
			// (c4_ + c5_) * k <= k5_ - k4_
			// k <= (k5_ - k4_) / (c4_ + c5_)
			int upper = div(k5_ - k4_, c4_ + c5_);

			if (lower > upper)
				continue;

			// c3 * k3 >= c4 * k4
			// c3 * k3 >= c4 * (k4_ + c5_ * k)
			// c4 * c5_ * k <= c3 * k3 - c4 * k4_
			// k <= (c3 * k3 - c4 * k4_) / (c4 * c5_)
			int upper34 = div(c3 * k3 - c4 * k4_, c4 * c5_);
			// c3 * k3 < c4 * k4
			int lower34 = upper34 + 1;

			// c4 * k4 >= c5 * k5
			// c4 * (k4_ + c5_ * k) >= c5 * (k5_ - c4_ * k)
			// (c4 * c5_ + c5 * c4_) * k >= c5 * k5_ - c4 * k4_
			// (c4 * c5_ + c5 * c4_) * k > c5 * k5_ - c4 * k4_ - 1
			// k > (c5 * k5_ - c4 * k4_ - 1) / (c4 * c5_ + c5 * c4_)
			// k >= (c5 * k5_ - c4 * k4_ - 1) / (c4 * c5_ + c5 * c4_) + 1
			int lower45 = div(c5 * k5_ - c4 * k4_ - 1, c4 * c5_ + c5 * c4_) + 1;
			// c4 * k4 < c5 * k5
			int upper45 = lower45 - 1;

			// Case 1: c3 * k3 >= c4 * k4 && c4 * k4 >= c5 * k5
			// goal
			// = c3 * k3 - c4 * k4 + c4 * k4 - c5 * k5
			// = c3 * k3 - c5 * k5
			// = c3 * k3 - c5 * (k5_ - c4_ * k)
			// +k
			// minimize k
			int lower1 = Math.max(lower, lower45);
			int upper1 = Math.min(upper, upper34);
			if (lower1 <= upper1) {
				int k = lower1;
				int k4 = k4_ + c5_ * k;
				int k5 = k5_ - c4_ * k;
				int goal = Math.abs(c3 * k3 - c4 * k4) + Math.abs(c4 * k4 - c5 * k5);
				if (ans == -1 || ans > goal) {
					ans = goal;
					a3 = k3; a4 = k4; a5 = k5;
				}
			}
			// Case 2: c3 * k3 >= c4 * k4 && c4 * k4 < c5 * k5
			// goal
			// = c3 * k3 - c4 * k4 - c4 * k4 + c5 * k5
			// = c3 * k3 - 2 * c4 * k4 + c5 * k5
			// = c3 * k3 - 2 * c4 * (k4_ + c5_ * k) + c5 * (k5_ - c4_ * k)
			// -k
			// maximize k
			int lower2 = lower;
			int upper2 = Math.min(upper, Math.min(upper34, upper45));
			if (lower2 <= upper2) {
				int k = upper2;
				int k4 = k4_ + c5_ * k;
				int k5 = k5_ - c4_ * k;
				int goal = Math.abs(c3 * k3 - c4 * k4) + Math.abs(c4 * k4 - c5 * k5);
				if (ans == -1 || ans > goal) {
					ans = goal;
					a3 = k3; a4 = k4; a5 = k5;
				}
			}
			// Case 3: c3 * k3 < c4 * k4 && c4 * k4 < c5 * k5
			// goal
			// = -c3 * k3 + c4 * k4 - c4 * k4 + c5 * k5
			// = -c3 * k3 + c5 * k5
			// = -c3 * k3 + c5 * (k5_ - c4_ * k)
			// -k
			// maximize k
			int lower3 = Math.max(lower, lower34);
			int upper3 = Math.min(upper, upper45);
			if (lower3 <= upper3) {
				int k = upper3;
				int k4 = k4_ + c5_ * k;
				int k5 = k5_ - c4_ * k;
				int goal = Math.abs(c3 * k3 - c4 * k4) + Math.abs(c4 * k4 - c5 * k5);
				if (ans == -1 || ans > goal) {
					ans = goal;
					a3 = k3; a4 = k4; a5 = k5;
				}
			}
			// Case 4: c3 * k3 < c4 * k4 && c4 * k4 >= c5 * k5
			// goal
			// = -c3 * k3 + c4 * k4 + c4 * k4 - c5 * k5
			// = -c3 * k3 + 2 * c4 * k4 - c5 * k5
			// = -c3 * k3 + 2 * c4 * (k4_ + c5_ * k) - c5 * (k5_ - c4_ * k)
			// +k
			// minimize k
			int lower4 = Math.max(lower, Math.max(lower34, lower45));
			int upper4 = upper;
			if (lower4 <= upper4) {
				int k = lower4;
				int k4 = k4_ + c5_ * k;
				int k5 = k5_ - c4_ * k;
				int goal = Math.abs(c3 * k3 - c4 * k4) + Math.abs(c4 * k4 - c5 * k5);
				if (ans == -1 || ans > goal) {
					ans = goal;
					a3 = k3; a4 = k4; a5 = k5;
				}
			}
		}
		if (ans == -1)
			println(-1);
		else
			println(a3 + " " + a4 + " " + a5);
	}
}
