public class ENUM {

    public static void main(String[] args) {

        Scanner scanner = new Scanner(System.in);

        int N = Integer.parseInt(scanner.nextLine());
        int[][] board = new int[N][N];
        int[] input = new int[N * N];
        for (int i = 0; i < N * N; i++)
            input[i] = scanner.nextInt();
        scanner.close();

        boolean[] used = new boolean[N * N];
        if (put(board, 0, 0, N, input, used)) {
            System.out.println(record);
            for (int r = 0; r < N; r++) {
                for (int c = 0; c < N; c++)
                    System.out.print(board[r][c] + " ");
                System.out.println();
            }
        }
    }

    static int record = 0;

    static boolean put(int[][] board, int r, int c, int N, int[] input, boolean[] used) {
        if (c == 0 && r == N)
            return check(board, N);
        int nr = c == N - 1 ? r + 1 : r;
        int nc = c == N - 1 ? 0 : c + 1;
        for (int i = 0; i < N * N; i++) {
            if (!used[i]) {
                // if (check(board, r, c, N, input[i])) {
                used[i] = true;
                board[r][c] = input[i];
                if (put(board, nr, nc, N, input, used))
                    return true;
                used[i] = false;
                // }
            }
        }
        return false;
    }

    static boolean check(int[][] board, int N) {
        int sum = 0;
        for (int c = 0; c < N; c++)
            sum += board[0][c];
        // check rows
        for (int r = 1; r < N; r++) {
            int s = 0;
            for (int c = 0; c < N; c++)
                s += board[r][c];
            if (s != sum)
                return false;
        }
        // check cols
        for (int c = 0; c < N; c++) {
            int s = 0;
            for (int r = 0; r < N; r++)
                s += board[r][c];
            if (s != sum)
                return false;
        }
        // check diag
        int s = 0; 
        for (int r = 0, c = N - 1; r < N && c > -1; r++, c--)
            s += board[r][c];
        if (sum != s)
            return false;
        s = 0;
        for (int r = 0, c = 0; r < N && c < N; r++, c++)
            s += board[r][c];
        if (sum != s)
            return false;
        record = sum;
        return true;
    }

    static boolean check(int[][] board, int r, int c, int N, int x) {
        int sum = 0;
        if (r > 0) {
            for (int cc = 0; cc < N; cc++)
                sum += board[0][cc];
        } else {
            return true;
        }
        if (r == N - 1) {
            // check col c
            int s = x;
            for (int rr = 0; rr < N - 1; rr++)
                s += board[rr][c];
            if (sum != s)
                return false;
        }
        if (c == N - 1) {
            // check row r
            int s = x;
            for (int cc = 0; cc < N - 1; cc++)
                s += board[r][cc];
            if (sum != s)
                return false;
        }
        if (r == N - 1 && c == 0) {
            // check diag
            int s = x;
            for (int rr = 0, cc = N - 1; rr < N - 1 && cc > 0; rr++, cc--)
                s += board[rr][cc];
            if (sum != s)
                return false;
        }
        if (r == N - 1 && c == N - 1) {
            // check diag
            int s = x;
            for (int rr = 0, cc = 0; rr < N - 1 && cc < N - 1; rr++, cc++)
                s += board[rr][cc];
            if (sum != s)
                return false;
        }
        record = sum;
        return true;
    }
}
