public class Abracadabra {

	public static void main(String[] args) {
		Scanner sc = new Scanner(System.in);
		int l1 = sc.nextInt();
		int r1 = sc.nextInt();
		int l2 = sc.nextInt();
		int r2 = sc.nextInt();
		sc.close();
		System.out.println(solve(30, l1, r1, l2, r2));
	}

	private static int solve(int i, int l1, int r1, int l2, int r2) {
		if (r1 < l1 || r2 < l2) {
			return 0;
		}
		if (i < 0) {
			return 0;
		}

		int r = Math.min(r1, r2) - Math.max(l1, l2) + 1;

		if (l1 <= l2 && r1 >= r2) {
			return r = r2 - l2 + 1;
		}
		if (l2 <= l1 && r2 >= r1) {
			return r = r1 - l1 + 1;
		}

		int mid = (1 << i);

		if (l1 > mid) {
			l1 -= mid;
			r1 -= mid;
		}
		if (l2 > mid) {
			l2 -= mid;
			r2 -= mid;
		}

		r = Math.max(r, solve(i - 1, l1, Math.min(r1, mid - 1), l2, Math.min(r2, mid - 1)));

		if (r2 > mid) {
			r = Math.max(r, solve(i - 1, l1, Math.min(r1, mid - 1), 1, r2 - mid));
		}
		if (r1 > mid) {
			r = Math.max(r, solve(i - 1, 1, r1 - mid, l2, Math.min(r2, mid - 1)));
			if (r2 > mid) {
				r = Math.max(r, solve(i - 1, 1, r1 - mid, 1, r2 - mid));
			}
		}

		return r;
	}
}
